return ['x-generator'=>'GlotPress/4.0.1','translation-revision-date'=>'2024-05-04 03:17:26+0000','plural-forms'=>'nplurals=2; plural=n != 1;','project-id-version'=>'WordPress - 6.5.x - Development - Administration','language'=>'ug_CN','messages'=>['start of week1'=>'0','default GMT offset or timezone string0'=>'Asia/Urumqi','patterns menu itemPatterns'=>'ئەندىزە','This release includes 110+ performance updates, with an impressive increase in speed and efficiency across the Post Editor and Site Editor. Loading is over two times faster than in 6.4, with input processing speed up to five times faster than the previous release. Translated sites see up to 25% improvement in load time for this release.'=>'بۇ نەشرىدە +110 ئىقتىدار يېڭىلىنىشى بار، پۈتكۈل يازما تەھرىرلىگۈچ ۋە بېكەت تەھرىرلىگۈچنىڭ سۈرئەت ۋە ئۈنۈمى روشەن ياخشىلاندى. يۈكلەش سۈرئىتى 6.4 كە سېلىشتۇرغاندا ئىككى ھەسسىدىن ئارتۇق تېزلەشتى، كىرگۈزۈش جەريانى ئالدىنقى نەشرىدىن بەش ھەسسە تېزلەشتى. تەرجىمە قىلىنغان بېكەتنىڭ يۈكلەش سۈرئىتى ئەڭ كۆپ بولغاندا %25 ئۆستى.','Find and organize your data however you like with data views for pages, templates, patterns, and template parts. Arrange it in a table or grid view with the option to toggle fields and make bulk changes.'=>'بەت، قېلىپ، ئەندىزە ۋە قېلىپ پارچىسى سانلىق مەلۇمات كۆرۈنۈشىنى ئىشلىتىپ، سانلىق مەلۇماتلارنى خالىغانچە ئىزدەپ ۋە تەشكىللىيەلەيسىز.  جەدۋەل ياكى سېتكا كۆرۈنۈشىدە سانلىق مەلۇماتلارنى تىزىپ ھەمدە سۆز بۆلەكلىرىنى ئالماشتۇرۇپ ۋە توپ ئۆزگەرتىش ئېلىپ بارالايسىز.','Change Site Icon'=>'بېكەت سىنبەلگىسىنى ئۆزگەرت','<strong>Error:</strong> %1$s requires %2$d plugin to be installed and activated: %3$s.'=>'<strong>خاتالىق:</strong>%1$s نى ئورنىتىش ئۈچۈن %2$d قىستۇرما ئورنىتىپ ئاكتىپلاش كېرەك: %3$s.' . "\0" . '<strong>خاتالىق:</strong>%1$s نى ئورنىتىش ئۈچۈن %2$d قىستۇرما ئورنىتىپ ئاكتىپلاش كېرەك: %3$s.','pluginUpdate Now'=>'دەرھال يېڭىلا','themeInstall Now'=>'ھازىر ئورنات','This plugin cannot be activated because required plugins are missing or inactive.'=>'بۇ قىستۇرمىنى ئاكتىپلىيالمىدى چۈنكى زۆرۈر قىستۇرما كەم ياكى ئاكتىپ ئەمەس.','This plugin is active but may not function correctly because required plugins are missing or inactive.'=>'بۇ قىستۇرما ئاكتىپ ئەمما نورمال ئىشلىمەسلىكى مۇمكىن چۈنكى زۆرۈر قىستۇرما كەم ياكى ئاكتىپ ئەمەس.','<strong>Requires:</strong> %s'=>'<strong>كېرەكلىك:</strong> %s','<strong>Required by:</strong> %s'=>'<strong>كېرەكلىك:</strong> %s','Note: This plugin cannot be deactivated or deleted until the plugins that require it are deactivated or deleted.'=>'ئەسكەرتىش: بۇ قىستۇرما تايىنىدىغان قىستۇرمىلارنى ئاكتىپسىزلاپ ياكى ئۆچۈرمىگىچە بۇ قىستۇرمىنى ئاكتىپسىزلىغىلى ياكى ئۆچۈرگىلى بولمايدۇ.','pluginActivate'=>'ئاكتىپلا','Additional plugins are required'=>'قوشۇمچە قىستۇرما زۆرۈر','Site ID'=>'تور بېكەت كىملىكى','The PHP version on your server is %1$s, however the new theme version requires %2$s.'=>'مۇلازىمېتىرىڭىزدىكى PHP نەشرى %1$s، ئەمما يېڭى ئۆرنەك تەلەپ قىلىدىغان نەشرى %2$s.','Your WordPress version is %1$s, however the new theme version requires %2$s.'=>'سىزدىكى WordPress نەشرى %1$s، ئەمما يېڭى ئۆرنەك تەلەپ قىلىدىغان نەشرى %2$s.','pluginNetwork Activate'=>'تورنى ئاكتىپلا','%s is already active.'=>'%s ئاكتىپ.','pluginInstall Now'=>'ھازىر ئورنات','Created by a worldwide team of passionate individuals'=>'دۇنيانىڭ ھەرقايسى جايلىرىدىكى ئوت يۈرەك تۆھپىكارلار قۇرغان.','You cannot deactivate this plugin as other plugins depend on it.'=>'باشقا قىستۇرما تايىنىدىغان قىستۇرمىنى ئاكتىپسىزلىيالمايسىز.','You cannot delete this plugin as other plugins require it.'=>'باشقا قىستۇرما تايىنىدىغان قىستۇرمىنى ئۆچۈرەلمەيسىز.','You cannot activate this plugin as it has unmet requirements.'=>'قىستۇرمىغا كېرەكلىك شەرتلەرنى ھازىرلىماي تۇرۇپ بۇ قىستۇرمىنى ئاكتىپلىيالمايسىز.','You cannot deactivate this plugin as other plugins require it.'=>'باشقا قىستۇرمىغا كېرەكلىك قىستۇرمىنى ئاكتىپسىزلىيالمايسىز.','pluginDeactivate'=>'ئاكتىپلىما','pluginNetwork Deactivate'=>'تور ئاكتىپلىما','This release includes more than 65 accessibility improvements across the platform, making it more accessible than ever. This release adds fixes to contrast settings, cursor focus, submenus, and positioning of elements, among many others, that help improve the WordPress experience for everyone.'=>'بۇ نەشرى پۈتكۈل سۇپىنىڭ 65 تىن ئارتۇق زىيارەتچانلىقىنى ياخشىلىدى، ئۇ ئىلگىرىكى ھەر قانداق ۋاقىتتىكىدىن تېخىمۇ زىيارەتچان قىلىندى. بۇ نەشرىگە پەرق ئېتىش نىسبىتى تەڭشىكى،  نۇر بەلگە فوكۇسى، تارماق تىزىملىك ۋە ئېلېمېنت ئورۇن بەلگىلەش قاتارلىقلار قوشۇلۇپ ۋە تۈزىتىلىپ، ھەممەيلەننىڭ WordPress تۇيغۇسىنى ياخشىلىدى.','Accessibility improvements'=>'زىيارەتچانلىقى ياخشىلاندى','Performance updates'=>'ئىقتىدار يېڭىلانمىلىرى','There&#8217;s now an easier way to manage plugin dependencies. Plugin authors can supply a new %s header with a comma-separated list of required plugin slugs, presenting users with links to install and activate those plugins first.'=>'ھازىر قىستۇرما تايىنىشچانلىقنى باشقۇرۇش ئاددىيلاشتى. قىستۇرما يازغۇچى يېڭى بىر %s تېما تەمىنلىيەلەيدۇ، ئۇنىڭدا پەش بىلەن ئايرىلغان لازىملىق قىستۇرمىلار قىسقارتىلمىسىنىڭ تىزىمى ئىشلەتكۈچىلەرگە ئۇلانمىسى بىلەن قوشۇپ تەمىنلىنىپ، ئالدى بىلەن شۇ قىستۇرمىلارنى ئورنىتىپ ئاكتىپلاشقا قۇلايلىق يارىتىدۇ.','Explore improvements to the plugin experience'=>'قىستۇرما تەسىرات ياخشىلىنىشىنى كېزىش','Give designers and creators using Classic themes access to an upgraded design experience. Opt in to support for spacing, border, typography, and color options, even without using theme.json. Once support is enabled, more tools will be automatically added as they become available.'=>'ئەنئەنىۋى ئۆرنەك ئىشلىتىدىغان لايىھەلىگۈچى ۋە ئىجادكارلار يېڭىلانغان لايىھەلەش تۇيغۇسىغا ئېرىشەلەيدۇ. theme.json نى ئىشلەتمەيمۇ، ئارىلىق، گىرۋەك، بەتچىلىك ۋە رەڭ تاللانمىسى تاللاشنى قوللايدۇ. قوللاش قوزغىتىلسىلا لازىم بولغاندا تېخىمۇ كۆپ قورال ئۆزلۈكىدىن قوشۇلىدۇ.','Add appearance tools to Classic themes'=>'ئەنئەنىۋى ئۆرنەككە كۆرۈنۈش قورالى قوشۇلدى','Link core block attributes to custom fields and use the value of custom fields without creating custom blocks. Powered by the Block Bindings API, developers can extend this capability further to connect blocks to any dynamic content—even beyond custom fields. If there&#8217;s data stored elsewhere, easily point blocks to that new source with only a few lines of code.'=>'يادرولۇق بۆلەك خاسلىق ئۇلانمىسىنى ئىختىيارى بۆلەككە ئۇلاپ، ئىختىيارى بۆلەك قۇرمايمۇ ئىختىيارى بۆلەكنىڭ قىممىتىنى ئىشلەتكىلى بولىدۇ. بۆلەك باغلاش API ئارقىلىق، ئىجادكارلار بۇ ئىقتىدارنى كېڭەيتىپ، بۆلەكنى خالىغان ھەرىكەتچان مەزمۇنغا باغلىيالايدۇ، ھەتتا ئىختىيارى بۆلەكنىڭ سىرتىدىكى مەزمۇنغىمۇ باغلىيالايدۇ. ئەگەر سانلىق مەلۇمات باشقا جايدا ساقلانغان بولسا، پەقەت بىر قانچە قۇر كود يېزىپلا بۆلەكنى يېڭى سانلىق مەلۇمات مەنبەسىگە ئوڭايلا نىشانلىيالايسىز.','Connect blocks to custom fields or other dynamic content'=>'بۆلەكنى ئىختىيارى بۆلەك ياكى باشقا ھەرىكەتچان مەزمۇنغا باغلايدۇ','The Interactivity API offers developers a standardized method for building interactive front-end experiences with blocks. It simplifies the process, with fewer dependencies on external tooling, while maintaining optimal performance. Use it to create memorable user experiences, like fetching search results instantly or letting visitors interact with content in real time.'=>'تەسىرلىشىشچان API ئىجادكارلارغا ئۆلچەملەشكەن ئۇسۇل تەمىنلەپ، بۆلەك ئارقىلىق تەسىرلىشىشچان ئالدى تەرەپ تۇيغۇسىغا ئىشلىتىلىدۇ. جەرياننى ئاددىيلاشتۇرۇپ، سىرتقى قورالغا تايىنىشچانلىقنى ئازايتتى شۇنىڭ بىلەن بىللە ئەڭ ياخشى ئۈنۈمنى ساقلاپ قالدى. ئۇنى ئىشلىتىپ ئۇنتۇلغۇسىز ئىشلەتكۈچى تەسىراتى ياراتقىلى بولىدۇ، مەسىلەن، شۇئان ئىزدەش نەتىجىسىگە ئېرىشىش ياكى زىيارەتچىلەر بىلەن مەزمۇن ئارىسىدا شۇئان تەسىرلىشىش.','Improved link controls'=>'ياخشىلانغان ئۇلىنىش كونتروللىرى','Bring interactions to blocks with the Interactivity API'=>'تەسىرلىشىشچان API ئىشلىتىپ تەسىرلىشىشنى بۆلەككە ئەكىرىدۇ','Create and manage links easily with a more intuitive link-building experience, like a streamlined UI and a shortcut for copying links.'=>'بىۋاسىتە ئۇلانما قۇرۇش تەسىراتى، يەنى ئاددىيلاشتۇرۇلغان ئىشلەتكۈچى ئارايۈزى ۋە ئۇلانما كۆچۈرۈشنىڭ تېزلەتمىسى قاتارلىقلار ئارقىلىق ئۇلانما قۇرۇش ۋە باشقۇرۇشنى ئاسانلاشتۇرىدۇ.','Feel the difference when you move things around, with helpful visual cues like displaced items in List View or frictionless dragging to anywhere in your workspace—from beginning to end.'=>'كېرەكلىك كۆرۈنۈش ئەسكەرتىشى يەنى تىزىم كۆرۈنۈشىدە تۈرنى يۆتكەش ياكى خىزمەت رايونىنىڭ خالىغان جايىغا سۈركىلىشسىز ھالدا يۆتكەشتە باشتىن ئاخىر يېڭى تۇيغۇ ھېس قىلدۇرىدۇ.','Smoother drag-and-drop'=>'سۆرەپ تاشلاش تېخىمۇ سىلىق','Discover new Data Views'=>'يېڭى سانلىق مەلۇمات كۆرۈنۈشىنى بايقاش','Add box shadow supports to even more blocks'=>'تېخىمۇ كۆپ بۆلەككە رامكا سايىسى قوشۇشنى قوللايدۇ','Do more with background images in Group blocks'=>'گۇرۇپپا بۆلەكتە تېخىمۇ كۆپ تەگلىك سۈرەت ئىشلىتىدۇ','Get more control over images in Cover blocks'=>'مۇقاۋا بۆلەكتىكى سۈرەتنى تىزگىنلەش موللاشتى','With shadow supports enabled, you can create layouts with visual depth or add a little personality to your design.'=>'سايە قوللاش قوزغىتىلغاندىن كېيىن، كۆرۈنۈش چوڭقۇرلۇق جايلاشتۇرۇشى قۇرالايسىز ياكى لايىھەيىڭىزگە يېڭى خاسلىق قوشالايسىز.','Set aspect ratios for Cover block images and easily add color overlays that automatically source color from your chosen image.'=>'مۇقاۋا بۆلەك سۈرىتى تەرەپ نىسبىتىنى تەڭشەيدۇ ھەمدە قۇلاي ھالدا رەڭلەرنى دەستىلەپ، تاللىغان سۈرەتتىن ئۆزلۈكىدىن رەڭگە ئېرىشەلەيدۇ.','Control size, repeat, and focal point options so you can play around with subtle or splashy ways to add visual interest to layouts.'=>'چوڭلۇقى، تەكرارلىنىشى ۋە فوكۇس نۇقتا تاللانمىلىرىنى تىزگىنلەپ، زىل ۋە چاققان ئۇسۇل بىلەن جايلاشتۇرۇشقا كۆرۈنۈش ئۈنۈمى قوشىدۇ.','Work through creative projects with a more comprehensive picture of what&#8217;s been done—and what you can fall back on. Get details like time stamps, quick summaries, and a paginated list of total revisions. View revisions from the Style Book to see changes outside of what you&#8217;re working on. Revisions are also now available for templates and template parts.'=>'ۋاقىت تامغىسى، تېز قىسقىچە خۇلاسە ۋە بەتكە ئايرىلغان ئومۇمىي تۈزىتىلمە تىزىمى قاتارلىقلار ئىجادىي قۇرۇلۇشنىڭ تاماملىنىش ئەھۋالىنى ئومۇميۈزلۈك ئىگىلىيەلەيسىز. ئۇسلۇب قوللانمىسىدا تۈزىتىلمە مەزمۇنىنى كۆرسىتىپ، بىر تەرەپ قىلىۋاتقان مەزمۇننىڭ سىرتىدىكى ئۆزگەرتىشنى بىلدۈرىدۇ. ھازىر قېلىپ ۋە قېلىپ پارچىسىمۇ تۈزىتىلمىنى قوللايدۇ.','Get more details from your style revisions'=>'ئۇسلۇب تۈزىتىلمىڭىزنىڭ تەپسىلاتى','The new Font Library puts you in control of an essential piece of your site&#8217;s design—typography—without coding or extra steps. Effortlessly install, remove, and activate local and Google Fonts across your site for any block theme. The ability to include custom typography collections gives site creators and publishers even more choice.'=>'يېڭى خەت نۇسخا ئامبىرى تور بېكەت لايىھەسىنىڭ مۇھىم بۆلەكلىرى-مەتبەچىلىكىنى تىزگىنلەشتە كود يېزىپ ياكى ئارتۇق قەدەم بېسىپ يۈرمەيلا ئىشلىتىشنى ئاسانلاشتۇرىدۇ. تور بېكىتىڭىزدە يەرلىك ۋە Google خەت نۇسخىلىرىنى ئورنىتىپ، چىقىرىۋېتىپ ۋە قوزغىتالايسىز، خەت نۇسخىلىرىنى خالىغان بۆلەك ئۆرنىكىگە قوللىنالايسىز. ئىختىيارى مەتبەچىلىك توپلىمى ئىقتىدارى تور بېكەت قۇرغۇچى ۋە تارقاتقۇچىلارغا تېخىمۇ كۆپ تاللاش بىلەن بىلەن تەمىنلەيدۇ.','Add and manage fonts across your site'=>'تور بېكەتكە خەت نۇسخا قوشۇش ۋە باشقۇرۇش','Take your site-building experience further with WordPress 6.5. Explore more avenues to make it your own, with new features and enhancements that will help fine-tune your creative work. Discover the latest additions to the developer experience, with fresh foundational tools poised to transform the future of blocks.'=>'WordPress 6.5 ئىشلىتىلسە تور بېكىتىڭىزنىڭ ئىشلەتكۈچى تۇيغۇسى تېخىمۇ ياخشىلىنىدۇ. يېڭى ۋە كۈچەيتىلگەن ئىقتىدارلار ئارقىلىق، ئۆزىڭىزگە خاس يولنى بايقاپ، ئىجادىي ئەسىرىڭىزنى تەڭشىشىڭىزگە ياردەم بېرىدۇ. ئىجادىيەت تۇيغۇسىغا قوشۇلغان يېڭى مەزمۇن، يېڭىدىن قوشۇلغان ئاساسىي قورال بۆلەكنىڭ كەلگۈسىنى ئۆزگەرتىدىغانلىقىنى بايقىيالايسىز.','Only .zip archives may be uploaded.'=>'پەقەت .zip ئارخىپىنى يۈكلىگىلى بولىدۇ.','The block widgets require JavaScript. Please enable JavaScript in your browser settings, or activate the <a href="%s">Classic Widgets plugin</a>.'=>'بۆلەك ئەپچە JavaScript نى تەلەپ قىلىدۇ. توركۆرگۈ تەڭشىكىڭىزدىن JavaScript نى قوزغىتىڭ ياكى <a href="%s">ئەنئەنىۋى ئەپچە قىستۇرمىسى</a>نى ئاكتىپلاڭ.','The block editor requires JavaScript. Please enable JavaScript in your browser settings, or install the <a href="%s">Classic Editor plugin</a>.'=>'بۆلەك تەھرىرلىگۈچ JavaScript نى تەلەپ قىلىدۇ. توركۆرگۈ تەڭشىكىڭىزدىن JavaScript نى قوزغىتىڭ ياكى <a href="%s">ئەنئەنىۋى تەھرىرلىگۈچ قىستۇرمىسى</a>نى ئورنىتىڭ.','The block editor requires JavaScript. Please enable JavaScript in your browser settings, or activate the <a href="%s">Classic Editor plugin</a>.'=>'بۆلەك تەھرىرلىگۈچ JavaScript نى تەلەپ قىلىدۇ. توركۆرگۈ تەڭشىكىڭىزدىن JavaScript نى قوزغىتىڭ ياكى <a href="%s">ئەنئەنىۋى تەھرىرلىگۈچ قىستۇرمىسى</a>نى ئاكتىپلاڭ.','Add New Site'=>'يېڭى بېكەت قوش','Add New Plugin'=>'يېڭى قىستۇرما قوش','Rotate 180&deg;'=>'180&deg; ئايلاندۇر','Rotate 90&deg; right'=>'ئوڭغا 90&deg; ئايلاندۇر','Rotate 90&deg; left'=>'سولغا °90 ئايلاندۇر','%s pattern moved to the Trash.'=>'%s ئەندىزە «ئەخلەتخانا» غا يۆتكەلدى.' . "\0" . '%s ئەندىزە «ئەخلەتخانا» غا يۆتكەلدى.','%s pattern permanently deleted.'=>'%s ئەندىزە مەڭگۈلۈك ئۆچۈرۈلدى.' . "\0" . '%s ئەندىزە مەڭگۈلۈك ئۆچۈرۈلدى.','%s pattern updated.'=>'%s ئەندىزە يېڭىلاندى.' . "\0" . '%s ئەندىزە يېڭىلاندى.','When using Bulk Edit, you can change the metadata (categories, author, etc.) for all selected posts at once. To remove a post from the grouping, just click the %s<span class="screen-reader-text">remove</span> button next to its name in the Bulk Edit area that appears.'=>'«تۈركۈملەپ تەھرىرلەش»نى ئىشلەتسىڭىز، تاللانغان بارلىق يازمىلارنىڭ مېتا مەلۇماتلىرى (سەھىپە، ئاپتور ۋە باشقىلار)نى بىراقلا ئۆزگەرتەلەيسىز. گۇرۇپپىدىن يازما چىقىرىۋېتىش ئۈچۈن، كۆرۈنگەن «تۈركۈملەپ تەھرىرلەش» رايونىدا يازما نامىنىڭ يېنىدىكى %s<span class="screen-reader-text">چىقىرىۋەت</span> نى چەكسىڭىزلا بولىدۇ.','<a href="%1$s">Read the WordPress %2$s Release Notes</a> for information on installation, enhancements, fixed issues, release contributors, learning resources, and the list of file changes.'=>'<a href="%1$s">WordPress %2$s تارقىتىش ئۇقتۇرۇشىنى ئوقۇپ</a>، ئورنىتىش، كۈچەيتىلگەن ئىقتىدار، ئوڭشالغان مەسىلە، تارقىتىش تۆھپىكارلىرى، ئۆگىنىش مەنبەلىرى ۋە ھۆججەت ئۆزگىرىش تىزىمى ھەققىدىكى ئۇچۇرلار بىلەن تونۇشۇڭ.','Explore the <a href="%1$s">WordPress %2$s Field Guide</a>. Learn about the changes in this release with detailed developer notes to help you build with WordPress.'=>'<a href="%1$s">WordPress %2$s تەپسىلىي يېتەكچىسى</a>دىن ئىزدىنىڭ. WordPress ئىشلىتىپ تور بېكەت قۇرۇشقا قۇلايلىق يارىتىش ئۈچۈن ئەستايىدىل ئىجادكارلار بۇ نەشرىدىكى ئۆزگىرىشلەرنى ئىزاھلىدى.','Invalid URL format.'=>'ئىناۋەتسىز تور ئادرېس پىچىمى.','The PHP version on your server is %1$s, however the new plugin version requires %2$s.'=>'مۇلازىمېتىرىڭىزدىكى PHP نەشرى %1$s، ئەمما يېڭى قىستۇرما تەلەپ قىلىدىغان نەشرى %2$s.','Your WordPress version is %1$s, however the new plugin version requires %2$s.'=>'سىزدىكى WordPress نەشرى %1$s، ئەمما يېڭى قىستۇرما تەلەپ قىلىدىغان نەشرى %2$s.','https://wordpress.org/support/wordpress-version/version-%s/'=>'https://wordpress.org/support/wordpress-version/version-%s/','https://make.wordpress.org/contribute/'=>'https://make.wordpress.org/contribute/','Restore Plugin or Theme'=>'قىستۇرما ياكى ئۆرنەكنى ئەسلىگە قايتۇرىدۇ','<a href="https://wordpress.org/documentation/article/common-wordpress-errors/">Common Errors</a>'=>'<a href="https://wordpress.org/documentation/article/common-wordpress-errors/">كۆپ كۆرۈلىدىغان خاتالىق</a>','Updates may take several minutes to complete. If there is no feedback after 5 minutes, or if there are errors please refer to the Help section above.'=>'يېڭىلاشقا بەلكىم بىر نەچچە مىنۇت كېتىشى مۇمكىن. ئەگەر 5 مىنۇتقىچە ھېچقانداق ئىنكاس بولمىسا ياكى خاتالىق كۆرۈلسە، يۇقىرىدىكى ياردەم قىسمىغا قاراڭ.','On systems with fewer resources, this may lead to server timeouts or resource limits being reached. If you encounter an issue during the update process, please create a support forum topic and reference <strong>Rollback</strong> in the issue title.'=>'مەنبەسى ئازراق سىستېمىدا، بۇ مۇلازىمېتىرنىڭ ۋاقىت ھالقىش ياكى مەنبە چەكلىمىسىگە ئۇچرىشىنى كەلتۈرۈپ چىقىرىشى مۇمكىن. ئەگەر يېڭىلاش جەريانىدا خاتالىققا يولۇقسىڭىز، قوللاش مۇنبىرىدە يېڭى تېما قۇرۇپ، ماۋزۇسىدا <strong>Rollback</strong> قايتىشنى نەقىل ئېلىڭ.','This feature will create a temporary backup of a plugin or theme before it is upgraded. This backup is used to restore the plugin or theme back to its previous state if there is an error during the update process.'=>'بۇ ئىقتىدار يېڭىلاشتىن ئىلگىرى قىستۇرما ياكى ئۆرنەكتىن ۋاقىتلىق زاپاس قۇرىدۇ. ئەگەر يېڭىلاش جەريانىدا خاتالىق كۆرۈلسە، بۇ زاپاس قىستۇرما ياكى ئۆرنەكنى ئىلگىرىكى ھالەتكە قايتۇرۇشقا ئىشلىتىلىدۇ.','The site editor requires JavaScript. Please enable JavaScript in your browser settings.'=>'بېكەت تەھرىرلىگۈچ JavaScript نى تەلەپ قىلىدۇ. توركۆرگۈ تەڭشەكلىرىدىن JavaScript نى قوزغىتىڭ.','https://wordpress.org/documentation/article/customize-permalinks/'=>'https://wordpress.org/documentation/article/customize-permalinks/','New custom field name'=>'ئىختىيارى سۆز بۆلىكىنىڭ ئىسمى','Search Media:'=>'ۋاسىتە ئىزدەش:','Crop Image'=>'سۈرەت كەس','Save Edits'=>'تەھرىرلەشنى ساقلا','Cancel Editing'=>'تەھرىرلەشتىن ۋاز كەچ','Could not create the destination directory.'=>'نىشان مۇندەرىجىنى قۇرالمىدى.','Could not delete the temporary backup directory for %s.'=>'%s نىڭ ۋاقىتلىق زاپاسلاش مۇندەرىجىسىنى ئۆچۈرەلمىدى.','Clear Crop'=>'قايچىلاشنى تازىلا','Apply Crop'=>'قايچىلاشنى قوللان','vertical start position'=>'بويىغا باشلىنىش ئورنى','horizontal start position'=>'توغرىسىغا باشلىنىش ئورنى','Starting Coordinates:'=>'باشلىنىش كوردىناتى:','Images cannot be scaled to a size larger than the original.'=>'سۈرەتنى ئەسلى چوڭلۇقىدىن چوڭايتقىلى بولمايدۇ.','Table ordered by E-mail.'=>'جەدۋەل ئېلخەت بويىچە رەتلەنگەن.','Table ordered by Username.'=>'جەدۋەل ئىشلەتكۈچى ئىسمى بويىچە رەتلەنگەن.','In a few words, explain what this site is about. Example: &#8220;%s.&#8221;'=>'بۇ تور بېكىتىنىڭ نىمە ھەققىدە ئىكەنلىكىنى بىر-ئىككى ئېغىز سۆز بىلەن چۈشەندۈرۈڭ. مەسىلەن: &#8220;%s.&#8221؛','Note: Discouraging search engines does not block access to your site &mdash; it is up to search engines to honor your request.'=>'دىققەت: ئىزدەش موتورلىرىنى چەكلەپ قويۇش تور بېكىتىڭىزنى زىيارەت قىلىشقا توسالغۇ بولمايدۇ؛ چەكلىمىڭىزنىڭ ئىناۋەتلىك بولۇش-بولماسلىقى ئىزدەش موتورىنىڭ ئىنسابىغا باغلىق.','Could not restore the original version of %s.'=>'‎%s‎‏ نىڭ ئەسلى نەشرىنى ئەسلىگە كەلتۈرەلمىدى.','Could not move the old version to the %s directory.'=>'كونا نەشرىنى %s مۇندەرىجىگە يۆتكىيەلمىدى.','Could not create the %s directory.'=>'%s مۇندەرىجىنى قۇرالمىدى.','Available disk space'=>'ئىشلىتىلىشچان دىسكا بوشلۇقى','Plugin and theme temporary backup directory access'=>'قىستۇرما ۋە ئۆرنەكنىڭ ۋاقىتلىق زاپاسلاش مۇندەرىجىسى زىيارىتى','Table ordered by Links.'=>'جەدۋەل ئۇلانما بويىچە رەتلەنگەن.','Table ordered hierarchically.'=>'جەدۋەل قەۋەت بويىچە رەتلەنگەن.','Table ordered by Posts Count.'=>'جەدۋەل يازما سانى بويىچە رەتلەنگەن.','Table ordered by Slug.'=>'جەدۋەل قىسقارتىلما بويىچە رەتلەنگەن.','Table ordered by Description.'=>'جەدۋەل چۈشەندۈرۈش بويىچە رەتلەنگەن.','The %1$s directory does not exist, and the server does not have write permissions in %2$s to create it. This directory is used for plugin and theme updates. Please make sure the server has write permissions in %2$s.'=>'%1$s مۇندەرىجىسى تېپىلدىم. مۇلازىمېتىرنىڭمۇ %2$s نىڭ ئىچىدە ئۇنى قۇرىدىغان يېزىش ھوقۇقى يوق. بۇ مۇندەرىجە قىستۇرما ۋە ئۆرنەك يېڭىلاشلار ئۈچۈن ئىشلىتىلەتتى. مۇلازىمېتىرنىڭ  %2$s نىڭ ئىچىدە يېزىش ھوقۇقى بار-يوقلۇقىنى مۇقىم قىلىڭ.','The upgrade directory cannot be created'=>'يۈكسەلتىش مۇندەرىجىسىنى قۇرالمىدى','The upgrade directory exists but is not writable'=>'يۈكسەلتىش مۇندەرىجىسى مەۋجۇت، ئەمما يازغىلى بولمايدۇ','The temporary backup directory exists but is not writable'=>'ۋاقىتلىق مۇندەرىجە مەۋجۇت، ئەمما يازغىلى بولمايدۇ','The %s directory exists but is not writable. This directory is used for plugin and theme updates. Please make sure the server has write permissions to this directory.'=>'%s مۇندەرىجە مەۋجۇت، ئەمما يازغىلى بولمايدىكەن. بۇ مۇندەرىجە قىستۇرما ۋە ئۆرنەك يېڭىلاشلار ئۈچۈن ئىشلىتىلەتتى. مۇلازىمېتىرنىڭ بۇ مۇندەرىجىدە يېزىش ھوقۇقى بار-يوقلۇقىنى مۇقىم قىلىڭ.','The %s directory exists but is not writable. This directory is used to improve the stability of plugin and theme updates. Please make sure the server has write permissions to this directory.'=>'%s مۇندەرىجە مەۋجۇت، ئەمما يازغىلى بولمايدىكەن. بۇ مۇندەرىجە قىستۇرما ۋە ئۆرنەك يېڭىلاشلارنىڭ مۇقىملىقىنى ئاشۇرۇش ئۈچۈن ئىشلىتىلەتتى. مۇلازىمېتىرنىڭ بۇ مۇندەرىجىدە يېزىش ھوقۇقى بار-يوقلۇقىنى مۇقىم قىلىڭ.','The %s directory exists but is not writable. This directory is used to improve the stability of theme updates. Please make sure the server has write permissions to this directory.'=>'%s مۇندەرىجە مەۋجۇت، ئەمما يازغىلى بولمايدىكەن. بۇ مۇندەرىجە ئۆرنەك يېڭىلاشنىڭ مۇقىملىقىنى ئاشۇرۇش ئۈچۈن ئىشلىتىلەتتى. مۇلازىمېتىرنىڭ بۇ مۇندەرىجىدە يېزىش ھوقۇقى بار-يوقلۇقىنى مۇقىم قىلىڭ.','Theme temporary backup directory exists but is not writable'=>'ۋاقىتلىق زاپاسلاش مۇندەرىجىسى مەۋجۇت، ئەمما يازغىلى بولمايدۇ','Plugin temporary backup directory exists but is not writable'=>'قىستۇرما ۋاقىتلىق زاپاسلاش مۇندەرىجىسى مەۋجۇت، ئەمما يازغىلى بولمايدۇ','The %s directory exists but is not writable. This directory is used to improve the stability of plugin updates. Please make sure the server has write permissions to this directory.'=>'%s مۇندەرىجە مەۋجۇت، ئەمما يازغىلى بولمايدىكەن. بۇ مۇندەرىجە قىستۇرما يېڭىلاشنىڭ مۇقىملىقىنى ئاشۇرۇش ئۈچۈن ئىشلىتىلەتتى. مۇلازىمېتىرنىڭ بۇ مۇندەرىجىدە يېزىش ھوقۇقى بار-يوقلۇقىنى مۇقىم قىلىڭ.','The %1$s and %2$s directories exist but are not writable. These directories are used to improve the stability of plugin updates. Please make sure the server has write permissions to these directories.'=>'مۇندەرىجە %1$s بىلەن %2$s مەۋجۇت، ئەمما ئۇلارغا يازغىلى بولمايدىكەن. بۇ مۇندەرىجىلەر ئۆرنەك يېڭىلاشنىڭ مۇقىملىقىنى ئاشۇرۇش ئۈچۈن ئىشلىتىلەتتى. مۇلازىمېتىرنىڭ بۇ مۇندەرىجىدە يېزىش ھوقۇقى بار-يوقلۇقىنى مۇقىم قىلىڭ.','Plugin and theme temporary backup directories exist but are not writable'=>'قىستۇرما ۋە ئۆرنەك ۋاقىتلىق زاپاسلاش مۇندەرىجىسى مەۋجۇت، ئەمما يازغىلى بولمايدۇ','The %s directory cannot be located.'=>'بۇ %s مۇندەرىجىسىنىڭ ئورنى تېپىلمىدى.','Plugin and theme temporary backup directory is writable'=>'قىستۇرما ۋە ئۆرنەك ۋاقىتلىق زاپاسلاش مۇندەرىجىسىگە يازغىلى بولىدۇ','Could not determine available disk space for updates.'=>'يېڭىلاشقا كېرەكلىك دىسكا بوشلۇقىنى ئېنىقلىيالمىدى.','Available disk space is critically low, less than 20 MB available. Proceed with caution, updates may fail.'=>'ئئىشلىتىلىشچان دىسكا بوشلۇقى بەكلا تۆۋەن، 20 مېگابايتتىن تۆۋەن. ئېھتىيات بىلەن داۋاملاشتۇرۇڭ، يېڭىلىيالماسلىقى مۇمكىن.','Available disk space is low, less than 100 MB available.'=>'ئئىشلىتىلىشچان دىسكا بوشلۇقى تۆۋەن، 100 مېگابايتتىن تۆۋەن.','Descending.'=>'كېمەيگۈچى.','Ascending.'=>'ئۆسكۈچى.','Sort descending.'=>'كېمەيگۈچى تەرتىپ.','Sort ascending.'=>'ئۆسكۈچى تەرتىپ.','Current Server time'=>'نۆۋەتتىكى مۇلازىمېتىر ۋاقتى','Current UTC time'=>'نۆۋەتتىكى UTC ۋاقتى','Current time'=>'نۆۋەتتىكى ۋاقىت','Ordered by Comment Date, descending.'=>'ئىنكاس چېسلاسى بويىچە تەرتىپلەندى، كېمەيگۈچى.','The %s directory used to improve the stability of plugin and theme updates is writable.'=>'قىستۇرما ۋە ئۆرنەك يېڭىلىنىشىنىڭ مۇقىملىقىنى ئاشۇرۇشقا ئىشلىتىلىدىغان %s  مۇندەرىجە يېزىشچان.','%s available disk space was detected, update routines can be performed safely.'=>'ئىشلىتىلىشچان دىسكا بوشلۇقى %s بايقالدى، يېڭىلاش جەريانىنى بىخەتەر ئىجرا قىلغىلى بولىدۇ.','Disk space available to safely perform updates'=>'يېڭىلاشنى بىخەتەر ئىجرا قىلىشقا كېرەكلىك دىسكا بوشلۇقى','Table ordered by Hierarchical Menu Order and Title.'=>'جەدۋەل قەۋەتلىك تىزىملىك تەرتىپى ۋە ماۋزۇ بويىچە تەرتىپلەندى.','Table ordered by Title.'=>'جەدۋەل ماۋزۇ بويىچە رەتلەنگەن.','Table ordered by Date.'=>'جەدۋەل چېسلا بويىچە رەتلەنگەن.','Table ordered by Comments.'=>'جەدۋەل ئىنكاس بويىچە رەتلەنگەن.','Table ordered by Uploaded To.'=>'جەدۋەل يۈكلەنمە بويىچە رەتلەنگەن.','Table ordered by Author.'=>'جەدۋەل يازغۇچى بويىچە رەتلەنگەن.','Table ordered by File Name.'=>'جەدۋەل ھۆججەت ئىسمى بويىچە رەتلەنگەن.','Table ordered by Rating.'=>'جەدۋەل باھالاش بويىچە رەتلەنگەن.','Table ordered by Visibility.'=>'جەدۋەل كۆرۈنۈشچانلىق بويىچە رەتلەنگەن.','Table ordered by URL.'=>'جەدۋەل تور ئادرېسى بويىچە رەتلەنگەن.','Table ordered by Name.'=>'جەدۋەل ئات بويىچە رەتلەنگەن.','Table ordered by Post Replied To.'=>'جەدۋەل يازما ئىنكاسى بويىچە رەتلەنگەن.','Table ordered by Comment Author.'=>'جەدۋەل ئىنكاس يازغۇچى بويىچە رەتلەنگەن.','More details.'=>'تېخىمۇ كۆپ تەپسىلاتلار.','Attempting to restore the previous version.'=>'ئىلگىرىكى نەشرىگە ئەسلىگە قايتۇرماقچى بولۇۋاتىدۇ.','Find your team &rarr;'=>'قوشۇنىڭىزنى ئىزدەڭ←','Finding the area that aligns with your skills and interests is the first step toward meaningful contribution. With more than 20 Make WordPress teams working on different parts of the open source WordPress project, there&#8217;s a place for everyone, no matter what your skill set is.'=>'ماھارىتىڭىز ۋە قىزىقىشىڭىزغا ماس كېلىدىغان ساھەنى بايقاش ئەھمىيەتلىك تۆھپە قوشۇشنىڭ بىرىنچى قەدىمى. 20 دىن ئارتۇق Make WordPress قوشۇنى ئوچۇق كودلۇق WordPress قۇرۇلۇشىنىڭ ئوخشىمىغان بۆلەكلىرىگە كۈچ چىقىرىۋاتىدۇ، ماھارىتىڭىز قانداق بولۇشىدىن قەتئىينەزەر، ھەر كىم ئۆز ئورنىنى تاپالايدۇ.','Code-based contribution'=>'كود ئاساسىدىكى تۆھپە','<strong>Organize</strong> or participate in local Meetups and WordCamps.'=>'يەرلىك Meetups ۋە WordCamps نى <strong>تەشكىللەڭ</strong> ياكى قاتناشتۇرۇڭ.','<strong>Edit</strong> videos and add captions to WordPress.tv.'=>'WordPress.tv دىكى سىنلارنى <strong>تەھرىر</strong>لەپ، كىنو خېتى قوشۇڭ.','Shape the future of the web with WordPress'=>'WordPress بىلەن ئىنتېرنېتنىڭ كەلگۈسىنى يارىتىڭ','WordPress app: Kotlin, Java, Swift, Objective-C, Vue, Python, and TypeScript.'=>'WordPress ئەپلىرى: Kotlin، Java، Swift، Objective-C، Vue، Python، ۋە TypeScript.','WordPress Core and Block Editor: HTML, CSS, PHP, SQL, JavaScript, and React.'=>'WordPress يادرو ۋە بۆلەك تەھرىرلىگۈچ: HTML، CSS، PHP، SQL، JavaScript ۋە React.','<strong>Lend</strong> your creative imagination to the WordPress UI design.'=>'مول تەسەۋۋۇرىڭىزنى WordPress ئارايۈز لايىھەسىگە <strong>يۈزلەندۈر</strong>ۈڭ.','<strong>Contribute</strong> to the code, improve the UX, and test the WordPress app.'=>'كودقا <strong>تۆھپە</strong> قوشۇڭ، UX ياخشىلاپ، WordPress ئەپنى سىناڭ.','WordPress embraces new technologies, while being committed to backward compatibility. The WordPress project uses the following languages and libraries:'=>'WordPress يېڭى تېخنىكىغا كەڭ قۇچاق ئاچىدۇ، شۇنداقلا ئىلگىرىكى نەشرىنى قوللاشقا تىرىشىدۇ. WordPress قۇرۇلۇشى تۆۋەندىكى تىل ۋە ئامبارلارنى ئىشلىتىدۇ:','<strong>Write</strong> and submit patches to fix bugs or help build new features.'=>'ياماق <strong>يېزىپ</strong> ۋە يوللاپ خاتالىقلارنى تۈزىتىڭ ياكى يېڭى ئىقتىدار قوشۇشقا ياردەملىشىڭ.','<strong>Test</strong> new releases and proposed features for the Block Editor.'=>'بۆلەك تەھرىرلىگۈچنىڭ يېڭى نەشرى ۋە تەۋسىيە قىلىنغان ئىقتىدارىنى <strong>سىنا</strong>ڭ.','<strong>Find</strong> and report bugs in the WordPress core software.'=>'WordPress نىڭ يادرولۇق يۇمشاق دېتالىدىكى خاتالىقلارنى <strong>بايقاپ</strong> ۋە دوكلات قىلىڭ.','If you do code, or want to learn how, you can contribute technically in numerous ways:'=>'ئەگەر كود يازسىڭىز ياكى كودنى قانداق يېزىشنى ئۆگەنمەكچى بولسىڭىز، كۆپ خىل ئۇسۇلدا  تېخنىكىلىق تۆھپە قوشالايسىز.','<strong>Explore</strong> ways to reduce the environmental impact of websites.'=>'تور بېكەتلەرنىڭ مۇھىت تەسىرىنى ئازايتىشنىڭ يوللىرى ئۈستىدە <strong>ئىزدە</strong>نىڭ.','<strong>Curate</strong> submissions or take photos for the Photo Directory.'=>'يوللانغان مەزمۇنلارنى <strong>رەتلە</strong>ڭ ياكى سۈرەت مۇندەرىجىسى ئۈچۈن سۈرەت تارتىڭ.','<strong>Translate</strong> WordPress into your local language.'=>'WordPress نى يەرلىك تىلىڭىزغا <strong>تەرجىمە</strong> قىلىڭ.','<strong>Create</strong> and improve WordPress educational materials.'=>'WordPress تەربىيەلەش ماتېرىياللىرىنى <strong>ياساڭ</strong> ياكى ياخشىلاڭ.','<strong>Write</strong> or improve documentation for WordPress.'=>'WordPress قوللانمسىنى <strong>يېزىڭ</strong> ياكى ياخشىلاشقا كۈچ قوشۇڭ.','<strong>Share</strong> your knowledge in the WordPress support forums.'=>'بىلگەنلىرىڭىزنى WordPress قوللاش مۇنبەرلىرىدە باشقىلار بىلەن <strong>ھەمبەھىر</strong>لەڭ.','WordPress may thrive on technical contributions, but you don&#8217;t have to code to contribute. Here are some of the ways you can make an impact without writing a single line of code:'=>'WordPress تېخنىكىلىق تۆھپىلەر بىلەن راۋاجلىنىشى مۈمكىن. لېكىن تۆھپە قوشۇش ئۈچۈن كود يېزىش لازىم ئەمەس. بىر قۇر كود يازماي تۇرۇپمۇ ئۆز تەسىرىڭىزنى قوشالايدىغان بەزى يوللارمۇ بار.','Grow your network and make friends.'=>'ئارىلىشىش دائىرىڭىزنى كېڭەيتىپ دوست تۇتۇڭ.','Apply your skills or learn new ones.'=>'ماھارەتلىرىڭىزنى نامايان قىلىڭ ياكى يېڭىلىرىنى ئۆگىنىڭ.','Be part of a global open source community.'=>'دۇنياۋى ئوچۇق مەنبە جامائىتىنىڭ بىر پارچىسى بولۇڭ.','Join the diverse WordPress contributor community and connect with other people who are passionate about maintaining a free and open web.'=>'WordPress تۆھپىكارلار جامائىتىگە قوشۇلۇڭ. ئەركىن ۋە ئوچۇق تور بېكەت ئاسراشقا ئىشتىياق باغلىغان كىشىلەر بىلەن تونۇشۇڭ.','Do you use WordPress for work, for personal projects, or even just for fun? You can help shape the long-term success of the open source project that powers millions of websites around the world.'=>'WordPress نى خىزمەت ئۈچۈن ئىشلىتەمسىز، شەخسىي تۈر ئۈچۈنمۇ ۋە ياكى پەقەتلا قىزىققىنىڭىز ئۈچۈنمۇ؟ دۇنيادىكى مىليونلىغان تور بېكىتىنىڭ ھەرىكەتلەندۈرگۈچ كۈچى بولغان ئوچۇق مەنبەلىك بۇ تۈرنىڭ ئۇزۇن مۇددەت مۇۋەپپەقىيەت قازىنىشىغا ياردەم قىلالايسىز.','<strong>Promote</strong> the WordPress project to your community.'=>'WordPress قۇرۇلۇشىنى جامائىتىڭىزگە <strong>تەشۋىق</strong> قىلىڭ.','No-code contribution'=>'كودسىز تۆھپە','<a href="%1$s">Learn WordPress</a> is a free resource for new and experienced WordPress users. Learn is stocked with how-to videos on using various features in WordPress, <a href="%2$s">interactive workshops</a> for exploring topics in-depth, and lesson plans for diving deep into specific areas of WordPress.'=>'<a href="%1$s"> WordPress ئۆگىنىش</a> يېڭى ۋە تەجرىبىلىك WordPress ئىشلەتكۈچلىرى ئۈچۈن ھەقسىز پايدىلىنىش مەنبەسى. ئۆگىنىش، WordPress نىڭ ھەر خىل ئىقتىدارلىرى تونۇشتۇرۇلغان قانداق ئىشلىتىش سىنلىرى، چوڭقۇرلاپ ئۆگىنىشكە پايدىلىق <a href="%2$s"> تەسىرلىشىشچان خىزمەتخاىىلار</a> ۋە WordPress نىڭ مەلۇم ساھەسىنى چوڭقۇر ئۆگىنىشنى مەقسەت قىلغان دەرس پىلانلىرى بىلەن تولغان.','Be the future of WordPress'=>'WordPress نىڭ كەلگۈسىگە قاتنىشىڭ','<a href="https://wordpress.org/support/forums/">Support forums</a>'=>'<a href="https://wordpress.org/support/forums/">قوللاش مۇنبىرى</a>','<a href="https://wordpress.org/documentation/article/appearance-widgets-screen-classic-editor/">Documentation on Widgets</a>'=>'<a href="https://wordpress.org/documentation/article/appearance-widgets-screen-classic-editor/">ئەپچە قوللانمىسى</a>','<strong>View</strong> takes you to a public author archive which lists all the posts published by the user.'=>'<strong>كۆرسەت</strong> سىزنى ئىشلەتكۈچى ئېلان قىلغان بارلىق يازمىلارنىڭ تىزىملىكىنى كۆرسىتىغان يازغۇچى ئارخىپىغا باشلايدۇ.','<strong>Download file</strong> downloads the original media file to your device.'=>'<strong>ھۆججەت چۈشۈر</strong> ئەسلى ۋاسىتە ھۆججىتىنى كومپۇتېرىڭىزغا چۈشۈرىدۇ.','site editor title tagEditor'=>'تەھرىرلىگۈچ','<a href="https://wordpress.org/documentation/article/plugins-themes-auto-updates/">Documentation on Auto-updates</a>'=>'<a href="https://wordpress.org/documentation/article/plugins-themes-auto-updates/">ئۆزلۈكىدىن يېڭىلاش قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/customize-date-and-time-format/">Documentation on date and time formatting</a>.'=>'<a href="https://wordpress.org/documentation/article/customize-date-and-time-format/">چېسلا ۋە ۋاقىت پىچىمى قوللانمىسى</a>.','You can set the language, and WordPress will automatically download and install the translation files (available if your filesystem is writable).'=>'تىلنى بېكىتسىڭىز WordPress تەرجىمە ھۆججىتىنى ئاپتوماتىك چۈشۈرۈپ ئورنىتىدۇ.(ئەگەر ھۆججەت سىستېمىڭىزغا يازغىلى بولغاندىلا)','If you want site visitors to be able to register themselves, check the membership box. If you want the site administrator to register every new user, leave the box unchecked. In either case, you can set a default user role for all new users.'=>'ئەگەر بېكەت زىيارەتچىلىرىنىڭ ئۆزىنى تىزىملىتالىشىنى ئۈمىت قىلسىڭىز، ئەزالىق قۇتىسىغا ئىشارەت قويۇڭ. ئەگەر بېكەت باشقۇرغۇچىسىنىڭ ھەر بىر يېڭى ئىشلەتكۈچىنى تىزىملىتىشىنى ئۈمىت قىلسىڭىز، قۇتىغا ئىشارەت قويماڭ. مەيلى قايسى ئەھۋال بولسۇن، يېڭى ئىشلەتكۈچىلەرگە بىر كۆڭۈلدىكى ئىشلەتكۈچى رولى بېكىتەلەيسىز.','Both WordPress URL and site URL can start with either %1$s or %2$s. A URL starting with %2$s requires an SSL certificate, so be sure that you have one before changing to %2$s. With %2$s, a padlock will appear next to the address in the browser address bar. Both %2$s and the padlock signal that your site meets some basic security requirements, which can build trust with your visitors and with search engines.'=>'WordPress تور ئادرېسى ۋە تور بېكەت تور ئادرېسىنىڭ ھەر ئىككىسى %1$s ياكى %2$s بىلەن باشلانسا بولىدۇ. %2$s بىلەن باشلانغان تور ئادرېسى SSL گۇۋاھنامە تەلەپ قىلىدۇ. شۇڭلاشقا %2$s بىلەن باشلىنىدىغان قىلىپ ئۆزگەرتىشتىن بۇرۇن، مۇناسىپ تور ئادرېسىنىڭ SSL گۇۋاھنامەسى ئورنىتىلغانلىقىغا كاپالەتلىك قىلىڭ. %2$s بىلەن باشلانسا توركۆرگۈ ئادرېس بالداققا يېقىن جايدا قۇلۇپ سىگنالى كۆرۈنىدۇ. %2$s بىلەن قۇلۇپ سىگنالى تور بېكىتىڭىزنى ئاساسىي بىخەتەرلىك تەلىپىنى قاندۇرغانلىقىنى بىلدۈرىدۇ، بۇ زىيارەتچى ۋە ئىزدەش موتورىنىڭ تور بېكىتىڭىزنى ئىشەنچ بىلەن زىيارەت قىلالايدىغانلىقىنى بىلدۈرىدۇ.','Though the terms refer to two different concepts, in practice, they can be the same address or different. For example, you can have the core WordPress installation files in the root directory (<code>https://example.com</code>), in which case the two URLs would be the same. Or the <a href="%s">WordPress files can be in a subdirectory</a> (<code>https://example.com/wordpress</code>). In that case, the WordPress URL and the site URL would be different.'=>'بۇ ئىككى قۇرۇلۇش پەرقلىق ئىككى ئۇقۇمغا ۋەكىللىك قىلسىمۇ، ئەمما ئەمەلىي قوللانغاندا ئىككىسى ئوخشاش ئادرېس بولسىمۇ ياكى پەرقلىق ئادرېس بولسىمۇ بولىدۇ. مەسىلەن، WordPress نىڭ يادرولۇق ئورنىتىش ھۆججەتلىرى غول مۇندەرىجە (<code>https://example.com</code>) گە قويۇلغان بولسا، ئۇنداقتا ئىككى تور ئادرېسى بىردەكلىكنى ساقلايدۇ. ياكى <a href="%s">WordPress ھۆججەتلىرى تارماق مۇندەرىجە</a> (<code>https://example.com/wordpress</code>) گە قويۇلغان بولسا، ئۇنداقتا WordPress تور ئادرېسى بىلەن تور بېكەت ئادرېسى پەرقلىق بولىدۇ.','Two terms you will want to know are the WordPress URL and the site URL. The WordPress URL is where the core WordPress installation files are, and the site URL is the address a visitor uses in the browser to go to your site.'=>'سىز بىلىشكە تېگىشلىك ئىككى ئۇقۇم، بىرى WordPress تور ئادرېسى يەنە بىرى تور بېكەت ئادرېسى. WordPress تور ئادرېسى WordPress نىڭ يادرولۇق ئورنىتىش ھۆججەتلىرىنىڭ ئورنى، تور بېكەت ئادرېسى زىيارەتچىلەر تور بېكىتىڭىزنى زىيارەت قىلغاندا ئىشلىتىدىغان تور ئادرېسى.','RoboHash (Generated)'=>'RoboHash (ھاسىل قىلىنغان)','site editor menu itemEditor'=>'تەھرىرلىگۈچ','https://wordpress.org/documentation/article/assign-custom-fields/'=>'https://wordpress.org/documentation/article/assign-custom-fields/','https://wordpress.org/documentation/article/what-is-an-excerpt-classic-editor/'=>'https://wordpress.org/documentation/article/what-is-an-excerpt-classic-editor/','The destination folder already exists.'=>'نىشان قىسقۇچى مەۋجۇت.','The source and destination are the same.'=>'مەنبە بىلەن نىشان ئوخشاش.','https://wordpress.org/documentation/article/changing-file-permissions/'=>'https://wordpress.org/documentation/article/changing-file-permissions/','%s expects a non-empty string.'=>'%s چوقۇم بوش بولمىغان ھەرپ تىزىقى بولۇشى كېرەك.','The destination directory already exists and could not be removed.'=>'نىشان مۇندەرىجەت مەۋجۇت ھەمدە چىقىرىۋەتكىلى بولمايدۇ.','Allow <a href="%s">trackbacks and pingbacks</a>'=>'بۇ بەتتە <a href="%s">نەقىل ئىنكاسى ۋە ping ئىنكاسى</a>غا يول قوي','Expand or collapse the elements by clicking on their headings, and arrange them by dragging their headings or by clicking on the up and down arrows.'=>'ماۋزۇنى چېكىش ئارقىلىق ئېلېمېنلەرنى يىغقىلى ۋە يايغىلى بولىدۇ ھەمدە ماۋزۇنى سۆرەش ياكى ئاستى ۋە ئۈستى يا ئوقنى چېكىش ئارقىلىق ئۇلارنى رەتلىگىلى بولىدۇ.','Download &#8220;%s&#8221;'=>'«%s» نى چۈشۈر','The "%s" argument must be a non-empty string.'=>'بۇ «%s» پارامېتىر چوقۇم بوش بولمىغان ھەرپ تىزىقى بولۇشى كېرەك.','<a href="https://wordpress.org/documentation/article/write-posts-classic-editor/">Documentation on Writing and Editing Posts</a>'=>'<a href="https://wordpress.org/documentation/article/write-posts-classic-editor/">يازما يېزىش ۋە تەھرىرلەش قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/keyboard-shortcuts-classic-editor/#keyboard-shortcuts-for-comments">Documentation on Keyboard Shortcuts</a>'=>'<a href="https://wordpress.org/documentation/article/keyboard-shortcuts-classic-editor/#keyboard-shortcuts-for-comments">ھەرپتاختا قىسقا يول قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/understand-comment-spam/">Documentation on Comment Spam</a>'=>'<a href="https://wordpress.org/documentation/article/understand-comment-spam/">ئەخلەت ئىنكاس قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/customizer/">Documentation on Customizer</a>'=>'<a href="https://wordpress.org/documentation/article/customizer/">خاسلاشتۇرغۇچ قوللانمىسى</a>','https://wordpress.org/download/'=>'https://wordpress.org/download/','This is the final release of WordPress %s'=>'بۇ WordPress %s نىڭ ئاخىرقى نەشرى','Site Editor'=>'بېكەت تەھرىرلىگۈچ','https://developer.wordpress.org/apis/wp-config-php/#wp-environment-type'=>'https://developer.wordpress.org/apis/wp-config-php/#wp-environment-type','<strong>Send password reset</strong> sends the user an email with a link to set a new password.'=>'يېڭى پارول بەلگىلەش ئۈچۈن لازىملىق ئۇلانمىنى <strong>پارول ئەسلىگە قايتۇرۇش يوللا</strong> ئارقىلىق ئىشلەتكۈچىگە ئېلخەت بىلەن ئەۋەتىدۇ.','<strong>Copy URL</strong> copies the URL for the media file to your clipboard.'=>'<strong>ئۇلانمىنى كۆچۈر</strong> ۋاسىتە ھۆججىتى ئۈچۈن تور ئادرېسىنى چاپلاش تاختىسىغا كۆچۈرىدۇ.','<strong>View</strong> will take you to a public display page for that file.'=>'<strong>كۆرسەت</strong> سىزنى بۇ ھۆججەتنى ئوچۇق كۆرسىتىغان بىر بەتكە ئېلىپ بارىدۇ.','<strong>Delete Permanently</strong> will delete the file from the media library (as well as from any posts to which it is currently attached).'=>'<strong>مەڭگۈلۈك ئۆچۈر</strong> ھۆججەتنى ۋاسىتە ئامبىرىدىن (شۇنىڭ بىلەن بىرگە ھۆججەت قوشۇلغان بارلىق يازمىلاردىن) ئۆچۈرىدۇ.','Hovering over a row reveals action links that allow you to manage media items. You can perform the following actions:'=>'مائۇسنى بىرەر قۇر ئۈستىگە ئەكەلسىڭىز، ۋاسىتە تۈرلىرىنى باشقۇرۇشقا تەمىنلەنگەن مەشغۇلات ئۇلانمىلىرى كۆرسىتىلىدۇ. سىز تۆۋەندىكى مەشغۇلاتلارنى ئورۇنلىيالايسىز:','<strong>Edit</strong> takes you to a simple screen to edit that individual file&#8217;s metadata. You can also reach that screen by clicking on the media file name or thumbnail.'=>'<strong>تەھرىر</strong> سىزنى يەككە ھۆججەتنىڭ مېتا سانلىق مەلۇماتىنى تەھرىرلەيدىغان بەتكە باشلايدۇ. ھۆججەت ئىسمى ياكى كىچىك كۆرۈنۈشنى چېكىپ بۇ بەتكە كىرەلەيسىز.','themesBlock Themes'=>'بۆلەك ئۆرنەكلەر','<a href="https://wordpress.org/documentation/article/block-themes/">Documentation on Block Themes</a>'=>'<a href="https://wordpress.org/documentation/article/block-themes/">بۆلەك ئۆرنەك قوللانمىسى</a>','Block themes'=>'بۆلەك ئۆرنەكلەر','With a block theme, you can place and edit blocks without affecting your content by customizing or creating new templates.'=>'بۆلەك ئۆرنەك ئىشلىتىش ئارقىلىق، مەزمۇنغا تەسىر كۆرسەتمەيلا، بۆلەكنى خاسلاشتۇرۇش ياكى قېلىپ قۇرۇش ئارقىلىق بۆلەكنى جايلاشتۇرۇپ تەھرىرلىيەلەيسىز.','A block theme is a theme that uses blocks for all parts of a site including navigation menus, header, content, and site footer. These themes are built for the features that allow you to edit and customize all parts of your site.'=>'بۆلەك ئۆرنەك تور بېكەتنىڭ يولباشچى تىزىملىكى، بەت قاش، مەزمۇن ۋە تور بېكەت بەت ئاستىنى ئۆز ئىچىگە ئالغان بارلىق بۆلەكلىرىگە ئىشلىتىدىغان ئۆرنەك. بۇ ئۆرنەكلەر تور بېتىڭىزنىڭ ھەممە قىسىملىرىنى تەھرىرلىيەلەيدىغان ۋە خاسلاشتۇرالايدىغان ئىقتىدارلار ئۈچۈن ياسالغان.','Recommended items are considered beneficial to your site, although not as important to prioritize as a critical issue, they may include improvements to things such as; Performance, user experience, and more.'=>'تەۋسىيە قىلىنغان تۈر تور بېكىتىڭىزگە پايدىلىق تۈر بولۇپ، ھالقىلىق مەسىلىلەرگە ئوخشاش ئالدىن ئويلىشىلمىسىمۇ، يەنىلا تور بېكەتنىڭ ئۈنۈمى، ئىشلەتكۈچى تەسىراتى ۋە باشقىلارنى ئۆز ئىچىگە ئالغان ياخشىلىنىشنى كۆرسىتىدۇ.','Configuration rules for %s:'=>'%s نىڭ سەپلىمە قائىدىسى:','The theme you are currently using is not compatible with the Site Editor.'=>'نۆۋەتتە ئىشلىتىۋاتقان ئۆرنەك بېكەت تەھرىرلىگۈچى بىلەن ماسلاشمايدۇ.','Critical issues are items that may have a high impact on your sites performance or security, and resolving these issues should be prioritized.'=>'ھالقىلىق مەسىلە تور بېكىتىڭىزنىڭ ئۈنۈمى ياكى بىخەتەرلىكىگە زور تەسىر ئېلىپ كېلىدىغان تۈرلەرنى كۆرسىتىدۇ، بۇ مەسىلىلەرنى ئالدىن ئويلىشىپ بىر تەرەپ قىلىش كېرەك.','%s removed from permalink structure'=>'%s نى مەڭگۈلۈك قۇرۇلمىدىن چىقىرىۋەتتى','Site Health %s'=>'بېكەت ساغلاملىقى ‎%s‎‏','Customize permalink structure by selecting available tags'=>'ئىشلەتكىلى بولىدىغان بەلگىلەرنى تاللاپ، ئۆزگەرمەس ئۇلانمىلارنى خاسلاشتۇرۇڭ.','Select the permalink structure for your website. Including the %s tag makes links easy to understand, and can help your posts rank higher in search engines.'=>'تور بېكىتىڭىزدە ئىشلىتىدىغان ئۆزگەرمەس ئۇلانما قۇرۇلمىسىنى تاللاڭ. %s بەلگىسىنى ئۆز ئىچىگە ئالسا تېخىمۇ چۈشىنىشلىك بولىدۇ ھەمدە يازمىلىرىڭىز ئىزدەش موتورىدا تېخىمۇ ئالدىغا تىزىلىدۇ.','Theme Styles & Block Settings'=>'ئۆرنەك ئۇسلۇبى ۋە بۆلەك تەڭشەكلىرى','The minimum recommended version of PHP is %s.'=>'تەۋسىيە قىلىنىدىغان PHP نىڭ ئەڭ تۆۋەن نەشرى %s.','PHP is one of the programming languages used to build WordPress. Newer versions of PHP receive regular security updates and may increase your site&#8217;s performance.'=>'WordPress تور بېكىتى قۇرۇشتا ئىشلىتىدىغان پىروگرامما تىللىرىنىڭ بىرى PHP بولۇپ، ئەڭ يېڭى PHP نەشرى بىخەتەرلىك يېڭىلىنىشلىرىنى قوبۇل قىلالايدۇ ھەمدە تور بېكىتىڭىزنىڭ ئۈنۈمىنى ئۆستۈرەلىشى مۇمكىن.','Your site is running on an outdated version of PHP (%s), which soon will not be supported by WordPress. Ensure that PHP is updated on your server as soon as possible. Otherwise you will not be able to upgrade WordPress.'=>'تور بېكىتىڭىزدە PHP (%s) نىڭ ۋاقتى ئۆتكەن نەشرى ئىجرا قىلىنىۋېتىپتۇ، پات يېقىندا WordPress ئۇنى قوللاشنى توختىتىدۇ. ئامالنىڭ بارىچە مۇلازىمېتىرىڭىزدىكى PHP نى يېڭى نەشرىگە يېڭىلاڭ بولمىسا WordPress نى يۈكسەلتەلمەيسىز.','Your site is running on an outdated version of PHP (%s), which does not receive security updates and soon will not be supported by WordPress. Ensure that PHP is updated on your server as soon as possible. Otherwise you will not be able to upgrade WordPress.'=>'تور بېكىتىڭىزدە PHP (%s) نىڭ ۋاقتى ئۆتكەن نەشرى ئىجرا قىلىنىۋېتىپتۇ، بىخەتەرلىك يېڭىلىنىشىنى قوبۇل قىلالمايدۇ، پات يېقىندا WordPress ئۇنى قوللاشنى توختىتىدۇ. ئامالنىڭ بارىچە مۇلازىمېتىرىڭىزدىكى PHP نى يېڭى نەشرىگە يېڭىلاڭ بولمىسا WordPress نى يۈكسەلتەلمەيسىز.','Persistent object cache'=>'ئىزچىل ئوبيېكت غەملەك','Page cache'=>'بەت غەملەك','You should use a persistent object cache'=>'ئۈزلۈكسىز ئوبيېكت غەملەك ئىشلىتىشىڭىز كېرەك.','Your host appears to support the following object caching services: %s.'=>'تور بېكەت مۇلازىمەت تەمىنلىگۈچىڭىز تۆۋەندىكى غەملەك مۇلازىمىتىنى قوللايدىغاندەك قىلىدۇ: %s.','Your hosting provider can tell you if a persistent object cache can be enabled on your site.'=>'تور بېكەت مۇلازىمەت تەمىنلىگۈچىڭىز تور بېكىتىڭىزگە ئۈزلۈكسىز ئوبيېكت غەملەك تەمىنلىيەلەيدىغان ياكى تەمىنلىيەلمەيدىغانلىقىنى سىزگە بىلدۈرىدۇ.','A persistent object cache is not required'=>'ئۈزلۈكسىز ئوبيېكت غەملەك زۆرۈر ئەمەس','Learn more about persistent object caching.'=>'ئۈزلۈكسىز ئوبيېكت غەملەك ھەققىدىكى تەپسىلاتلار.','A persistent object cache makes your site&#8217;s database more efficient, resulting in faster load times because WordPress can retrieve your site&#8217;s content and settings much more quickly.'=>'داۋاملىشىدىغان ئوبيېكت غەملەك تور بېكىتىڭىزنىڭ ساندانىنىڭ ئۈنۈمىنى ئۆستۈرىدۇ، WordPress تور بېكەتنىڭ مەزمۇن ۋە تەڭشەكلىرىگە تېخىمۇ تېز ئېرىشىپ، يۈكلەش ۋاقتىنى تېخىمۇ تېزلەشتۈرىدۇ.','https://wordpress.org/documentation/article/optimization/#persistent-object-cache'=>'https://wordpress.org/documentation/article/optimization/#persistent-object-cache','A page cache plugin was not detected.'=>'بەت غەملەك قىستۇرمىسى بايقالمىغان.','A page cache plugin was detected.'=>'بەت غەملەك قىستۇرمىسى بايقالغان.','Learn more about page cache'=>'بەت غەملەكلىرى ھەققىدىكى تەپسىلاتلار','https://wordpress.org/documentation/article/optimization/#Caching'=>'https://wordpress.org/documentation/article/optimization/#Caching','A persistent object cache is being used'=>'ئۈزلۈكسىز ئوبيېكت غەملەكنى ئىشلىتىۋاتىدۇ','There was %d client caching response header detected:'=>'%d خېرىدار غەملەك ئىنكاس بېشى بايقالدى:' . "\0" . '%d خېرىدار غەملەك ئىنكاس بېشى بايقالدى:','No client caching response headers were detected.'=>'خېرىدار غەملەك ئىنكاس بېشى بايقالمىدى.','Page cache is not detected and the server response time is slow'=>'بەت غەملەك بايقالمىدى، مۇلازىمېتىرنىڭ ئىنكاس ۋاقتى ئاستا','Page cache is detected and the server response time is good'=>'بەت غەملەك بايقالدى، مۇلازىمېتىرنىڭ ئىنكاس ۋاقتى ياخشى','Page cache is not detected but the server response time is OK'=>'بەت غەملەك بايقالمىدى ئەمما مۇلازىمېتىرنىڭ ئىنكاس ۋاقتى ئادەتتىكىدەك','Unable to detect the presence of page cache'=>'بەت غەملەكنىڭ مەۋجۇتلۇقىنى بايقىيالمىدى','Server response time could not be determined. Verify that loopback requests are working.'=>'مۇلازىمېتىر ئىنكاس ۋاقتىنى جەزملىيەلمىدى. ئايلانما ئىنكاس ئىلتىماسىنىڭ ئىشلەۋاتقانلىقىنى دەلىللەڭ.','Page cache is detected but the server response time is still slow'=>'بەت غەملەك بايقالدى ئەمما مۇلازىمېتىرنىڭ ئىنكاس ۋاقتى يەنىلا ئاستا','Median server response time was %1$s milliseconds. It should be less than the recommended %2$s milliseconds threshold.'=>'مۇلازىمېتىرنىڭ ئىنكاس ۋاقتىدىكى ئوتتۇرىدىكى سان %1$s مىللىسېكۇنت. ئۇ تەۋسىيە قىلىنغان %2$s مىللىسېكۇنت بوسۇغا قىممىتىدىن كىچىك بولۇشى كېرەك.','Median server response time was %1$s milliseconds. This is less than the recommended %2$s milliseconds threshold.'=>'مۇلازىمېتىرنىڭ ئىنكاس ۋاقتىدىكى ئوتتۇرىدىكى سان %1$s مىللىسېكۇنت. بۇ تەۋسىيە قىلىنغان %2$s مىللىسېكۇنت بوسۇغا قىممىتىدىن كىچىك بولۇشى كېرەك.','Unable to detect page cache due to possible loopback request problem. Please verify that the loopback request test is passing. Error: %1$s (Code: %2$s)'=>'ئايلانما ئىنكاس مەسىلىسى تۈپەيلىدىن بەت غەملىكىنى بايقىيالمىدى. ئايلانما ئىنكاس ئىلتىماسى سىنىقىنىڭ سىنالغان ياكى سىنالمىغانلىقىنى دەلىللەڭ. خاتالىق: %1$s (كود: %2$s)','Page cache is detected by looking for an active page cache plugin as well as making three requests to the homepage and looking for one or more of the following HTTP client caching response headers:'=>'ئاكتىپ بەت غەملەك قىستۇرمىسى ئىزدەش ۋە باش بەتكە ئۈچ ئىلتىماس يوللاپ، كېيىنكى ياكى كۆپ HTTP خېرىدار غەملەك ئىنكاسى بېشىنى ئىزدەپ، غەملەك بار يوقلۇقىنى بايقايدۇ:','REST API Response: (%1$s) %2$s'=>'REST API ئىنكاسى: (%1$s) %2$s','REST API Endpoint: %s'=>'REST API ئاخىرلىشىش نۇقتىسى: %s','When testing the REST API, an error was encountered:'=>'REST API نى سىناۋاتقاندا، بىر خاتالىق كۆرۈلگەن:','When testing the REST API, an unexpected result was returned:'=>'REST API سىناۋاتقاندا، كۈتۈلمىگەن نەتىجە قايتۇردى:','Page cache enhances the speed and performance of your site by saving and serving static pages instead of calling for a page every time a user visits.'=>'بەت غەملەك مۇقىم بەت ساقلاش ۋە تەمىنلەش ئارقىلىق ئىشلەتكۈچىلەر ھەر قېتىم زىيارەت قىلغاندا بەتنى چاقىرماي، تور بېكىتىڭىزنىڭ سۈرئىتى ۋە ئۈنۈمىنى ياخشىلايدۇ.','If you are still seeing this warning after having tried the actions below, you may need to contact your hosting provider for further assistance.'=>'ئەگەر تۆۋەندىكى مەشغۇلاتنى سىنىغاندىن كېيىنمۇ بۇ ئاگاھلاندۇرۇشنى يەنە كۆرسىڭىز، مۇلازىمېتىر تەمىنلىگۈچىڭىز بىلەن ئالاقىلىشىپ ئۇنىڭ ياردىمىگە ئېرىشىڭ.','The Authorization header is used by third-party applications you have approved for this site. Without this header, those apps cannot connect to your site.'=>'دەلىللەش بېشىنى تور بېكىتىڭىز تەستىقلىغان ئۈچىنچى تەرەپ پىروگراممىسى ئىشلىتىدۇ. بۇ دەلىللەش بېشى بولمىسا، بۇ پىروگراممىلار تور بېكىتىڭىزگە باغلىنالمايدۇ.','Requirements'=>'تەلەپلەر','Your site is running on an outdated version of PHP (%s), which does not receive security updates. It should be updated.'=>'تور بېكىتىڭىزدە ۋاقتى ئۆتكەن كونا نەشرىدىكى PHP (%s) ئىجرا قىلىنىۋېتىپتۇ، ئۇ بىخەتەرلىك يېڭىلىنىشىنى تاپشۇرۇۋالالمايدۇ. ئۇنى يېڭىلىشىڭىز كېرەك.','Your site is running on an outdated version of PHP (%s), which does not receive security updates and soon will not be supported by WordPress.'=>'تور بېكىتىڭىزدە ۋاقتى ئۆتكەن كونا نەشرىدىكى PHP (%s) ئىجرا قىلىنىۋېتىپتۇ، ئۇ بىخەتەرلىك يېڭىلىنىشىنى تاپشۇرۇۋالالمايدۇ. ناھايىتى تېزلا WordPress مۇ قوللىمايدۇ.','Your site is running on an outdated version of PHP (%s), which soon will not be supported by WordPress.'=>'تور بېكىتىڭىزدە PHP (%s) نىڭ ۋاقتى ئۆتكەن نەشرى ئىجرا قىلىنىۋاتىدۇ، ناھايىتى تېزلا WordPress مۇ قوللىمايدۇ.','PHP is one of the programming languages used to build WordPress. Newer versions of PHP receive regular security updates and may increase your site&#8217;s performance. The minimum recommended version of PHP is %s.'=>'WordPress تور بېكىتى قۇرۇشتا ئىشلىتىدىغان پىروگرامما تىللىرىنىڭ بىرى PHP بولۇپ، ئەڭ يېڭى PHP نەشرى قەرەلىك بىخەتەرلىك يېڭىلىنىشلىرىنى قوبۇل قىلالايدۇ ھەمدە تور بېكىتىڭىزنىڭ ئۈنۈمىنى ئۆستۈرەلىشى مۇمكىن. PHP نىڭ تەۋسىيە قىلىنىدىغان ئەڭ تۆۋەن نەشرى %s.','Your site does not have any installed themes.'=>'بېكىتىڭىزگە ھېچقانداق ئۆرنەك ئورنىتىلمىغان.','Your site does not have any active plugins.'=>'بېكىتىڭىزگە ھېچقانداق ئاكتىپ قىستۇرما يوق.','The %s argument must be an array.'=>'%s ئەركىن ئۆزگەرگۈچى سانلار قاتارى بولۇشى كېرەك.','- %1$s version %2$s%3$s'=>'- %1$s نەشرى %2$s%3$s','- %1$s (from version %2$s to %3$s)%4$s'=>'- %1$s (%2$s نەشرىدىن %3$s)%4$s','Another attempt will be made with the next release.'=>'كېيىنكى نەشرى تارقىتىلغاندا يەنە سىنايدۇ.','The %1$s constant is defined as %2$s'=>'%1$s تۇراقلىق سان %2$s سۈپىتىدە ئېنىقلىما بېرىلدى','The %1$s argument must be a non-empty string for %2$s.'=>'%2$s  نىڭ %1$s پارامېتىرى چوقۇم بوش بولمىغان ھەرپ تىزىقى بولۇشى كېرەك.','Reach out to WordPress Core developers to ensure you\'ll never have this problem again.'=>'WordPress يادرولۇق ئىجادكارلىرى بىلەن ئالاقىلىشىپ بۇ مەسىلىنىڭ ھەرگىز قايتا يۈز بەرمەسلىكىنى جەزملەڭ.','Important! Your version of WordPress (%1$s) will stop receiving security updates in the near future. To keep your site secure, please <a href="%2$s">update to the latest version of WordPress</a>.'=>'مۇھىم! سىزنىڭ WordPress  (%1$s) نۇسخىڭىز پات يېقىندا بىخەتەرلىك يېڭىلاشلىرىنى تاپشۇرۇۋېلىشتىن توختايدۇ. تور بېكىتىڭىزنىڭ بىخەتەرلىكى ئۈچۈن، <a href="%2$s">WordPress نىڭ ئەڭ يېڭى نۇسخىسىغا يېڭىلىۋېلىڭ</a>.','Important! Your version of WordPress (%1$s) is no longer supported, you will not receive any security updates for your website. To keep your site secure, please <a href="%2$s">update to the latest version of WordPress</a>.'=>'مۇھىم! سىزنىڭ WordPress  (%1$s) نۇسخىڭىز قوللاشتىن توختىدى. تور بېكىتىڭىز ئەمدى ھېچقانداق بىخەتەرلىك يېڭىلاشلىرىنى تاپشۇرۇۋالمايدۇ. تور بېكىتىڭىزنىڭ بىخەتەرلىكى ئۈچۈن، <a href="%2$s">WordPress نىڭ ئەڭ يېڭى نۇسخىسىغا يېڭىلىۋېلىڭ</a>.','https://make.wordpress.org/core/wordpress-6-5-field-guide/'=>'https://make.wordpress.org/core/wordpress-6-5-field-guide/','Learn more about WordPress %s'=>'WordPress %s ھەققىدە تەپسىلاتلار','Please type your comment text.'=>'ئىنكاس تېكىستىڭىزنى يېزىڭ.','You cannot remove users.'=>'ئىشلەتكۈچىنى چىقىرىۋېتەلمەيسىز.','Application passwords grant access to <a href="%1$s">the %2$s site on the network as you have Super Admin rights</a>.'=>'پىروگرامما پاروللىرى <a href="%1$s"> ئالىي باشقۇرغۇچى ھوقۇقىغا ئىگە بولغىنىڭىز ئۈچۈن سىزگە %2$s بېكىتىنى زىيارەت قىلىش ھوقۇقى بېرىدۇ</a>.' . "\0" . 'پىروگرامما پاروللىرى <a href="%1$s"> ئالىي باشقۇرغۇچى ھوقۇقىغا ئىگە بولغىنىڭىز ئۈچۈن سىزگە %2$s بېكىتىنى زىيارەت قىلىش ھوقۇقى بېرىدۇ</a>.','<a href="https://wordpress.org/documentation/article/appearance-themes-screen/">Documentation on Managing Themes</a>'=>'<a href="https://wordpress.org/documentation/article/appearance-themes-screen/">ئۆرنەك باشقۇرۇش قوللانمىسى</a>','WordPress has been updated! Next and final step is to update your database to the newest version.'=>'WordPress يېڭىلىنىپ بولدى! كېيىنكى ھەم ئاخىرقى قەدەم ساندانىڭىزنى ئەڭ يېڭى نەشرىگە يېڭىلاش.','This information is being used to create a %s file.'=>'بۇ ئۇچۇرلار %s ھۆججىتى قۇرۇشقا ئىشلىتىلىدۇ.','Welcome to WordPress. Before getting started, you will need to know the following items.'=>'WordPress كە خۇش كەپسىز. باشلاشتىن ئىلگىرى، تۆۋەندىكى تۈرلەرنى بىلىشىڭىز كېرەك.','Settings save failed.'=>'تەڭشەكلەرنى ساقلىيالمىدى.','After your Privacy Policy page is set, you should edit it.'=>'شەخسىيەت تۈزۈمى بېتىنى تەڭشىگەندىن كېيىن، ئۇنىڭ تەھرىرلىشىڭىز كېرەك.','<strong>Error:</strong> Your %1$s file is not <a href="%2$s">writable</a>, so updating it automatically was not possible. These are the mod_rewrite rules you should have in your %1$s file. Click in the field and press %3$s (or %4$s on Mac) to select all.'=>'<strong>خاتالىق:</strong> سىزنىڭ %1$s ھۆججىتىڭىزگە <a href="%2$s">يازغىلى</a> بولمايدۇ، شۇڭا ئۆزلۈكىدىن يېڭىلىغىلى بولمايدۇ. بۇلار %1$s ھۆججەتكە زۆرۈر بولغان mod_rewrite قائىدىسى. شۇ بۆلەك %3$s (ياكى Mac تە %4$s) بېسىلسا ھەممىسى تاللىنىدۇ.','<strong>Error:</strong> Your %1$s file is not <a href="%2$s">writable</a>, so updating it automatically was not possible. This is the URL rewrite rule you should have in your %1$s file. Click in the field and press %3$s (or %4$s on Mac) to select all. Then insert this rule inside of the %5$s element in %1$s file.'=>'<strong>خاتالىق:</strong> سىزنىڭ %1$s ھۆججىتىڭىزگە <a href="%2$s">يازغىلى</a> بولمايدۇ، شۇڭا ئۆزلۈكىدىن يېڭىلىغىلى بولمايدۇ. بۇ %1$s ھۆججەتتە بولۇشقا تېگىشلىك تور ئادرېسىنى قايتا يېزىش قائىدىسى. شۇ بۆلەكتە %3$s (ياكى Mac تە %4$s) بېسىلسا ھەممىسى تاللىنىدۇ. ئاندىن بۇ قائىدىنى %1$s ھۆججەتكە %5$s ئېلېمېنتقا قىستۇرۇڭ.','An avatar is an image that can be associated with a user across multiple websites. In this area, you can choose to display avatars of users who interact with the site.'=>'سىما كۆپ تور بېكەت ئارا ئىشلىتىلىدىغان ئىشلەتكۈچىگە مۇناسىۋەتلىك سۈرەت. بۇ دائىرىدە، ئىشلەتكۈچى بىلەن تور بېكەت ئارىسىدا تەسىرلىشىشتە كۆرسىتىدىغان سىمانى تاللىيالايسىز.','Change Permalink Structure'=>'ئۆزگەرمەس ئۇلانمىنىڭ قۇرۇلمىسىنى ئۆزگەرتىش','Howdy ###USERNAME###,

Someone with administrator capabilities recently requested to have the
administration email address changed on this site:
###SITEURL###

To confirm this change, please click on the following link:
###ADMIN_URL###

You can safely ignore and delete this email if you do not want to
take this action.

This email has been sent to ###EMAIL###

Regards,
All at ###SITENAME###
###SITEURL###'=>'سالام ###USERNAME###،

يېقىندا باشقۇرغۇچى ھوقۇقى بار بىرەيلەن مەزكۇر تور بېكەتنىڭ باشقۇرغۇچى ئېلخېتىنى ئۆزگەرتىشنى
 تەلەپ قىلدى.
