###SITEURL###','Where your data is sent'=>'سانلىق مەلۇماتلىرىڭىز قەيەرگە ئەۋەتىلدى','Copy &#8220;%s&#8221; URL to clipboard'=>'«%s» نىڭ تور ئادرېسىنى چاپلاش تاختىسىغا كۆچۈر','Some data that describes the error your site encountered has been put together.'=>'مەزكۇر بېكەت يولۇققان خاتالىق ئۇچۇرلىرىنى ئىپادىلەيدىغان بەزى سانلىق مەلۇماتلار بىر يەرگە يىغىلدى.','An attempt was made, but your site could not be updated automatically.'=>'سىستېما سىناپ باقتى، شۇغىنىسى تور بېكىتىڭىزنى ئۆزلۈكىدىن يېڭىلىغىلى بولمايدۇ.','themeActive'=>'ئاكتىپ','The update cannot be installed because some files could not be copied. This is usually due to inconsistent file permissions.'=>'يېڭىلانمىنى ئورنىتالمىدى، چۈنكى بەزى ھۆججەتلەرنى كۆچۈرەلمىدى. بۇ ئادەتتە ھۆججەت ئىجازىتىنىڭ بىردەك بولماسلىقىدىن بولىدۇ.','<strong>Media</strong> &mdash; A list of URLs for media files the user uploads.'=>'<strong>ۋاسىتە</strong> &mdash; ئىشلەتكۈچى يۈكلىگەن بارلىق ۋاسىتە ھۆججەتلىرىنىڭ تور ئادرېس تىزىمى.','<strong>Community Events Location</strong> &mdash; The IP Address of the user, which populates the Upcoming Community Events dashboard widget with relevant information.'=>'<strong>جامائەت پائالىيەتلىرىنىڭ ئورنى</strong>&mdash; ئىشلەتكۈچىنىڭ IP ئادرېسىنى ئىشلىتىپ ئۆتكۈزۈلمەكچى بولغان جامائەت پائالىيى باشقۇرۇش تاختىسى ئەپچىدە مۇناسىپ ئۇچۇرنى تولدۇرىدۇ.','WordPress collects (but <em>never</em> publishes) a limited amount of data from registered users who have logged in to the site. Generally, these users are people who contribute to the site in some way -- content, store management, and so on. With rare exceptions, these users do not include occasional visitors who might have registered to comment on articles or buy products. The data WordPress retains can include:'=>'WordPress تىزىمغا كىرگەن ئىشلەتكۈچىلەردىن چەكلىك ئۇچۇر توپلايدۇ (ئەمما <em>ھەرگىز</em> تارقاتمايدۇ). ئادەتتە، بۇ ئىشلەتكۈچىلەر مەلۇم ئۇسۇلدا (مەسىلەن، مەزمۇن، دۇكان باشقۇرۇش) تۆھپە قوشقانلاردۇر؛ ئاز ساندىكىلەردىن سىرت، بۇ ئىشلەتكۈچىلەر خەتلىتىپ ئىنكاس يوللاش، يازما ئېلان قىلىش ياكى تاۋار سېتىۋېلىش قاتارلىق ئىشلارنى قىلىدىغان ئادەتتىكى زىيارەتچىلەرنى ئۆز ئىچىگە ئالمايدۇ. WordPress ساقلاپ قالىدىغان سانلىق مەلۇماتلار تۆۋەندىكىچە:','Note: Since this tool only gathers data from WordPress and participating plugins, you may need to do more to comply with export requests. For example, you should also send the requester some of the data collected from or stored with the 3rd party services your organization uses.'=>'ئەسكەرتىش: بۇ قورال پەقەت WordPress ۋە ھەمكارلاشقان قىستۇرمىنىڭ سانلىق مەلۇماتلىرىنىلا توپلايدۇ. سىز تېخىمۇ كۆپ تەدبىرلەرنى قوللىنىپ چىقىرىش ئىلتىماسىغا بويسۇنسىڭىز بولىدۇ. مەسىلەن، سىزنىڭ يەنە تەشكىلىڭىز ئىشلىتىدىغان ئۈچىنچى تەرەپ مۇلازىمىتى توپلايدىغان ياكى ساقلايدىغان سانلىق مەلۇماتلارنىمۇ ئىلتىماسچىلارغا يوللاش مەسئۇلىيىتىڭىز بار.','Privacy Laws around the world require businesses and online services to provide an export of some of the data they collect about an individual, and to deliver that export on request. The rights those laws enshrine are sometimes called the "Right of Data Portability". It allows individuals to obtain and reuse their personal data for their own purposes across different services. It allows them to move, copy or transfer personal data easily from one IT environment to another.'=>'دۇنيانىڭ ھەر قايسى جايلىرىدىكى شەخسىيەت قانۇنى كارخانا ۋە توردا مۇلازىمەت تەمىنلىگۈچىلەر توپلىغان شەخسكە مۇناسىۋەتلىك بەزى ئۇچۇرلارنى چىقىرىش ئىقتىدارىنى تەمىنلەشنى تەلەپ قىلىدۇ، ھەمدە مەزكۇر چىقىرىش ئىقتىدارىنى تەلەپكە ئاساسەن تەمىنلەشنى تەلەپ قىلىدۇ. بۇ قانۇنلار ئارقىلىق بېرىلگەن ھوقۇق بەزىدە «سانلىق مەلۇماتنى ئېلىپ يۈرۈش ھوقۇقى» دەپمۇ ئاتىلىدۇ. بۇ ھوقۇق شەخسلەرگە ئوخشاش بولمىغان مۇلازىمەتتە ئۆزىنىڭ مەقسىتى ئۈچۈن شەخسىي سانلىق مەلۇماتلىرىغا ئېرىشىش ۋە قايتا ئىشلىتىش ھوقۇقى بېرىدۇ، ھەمدە ئىشلەتكۈچى ئۆزىنىڭ سانلىق مەلۇماتىنى بىر ئۇچۇر سىستېمىسىدىن يەنە بىر ئۇچۇر سىستېمىسىغا قولاي ھالدا يۆتكەش، كۆچۈرۈش ياكى يوللىشىغا يول قويىدۇ.','<strong>Comments</strong> &mdash; WordPress does not delete comments. The software does anonymize (but, again, <em>never</em> publishes) the associated Email Address, IP Address, and User Agent (Browser/OS).'=>'<strong>ئىنكاس</strong> &mdash; WordPress ئىنكاسنى ئۆچۈرمەيدۇ. يۇمشاق دېتال نامسىزلاشتۇرۇلغان (ئەمما، قايتا ئەسكەرتىش) مۇناسىۋەتلىك ئېلخەت ئادرېس، IP ئادرېس ۋە ئىشلەتكۈچى ۋاكالەتچىسى (توركۆرگۈ/مەشغۇلات سىستېمىسى) نى <em>ھەرگىز</em> تارقاتمايدۇ)','WordPress collects (but <em>never</em> publishes) a limited amount of data from logged-in users but then deletes it or anonymizes it. That data can include:'=>'WordPress تىزىمغا كىرگەن ئىشلەتكۈچىنىڭ چەكلىك ئۇچۇرىنى توپلايدۇ (ئەمما <em>ھەرگىز</em> تارقاتمايدۇ) ئەمما كېيىن ئۇنى ئۆچۈرۈۋېتىدۇ ياكى نامسىزلاشتۇرىدۇ. بۇ سانلىق مەلۇماتلاردىن تۆۋەندىكىلەر بار:','Note: As this tool only gathers data from WordPress and participating plugins, you may need to do more to comply with erasure requests. For example, you are also responsible for ensuring that data collected by or stored with the 3rd party services your organization uses gets deleted.'=>'ئەسكەرتىش: بۇ قورال پەقەت WordPress ۋە ھەمكارلاشقان قىستۇرمىنىڭ سانلىق مەلۇماتلىرىنىلا توپلايدۇ. سىز تېخىمۇ كۆپ تەدبىرلەرنى قوللىنىپ ئۆچۈرۈش ئىلتىماسىغا بويسۇنسىڭىز بولىدۇ. مەسىلەن، سىزنىڭ يەنە تەشكىلىڭىز ئىشلىتىدىغان ئۈچىنچى تەرەپ مۇلازىمىتى توپلايدىغان ياكى ساقلايدىغان سانلىق مەلۇماتلارنىمۇ ئىلتىماسچىلارنىڭ تەلىپى بويىچە ئۆچۈرۈش مەسئۇلىيىتىڭىز بار.','Privacy Laws around the world require businesses and online services to delete, anonymize, or forget the data they collect about an individual. The rights those laws enshrine are sometimes called the "Right to be Forgotten".'=>'شەخسىيەت قانۇنى كارخانا ۋە توردا مۇلازىمەت تەمىنلىگۈچىلەر كىشىلەردىن توپلىغان شەخسكە مۇناسىۋەتلىك ئۇچۇرلارنى ئۆچۈرۈش، نامسىزلاشتۇرۇش ياكى يوقىتىۋېتىش ئىقتىدارىنى تەلەپ قىلىدۇ، بۇ قانۇنلار ئارقىلىق بېرىلگەن ھوقۇق بەزىدە «سانلىق مەلۇماتنى ئۇنتۇلدۇرۇش ھوقۇقى» دەپمۇ ئاتىلىدۇ.','This screen is where you manage requests to erase personal data.'=>'بۇ ئېكران شەخسىي سانلىق مەلۇماتنى ئۆچۈرۈش ئىلتىماسىنى باشقۇرۇش ئۈچۈن ئىشلىتىلىدۇ.','This post is being backed up in your browser, just in case.'=>'تاسادىپىيلىقنىڭ ئالدىنى ئېلىش ئۈچۈن، بۇ يازمىنى توركۆرگۈڭىز زاپاسلىغان.','This will grant access to <a href="%1$s">the %2$s site on the network as you have Super Admin rights</a>.'=>'بۇ مەشغۇلات<a href="%1$s">غا توردىكى سىز ئالىي باشقۇرغۇچى ھوقۇقىغا ئىگە بولغان، %2$s بېكەتنى زىيارەت قىلش ئىجازىتىنى بېرىدۇ</a>.' . "\0" . 'بۇ مەشغۇلات<a href="%1$s">غا توردىكى سىز ئالىي باشقۇرغۇچى ھوقۇقىغا ئىگە بولغان، %2$s بېكەتنى زىيارەت قىلش ئىجازىتىنى بېرىدۇ</a>.','Learn about block themes'=>'بۆلەك ئۆرنەك ھەققىدە بىلدۈرگۈ','There is a new kind of WordPress theme, called a block theme, that lets you build the site you&#8217;ve always wanted &#8212; with blocks and styles.'=>'بۇ يېڭى WordPress بۆلەك ئۆرنىكى بولۇپ، ئېھتىياجىڭىزغا ئاساسەن بۆلەك ۋە ئۇسلۇبلارنى ئىشلىتىپ بېكەت قۇرالايسىز.','Open the Customizer'=>'خاسلاشتۇرغۇچنى ئاچىدۇ','Start Customizing'=>'خاسلاشتۇرۇشنى باشلايدۇ','Open site editor'=>'بېكەت تەھرىرلىگۈچنى ئاچ','Customize your entire site with block themes'=>'پۈتكۈل تور بېكىتىڭىزنى بۆلەك ئۆرنەكلىرى ئارقىلىق خاسلاشتۇرۇڭ','Add a new page'=>'يېڭى بەت قوش','Learn more about the %s version.'=>'%s نەشرى ھەققىدىكى تېخىمۇ كۆپ بىلدۈرگۈ.','Discover a new way to build your site.'=>'تور بېكىتىڭىزنى قۇرىدىغان يېڭى ئۇسۇلنى بايقاڭ.','Switch up your site&#8217;s look & feel with Styles'=>'ئۇسلۇب ئارقىلىق تور بېكىتىڭىزنىڭ كۆرۈنۈشى ۋە تەسۋىرىنى ئالماشتۇرۇڭ','Configure your site&#8217;s logo, header, menus, and more in the Customizer.'=>'خاسلاشتۇرغۇچتا تور بېكىتىڭىزنىڭ تۇغ، بەت قاش، تىزىملىك قاتارلىقلارنى سەپلەڭ.','Author rich content with blocks and patterns'=>'بۆلەك ۋە ئەندىزە بىلەن تېخىمۇ مول مەزمۇنلارنى يارىتىدۇ','Tweak your site, or give it a whole new look! Get creative &#8212; how about a new color palette or font?'=>'تور بېكىتىڭىزنى تەڭشەڭ ياكى يېپيېڭى قىياپەتكە كىرگۈزۈڭ! ئىجادكارلىقىڭىزنى جارى قىلدۇرۇپ - يېڭى رەڭ تاختا ياكى خەت نۇسخىسىنى سىناپ باقامسىز؟','Design everything on your site &#8212; from the header down to the footer, all using blocks and patterns.'=>'بەت قاشتىن بەت ئاستىغىچە، پۈتكۈل تور بېكىتىڭىزنىڭ ھەممە يېرى بۆلەك ۋە ئەندىزە بىلەن لايىھەلەنگەن.','Block patterns are pre-configured block layouts. Use them to get inspired or create new pages in a flash.'=>'بۆلەك ئەندىزە ئالدىن سەپلەنگەن بۆلەك جايلاشتۇرۇلۇشى. ئۇلارنى ئىشلىتىپ ئىلھاملىنىپ ئىنتايىن قىسقا ۋاقىتتا يېڭى بەت قۇرالايسىز.','WordPress is free and open source software'=>'WordPress ئەركىن ۋە ئوچۇق كودلۇق يۇمشاق دېتال','Plugin File Editor'=>'قىستۇرما ھۆججەت تەھرىرلىگۈچ','Theme File Editor'=>'ئۆرنەك ھۆججەت تەھرىرلىگۈچ','If this is a development website you can <a href="%s" target="_blank">set the environment type accordingly</a> to enable application passwords.'=>'ئەگەر بۇ ئىجادىيەت تور بېكىتى بولسا، پىروگرامما پاروللىرى ئۈچۈن <a href="%s" target="_blank">مۇناسىپ مۇھىت تىپى سەپلەڭ</a>.','The application password feature requires HTTPS, which is not enabled on this site.'=>'پىروگرامما پارولى ئىقتىدارى بۇ بېكەتتە تېخى قوزغىتىلمىغان HTTPS نى تەلەپ قىلىدۇ.','g:i a T'=>'H:i T','<a href="https://wordpress.org/documentation/article/appearance-theme-file-editor-screen/">Documentation on Editing Themes</a>'=>'<a href="https://wordpress.org/documentation/article/appearance-theme-file-editor-screen/">ئۆرنەك تەھرىرلەش قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/site-health-screen/">Documentation on Site Health tool</a>'=>'<a href="https://wordpress.org/documentation/article/site-health-screen/">بېكەت ساغلاملىقى قورالى قوللانمىسى</a>','In the Info tab, you will find all the details about the configuration of your WordPress site, server, and database. There is also an export feature that allows you to copy all of the information about your site to the clipboard, to help solve problems on your site when obtaining support.'=>'ئۇچۇر بەتكۈچتە، WordPress تور بېكىتىڭىز، مۇلازىمېتىر ۋە سانداننىڭ سەپلىمىسى ھەققىدىكى تەپسىلاتلارنى تاپالايسىز. يەنە چىقىرىش ئىقتىدارى بار بولۇپ، تور بېكىتىڭىزگە ئائىت بارلىق ئۇچۇرلارنى چاپلاش تاختىسىغا كۆچۈرۈپ، بېكىتىڭىزگە ئائىت مەسىلە ھەققىدە ياردەم تەلەپ قىلغاندا قۇلايلىق يارىتىدۇ.','In the Status tab, you can see critical information about your WordPress configuration, along with anything else that requires your attention.'=>'ھالەت بەتكۈچتە، WordPress سەپلىمىسى ھەققىدىكى ھالقىلىق ئۇچۇر ۋە باشقا سىز كۆڭۈل بۆلىدىغان ئۇچۇرلارنى كۆرەلەيسىز.','This screen allows you to obtain a health diagnosis of your site, and displays an overall rating of the status of your installation.'=>'بۇ بەتتە تور بېكىتىڭىزنىڭ ساغلاملىق ئۇچۇرىغا ئېرىشەلەيسىز ھەمدە WordPress ئورنىتىش ھالىتىگە بولغان ئومۇمىي باھالىنىشىنى كۆرسىتىدۇ.','<a href="https://wordpress.org/documentation/article/settings-privacy-screen/">Documentation on Privacy Settings</a>'=>'<a href="https://wordpress.org/documentation/article/settings-privacy-screen/">شەخسىيەت تۈزۈمى قوللانمىسى</a>','This screen includes suggestions to help you write your own privacy policy. However, it is your responsibility to use these resources correctly, to provide the information required by your privacy policy, and to keep this information current and accurate.'=>'بۇ بەتتە شەخسىيەت تۈزۈمىنى يېزىشقا ياردەم بېرىدىغان تەكلىپلەر بار. بۇ مەنبەلەردىن پايدىلىنىپ شەخسىيەت تۈزۈمىڭىزگە زۆرۈر بولغان ئۇچۇرلارنى تەمىنلەش مەسئۇلىيىتىڭىز بار بولۇپ، بۇ ئۇچۇرلارنىڭ ئۈنۈملۈك ۋە توغرا بولۇشىغا كاپالەتلىك قىلىڭ.','The Privacy screen lets you either build a new privacy-policy page or choose one you already have to show.'=>'شەخسىيەت ئېكرانىدا يېڭى شەخسىيەت تۈزۈمى قۇرۇپ ياكى كۆرسىتىدىغان تەييار شەخسىيەت تۈزۈمىنى تاللىيالايسىز.','Individual posts may override these settings. Changes here will only be applied to new posts.'=>'ئايرىم يازمىلار بۇ تەڭشەكنى قاپلىۋېتىشى مۇمكىن. بۇ جايدا ئېلىپ بېرىلغان ئۆزگەرتىش پەقەت يېڭى يازمىلارغىلا قوللىنىلىدۇ.','Menu item moved to the top'=>'تىزىملىك تۈرى ئۈستىگە يۆتكەلدى','Menu item removed'=>'تىزىملىك تۈرى يۈتكەلدى','The Dashboard is the first place you will come to every time you log into your site. It is where you will find all your WordPress tools. If you need help, just click the &#8220;Help&#8221; tab above the screen title.'=>'باشقۇرۇش تاختا سىز ھەر قېتىم تور بېكىتىڭىزگە تىزىمغا كىرگەندە تۇنجى بولۇپ كۆرىدىغان جاي. بۇ جايدىن بارلىق WordPress قوراللىرىنى تاپالايسىز. ئەگەر ياردەمگە ئېھتىياجلىق بولسىڭىز، كۆرۈنۈش ماۋزۇسىنىڭ ئۈستىدىكى «ياردەم» بەتكۈچنى چەكسىڭىزلا بولىدۇ.','Welcome to your WordPress Dashboard!'=>'WordPress تىزگىن تاختىغا خۇش كەلدىڭىز!','The application ID must be a UUID.'=>'ئەپ كىملىكى چوقۇم UUID بولىدۇ.','Select location'=>'ئورۇن تاللاش','pluginCannot Activate'=>'ئاكتىپلىيالمايدۇ','Max connections number'=>'باغلىنىش سانى چېكى','Max allowed packet size'=>'يول قويۇلىدىغان بوغچا چوڭلۇق چېكى','Visit plugin site for %s'=>'%s قىستۇرما تور بېكىتىنى زىيارەت قىلىڭ','Your website appears to use Basic Authentication, which is not currently compatible with application passwords.'=>'تور بېكىتىڭىزدە پىروگرامما پاروللىرى بىلەن ماسلاشمايدىغان ئاددىي كىملىك دەلىللەش ئىشلىتىلگەندەك قىلىدۇ.','%1$s &#8220;%2$s&#8221;'=>'%1$s «%2$s»','Template Editing'=>'قېلىپ تەھرىرلەش','Get involved in WordPress.'=>'WordPressكە قاتنىشىڭ.','WordPress comes with some awesome, worldview-changing rights courtesy of its <a href="%s">license</a>, the GPL.'=>'WordPress كىشىنى ھەيران قالدۇرىدىغان، كىشىلەرنىڭ يۇمشاق دېتالغا بولغان قارىشىنى ئۆزگەرتىدىغان ھوقۇقنى ئۆز ئىچىگە ئالغان بولۇپ، بۇ تۆھپە ئۇ ئىشلىتىۋاتقان GPL. <a href="%s">ئىجازەتنامە</a>گە تەۋە.','Want to see your name in lights on this page?'=>'بۇ بەتتە ئىسمىڭىزنى كۆرۈشنى خالامسىز؟','WordPress is created by a <a href="%1$s">worldwide team</a> of passionate individuals.'=>'WordPress نى <a href="%1$s">دۇنياۋى قوشۇن</a>دىكى ئوت يۈرەك تۆھپىكارلار قۇرغان.','%s plugin deactivated during WordPress upgrade.'=>'WordPress نى يۈكسەلتىۋاتقاندا %s قىستۇرما ئاكتىپسىزلاندى.','%1$s %2$s was deactivated due to incompatibility with WordPress %3$s.'=>'WordPress %3$s نەشرى %1$s %2$s نى قوللىمىغانلىقتىن ئاكتىپسىزلانغان.','%1$s %2$s was deactivated due to incompatibility with WordPress %3$s, please upgrade to %1$s %4$s or later.'=>'WordPress %3$s نەشرى بىلەن سىغىشالمىغانلىقتىن %1$s %2$s چەكلەنگەن، %1$s %4$s ياكى يېڭى نەشرىگە يۈكسەلتىڭ.','The Four Freedoms'=>'تۆت ئەركىنلىك','We take privacy and transparency very seriously'=>'شەخسىيەت ۋە ئاشكارىلىققا ئەستايىدىل مۇئامىلە قىلىمىز','themeCustomize %s'=>'%s نى خاسلاشتۇرۇش','themeDelete %s'=>'%s نى ئۆچۈر','themeLive Preview %s'=>'شۇئان ئالدىن كۆزىتىش: %s','themeView Theme Details for %s'=>'%s نىڭ ئۆرنەك تەپسىلاتىنى كۆرسىتىدۇ','Toggle extra menu items'=>'قوشۇمچە تىزىملىك تۈرىنى يۆتكەيدۇ','Site Health - %s'=>'بېكەت ساغلاملىقى-%s','You need to make the file %1$s writable before you can save your changes. See <a href="%2$s">Changing File Permissions</a> for more information.'=>'ئۆزگەرتىشلىرىڭىزنى ساقلاشتىن بۇرۇن بۇ ھۆججەت %1$s نى يېزىشقا بولىدىغان قىلىپ بەلگىلىشىڭىز كېرەك. تەپسىلىي بىلمەكچى بولسىڭىز <a href="%2$s">ھۆججەت ئىجازىتىنى ئۆزگەرتىش</a> كە قاراڭ.','Rewrite rules:'=>'قائىدىلەرنى قايتا يېزىش:','List of menu items selected for deletion:'=>'ئۆچۈرۈش ئۈچۈن تاللانغان تىزىملىك تۈرلىرى تىزىمى:','Remove Selected Items'=>'تاللىغان تۈرلەرنى چىقىرىۋەت','Bulk Select'=>'تۈركۈملەپ تاللاش','Deleted menu item: %s.'=>'ئۆچۈرۈلگەن تىزىملىك تۈرى: %s.','item %s'=>'%s تۈرى','Themes %s'=>'%s‎‏ ئۆرنەك','Unable to encode the personal data for export. Error: %s'=>'چىقىرىدىغان شەخسىي سانلىق مەلۇماتنى كودلىيالمايدۇ. خاتالىق: %s','The %s post meta must be an array.'=>'%s يازما مېتا سانلىق مەلۇماتى سانلار قاتارى بولۇشى كېرەك.','Your site&#8217;s health is looking good, but there is still one thing you can do to improve its performance and security.'=>'تور بېكىتىڭىزنىڭ ساغلاملىق ئەھۋالى ياخشىدەك قىلىدۇ، ئەمما بەزى مەشغۇلاتنى ئېلىپ بېرىپ ئۈنۈم ۋە بىخەتەرلىكنى ئاشۇرسىڭىز بولىدۇ.','Your site has a critical issue that should be addressed as soon as possible to improve its performance and security.'=>'تور بېكىتىڭىزدە ئېغىر مەسىلە مەۋجۇت، ئۇنى دەرھال ھەل قىلىپ تور بېكىتىڭىزنىڭ ئۈنۈمى ۋە بىخەتەرلىكىنى ئۆستۈرۈڭ.','Learn how to <a href="%s" class="update-browser-link">browse happy</a>'=>'قانداق <a href="%s" class="update-browser-link">خۇشال زىيارەت</a> قىلىشنى ئۆگىنىڭ','Internet Explorer does not give you the best WordPress experience. Switch to Microsoft Edge, or another more modern browser to get the most from your site.'=>'Internet Explorer سىزگە ئەڭ ياخشى WordPress تۇيغۇسى ئېلىپ كەلمەيدۇ. Microsoft Edge ياكى يېڭىلانغان باشقا زامانىۋى توركۆرگۈگە ئالماشتۇرۇپ بېكەتنىڭ ئەڭ ياخشى ئۈنۈمىنى جارى قىلدۇرۇڭ.','pluginUploaded'=>'يۈكلەنگەنلەر','themeUploaded'=>'يۈكلەنگەنلەر','pluginCurrent'=>'نۆۋەتتىكى','GD supported file formats'=>'GD قوللايدىغان ھۆججەت پىچىمى','Unable to determine'=>'جەزملىيەلمىدى','ImageMagick supported file formats'=>'ImageMagick قوللايدىغان ھۆججەت پىچىمى','Imagick version'=>'Imagick نەشرى','pluginReplace current with uploaded'=>'نۆۋەتتىكىنى يۈكلىگەنگە ئالماشتۇر','Please activate the <a href="%s">Link Manager plugin</a> to use the link manager.'=>'ئۇلانما باشقۇرغۇچنى ئىشلىتىش ئۈچۈن <a href="%s">ئۇلانما باشقۇرۇش قىستۇرمىسى</a>نى ئاكتىپلاڭ.','Create a new Privacy Policy page'=>'يېڭى بىر شەخسىيەت تۈزۈم بېتى قۇرىدۇ','Send personal data export confirmation email.'=>'شەخسى سانلىق مەلۇمات چىقىرىشنى جەزملەش ئېلخىتى ئەۋەتىدۇ.','This tool helps site owners comply with local laws and regulations by exporting known data for a given user in a .zip file.'=>'بۇ قورال بېرىلگەن ئىشلەتكۈچىنىڭ سانلىق مەلۇماتلىرىنى .zip ھۆججەتكە پىرىسلاپ چىقىرىپ بېرىدۇ، بۇ تور بېكەت ئىگىسىنىڭ يەرلىك قانۇن قائىدىلىرىگە بوي سۇنۇشقا ياردەم بېرىدۇ.','<a href="https://wordpress.org/documentation/article/tools-export-personal-data-screen/">Documentation on Export Personal Data</a>'=>'<a href="https://wordpress.org/documentation/article/tools-export-personal-data-screen/">شەخسىي سانلىق مەلۇمات چىقىرىش قوللانمىسى</a>','Plugin authors can <a href="https://developer.wordpress.org/plugins/privacy/adding-the-personal-data-exporter-to-your-plugin/" target="_blank">learn more about how to add the Personal Data Exporter to a plugin here</a>.'=>'قىستۇرما يازغۇچىلار <a href="https://developer.wordpress.org/plugins/privacy/adding-the-personal-data-exporter-to-your-plugin/" target="_blank">بۇ ماقالە</a>دىن شەخسىي سانلىق مەلۇمات چىقارغۇچنى قىستۇرمىغا قانداق قوشۇش ھەققىدىكى تېخىمۇ كۆپ ئۇچۇرلارنى بىلەلەيدۇ.','Many plugins may collect or store personal data either in the WordPress database or remotely. Any Export Personal Data request should include data from plugins as well.'=>'نۇرغۇن قىستۇرمىلار WordPress ساندانى ياكى يىراقتىن ئىشلەتكۈچىلەرنىڭ شەخسىي سانلىق مەلۇماتلىرىنى توپلىشى ياكى ساقلىشى مۇمكىن. ھەر قانداق ئىشلەتكۈچى شەخسىي سانلىق مەلۇماتىنى تەلەپ قىلسا، قىستۇرما توپلىغان ئۇچۇرلارنىمۇ ئۆز ئىچىگە ئالىدۇ.','If you are not sure, check the plugin documentation or contact the plugin author to see if the plugin collects data and if it supports the Data Exporter tool. This information may be available in the <a href="%s">Privacy Policy Guide</a>.'=>'ئەگەر جەزملەشتۈرەلمىسىڭىز، قىستۇرما قوللانمىسى ياكى قىستۇرما يازغۇچى بىلەن ئالاقىلىشىپ، قىستۇرمىنىڭ شەخسىي سانلىق مەلۇماتلارنى توپلايدىغان ياكى توپلىمايدىغانلىقى شۇنداقلا شەخسىي سانلىق مەلۇماتنى چىقارغۇچ قورالىنى قوللايدىغان ياكى قوللىمايدىغانلىقىنى سۈرۈشتۈرۈڭ. بۇ ئۇچۇرنى <a href="%s">شەخسىيەت تۈزۈمى يېتەكچىسى</a>دىن تاپالىشىڭىز مۇمكىن.','<strong>Comments</strong> &mdash; For user comments, Email Address, IP Address, User Agent (Browser/OS), Date/Time, Comment Content, and Content URL.'=>'<strong>ئىنكاس</strong> &mdash; ئىشلەتكۈچى يوللىغان ئىنكاس، ئېلخەت ئادرېسى، IP ئادرېس، ئىشلەتكۈچى ۋاكالەتچىسى (توركۆرگۈ/مەشغۇلات سىستېمىسى)، چېسلا/ۋاقىت، ئىنكاس مەزمۇنى ۋە مەزمۇن تور ئادرېسى.','It looks like HTTPS is not supported for your website at this point.'=>'بۇ ۋاقىتتا تور بېكىتىڭىزنى HTTPS قوللىمايدىغاندەك قىلىدۇ.','Sorry, you are not allowed to update this site to HTTPS.'=>'كۈچۈرۇڭ، بۇ تور بېكەتنى HTTPS كە يېڭىلاش ئىجازىتىڭىز يوق.','Password reset links sent to %s user.'=>'ئىشلەتكۈچى %s  كە ئىم ئەسلىگەكەلتۈرۈش ئۇلانمىسى ئەۋەتىلدى.','Site URLs could not be switched to HTTPS.'=>'بېكەت ئادرېسىنى HTTPS غا ئالماشتۇرالمىدى.','Site URLs switched to HTTPS.'=>'بېكەت ئادرېسى HTTPS غا ئالماشتۇرۇلدى.','This screen is where you manage requests for an export of personal data.'=>'بۇ ئېكران شەخسىي سانلىق مەلۇماتنى چىقىرىش ئىلتىماسىنى باشقۇرۇش ئۈچۈن ئىشلىتىلىدۇ.','Password reset link sent.'=>'ئىمنى ئەسلىگە قايتۇرۇش ئۇلانمىسى ئەۋەتىلدى.','Send Reset Link'=>'ئەسلىگە قايتۇرۇش ئۇلانمىسى ئەۋەت','Policies'=>'تۈزۈملەر','The Privacy Settings require JavaScript.'=>'شەخسىيەت تەڭشەكلىرى JavaScript نى تەلەپ قىلىدۇ.','Send %s a link to reset their password. This will not change their password, nor will it force a change.'=>'%s گە پارولىنى قايتا تەڭشەش ئۈچۈن بىر ئۇلانما ئەۋەتىدۇ. بۇ ئۇلارنىڭ پارولىنى ئۆزگەرتمەيدۇ ياكى ئۆزگەرتىشكە مەجبۇرلىمايدۇ.','Privacy SettingsSettings'=>'تەڭشەكلەر','Privacy SettingsPolicy Guide'=>'شەخسىيەت كۆرسەتكۈچى','Re-install version %s'=>'%s نەشرىنى قايتا ئورنات','Update to latest %s nightly'=>'ئەڭ يېڭى %s كەچلىك نەشرىگە يېڭىلا','Send personal data erasure confirmation email.'=>'شەخسى سانلىق مەلۇمات ئۆچۈرۈشنى جەزملەش ئېلخىتى ئەۋەتىدۇ.','Confirmation email'=>'جەزملەش ئېلخەتى','This tool helps site owners comply with local laws and regulations by deleting or anonymizing known data for a given user.'=>'بۇ قورال بېرىلگەن ئىشلەتكۈچىنىڭ سانلىق مەلۇماتلىرىنى ئۆچۈرىدۇ ياكى نامسىزلاشتۇرىدۇ، بۇ تور بېكەت ئىگىسىنىڭ يەرلىك قانۇن قائىدىلىرىگە بوي سۇنۇشقا ياردەم بېرىدۇ.','<a href="https://wordpress.org/documentation/article/tools-erase-personal-data-screen/">Documentation on Erase Personal Data</a>'=>'<a href="https://wordpress.org/documentation/article/tools-erase-personal-data-screen/">شەخسىي سانلىق مەلۇمات ئۆچۈرۈش قوللانمىسى</a>','If you are a plugin author, you can <a href="https://developer.wordpress.org/plugins/privacy/adding-the-personal-data-eraser-to-your-plugin/" target="_blank">learn more about how to add support for the Personal Data Eraser to a plugin here</a>.'=>'ئەگەر سىز قىستۇرما يازغۇچى بولسىڭىز، <a href="https://developer.wordpress.org/plugins/privacy/adding-the-personal-data-eraser-to-your-plugin/" target="_blank">بۇ ماقالە</a>دىن شەخسىي سانلىق مەلۇمات ئۆچۈرگۈچنى قىستۇرمىغا قانداق قوشۇش ھەققىدىكى تېخىمۇ كۆپ ئۇچۇرلارنى بىلەلەيسىز.','Many plugins may collect or store personal data either in the WordPress database or remotely. Any Erase Personal Data request should delete data from plugins as well.'=>'نۇرغۇن قىستۇرمىلار WordPress ساندانى ياكى يىراقتىن ئىشلەتكۈچىلەرنىڭ شەخسىي سانلىق مەلۇماتلىرىنى توپلىشى ياكى ساقلىشى مۇمكىن. ھەر قانداق ئىشلەتكۈچى شەخسىي سانلىق مەلۇماتىنى ئۆچۈرۈشنى تەلەپ قىلسا، قىستۇرما توپلىغان ئۇچۇرلارنىمۇ ئۆچۈرۈشنى ئۆز ئىچىگە ئالىدۇ.','Plugin Data'=>'قىستۇرما ئۇچۇرى','If you are not sure, check the plugin documentation or contact the plugin author to see if the plugin collects data and if it supports the Data Eraser tool. This information may be available in the <a href="%s">Privacy Policy Guide</a>.'=>'ئەگەر جەزملەشتۈرەلمىسىڭىز، قىستۇرما قوللانمىسى ياكى قىستۇرما يازغۇچى بىلەن ئالاقىلىشىپ، قىستۇرمىنىڭ شەخسىي سانلىق مەلۇماتلارنى توپلايدىغان ياكى توپلىمايدىغانلىقى شۇنداقلا شەخسىي سانلىق مەلۇماتنى ئۆچۈرۈش قورالىنى قوللايدىغان ياكى قوللىمايدىغانلىقىنى سۈرۈشتۈرۈڭ. بۇ ئۇچۇرنى <a href="%s">شەخسىيەت تۈزۈمى يېتەكچىسى</a>دىن تاپالىشىڭىز مۇمكىن.','<strong>Media</strong> &mdash; A list of URLs for all media file uploads made by the user.'=>'<strong>ۋاسىتە</strong> &mdash; ئىشلەتكۈچى يۈكلىگەن بارلىق ۋاسىتە ھۆججەتلىرىنىڭ تور ئادرېس تىزىمى.','<strong>Session Tokens</strong> &mdash; User login information, IP Addresses, Expiration Date, User Agent (Browser/OS), and Last Login.'=>'<strong>سۆزلىشىش پەرمان تاختىسى</strong> &mdash; ئىشلەتكۈچى تىزىمغا كىرىش ئۇچۇرى، IP ئادرېسى، ۋاقتى ئۆتۈش ۋاقتى، ئىشلەتكۈچى ۋاكالەتچىسى (توركۆرگۈ/مەشغۇلات سىستېمىسى) ۋە ئاخىرقى قېتىم تىزىمغا كىرگەن ۋاقىت.','<strong>Community Events Location</strong> &mdash; The IP Address of the user which is used for the Upcoming Community Events shown in the dashboard widget.'=>'<strong>جامائەت پائالىيەتلىرىنىڭ ئورنى</strong>&mdash; ئىشلەتكۈچىنىڭ IP ئادرېسىنى ئىشلىتىپ ئۆتكۈزۈلمەكچى بولغان جامائەت پائالىيىتىنى باشقۇرۇش تاختىسىدىكى ئەپچىدە كۆرسىتىدۇ.','<strong>Profile Information</strong> &mdash; user email address, username, display name, nickname, first name, last name, description/bio, and registration date.'=>'<strong>تەرجىمىھال ئۇچۇرى</strong> &mdash; ئىشلەتكۈچىنىڭ ئېلخەت ئادرېسى، ئىشلەتكۈچى ئاتى، كۆرسىتىدىغان ئىسىم، تەخەللۇس، ئىسىم، تەگئات، چۈشەندۈرۈش/تەرجىمىھال ۋە تىزىملاتقان ۋاقىت.','Default Data'=>'كۆڭۈلدىكى سانلىق مەلۇمات','The tool associates data stored in WordPress with a supplied email address, including profile data and comments.'=>'بۇ قورال تەمىنلەنگەن ئېلخەت ئادرېسىغا مۇناسىۋەتلىك WordPress ساندانغا ساقلانغان سانلىق مەلۇماتقا باغلىنىدۇ، تەرجىمىھال ۋە ئىنكاسنىمۇ ئۆز ئىچىگە ئالىدۇ.','https://make.wordpress.org/community/organize-event-landing-page/'=>'https://make.wordpress.org/community/organize-event-landing-page/','A password reset link was emailed to %s.'=>'ئىم ئەسلىگە قايتۇرۇش ئۇلانمىسى %s غا ئېلخەت بىلەن يوللاندى.','Cannot send password reset, permission denied.'=>'ئىم ئەسلىگە قايتۇرۇشنى ئەۋەتەلمەيدۇ. ئىجازەت رەت قىلىندى.','Want more events? <a href="%s">Help organize the next one</a>!'=>'تېخىمۇ كۆپ پائالىيەتنى خالامسىز؟ <a href="%s">كېيىنكى پائالىيەتنى تەشكىللەشكە ياردەملىشىڭ</a>!','The setting for %1$s is currently configured as 0, this could cause some problems when trying to upload files through plugin or theme features that rely on various upload methods. It is recommended to configure this setting to a fixed value, ideally matching the value of %2$s, as some upload methods read the value 0 as either unlimited, or disabled.'=>'%1$s نىڭ تەڭشىكى 0 گە سەپلەنگەن، بۇ ھەر خىل يۈكلەش ئۇسۇللىرىغا تايىنىدىغان قىستۇرما ياكى ئۆرنەكلەر ھۆججەت يۈكلىگەندە بەزى مەسىلىلەر كۆرۈلۈشى مۇمكىن. بۇنى مۇقىم قىممەتكە تەڭشەش تەۋسىيە قىلىنىدۇ، ئادەتتىكى ئەھۋالدا %2$s نىڭ قىممىتى بىلەن ماسلاشتۇرۇلىدۇ، چۈنكى بەزى يۈكلەش ئۇسۇلى 0 قىممەتنى چەكلىمىسىز ياكى چەكلەنگەن دەپ ئوقۇۋالىدۇ.','Update your site to use HTTPS'=>'تور بېكىتىڭىزدە HTTPS ئىشلىتىشكە يېڭىلاڭ','Talk to your web host about supporting HTTPS for your website.'=>'تور بېكىتىڭىز HTTPS نى قوللاش ئۈچۈن تور بېكەت مۇلازىمىتېر تەمىنلىگۈچىڭىز بىلەن سۆزلىشىڭ.','However, your WordPress Address is currently controlled by a PHP constant and therefore cannot be updated. You need to edit your %1$s and remove or update the definitions of %2$s and %3$s.'=>'ئەمما، سىزنىڭ WordPress ئادرېسىڭىزنى نۆۋەتتە PHP تۇراقلىق مىقدارى تىزگىنلەيدۇ، شۇڭلاشقا يېڭىلىغىلى بولمايدۇ. %1$s نى تەھرىرلەپ %2$s ۋە %3$s نىڭ ئېنىقلىمىسىنى چىقىرىۋېتىڭ ياكى يېڭىلاڭ.','HTTPS is already supported for your website.'=>'HTTPS تور بېكىتىڭىزنى قوللايدۇ.','Your <a href="%1$s">WordPress Address</a> and <a href="%2$s">Site Address</a> are not set up to use HTTPS.'=>'سىزنىڭ <a href="%1$s">WordPress ئادرېس</a> ۋە <a href="%2$s">تور بېكەت ئادرېس</a>ىڭىز HTTPS ئىشلىتىشكە تەڭشەلمىگەن.','You are accessing this website using HTTPS, but your <a href="%1$s">WordPress Address</a> and <a href="%2$s">Site Address</a> are not set up to use HTTPS by default.'=>'بۇ تور بېكەتنى HTTPS ئارقىلىق زىيارەت قىلىۋاتىسىز، ئەمما <a href="%1$s">WordPress ئادرېس</a> ۋە <a href="%2$s">تور ئادرېس</a>ىڭىز HTTPS ئىشلىتىشكە تەڭشەلمىگەن.','Your <a href="%s">Site Address</a> is not set up to use HTTPS.'=>'سىزنىڭ <a href="%s">تور بېكەت ئادرېسى</a>ڭىز HTTPS ئىشلىتىشكە تەڭشەلمىگەن.','Learn more about debugging in WordPress.'=>'تېخىمۇ كۆپ WordPress تە خاتالىق ھەل قىلىش چارىسىنى ئۈگىنىڭ.','Added'=>'قوشۇلدى','Send password reset'=>'ئىم ئەسلىگە قايتۇرۇشنى ئەۋەت','Contact information'=>'ئالاقەداش ئۇچۇرى','Copy suggested policy text to clipboard'=>'تەۋسىيەلىك تۈزۈم تېكىستىنى چاپلاش تاختىسىغا كۆچۈر','Search Results'=>'ئىزدەش نەتىجىسى','Directory listing failed.'=>'مۇندەرىجە تىزىمىنى كۆرسىتەلمىدى.','Invalid request ID when processing personal data to erase.'=>'شەخسىي سانلىق مەلۇماتنى ئۆچۈرۈۋاتقاندا ئىناۋەتسىز تەلەپ كىملىكى بايقالدى.','Invalid request ID when merging personal data to export.'=>'شەخسىي سانلىق مەلۇماتنى چىقىرىش ئۈچۈن بىرلەشتۈرۈۋاتقاندا ئىناۋەتسىز تەلەپ كىملىكى بايقالدى.','Unable to archive the personal data export file (JSON format).'=>'شەخسىي سانلىق مەلۇمات چىقىرىش ھۆججىتىنى ئارخىپلاشتۇرالمايدۇ (JSON پىچىمى).','Unable to archive the personal data export file (HTML format).'=>'سىي سانلىق مەلۇمات چىقىرىش ھۆججىتىنى ئارخىپلاشتۇرالمايدۇ (HTML پىچىمى).','Unable to open personal data export (HTML report) for writing.'=>'يازىدىغان شەخسىي سانلىق مەلۇمات چىقىرىش (HTML دوكلات) ھۆججىتىنى ئاچالمايدۇ.','Unable to create personal data export folder.'=>'شەخسىي سانلىق مەلۇمات چىقىرىش مۇندەرىجىسىنى قۇرالمايدۇ.','Request added successfully.'=>'ئىلتىماس مۇۋەپپەقىيەتلىك قوشۇلدى.','https://wordpress.org/documentation/article/update-services/'=>'https://wordpress.org/documentation/article/update-services/','Invalid personal data action.'=>'ئىناۋەتسىز شەخسىي سانلىق مەلۇمات مەشغۇلاتى.','Unable to initiate confirmation for personal data request.'=>'شەخسىي سانلىق مەلۇمات ئىلتىماسى قوزغىتىشنى جەزملىيەلمەيدۇ.','PHP Update Recommended'=>'PHP يېڭىلاش تەۋسىيەسى','Your site is running on an outdated version of PHP (%s), which should be updated.'=>'تور بېكىتىڭىزدە PHP (%s) نىڭ ۋاقتى ئۆتكەن نەشرى ئىجرا قىلىنىۋاتىدۇ، يېڭىلاش كېرەك.','Your website appears to use Basic Authentication, which is not currently compatible with Application Passwords.'=>'تور بېكىتىڭىزدە پىروگرامما پاروللىرى بىلەن ماسلاشمايدىغان ئاددىي كىملىك دەلىللەش ئىشلىتىلگەندەك قىلىدۇ.','https://developer.wordpress.org/rest-api/frequently-asked-questions/#why-is-authentication-not-working'=>'https://developer.wordpress.org/rest-api/frequently-asked-questions/#why-is-authentication-not-working','This site appears to be under version control. Automatic updates are disabled.'=>'بۇ تور بېكەت نەشىرى تىزگىنلەنگەندەك قىلىدۇ. ئاپتوماتىك يېڭىلاش چەكلەنگەن.','You are using a development version of WordPress.'=>'ئىجادىيەت نەشردىكى WordPress نى ئىشلىتىۋېتىپسىز.','You can update to the latest nightly build manually:'=>'ئەڭ يېڭى كەچلىك نەشرىگە قولدا يېڭىلىيالايسىز:','Enable automatic updates for all new versions of WordPress.'=>'بارلىق WordPress يېڭى نەشرىنى ئۆزلۈكىدىن يېڭىلاشنى قوزغىتىدۇ.','Switch to automatic updates for maintenance and security releases only.'=>'ئاسراش ۋە بىخەتەرلىك تارقىتىلىشىنىلا ئۆزلۈكىدىن يېڭىلاشقا ئالماشتۇرىدۇ.','Current version: %s'=>'نۆۋەتتىكى نەشرى:%s','This site will not receive automatic updates for new versions of WordPress.'=>'بۇ تور بېكەت WordPress يېڭى نەشرىنىڭ ئاپتوماتىك يېڭىلانمىلىرىنى تاپشۇرۇۋالمايدۇ.','This site is automatically kept up to date with maintenance and security releases of WordPress only.'=>'بۇ تور بېكەت پەقەت WordPress نىڭ ئاسراش ۋە بىخەتەرلىك تارقىتىلىشى بىلەن ئاپتوماتىك يېڭىلىنىپ تۇرىدۇ.','This site is automatically kept up to date with each new version of WordPress.'=>'بۇ تور بېكەت WordPress نىڭ ھەر بىر يېڭى نەشرى بىلەن ئاپتوماتىك يېڭىلىنىپ تۇرىدۇ.','WordPress will only receive automatic security and maintenance releases from now on.'=>'WordPress ھازىردىن باشلاپ بىخەتەرلىك ۋە ئاسراش تارقىتىشلىرىنىلا تاپشۇرۇۋالىدۇ.','Automatic updates for all WordPress versions have been enabled. Thank you!'=>'بارلىق WordPress نەشرىلىرىنىڭ ھەممىسىگە ئۆزلۈكىدىكىن يېڭىلاش قوزغىتىلدى. رەھمەت سىزگە!','<strong>Site Health Status</strong> &mdash; Informs you of any potential issues that should be addressed to improve the performance or security of your website.'=>'<strong>بېكەت ساغلاملىق ئەھۋالى</strong> &mdash; تور بېكىتىڭىزدىكى ھەل قىلىشقا تېگىشلىك ھەر قانداق يوشۇرۇن مەسىلىنى سىزگە بىلدۈرۈپ، تور بېكىتىڭىزنىڭ ئۈنۈمى ۋە بىخەتەرلىكىنى ياخشىلاشقا قۇلايلىق يارىتىدۇ.','Your new password for %s is:'=>'%s ئۈچۈن يېڭى پارولىڭىز:','Add New Application Password'=>'يېڭى ئەپ پارولى قوش','Required to create an Application Password, but not to update the user.'=>'پىروگرامما پارولى قۇرۇش ئۈچۈن تەلەپ قىلىنىدۇ، ئەمما ئىشلەتكۈچى يېڭىلاش ئۈچۈن ئەمەس.','Go to Updates'=>'يېڭىلاشقا يۆتكەل','&larr; Go to Users'=>'&rarr;ئىشلەتكۈچىگە يۆتكەل','&larr; Go to editor'=>'&rarr;تەھرىرلىگۈچكە يۆتكەل','Go to Plugin Installer'=>'قىستۇرما ئورناتقۇچقا يۆتكەل','Go to Importers'=>'ئەكىرگۈچكە يۆتكەل','Go to Theme Installer'=>'ئۆرنەك ئورناتقۇچقا يۆتكەل','Go to top'=>'چوققىغا يۆتكەل','%s could not be located. Please try another nearby city. For example: Kansas City; Springfield; Portland.'=>'%s نىڭ ئورنىنى تاپالمىدى. باشقا يېقىنراق شەھەرنى سىناڭ. مەسىلەن: جانبازنى بىۋاسىتە ئىزدىمەي پەيزاۋات، قەشقەر دېگەندەك يېزىپ بېقىڭ.','You will be sent to %s'=>'سىز %s غا يوللايسىز','You will be returned to the WordPress Dashboard, and no changes will be made.'=>'سىز WordPress باشقۇرۇش تاختىسىغا قايتىپ، ھېچقانداق ئۆزگىرىش بولمايدۇ.','No, I do not approve of this connection'=>'ياق، بۇ باغلىنىشنى تەستىقلىمايمەن','You will be given a password to manually enter into the application in question.'=>'ئەپ سوئالىغا قولدا كىرگۈزۈشىڭىز ئۈچۈن ئىم تەمىنلىنىدۇ.','Yes, I approve of this connection'=>'ھەئە، بۇ باغلىنىشنى تەستىقلايمەن','This will grant access to <a href="%1$s">the %2$s site in this installation that you have permissions on</a>.'=>'بۇ مەشغۇلات <a href="%1$s"> بېكىتىدىكى مەزكۇر ئورنىتىشتا، ئىجازىتىڭىز بولغان %2$s بېكەتنى زىيارەت قىلىش ھوقۇقى بېرىدۇ</a>.' . "\0" . 'بۇ مەشغۇلات <a href="%1$s"> بېكىتىدىكى مەزكۇر ئورنىتىشتا، ئىجازىتىڭىز بولغان %2$s بېكەتنى زىيارەت قىلىش ھوقۇقى بېرىدۇ</a>.','Would you like to give this application access to your account? You should only do this if you trust the application in question.'=>'بۇ پىروگراممىغا ھېسابىڭىزنى زىيارەت قىلىش ھوقۇقى بېرەمسىز؟ سورالغان بۇ پىروگراممىغا ئىشەنچ قىلغان ۋاقتىڭىزدىلا شۇنداق قىلىڭ.','Would you like to give the application identifying itself as %s access to your account? You should only do this if you trust the application in question.'=>'ئۆزىنى %s دەپ تونۇتقان بۇ پىروگراممىغا ھېسابىڭىزنى زىيارەت قىلىش ھوقۇقى بېرەمسىز؟ سورالغان بۇ پىروگراممىغا ئىشەنچ قىلغان ۋاقتىڭىزدىلا شۇنداق قىلىڭ.','An application would like to connect to your account.'=>'بىر پىروگرامما ھېسابىڭىزغا باغلانماقچى بولۇۋاتىدۇ.','Cannot Authorize Application'=>'ئەپكە ئىجازەت بېرەلمەيدۇ','New Application Password Name'=>'يېڭى ئەپ ئىم ئىسمى','The Authorize Application request is not allowed.'=>'ئەپ ئىجازەت ئىلتىماسىغا يول قويۇلمىغان.','Authorize Application'=>'پىروگراممىغا ھوقۇق بەر','Application passwords grant access to <a href="%1$s">the %2$s site in this installation that you have permissions on</a>.'=>'پىروگرامما پاروللىرى <a href="%1$s">بۇ ئورنىتىشتا ئىجازىتىڭىز بولغان %2$s بېكىتىنى زىيارەت قىلىش ھوقۇقىنى سىزگە بېرىدۇ</a>.' . "\0" . 'پىروگرامما پاروللىرى <a href="%1$s">بۇ ئورنىتىشتا ئىجازىتىڭىز بولغان %2$s بېكىتىنى زىيارەت قىلىش ھوقۇقىنى سىزگە بېرىدۇ</a>.','Be sure to save this in a safe location. You will not be able to retrieve it.'=>'بۇنى بىخەتەر جايغا ساقلاشقا كاپالەتلىك قىلىڭ. ئۇ قايتا كۆرۈنمەيدۇ.','Application passwords allow authentication via non-interactive systems, such as XML-RPC or the REST API, without providing your actual password. Application passwords can be easily revoked. They cannot be used for traditional logins to your website.'=>'پىروگرامما پاروللىرى ھەقىقىي پارولىڭىزنى بەرمەي تۇرۇپ، XML-RPC ياكى REST API گە ئوخشاش ئۆزئارا تەسىرلەشمەيدىغان سىستېمىلار ئارقىلىق دەلىللەشكە يول قويىدۇ. بۇلارنى تور بېكىتىڭىزگە ئەنئەنىۋى ئۇسۇلدا تىزىمغا كىرىشكە ئىشلىتەلمەيسىز.','Type the password again.'=>'پارولنى قايتا كىرگۈزۈڭ.','Set New Password'=>'يېڭى پارول بەلگىلەڭ','Type the new password again.'=>'يېڭى پارولنى قايتا كىرگۈزۈڭ.','Application Passwords'=>'ئەپ ئىم.','You can update from WordPress %1$s to <a href="%2$s">WordPress %3$s</a> manually:'=>'سىز WordPress %1$s نى <a href="%2$s">WordPress %3$s</a> غا قولدا يېڭىلىيالايسىز:','Revoke'=>'بىكار قىلىش','Revoke "%s"'=>'%s نى بىكار قىلىش','Last Used'=>'ئاخىرقى ئىشلىتىلگەن','Last IP'=>'ئاخىرقى قېتىملىق IP ئادرېىسى','Erase personal data'=>'شەخسى ئۇچۇرنى ئۈچۈر','Revoke all application passwords'=>'بارلىق پىروگرامما پاروللىرىنى بىكار قىلىدۇ','The Site Health check for %1$s has been replaced with %2$s.'=>'تور بېكەت ساغلاملىقىنى تەكشۈرىدىغان %1$s نىڭ ئورنىغا %2$s ئالماشتۇرۇلدى.','- %1$s (from version %2$s to %3$s)'=>'- %1$s (%2$s نەشرىدىن  ‏ ‎%3$s‎‏ غا)','Current Header Video'=>'نۆۋەتتىكى بەت قاش سىن','Authorization header'=>'ئىجازەت بېشى','Learn how to configure the Authorization header.'=>'دەلىللەش بېشىنى قانداق سەپلەشنى ئۆگىنىش','Flush permalinks'=>'ئۆزگەرمەس ئۇلانما يېڭىلا','The authorization header is invalid'=>'دەلىللەش بېشى ئىناۋەتسىز','The authorization header is missing'=>'دەلىللەش بېشى كەم','The Authorization header is working as expected'=>'دەلىللەش بېشى مۆلچەردىكىدەك ئىشلەۋاتىدۇ.','Screen elements'=>'ئېكران ئېلېمېنتى','The URL must be served over a secure connection.'=>'تور ئادرېسى چوقۇم بىخەتەر ئۇلانما بىلەن تەمىنلىنىشى كېرەك.','Some screen elements can be shown or hidden by using the checkboxes.'=>'تاللاش رامكىسىنى ئىشلىتىپ بەزى ئېكران ئېلېمېنتلىرىنى كۆرسەتكىلى ياكى يوشۇرغىلى بولىدۇ.','No plugins found for: %s.'=>'قىستۇرما تېپىلمىدى: %s.','If you request a password reset, your IP address will be included in the reset email.'=>'ئەگەر ئىم ئەسلىگە قايتۇرۇشنى ئىلتىماس قىلسىڭىز، ئەسلىگە قايتۇرۇش ئېلخەتتە IP ئادرېسىڭىز بولىدۇ.','Complete request'=>'ئىلتىماس تامام','Mark export request for &#8220;%s&#8221; as completed.'=>'«%s» نىڭ چىقىرىش ئىلتىماسىغا تامام بەلگىسى قويۇلدى.','%d request deleted successfully.'=>'%d ئىلتىماس مۇۋەپپەقىيەتلىك ئۆچۈرۈلدى.' . "\0" . '%d ئىلتىماس مۇۋەپپەقىيەتلىك ئۆچۈرۈلدى.','%d request failed to delete.'=>'%d ئىلتىماسنى ئۆچۈرەلمىدى.' . "\0" . '%d ئىلتىماسنى ئۆچۈرەلمىدى.','%d request marked as complete.'=>'%d ئىلتىماسقا تاماملاش بەلگىسى قويۇلدى.' . "\0" . '%d ئىلتىماسقا تاماملاش بەلگىسى قويۇلدى.','%d confirmation request re-sent successfully.'=>'%d جەزملەش ئىلتىماسى مۇۋەپپەقىيەتلىك ھالدا قايتا يوللاندى.' . "\0" . '%d جەزملەش ئىلتىماسى مۇۋەپپەقىيەتلىك ھالدا قايتا يوللاندى.','%d confirmation request failed to resend.'=>'%d جەزملەش ئىلتىماسىنى قايتا يوللىيالمىدى.' . "\0" . '%d جەزملەش ئىلتىماسىنى قايتا يوللىيالمىدى.','Mark requests as completed'=>'ئىلتىماسقا تاماملاش بەلگىسى قوي','Next steps'=>'كېيىنكى قەدەم','Unable to open personal data export file (archive) for writing.'=>'يازىدىغان شەخسىي سانلىق مەلۇمات چىقىرىش (ئارخىپ) ھۆججىتىنى ئاچالمايدۇ.','Unable to open personal data export file (JSON report) for writing.'=>'يازىدىغان شەخسىي سانلىق مەلۇمات چىقىرىش (JSON دوكلات) ھۆججىتىنى ئاچالمايدۇ.','Search results for: %s'=>'ئىزدەش نەتىجىسى: %s','Unable to protect personal data export folder from browsing.'=>'شەخسىي سانلىق مەلۇمات چىقىرىش مۇندەرىجىسىنى قوغدىيالمايدۇ.','Invalid email address when generating personal data export file.'=>'شەخسىي سانلىق مەلۇمات چىقىرىش ھۆججىتى ھاسىل قىلىدىغان ئېلخەت ئادرېس ئىناۋەتسىز.','Invalid request ID when generating personal data export file.'=>'شەخسىي سانلىق مەلۇمات چىقىرىش ھۆججىتىنى ھاسىللاۋاتقاندا ئىناۋەتسىز تەلەپ كىملىكى بايقالدى.','Unable to generate personal data export file. ZipArchive not available.'=>'شەخسىي سانلىق مەلۇمات چىقىرىش ھۆججىتىنى ھاسىللىيالمايدۇ. ZipArchive نى ئىشلەتكىلى بولمايدۇ.','Note that even when set to discourage search engines, your site is still visible on the web and not all search engines adhere to this directive.'=>'ئەسكەرتىش ئىزدەش موتورىنىڭ ئىندېكىسلىشىغا رىغبەتلەندۈرۈشنى تەڭشىمىگەن تەقدىردىمۇ، تور بېكىتىڭىز توردا كۆرۈنۈۋېرىدۇ ھەمدە ھەممە ئىزدەش موتورى بۇ كۆرسەتمىگە ئەمەل قىلىشى ناتايىن.','You can choose whether or not your site will be crawled by robots, ping services, and spiders. If you want those services to ignore your site, click the checkbox next to &#8220;Discourage search engines from indexing this site&#8221; and click the Save Changes button at the bottom of the screen.'=>'ماشىنا ئادەم، ping مۇلازىمەتلىرى ۋە «ئۆمۈچۈك» لەرنىڭ تور بېكىتىڭىزنى زىيارەت قىلىشى ياكى قىلماسلىقىنى تاللىيالايسىز. ئەگەر بۇ مۇلازىمەتلەرنىڭ تور بېكىتىڭىزنى زىيارەت قىلماسلىقىنى خالىسىڭىز،  «ئىزدەش موتورلىرىنىڭ بۇ بېكەتنى رەتكە تۇرغۇزۇشىنى ئىناۋەتسىز قىلىش» يېنىدىكى تاللاش رامكىسىنى چېكىپ، ئېكراننىڭ ئاستى تەرىپىدىكى «ئۆزگەرتىشلەرنى ساقلا» توپچىسىنى چېكىڭ.','The "%1$s" value is smaller than "%2$s"'=>'«%1$s» قىممىتى «%2$s» دىن كىچىك','Environment type'=>'مۇھىت تىپى','Auto-updates are only available for plugins recognized by WordPress.org, or that include a compatible update system.'=>'ئۆزلۈكىدىن يېڭىلاش پەقەت WordPress.org ئېتىراپ قىلىدىغان ياكى يېڭىلاش سىستېمىسى بىلەن ماسلىشىدىغان قىستۇرمىلارغىلا ماس كېلىدۇ.','Update Incompatible'=>'ماس كەلمەيدىغان يېڭىلاش','This update does not work with your version of WordPress.'=>'بۇ يېڭىلاش سىزنىڭ WordPress نەشرىڭىزدە ئىشلىمەيدۇ.','This update does not work with your versions of WordPress and PHP.'=>'بۇ يېڭىلاش سىزنىڭ WordPress ۋە PHP نەشرىڭىزدە ئىشلىمەيدۇ.','Disallowed Comment Keys'=>'رۇخسەت قىلىنمىغان ئىنكاس ئاچقۇچلۇق سۆزلىرى','Plugin and theme auto-updates'=>'قىستۇرما ۋە ئۆرنەك ئاپتوماتىك يېڭىلاش','There appear to be no issues with plugin and theme auto-updates.'=>'قىستۇرما ۋە ئۆرنەكنى ئۆزلۈكىدىن يېڭىلاشتا ھېچقانداق مەسىلە كۆرۈلمىگەندەك قىلىدۇ.','Auto-updates for themes appear to be disabled. This will prevent your site from receiving new versions automatically when available.'=>'ئۆرنەكنىڭ ئۆزلۈكىدىن يېڭىلاش ئىقتىدارى چەكلەنگەندەك تۇرىدۇ. بۇنداق بولغاندا تور بېكىتىڭىز يېڭى نەشرى بايقالغاندا ئۆزلۈكىدىن تاپشۇرۇۋېلىشنىڭ ئالدىنى ئالىدۇ.','Your site may have problems auto-updating plugins and themes'=>'تور بېكىتىڭىز قىستۇرما ۋە ئۆرنەكنى ئۆزلۈكىدىن يېڭىلاشتا مەسىلىگە يولۇقۇشى مۇمكىن.','Plugin and theme auto-updates ensure that the latest versions are always installed.'=>'قىستۇرما ۋە ئۆرنەكنىڭ ئۆزلۈكىدىن يېڭىلىنىشى ئورنىتىلغاننىڭ ئەڭ يېڭى بولۇشىغا كاپالەتلىك قىلىدۇ.','Auto-updates for plugins appear to be disabled. This will prevent your site from receiving new versions automatically when available.'=>'قىستۇرمىنىڭ ئۆزلۈكىدىن يېڭىلاش ئىقتىدارى چەكلەنگەندەك تۇرىدۇ. بۇنداق بولغاندا تور بېكىتىڭىز يېڭى نەشرى بايقالغاندا ئۆزلۈكىدىن تاپشۇرۇۋېلىشنىڭ ئالدىنى ئالىدۇ.','Auto-updates for plugins and themes appear to be disabled. This will prevent your site from receiving new versions automatically when available.'=>'قىستۇرما ۋە ئۆرنەكنىڭ ئۆزلۈكىدىن يېڭىلاش ئىقتىدارى چەكلەنگەندەك تۇرىدۇ. بۇنداق بولغاندا تور بېكىتىڭىز يېڭى نەشرى بايقالغاندا ئۆزلۈكىدىن تاپشۇرۇۋېلىشنىڭ ئالدىنى ئالىدۇ.','Auto-updates for plugins and/or themes appear to be disabled, but settings are still set to be displayed. This could cause auto-updates to not work as expected.'=>'قىستۇرما ۋە ياكى ئۆرنەكنىڭ ئۆزلۈكىدىن يېڭىلاش ئىقتىدارى چەكلەنگەندەك تۇرىدۇ. ئەمما كۆرۈنۈشتە يېڭىلاشنى كۆرسىتىدىغان قىلىپ تەڭشىلىپتۇ. بۇنداق بولسا ئۆزلۈكىدىن يېڭىلاش ئارزۇ قىلغاندەك ئىشلىمەسلىكى مۇمكىن.','themeActivate &#8220;%s&#8221;'=>'«%s» ئاكتىپلا','Plugin and theme auto-updates appear to be configured correctly'=>'قىستۇرما ۋە ئۆرنەكنىڭ ئۆزلۈكىدىن يېڭىلاش ئىقتىدارى توغرا سەپلەنگەن.','Sorry, you are not allowed to modify plugins.'=>'كەچۈرۈڭ، قىستۇرما ئۆزگەرتىش ئىجازىتىڭىز يوق.','%1$s is set to %2$s. You won\'t be able to upload files on your site.'=>'%1$s نىڭ قىممىتى %2$s غا تەڭشەلدى. تور بېكىتىڭىزگە ھۆججەت يۈكلىيەلمەيسىز.','The %s function has been disabled, some media settings are unavailable because of this.'=>'%s فونكسىيەسى چەكلەندى، شۇ سەۋەبتىن بەزى ۋاسىتە تەڭشەكلىرىنى ئىشلەتكىلى بولمايدۇ.','The setting for %1$s is smaller than %2$s, this could cause some problems when trying to upload files.'=>'%1$s نىڭ تەڭشىكى %2$s دىن كىچىك، بۇنداق بولغاندا ھۆججەت يۈكلىگەندە بەزى مەسىلىلەر كۆرۈلۈشى مۇمكىن.','The %1$s directive in %2$s determines if uploading files is allowed on your site.'=>'%2$s دىكى %1$s كۆرسەتمە تور بېكىتىڭىزگە ھۆججەت يۈكلەشكە بولۇش ياكى بولماسلىقنى بەلگىلەيدۇ.','File uploads'=>'ھۆججەت يۈكلەش','Files can be uploaded'=>'ھۆججەتلەرنى يۈكلەشكە بولىدۇ','Max number of files allowed'=>'يول قويىدىغان ئەڭ كۆپ ھۆججەت سانى','Max effective file size'=>'ئەڭ چوڭ ئۈنۈملۈك ھۆججەت چوڭلۇقى','Max size of an uploaded file'=>'يۈكلەنگەن ھۆججەتنىڭ ئەڭ چوڭ چوڭلۇقى','Max size of post data allowed'=>'يوللانغان سانلىق مەلۇماتنىڭ ئەڭ چوڭ چوڭلۇقى','File upload settings'=>'ھۆججەت يۈكلەش تەڭشەكلىرى','themeCannot Install %s'=>'%s نى ئورنىتالمايدۇ','pluginInstall %s'=>'%s نى ئورنات','themeInstall %s'=>'%s نى ئورنات','themeUpdate %s now'=>'%s نى ھازىرلا يېڭىلا','- %1$s version %2$s'=>'- %1$s نەشرى %2$s','themeActivated'=>'ئاكتىپلاندى','Sorry, you are not allowed to enable themes automatic updates.'=>'كەچۈرۈڭ، ئۆرنەكلەرنى ئاپتوماتىك يېڭىلاشنى قوزغىتىش ئىجازىتىڭىز يوق.','This plugin is already installed.'=>'بۇ قىستۇرما ئاللىقاچان ئورنىتىلغان.','pluginUpdate %s now'=>'%s نى ھازىرلا يېڭىلا','pluginInstall %s now'=>'ھازىر %s نى ئورنات','Dismiss this notice.'=>'ئۇقتۇرۇشقا پەرۋا قىلماڭ.','Theme will no longer be auto-updated.'=>'ئۆرنەك ئەمدى ئاپتوماتىك يېڭىلانمايدۇ.','Theme will be auto-updated.'=>'ئۆرنەك ئاپتۇماتىك يېڭىلىنىدۇ.','themeCannot Activate %s'=>'%s  نى ئاكتىپلىيالمايدۇ','Auto-updates can be enabled or disabled for each individual theme. Themes with auto-updates enabled will display the estimated date of the next auto-update. Auto-updates depends on the WP-Cron task scheduling system.'=>'ھەر بىر ئۆرنەكتە ئۆزلۈكىدىن يېڭىلاش ئىقتىدارىنى قوزغىتىپ ياكى چەكلىگىلى بولىدۇ. ئۆزلۈكىدىن يېڭىلاش قوزغىتىلغان ئۆرنەككە نىسبەتەن، سىستېما كېيىنكى قېتىم يېڭىلىنىدىغان پىلاندىكى ۋاقىتنى كۆرسىتىدۇ. ئۆزلۈكىدىن يېڭىلاش ئىقتىدارىنىڭ نورمال ئىشلەش ئىشلىمەسلىكى WP-Cron ۋەزىپە پىلان سىستېمىسىغا مۇناسىۋەتلىك.','Sorry, you are not allowed to disable themes automatic updates.'=>'كەچۈرۈڭ، ئۆرنەكلەرنى ئاپتوماتىك يېڭىلاشنى چەكلەش ئىجازىتىڭىز يوق.','Error in deleting the item.'=>'تۈرنى ئۆچۈرۈۋاتقاندا خاتالىق كۆرۈلدى.','Sorry, you are not allowed to manage plugins automatic updates.'=>'كەچۈرۈڭ، قىستۇرمىلارنىڭ ئاپتوماتىك يېڭىلىنىشىنى باشقۇرۇش ھوقۇقىڭىز يوق.','Error in restoring the item from Trash.'=>'تۈرنى ئەخلەتخانىدىن ئەسلىگە كەلتۈرۈۋاتقاندا خاتالىق كۆرۈلدى.','Selected plugins will no longer be auto-updated.'=>'تاللانغان قىستۇرمىلار ئەمدى ئۆزلۈكىدىن يېڭىلانمايدۇ.','Selected plugins will be auto-updated.'=>'تاللانغان قىستۇرمىلار ئۆزلۈكىدىن يېڭىلىنىدۇ.','Plugin will no longer be auto-updated.'=>'قىستۇرما ئەمدى ئۆزلۈكىدىن 