annot Install'=>'ئورنىتالمىدى','Block Editor Patterns'=>'بۆلەك تەھرىرلىگۈچ ئەندىزەسى','Plugin downgraded successfully.'=>'قىستۇرما مۇۋەپپەقىيەتلىك تۆۋەنلىتىلدى.','Plugin downgrade failed.'=>'قىستۇرمىنى تۆۋەنلىتەلمىدى.','Downgrading the plugin&#8230;'=>'قىستۇرما تۆۋەنلىتىلىۋاتىدۇ…','Updating the plugin&#8230;'=>'قىستۇرما يېڭىلاۋاتىدۇ…','Could not remove the current plugin.'=>'نۆۋەتتىكى قىستۇرمىنى چىقىرىۋېتەلمىدى.','Removing the current plugin&#8230;'=>'نۆۋەتتىكى قىستۇرمىنى چىقىرىۋېتىۋاتىدۇ…','Auto-update'=>'ئۆزلۈكىدىن يېڭىلا','Auto-updates disabled'=>'ئۆزلۈكىدىن يېڭىلاش چەكلەنگەن','Auto-updates enabled'=>'ئۆزلۈكىدىن يېڭىلاش قوزغىتىلغان','Is this site discouraging search engines?'=>'بۇ تور بېكەت ئىزدەش ماتورلىرىنى ئۈمىدسىزلەندۈرەمدۇ؟','Are pretty permalinks supported?'=>'ئۆزگەرمەس ئۇلانمىنى ياخشى قوللامدۇ؟','PHP memory limit (only for admin screens)'=>'PHP ئەسلەك چېكى (پەقەت باشقۇرغۇچى ئېكرانى ئۈچۈن)','Wide Blocks'=>'كەڭ بۆلەك','Block Editor Styles'=>'بۆلەك تەھرىرلىگۈچ ئۇسلۇبى','Spam'=>'ئەخلەت خەت','Unable to write to %s file.'=>'ھۆججەت %s گە يازالمايدۇ.','<strong>Error:</strong> The %s options page is not in the allowed options list.'=>'<strong> خاتالىق:</strong> بۇ %s تاللانما بېتى رۇخسەت قىلىنغان تاللانما تىزىمىدا ئەمەس.','Error:'=>'خاتالىق:','You should update your %s file now.'=>'ھازىر %s ھۆججىتىڭىزنى يېڭىلىشىڭىز زۆرۈر.','This localized version contains both the translation and various other localization fixes.'=>'بۇ يەرلىكلەشتۈرۈلگەن نەشرىدە تەرجىمە ۋە باشقا يەرلىكلەشتۈرۈش تۈزىتىلمىلىرى بار.','Take a look at the <strong>%1$d item</strong> on the <a href="%2$s">Site Health screen</a>.'=>'<a href="%2$s">بېكەت ساغلاملىق ئېكرانى</a> دىكى <strong>%1$d تۈر</strong>گە قاراپ بېقىڭ.' . "\0" . '<a href="%2$s">بېكەت ساغلاملىق ئېكرانى</a> دىكى <strong>%1$d تۈر</strong>گە قاراپ بېقىڭ.','Great job! Your site currently passes all site health checks.'=>'قالتىس! تور بېكىتىڭىز بارلىق تور بېكەت ساغلاملىق تەكشۈرۈشىدىن ئۆتتى.','Your site&#8217;s health is looking good, but there are still some things you can do to improve its performance and security.'=>'تور بېكىتىڭىزنىڭ ساغلاملىق ئەھۋالى ياخشىدەك قىلىدۇ، ئەمما بەزى مەشغۇلاتنى ئېلىپ بېرىپ ئۈنۈم ۋە بىخەتەرلىكنى ئاشۇرسىڭىز بولىدۇ.','Your site has critical issues that should be addressed as soon as possible to improve its performance and security.'=>'تور بېكىتىڭىزدە ئېغىر مەسىلە مەۋجۇت، ئۇنى دەرھال ھەل قىلىپ تور بېكىتىڭىزنىڭ ئۈنۈمى ۋە بىخەتەرلىكىنى ئۆستۈرۈڭ.','Site health checks will automatically run periodically to gather information about your site. You can also <a href="%s">visit the Site Health screen</a> to gather information about your site now.'=>'تور بېكەت ساغلاملىق تەكشۈرۈشى قەرەلىك ھالدا ئىجرا قىلىنىپ تور بېكىتىڭىزنىڭ ئۇچۇرلىرىنى ئاپتوماتىك توپلايدۇ. سىز <a href="%s">تور بېكەت ساغلاملىق بېتى</a> گە يۆتكىلىپ، تور بېكىتىڭىزگە ئائىت ئۇچۇرلارنى توپلىيالايسىز.','No information yet&hellip;'=>'ھازىرچە ھېچقانداق ئۇچۇر يوق…','The uploaded file exceeds the %1$s directive in %2$s.'=>'يۈكلىگەن ھۆججەتنىڭ سىغىمى %2$s دا بەلگىلەنگەن %1$s قىممەتتىن ئېشىپ كەتتى.','No comments found in Trash.'=>'ئەخلەتخانىدا ھېچقانداق ئىنكاس يوق.','File is empty. Please upload something more substantial. This error could also be caused by uploads being disabled in your %1$s file or by %2$s being defined as smaller than %3$s in %1$s.'=>'ھۆججەت بوش ئىكەن. بىرەر مەزمۇننى ئۆز ئىچىگە ئالغان ھۆججەتنى يۈكلەڭ. بۇ خاتالىق سىزنىڭ %1$s ھۆججىتىدە يۈكلەشنى چەكلىگەنلىكىڭىز ياكى %1$s دىكى %2$s نىڭ قىممىتى %3$s دىن كىچىك بولۇشى مۇمكىن.','A test is unavailable'=>'سىناقنى ئىشلەتكىلى بولمايدۇ','Error: %1$s (%2$s)'=>'خاتالىق: %1$s (%2$s)','Your site is running on an older version of PHP (%s), which should be updated'=>'تور بېكىتىڭىزدە PHP (%s) كونا نەشرى ئىجرا قىلىنىۋاتىدۇ، يېڭىلاش كېرەك.','Your site is running on an older version of PHP (%s)'=>'تور بېكىتىڭىزدە PHP (%s) كونا نەشرى ئىجرا قىلىنىۋاتىدۇ.','Your site is running the current version of PHP (%s)'=>'تور بېكىتىڭىزدە PHP (%s) نىڭ نەشرى ئىجرا قىلىنىۋاتىدۇ','No media files found in Trash.'=>'ئەخلەتخانىدا ھېچقانداق ھۆججەت بايقالمىدى.','%1$s %2$d – %3$s %4$d, %5$d'=>'%1$s %2$d – %3$s %4$d, %5$d','%1$s %2$d–%3$d, %4$d'=>'%1$s %2$d–%3$d, %4$d','upcoming events year formatY'=>'Y','upcoming events day formatj'=>'j','Delete requests'=>'ئىلتىماس ئۆچۈر','Table prefix'=>'جەدۋەل ئالدى قوشۇلغۇچى','Resend confirmation requests'=>'جەزملەش ئىلتىماسىنى قايتا يوللا','upcoming events month formatF'=>'n','PHP Default Timezone'=>'PHP كۆڭۈلدىكى ۋاقىت رايونى','PHP default timezone is valid'=>'PHP كۆڭۈلدىكى ۋاقىت رايونى ئىناۋەتلىك','PHP default timezone is invalid'=>'PHP كۆڭۈلدىكى ۋاقىت رايونى ئىناۋەتسىز','PHP default timezone was changed after WordPress loading by a %s function call. This interferes with correct calculations of dates and times.'=>'PHP نىڭ كۆڭۈلدىكى ۋاقىت رايونى WordPress يۈكلەنگەندىن كېيىن %s فونكسىيەنىڭ چاقىرىشى بىلەن ئۆزگەرتىلدى. بۇ چېسلا ۋە ۋاقىتنىڭ ھېسابلىنىشىغا تەسىر كۆرسىتىشى مۇمكىن.','PHP default timezone was configured by WordPress on loading. This is necessary for correct calculations of dates and times.'=>'WordPress يۈكلەنگەندە PHP نىڭ كۆڭۈلدىكى ۋاقىت رايونى سەپلەندى، بۇ چېسلا ۋە ۋاقىتنى توغرا ھېسابلاش ئۈچۈن ئېلىپ بېرىلدى.','The seventh parameter passed to %s should be numeric representing menu position.'=>'%s غا يوللىنىدىغان يەتتىنچى پارامېتىر تىزىملىك ئورنىنى ئىپادىلەيدىغان پۈتۈن سان بولۇشى كېرەك ئىدى.','The update cannot be installed because WordPress %1$s requires the %2$s PHP extension.'=>'يېڭىلاشنى ئورنىتالمايدۇ چۈنكى WordPress %1$s نەشرى PHP نىڭ %2$s كېڭەيتىلمىسىنى تەلەپ قىلىدۇ.','UTF8MB4 is the character set WordPress prefers for database storage because it safely supports the widest set of characters and encodings, including Emoji, enabling better support for non-English languages.'=>'WordPress تەۋسىيە قىلىدىغان ھەرپ توپلىمى UTF8MB4 بولۇپ، ئۇ چىراي ئىپادىنى ئۆز ئىچىگە ئالغان ھەرپ ۋە كودلاشنى بىخەتەر ھالدا قوللاپلا قالماي يەنە ئىنگلىزچىدىن باشقا تىللارنىمۇ ياخشى قوللايدۇ.','https://wordpress.org/about/stats/'=>'https://wordpress.org/about/stats/','<a href="https://wordpress.org/documentation/article/tools-export-screen/">Documentation on Export</a>'=>'<a href="https://wordpress.org/documentation/article/tools-export-screen/">چىقىرىش قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/plugins-add-new-screen/">Documentation on Installing Plugins</a>'=>'<a href="https://wordpress.org/documentation/article/plugins-add-new-screen/">قىستۇرما ئورنىتىش قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/pages-screen/">Documentation on Managing Pages</a>'=>'<a href="https://wordpress.org/documentation/article/pages-screen/">بەت باشقۇرۇش قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/settings-discussion-screen/">Documentation on Discussion Settings</a>'=>'<a href="https://wordpress.org/documentation/article/settings-discussion-screen/">مۇنازىرە تەڭشەكلىرى قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/posts-screen/">Documentation on Managing Posts</a>'=>'<a href="https://wordpress.org/documentation/article/posts-screen/">يازما باشقۇرۇش قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/appearance-themes-screen/#install-themes">Documentation on Adding New Themes</a>'=>'<a href="https://wordpress.org/documentation/article/appearance-themes-screen/#install-themes">يېڭى ئۆرنەك قوشۇش قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/media-add-new-screen/">Documentation on Uploading Media Files</a>'=>'<a href="https://wordpress.org/documentation/article/media-add-new-screen/">ۋاسىتە ھۆججەت يۈكلەش قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/roles-and-capabilities/">Descriptions of Roles and Capabilities</a>'=>'<a href="https://wordpress.org/documentation/article/roles-and-capabilities/">رول ۋە ئىقتىدار چۈشەندۈرۈلۈشى</a>','<a href="https://wordpress.org/documentation/article/users-screen/">Documentation on Managing Users</a>'=>'<a href="https://wordpress.org/documentation/article/users-screen/">ئىشلەتكۈچى باشقۇرۇش قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/users-your-profile-screen/">Documentation on User Profiles</a>'=>'<a href="https://wordpress.org/documentation/article/users-your-profile-screen/"> ئىشلەتكۈچى تەرجىمىھالىدىكى ھۆججەتلەر </a>','<a href="https://wordpress.org/documentation/article/settings-media-screen/">Documentation on Media Settings</a>'=>'<a href="https://wordpress.org/documentation/article/settings-media-screen/">ۋاسىتە تەڭشەكلەر قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/tools-import-screen/">Documentation on Import</a>'=>'<a href="https://wordpress.org/documentation/article/tools-import-screen/">ئەكىرىش قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/tools-screen/">Documentation on Tools</a>'=>'<a href="https://wordpress.org/documentation/article/tools-screen/"> قوراللاردىكى ھۆججەتلەر </a>','This page allows direct access to your site settings. You can break things here. Please be cautious!'=>'بۇ بەتتە تور بېكىتىڭىزنىڭ تەڭشىكىنى بىۋاسىتە زىيارەت قىلالايسىز. بۇ يەردىكى ئىشلارنى بۇزالايسىز. ئېھتىيات قىلىڭ!','The %s setting is unregistered. Unregistered settings are deprecated. See https://developer.wordpress.org/plugins/settings/settings-api/'=>'%s تەڭشىكى تىزىملىتىلمىغان. تىزىملىتىلمىغان تەڭشەكلەر كېيىنكى نەشرىدە ئەمەلدىن قالىدۇ. https://developer.wordpress.org/plugins/settings/settings-api/ غا قاراڭ.','<strong>Format</strong> &mdash; Post Formats designate how your theme will display a specific post. For example, you could have a <em>standard</em> blog post with a title and paragraphs, or a short <em>aside</em> that omits the title and contains a short text blurb. Your theme could enable all or some of 10 possible formats. <a href="https://wordpress.org/documentation/article/post-formats/#supported-formats">Learn more about each post format</a>.'=>'<strong>پىچىم</strong> &mdash; يازما پىچىمى ئۆرنىكىڭىزنىڭ يازمىنى قانداق كۆرسىتىدىغانلىقىنى بەلگىلەيدۇ. مەسىلەن، سىزنىڭ ماۋزۇ ۋە بىر قانچە ئابزاسى بار <em>ئۆلچەملىك</em> بىلوگ يازمىڭىز بولۇشى مۇمكىن ياكى ماۋزۇ ۋە ئازراقلا مەزمۇنى بار <em>قىسقا</em> يازما بولۇشىمۇ مۇمكىن. ئۆرنىكىڭىزدە 10 خىل پىچىم ياكى ھەممىسىنى قوزغىتىپ ئىشلىتەلەيسىز. <a href="https://wordpress.org/documentation/article/post-formats/#supported-formats">يازما پىچىمى ھەققىدىكى تېخىمۇ كۆپ بىلدۈرگۈ</a>.','<a href="https://wordpress.org/documentation/article/pages-screen/">Documentation on Editing Pages</a>'=>'<a href="https://wordpress.org/documentation/article/pages-screen/">بەت تەھرىرلەش قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/pages-add-new-screen/">Documentation on Adding New Pages</a>'=>'<a href="https://wordpress.org/documentation/article/pages-add-new-screen/">يېڭى بەت قوشۇش قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/media-library-screen/">Documentation on Media Library</a>'=>'<a href="https://wordpress.org/documentation/article/media-library-screen/">ۋاسىتە ئامبىرى قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/revisions/">Revisions Management</a>'=>'<a href="https://wordpress.org/documentation/article/revisions/">تۈزىتىلگەن نۇسخا باشقۇرۇش</a>','<a href="https://wordpress.org/documentation/article/edit-media/">Documentation on Edit Media</a>'=>'<a href="https://wordpress.org/documentation/article/edit-media/">ۋاسىتە تەھرىرلەش قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/manage-plugins/">Documentation on Managing Plugins</a>'=>'<a href="https://wordpress.org/documentation/article/manage-plugins/">قىستۇرما باشقۇرۇش قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/dashboard-screen/">Documentation on Dashboard</a>'=>'<a href="https://wordpress.org/documentation/article/dashboard-screen/">تىزگىن تاختا قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/users-add-new-screen/">Documentation on Adding New Users</a>'=>'<a href="https://wordpress.org/documentation/article/users-add-new-screen/">يېڭى ئىشلەتكۈچى قوشۇش قوللانمىسى</a>','This page can show you every detail about the configuration of your WordPress website. For any improvements that could be made, see the <a href="%s">Site Health Status</a> page.'=>'بۇ بەتتە WordPress تور بېكىتىڭىزنىڭ ھەر بىر سەپلىمىسىنىڭ تەپسىلاتىنى كۆرسىتەلەيسىز. تور بېكەتتە ياخشىلاشقا تېگىشلىك تۈر بولسا، <a href="%s">بېكەت ساغلاملىق ھالىتى</a> بېتىدىن كۆرەلەيسىز.','Results are still loading&hellip;'=>'نەتىجە يۈكلىنىۋاتىدۇ...','<a href="https://wordpress.org/documentation/article/nginx/">Documentation on Nginx configuration</a>.'=>'<a href="https://wordpress.org/documentation/article/nginx/">Nginx سەپلىمە قوللانمىسى</a>.','<a href="https://wordpress.org/documentation/article/settings-permalinks-screen/">Documentation on Permalinks Settings</a>'=>'<a href="https://wordpress.org/documentation/article/settings-permalinks-screen/">ئۆزگەرمەس ئۇلانما تەڭشەكلىرى قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/customize-permalinks/">Documentation on Using Permalinks</a>'=>'<a href="https://wordpress.org/documentation/article/customize-permalinks/">ئۆزگەرمەس ئۇلانما ئىشلىتىش قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/dashboard-updates-screen/">Documentation on Updating WordPress</a>'=>'<a href="https://wordpress.org/documentation/article/dashboard-updates-screen/">WordPress يېڭىلاش قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/appearance-menus-screen/">Documentation on Menus</a>'=>'<a href="https://wordpress.org/documentation/article/appearance-menus-screen/">تىزىملىك قوللانمىسى</a>','<a href="https://developer.wordpress.org/plugins/">Documentation on Writing Plugins</a>'=>'<a href="https://developer.wordpress.org/plugins/">قىستۇرما يېزىش قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/plugins-editor-screen/">Documentation on Editing Plugins</a>'=>'<a href="https://wordpress.org/documentation/article/plugins-editor-screen/">قىستۇرما تەھرىرلەش قوللانمىسى</a>','<a href="https://developer.wordpress.org/themes/basics/template-tags/">Documentation on Template Tags</a>'=>'<a href="https://developer.wordpress.org/themes/basics/template-tags/">قېلىپ قوللانمىسى Tags</a>','<a href="https://wordpress.org/documentation/article/editing-files/">Documentation on Editing Files</a>'=>'<a href="https://wordpress.org/documentation/article/editing-files/">ھۆججەت تەھرىرلەش قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/work-with-themes/">Documentation on Using Themes</a>'=>'<a href="https://wordpress.org/documentation/article/work-with-themes/">ئۆرنەك ئىشلىتىش قوللانمىسى</a>','<a href="https://developer.wordpress.org/themes/">Documentation on Theme Development</a>'=>'<a href="https://developer.wordpress.org/themes/">ئۆرنەك ئىجادىيەت قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/comments-screen/">Documentation on Comments</a>'=>'<a href="https://wordpress.org/documentation/article/comments-screen/">ئىنكاس قوللانمىسى</a>','Universal time is %s.'=>'خەلقئارا ئۆلچەملىك ۋاقىت:  %s.','Choose either a city in the same timezone as you or a %s (Coordinated Universal Time) time offset.'=>'ئوخشاش ۋاقىت رايونىدىكى شەھەردىن بىرنى ياكى %s (ماسلاشتۇرۇلغان ئۇنىۋېرسال ۋاقىت) خەلقئارا ئۆلچەملىك ۋاقىت پەرقىنى تاللاڭ.','Administration Email Address'=>'باشقۇرغۇچىنىڭ ئېلخەت ئادرېسى','<a href="https://wordpress.org/documentation/article/settings-general-screen/">Documentation on General Settings</a>'=>'<a href="https://wordpress.org/documentation/article/settings-general-screen/">ئادەتتىكى تەڭشەك قوللانمىسى</a>','You need to make this file writable before you can save your changes. See <a href="%s">Changing File Permissions</a> for more information.'=>'ئۆزگەرتىشلىرىڭىزنى ساقلاشتىن بۇرۇن بۇ ھۆججەتنى يېزىشقا بولىدىغان قىلىپ بەلگىلىشىڭىز كېرەك. تەپسىلىي بىلمەكچى بولسىڭىز <a href="%s">ھۆججەت ئىجازىتىنى ئۆزگەرتىش</a> كە قاراڭ.','https://wordpress.org/documentation/article/giving-wordpress-its-own-directory/'=>'https://wordpress.org/documentation/article/giving-wordpress-its-own-directory/','Upload failed. Please reload and try again.'=>'يۈكلىيەلمىدى. قايتا يۈكلەپ ئاندىن سىناڭ.','Data erasure has failed.'=>'سانلىق مەلۇماتلارنى ئۆچۈرەلمىدى.','Erasure completed.'=>'ئۆچۈرۈش تاماملاندى.','page labelPrivacy Policy Page'=>'شەخسىيەت تۈزۈمى بېتى','page labelPosts Page'=>'يازمىلار بېتى','page labelFront Page'=>'باش بەت','post statusSticky'=>'چوققا','post statusCustomization Draft'=>'خاسلاستۇرۇلغان دەسلەپكى نۇسخا','post statusPassword protected'=>'ئىم قوغدالغان','The attached file cannot be found.'=>'يۈكلەنمە ھۆججەت تېپىلمىدى.','The scheduled event, %s, is late to run. Your site still works, but this may indicate that scheduling posts or automated updates may not work as intended.'=>'كۈنتەرتىپتىكى پائالىيەت %s نى ئىجرا قىلىش كېچىكتۈرۈلدى. تور بېكىتىڭىز يەنىلا ئىشلەۋاتىدۇ ئەمما كۈنتەرتىپتىكى يازما ياكى ئۆزلۈكىدىن يېڭىلاش مۆلچەرلەنگەندىكىدەك ئىجرا بولماسلىقى مۇمكىن.','A scheduled event is late'=>'كۈنتەرتىپتىكى پائالىيەت كېچىكتى','An HTTPS connection is a more secure way of browsing the web. Many services now have HTTPS as a requirement. HTTPS allows you to take advantage of new features that can increase site speed, improve search rankings, and gain the trust of your visitors by helping to protect their online privacy.'=>'HTTPS تېخىمۇ بىخەتەر بولغان زور زىيارەت ئۇسۇلى. نۇرغۇن مۇلازىمېتىر HTTPS ئىشلىتىشنى تەلەپ قىلىۋاتىدۇ. HTTPS بېكەت سۈرئىتىنى تېزلىتىپ، ئىزدەش قاتارىدىكى تەرتىپىنى ياخشىلاپ، زىيارەتچىلەرنىڭ توردىكى شەخسىيىتىنى قوغداش ئارقىلىق ئىشەنچكە ئېرىشتۈرىدىغان يېڭى ئىقتىدار.','Your version of WordPress (%s) is up to date'=>'سىزنىڭ WordPress (%s) نەشرىڭىز ئەڭ يېڭىسى','<a href="https://wordpress.org/documentation/article/network-admin-sites-screen/">Documentation on Site Management</a>'=>'<a href="https://wordpress.org/documentation/article/network-admin-sites-screen/">بېكەت باشقۇرۇش قوللانمىسى</a>','https://wordpress.org/documentation/article/introduction-to-blogging/#managing-comments'=>'https://wordpress.org/documentation/article/introduction-to-blogging/#managing-comments','https://wordpress.org/documentation/article/introduction-to-blogging/#comments'=>'https://wordpress.org/documentation/article/introduction-to-blogging/#comments','https://wordpress.org/documentation/article/block-themes/'=>'https://wordpress.org/documentation/article/block-themes/','Publish on: %s'=>'ئېلان قىلىش: %s','Schedule for: %s'=>'كۈنتەرتىپ: %s','Scheduled for: %s'=>'كۈنتەرتىپتە: %s','publish box time formatH:i'=>'H:i','publish box date formatM j, Y'=>'Y-يىلى M-ئاينىڭ j-كۈنى','Published on: %s'=>'تارقىتىلغان ۋاقتى: %s','The directives (lines) between "BEGIN %1$s" and "END %1$s" are
dynamically generated, and should only be modified via WordPress filters.
Any changes to the directives between these markers will be overwritten.'=>'«BEGIN %1$s» بىلەن «END %1$s» ئارىسىدىكى بۇيرۇق (قۇرى) ھەرىكەتچان شەكىللىنىدۇ، WordPress سۈزگۈچ ئۇنى ئۆزگەرتەلىشى كېرەك. بەلگە ئارىسىدىكى ھەر قانداق بۇيرۇقنىڭ ئۆزگىرىشىنى سىستېما قاپلىۋېتىدۇ.','All automatic updates are disabled.'=>'بارلىق ئاپتوماتىك يېڭىلاش چەكلەنگەن.','Database collation'=>'ساندان دەلىللەش','Database charset'=>'ساندان ھەرپ توپلىمى','Inactive Themes'=>'ئاكتىپسىز ئۆرنەك','Parent Theme'=>'ئاتا ئۆرنەك','Drop-ins are single files, found in the %s directory, that replace or enhance WordPress features in ways that are not possible for traditional plugins.'=>'كۈچەيتىلگەن قىستۇرما %s مۇندەرىجىدىكى يەككە ھۆججەت بولۇپ، ئۇ WordPress تىكى ئەنئەنىۋى قىستۇرما ئارقىلىق ئىشقا ئاشۇرغىلى بولمايدىغان ئىقتىدارنىڭ ئورنىنى ئالىدىغان ياكى كۈچەيتىدىغان ھۆججەت.','<a href="https://wordpress.org/documentation/article/settings-writing-screen/">Documentation on Writing Settings</a>'=>'<a href="https://wordpress.org/documentation/article/settings-writing-screen/">يېزىش تەڭشەكلىرى قوللانمىسى</a>','personal data group descriptionOverview of export report.'=>'چىقىرىش دوكلاتىنىڭ ئومۇمىي ئەھۋالى','<a href="https://wordpress.org/documentation/article/posts-tags-screen/">Documentation on Tags</a>'=>'<a href="https://wordpress.org/documentation/article/posts-tags-screen/">بەلگە قوللانمىسى</a>','<a href="https://wordpress.org/documentation/article/posts-categories-screen/">Documentation on Categories</a>'=>'<a href="https://wordpress.org/documentation/article/posts-categories-screen/">سەھىپە قوللانمىسى</a>','<strong>Warning:</strong> these pages should not be the same as your Privacy Policy page!'=>'<strong>ئاگاھلاندۇرۇش:</strong> بۇ بەتلەر شەخسىيەت تۈزۈمى بېتىگە ئوخشاش بەتلەر بولماسلىقى كېرەك!','<a href="https://wordpress.org/documentation/article/settings-reading-screen/">Documentation on Reading Settings</a>'=>'<a href="https://wordpress.org/documentation/article/settings-reading-screen/">ئوقۇش تەڭشەكلىرى قوللانمىسى</a>','For each post in a feed, include'=>'مەنبەدىكى ھەر بىر يازما، ئىچىگە ئالسۇن','Your theme determines how content is displayed in browsers. <a href="%s">Learn more about feeds</a>.'=>'ئۆرنىكىڭىز توركۆرگۈنىڭ مەزمۇننى قانداق كۆرسىتىشنى بەلگىلەيدۇ. <a href="%s">مەنبە ھەققىدىكى تېخىمۇ كۆپ بىلدۈرگۈ</a>.','https://wordpress.org/documentation/article/wordpress-feeds/'=>'https://wordpress.org/documentation/article/wordpress-feeds/','[%s] Delete My Site'=>'[%s]تور بېكىتىمنى ئۆچۈر','Allow people to submit comments on new posts'=>'كىشىلەرنىڭ يېڭى يازمىلارغا ئىنكاس يېزىشىغا رۇخسەت قىل','Default post settings'=>'كۆڭۈلدىكى يازما تەڭشەكلىرى','<a href="%s">You can change your profile picture on Gravatar</a>.'=>'<a href="%s">تەرجىمىھال رەسىمىڭىزنى Gravatar دا ئۆزگەرتەلەيسىز</a>.','Plugin resumed.'=>'قىستۇرما ئەسلىگە كەلدى.','Selected plugins deactivated.'=>'تاللانغان قىستۇرمىلار  ئاكتىپسىزلاندى.','Plugin deactivated.'=>'قىستۇرما  ئاكتىپسىزلاندى.','Selected plugins activated.'=>'تاللانغان قىستۇرمىلار  ئاكتىپلاندى.','Plugin activated.'=>'قىستۇرما  ئاكتىپلاندى.','The selected plugins have been deleted.'=>'تاللانغان قىستۇرمىلار ئۆچۈرۈۋېتىلگەن.','The selected plugin has been deleted.'=>'تاللانغان قىستۇرما ئۆچۈرۈۋېتىلگەن.','The plugin %1$s has been deactivated due to an error: %2$s'=>'قىستۇرما %1$s بىر خاتالىق كۆرۈلگىنى ئۈچۈن توختىتىۋېتىلدى: %2$s','If you need to tweak more than your theme&#8217;s CSS, you might want to try <a href="%s">making a child theme</a>.'=>'ئەگەر سىز ئۆرنەك CSS نىڭ سىرتىدىكى مەزمۇننى ئۆزگەرتمەكچى بولسىڭىز، <a href="%s">بالا ئۆرنەك قۇرۇش</a>نى سىناپ بېقىڭ.','You appear to be making direct edits to your theme in the WordPress dashboard. It is not recommended! Editing your theme directly could break your site and your changes may be lost in future updates.'=>'WordPress باشقۇرۇش تاختىسىدىكى ئۆرنىكىڭىزنى بىۋاسىتە تەھرىرلەۋاتقاندەك قىلىسىز. ئۇنداق قىلماسلىقىڭىزنى تەۋسىيە قىلىمىز. ئۆرنەكنى بىۋاسىتە تەھرىرلەش ماسلاشماسلىقنى كەلتۈرۈپ چىقىرىپ بېكىتىڭىزنى بۇزۇۋېتىشى مۇمكىن، ئۇنىڭ ئۈستىگە ئۇ ئۆزگەرتىشلىرىڭىز سىستېما يېڭىلانسا يوقاپ كېتىشى مۇمكىن.','draft_length10'=>'10','%1$s needs to be a %2$s object.'=>'%1$s چوقۇم %2$s ئوبيېكتى بولۇشى كېرەك.','File does not exist! Please double check the name and try again.'=>'ھۆججەت مەۋجۇت ئەمەس! ھۆججەت ئىسمىنى تەكشۈرۈپ ئاندىن قايتا سىناڭ.','You are in recovery mode. This means there may be an error with a theme or plugin. To exit recovery mode, log out or use the Exit button. <a href="%s">Exit Recovery Mode</a>'=>'سىز ئەسلىگە كەلتۈرۈش ھالىتىدە. بۇ دېگەنلىك ئۆرنەك ياكى قىستۇرمىدا خاتالىق بولۇشى مۇمكىن. ئەسلىگە كەلتۈرۈش ھالىتىدىن چىقىش ئۈچۈن، تىزىمدىن چىقىڭ ياكى چىقىش توپچىسىنى ئىشلىتىڭ.<a href="%s"> ئەسلىگە كەلتۈرۈشتىن چىقىش</a>','Site HealthInfo'=>'ئۇچۇر','Site HealthStatus'=>'ھالىتى','Themes directory location'=>'ئۆرنەك مۇندەرىجە ئورنى','comment statusClosed'=>'يېپىق','%s critical issue'=>'%s جىددىي مەسىلە','https://wordpress.org/documentation/article/updating-wordpress/'=>'https://wordpress.org/documentation/article/updating-wordpress/','https://wordpress.org/about/requirements/'=>'https://wordpress.org/about/requirements/','Get help resolving this issue.'=>'بۇ مەسىلىنى ھەل قىلىدىغان ياردەمگە ئېرىشىڭ.','WordPress&#8217; utf8mb4 support requires MySQL client library (%1$s) version %2$s or newer. Please contact your server administrator.'=>'WordPress نىڭ utf8mb4 نى قوللىشى ئۈچۈن MySQL خېرىدار ئامبىرى (%1$s) نەشرى %2$s ياكى يۇقىرى بولۇشى كېرەك. مۇلازىمېتىر باشقۇرغۇچىڭىز بىلەن ئالاقىلىشىڭ.','WordPress&#8217; utf8mb4 support requires MariaDB version %s or greater. Please contact your server administrator.'=>'WordPress نىڭ utf8mb4 نى قوللىشى ئۈچۈن MariaDB نەشرى %s ياكى يۇقىرى بولۇشى كېرەك. مۇلازىمېتىر باشقۇرغۇچىڭىز بىلەن ئالاقىلىشىڭ.','WordPress&#8217; utf8mb4 support requires MySQL version %s or greater. Please contact your server administrator.'=>'WordPress نىڭ utf8mb4 نى قوللىشى ئۈچۈن MySQL نەشرى %s ياكى يۇقىرى بولۇشى كېرەك. مۇلازىمېتىر باشقۇرغۇچىڭىز بىلەن ئالاقىلىشىڭ.','Learn more about what WordPress requires to run.'=>'WordPress نىڭ ئىجرا بولۇش مۇھىتىنى چۈشىنىڭ.','The SQL server is a required piece of software for the database WordPress uses to store all your site&#8217;s content and settings.'=>'SQL مۇلازىمېتىر WordPress ساندانىغا زۆرۈر بولغان يۇمشاق دېتاللارنىڭ بىرى بولۇپ، تور بېكىتىڭىزدىكى بارلىق مەزمۇن ۋە تەڭشەكلەر ئۇنىڭدا ساقلىنىدۇ.','PHP modules perform most of the tasks on the server that make your site run. Any changes to these must be made by your server administrator.'=>'PHP مودېلى تور بېكىتىڭىزنى زور كۆپچىلىك ۋەزىپىلىرىنى ئورۇنلايدۇ. ھەر قانداق ئۆزگەرتىشنى مۇلازىمېتىر باشقۇرغۇچىڭىز ئېلىپ بارىدۇ.','Manage your themes'=>'ئۆرنەك باشقۇرۇش','Manage inactive plugins'=>'ئاكتىپسىز قىستۇرما باشقۇرۇش','Update your plugins'=>'قىستۇرمىلىرىڭىزنى يېڭىلاڭ','Manage your plugins'=>'قىستۇرمىلىرىڭىزنى باشقۇرۇڭ','View Privacy Policy Guide.'=>'شەخسىيەت تۈزۈمى كۆرسەتكۈچىنى كۆرسىتىدۇ.','User Language'=>'ئىشلەتكۈچى تىلى','The value, %1$s, has either been enabled by %2$s or added to your configuration file. This will make errors display on the front end of your site.'=>'بۇ قىممەت، %1$s، ياكى %2$s قوزغاتقان، ياكى سەپلىمە ھۆججىتىڭىزگە قوشۇلغان. بۇنداق بولغاندا خاتالىق تور بېكىتىڭىزنىڭ ئالدى ئۇچى تەرەپتە كۆرۈنىدۇ.','[%s] Background Update Finished'=>'[%s] ئارقا سۇپىدا يېڭىلاش تاماملاندى','[%s] Background Update Failed'=>'[%s] ئارقا سۇپىدا يېڭىلىيالمىدى','You should remove inactive themes'=>'ئاكتىپسىز ئۆرنەكلەرنى چىقىرىۋەتكىنىڭىز تۈزۈك','Your site has 1 installed theme, and it is up to date.'=>'بېكىتىڭىزگە 1 ئۆرنەك ئۆرنىتىلغان بولۇپ، ھەممىسى ئەڭ يېڭى نەشرى.','Your site has 1 active plugin, and it is up to date.'=>'بېكىتىڭىزگە 1 ئاكتىپ قىستۇرما ئۆرنىتىلغان بولۇپ، ھەممىسى ئەڭ يېڭى نەشرى.','Plugin could not be resumed because it triggered a <strong>fatal error</strong>.'=>'قىستۇرما ئىجرا قىلىشنى داۋاملاشتۇرالمايدۇ چۈنكى ئۇ <strong>ئەجەللىك خاتالىق</strong> سادىر قىلىشى مۇمكىن.','Passed tests'=>'سىناقتىن ئۆتتى','Sorry, you are not allowed to access site health information.'=>'كەچۈرۈڭ، بېكەت ساغلاملىق ئۇچۇرىنى زىيارەت قىلىش ئىجازىتىڭىز يوق.','Copy site info to clipboard'=>'بېكەت ئۇچۇرىنى چاپلاش تاختىسىغا كۆچۈرىدۇ','If you want to export a handy list of all the information on this page, you can use the button below to copy it to the clipboard. You can then paste it in a text file and save it to your device, or paste it in an email exchange with a support engineer or theme/plugin developer for example.'=>'ئەگەر بۇ بەتتىكى بارلىق تىزىم ئۇچۇرلىرىنى چىقارماقچى بولسىڭىز، تۆۋەندىكى توپچىنى ئىشلىتىپ ئۇنى چاپلاش تاختىسىغا كۆچۈرەلەيسىز. ئاندىن ئۇنى ئۈسكۈنىڭىزدىكى تېكست ھۆججەتكە چاپلىيالايسىز، ياكى ئېلخەتكە چاپلاپ ئۇنى قوللاش ئىنژېنېرى ياكى ئۆرنەك/قىستۇرما ئىجادكارىغا ئەۋەتىپ بېرەلەيسىز.','The Site Health check requires JavaScript.'=>'بېكەت ساغلاملىقىنى تەكشۈرۈش JavaScript نى تەلەپ قىلىدۇ.','Site Health Info'=>'بېكەت ساغلاملىق ئۇچۇرى','This update does not work with your version of PHP.'=>'بۇ يېڭىلاش سىزنىڭ PHP نەشرىڭىزدە ئىشلىمەيدۇ.','All formats'=>'بارلىق پىچىملار','Filter by post format'=>'يازما پىچىمى بويىچە سۈزىدۇ','Go to the Plugins screen'=>'قىستۇرما ئېكرانىغا يۆتكەل','The authenticity of %s could not be verified.'=>'%s راستلىقىنى دەلىللىيەلمەيدۇ.','The authenticity of %s could not be verified as no signature was found.'=>'ئىمزانى تاپالمىغانلىقتىن %s نىڭ راستلىقىنى دەلىللىيەلمىدى.','Sorry, you are not allowed to perform this action.'=>'كەچۈرۈڭ، بۇ مەشغۇلاتنى بىجىرىش ئىجازىتىڭىز يوق.','Eraser callback is not valid: %s.'=>'ئۆچۈرگۈچ چاقىرىق ئىنكاسى ئىناۋەتسىز: %s.','Eraser does not include a callback: %s.'=>'ئۆچۈرگۈچ چاقىرىق ئىنكاسىنى ئۆز ئىچىگە ئالمىغان: %s.','The authenticity of %s could not be verified as signature verification is unavailable on this system.'=>'بۇ سىستېمىدا ئىمزا دەلىللەشنى ئىشلەتكىلى بولمىغانلىقتىن %s نىڭ راستلىقىنى دەلىللىيەلمىدى.','HTTP requests have been blocked by the %1$s constant, with some allowed hosts: %2$s.'=>'HTTP ئىلتىماسىنى %1$s توستى، پەقەت تۆۋەندىكى مۇلازىمېتىرلارغىلا يول قويىدۇ: %2$s.','HTTP requests have been blocked by the %s constant, with no allowed hosts.'=>'HTTP ئىلتىماسىنى %s تۇراقلىق مىقدار توستى، يول قويىدىغان مۇلازىمېتىر يوق.','https://make.wordpress.org/hosting/handbook/handbook/server-environment/#php-extensions'=>'https://make.wordpress.org/hosting/handbook/handbook/server-environment/#php-extensions','Performance'=>'ئىقتىدارى','Your site has %1$d inactive theme, other than %2$s, your active theme.'=>'تور بېكىتىڭىزدە نۆۋەتتىكى %2$s ئۆرنەكتىن باشقا يەنە ئاكتىپلانمىغان %1$d ئۆرنەك بار.' . "\0" . 'تور بېكىتىڭىزدە نۆۋەتتىكى %2$s ئۆرنەكتىن باشقا يەنە ئاكتىپلانمىغان %1$d ئۆرنەك بار.','Your site has %1$d inactive theme, other than %2$s, the default WordPress theme, and %3$s, your active theme.'=>'تور بېكىتىڭىزدە كۆڭۈلدىكى WordPress ئۆرنىكى %2$s ۋە نۆۋەتتىكى %3$s ئۆرنەكتىن باشقا يەنە ئاكتىپلانمىغان %1$d ئۆرنەك بار.' . "\0" . 'تور بېكىتىڭىزدە كۆڭۈلدىكى WordPress ئۆرنىكى %2$s ۋە نۆۋەتتىكى %3$s ئۆرنەكتىن باشقا يەنە ئاكتىپلانمىغان %1$d ئۆرنەك بار.','You are using a %1$s drop-in which might mean that a %2$s database is not being used.'=>'تور بېكىتىڭىز %1$s كۈچەيتىلگەن قىستۇرما ئىشلىتىۋاتىدۇ، بۇ %2$s ساندانى ئىشلىتىلمىگەنلىكتىن دېرەك بېرىدۇ.','The WordPress Hosting Team maintains a list of those modules, both recommended and required, in <a href="%1$s" %2$s>the team handbook%3$s</a>.'=>'WordPress مۇلازىمېتىر قوشۇنى<a href="%1$s" %2$s>قوشۇن قوللانمىسى %3$s</a> دىكى تەۋسىيە قىلىنغان ۋە زۆرۈر بۆلەكلەر تىزىمىنى ئاسرايدۇ.','You should consider removing any unused themes to enhance your site&#8217;s security.'=>'ئىشلەتمىگەن ئۆرنەكنى چىقىرىۋېتىپ تور بېكىتىڭىزنىڭ بىخەتەرلىكىنى ياخشىلىشىڭىز تەۋسىيە قىلىنىدۇ.','Your site has %d inactive theme.'=>'بېكىتىڭىزدە %d ئاكتىپسىز ئۆرنەك بار.','Your site has %d inactive plugin.'=>'بېكىتىڭىزدە %d ئاكتىپسىز قىستۇرما بار.','Erase personal data list'=>'ئۆچۈرىدىغان شەخسىي سانلىق مەلۇمات تىزىمى','Erase personal data list navigation'=>'ئۆچۈرىدىغان شەخسىي سانلىق مەلۇمات تىزىمى يولباشچى','Export personal data list'=>'شەخسىي سانلىق مەلۇمات تىزىمىنى چىقار','Export personal data list navigation'=>'شەخسىي سانلىق مەلۇمات تىزىمى يولباشچىنى چىقار','Security'=>'بىخەتەرلىك','Filter erase personal data list'=>'ئۆچۈرىدىغان شەخسىي سانلىق مەلۇمات تىزىمىنى سۈزىدۇ','Filter export personal data list'=>'چىقىرىدىغان شەخسىي سانلىق مەلۇمات تىزىمىنى سۈزىدۇ','Inactive plugins are tempting targets for attackers. If you are not going to use a plugin, you should consider removing it.'=>'ئاكتىپلانمىغان قىستۇرما ھۇجۇمچىلارنى قىزىقتۇرىدىغان نىشان بولالايدۇ. ئەگەر قىستۇرمىنى ئىشلەتمىسىڭىز، ئۇنى چىقىرىۋېتىشنى ئويلىشىڭ.','There is a new version of %1$s available, but it does not work with your version of PHP. <a href="%2$s" %3$s>View version %4$s details</a> or <a href="%5$s">learn more about updating PHP</a>.'=>'%1$s نىڭ يېڭى نەشرى بار، ئەمما سىز ئىشلىتىۋاتقان PHP دە ئىشلىمەيدۇ. <a href="%2$s" %3$s>%4$s نەشىر تەپسىلاتى</a>نى كۆرۈڭ ياكى <a href="%5$s">PHP نى يېڭىلاش ھەققىدىكى تېخىمۇ كۆپ بىلدۈرگۈنى ئۆگىنىڭ</a>.','Go to the Themes screen'=>'ئۆرنەك ئېكرانىغا يۆتكىلىدۇ','These settings alter where and how parts of WordPress are loaded.'=>'بۇ تەڭشەكلەر WordPress نىڭ بۆلەكلىرىنىڭ قەيەردە ۋە قانداق يۈكلىنىدىغانلىقىنى ئۆزگەرتىدۇ.','This plugin failed to load properly and is paused during recovery mode.'=>'بۇ قىستۇرمىنى توغرا يۈكلىيەلمىدى، ئەسلىگە كەلتۈرۈش ھالىتىدە ۋاقىتلىق توختىتىلدى.','The size cannot be calculated. The directory is not accessible. Usually caused by invalid permissions.'=>'چوڭلۇقىنى ھېسابلىيالمىدى. مۇندەرىجىنى زىيارەت قىلغىلى بولمايدۇ. ئادەتتە بۇ خىل ئەھۋال ئىناۋەتسىز ئىجازەت تۈپەيلىدىن كېلىپ چىقىدۇ.','Total size is not available. Some errors were encountered when determining the size of your installation.'=>'تور بېكەت ئومۇمىي سىغىمىنى ئىشلەتكىلى بولمايدۇ. ئورنىتىشقا كېرەكلىك ئومۇمىي بوشلۇقنى ھېسابلاشتا خاتالىق كۆرۈلدى.','The directory size calculation has timed out. Usually caused by a very large number of sub-directories and files.'=>'مۇندەرىجە چوڭلۇقىنى ھېسابلاش ۋاقىت توشتى. ئادەتتە بۇ خىل ئەھۋال مۇندەرىجىدە تارماق مۇندەرىجە ۋە ھۆججەت بەك كۆپ بولغاندا يۈز بېرىدۇ.','Site Health Status'=>'بېكەت ساغلاملىق ھالىتى','Everything is running smoothly here.'=>'بۇ جايدا ھەممە ئىش ئوڭۇشلۇق ئىجرا بولۇۋاتىدۇ.','Great job!'=>'قالتىس ئىش!','%s recommended improvement'=>'%s  ياخشىلاشنى تەۋسىيە قىلدى' . "\0" . '%s  ياخشىلاشنى تەۋسىيە قىلدى','%s item with no issues detected'=>'%s  تۈردىن مەسىلە بايقالمىدى' . "\0" . '%s  تۈردىن مەسىلە بايقالمىدى','The site health check shows information about your WordPress configuration and items that may need your attention.'=>'بېكەت ساغلاملىق تەكشۈرۈشى سىزگە WordPress سەپلىمە ئۇچۇرى ۋە دىققەت قىلىشىڭىز زۆرۈر بولغان تۈرلەرنى كۆرسىتىدۇ.','Secondary menu'=>'ئىككىلەمچى تىزىملىك','Debugging enabled'=>'سازلاش قوزغىتىلغان','HTTP Requests'=>'HTTP ئىلتىماسى','Scheduled events'=>'كۈنتەرتىپتىكى پائالىيەتلەر','Secure communication'=>'بىخەتەر ئالاقە','HTTPS status'=>'HTTPS ھالىتى','MySQL utf8mb4 support'=>'MySQL utf8mb4 قوللاش','PHP Extensions'=>'PHP كېڭەيتىلمىسى','Database Server version'=>'ساندان مۇلازىمېتىر نەشرى','PHP Version'=>'PHP نەشرى','Theme Versions'=>'ئۆرنەك نەشرى','Plugin Versions'=>'قىستۇرما نەشرى','WordPress Version'=>'WordPress نەشرى','The REST API did not behave correctly'=>'REST API قىلمىشى توغرا ئەمەس','The REST API encountered an error'=>'REST API خاتالىققا يولۇقتى','No scheduled events exist on this site.'=>'بۇ تور بېكەتتە كۈنتەرتىپتىكى پائالىيەت مەۋجۇت ئەمەس.','REST API availability'=>'REST API ئىشلىتىشچانلىقى','Loopback request'=>'ئايلانما ئىنكاس ئىلتىماسى','The loopback request to your site completed successfully.'=>'تور بېكىتىڭىزگە يوللانغان ئايلانما ئىنكاس ئىلتىماسى مۇۋەپپەقىيەتلىك تاماملاندى.','The loopback request returned an unexpected http status code, %d, it was not possible to determine if this will prevent features from working as expected.'=>'تور بېكىتىڭىزنىڭ ئايلانما ئىنكاسى مۆلچەردىكىدىن باشقا http ھالەت كودى %d نى قايتۇردى، بۇ خىل ئىلتىماسقا تايىنىدىغان ئىقتىدارنىڭ ئويلىغاندەك ئىشلەيدىغان ياكى ئىشلىمەيدىغانلىقىنى جەزملىگىلى بولمايدۇ.','The loopback request to your site failed, this means features relying on them are not currently working as expected.'=>'تور بېكىتىڭىزنىڭ ئايلانما ئىنكاسى مەغلۇپ بولدى، بۇ خىل ئىلتىماسقا تايىنىدىغان ئىقتىدار ئويلىغاندەك ئىشلىمەسلىكى مۇمكىن.','The REST API did not process the %s query parameter correctly.'=>'بۇ REST API سۈرۈشتۈرۈش %s نىڭ پارامېتىرىنى توغرا بىر تەرەپ قىلالمىدى.','The REST API encountered an unexpected result'=>'REST API كۈتۈلمىگەن نەتىجىگە دۇچ كەلدى.','The REST API is one way that WordPress and other applications communicate with the server. For example, the block editor screen relies on the REST API to display and save your posts and pages.'=>'WordPress ۋە باشقا پىروگراممىلار مۇلازىمېتىر بىلەن ئالاقە قىلىشتا  REST API نى ئىشلىتىدۇ. مەسىلەن، بۆلەك تەھرىرلىگۈچ بېتى REST API غا تايىنىپ يازما ۋە بەتلىرىڭىزنى كۆرسىتىپ ۋە ساقلايدۇ.','HTTP requests are partially blocked'=>'HTTP ئىلتىماسى قىسمەن توسۇلغان','HTTP requests are blocked'=>'HTTP ئىلتىماسى توسۇلغان','The REST API is available'=>'REST API نى ئىشلەتكىلى بولىدۇ.','It is possible for site maintainers to block all, or some, communication to other sites and services. If set up incorrectly, this may prevent plugins and themes from working as intended.'=>'بېكەت ئاسرىغۇچىلىرى باشقا بېكەت ۋە مۇلازىمېتىرغا بارىدىغان بارلىق ياكى قىسمەن ئالاقىنى ئۈزۈۋېتەلەيدۇ. ئەگەر توغرا تەڭشەلمىسە، قىستۇرما ۋە ئۆرنەكلەر ئىشلىمەسلىكى مۇمكىن.','HTTP requests seem to be working as expected'=>'HTTP ئىلتىماسلىرى مۆلچەردىكىدەك ئىشلەۋاتقاندەك قىلىدۇ','Background updates may not be working properly'=>'ئارقا سۇپىدا يېڭىلاش توغرا ئىشلىمەسلىكى مۇمكىن','Background updates are not working as expected'=>'ئارقا سۇپىدا يېڭىلاش مۆلچەرلەنگەندەك ئىشلىمىدى','Passed'=>'ئۆتتى','Background updates are working'=>'ئارقا سۇپىدا يېڭىلاش ئىشلەۋاتىدۇ','A scheduled event has failed'=>'كۈنتەرتىپتىكى پائالىيەت مەغلۇپ بولدى','Your site can perform loopback requests'=>'تور بېكىتىڭىز ئايلانما ئىنكاس ئىلتىماسىنى ئىجرا قىلالايدۇ','Your site could not complete a loopback request'=>'تور بېكىتىڭىز ئايلانما ئىنكاس ئىلتىماسىنى تاماملىيالمىدى','Loopback requests are used to run scheduled events, and are also used by the built-in editors for themes and plugins to verify code stability.'=>'ئايلانما ئىنكاس ئىلتىماسى كۈنتەرتىپتىكى پائالىيەتلەرنى ئىجرا قىلىش ئۈچۈن ئىشلىتىلىدۇ، ئىچىدىكى تەھرىرلىگۈچ ئۇنى ئىشلىتىپ ئۆرنەك ۋە قىستۇرما كودىنىڭ مۇقىملىقىغا كاپالەتلىك قىلىدۇ.','Background updates ensure that WordPress can auto-update if a security update is released for the version you are currently using.'=>'WordPress يادرولۇق نەشرىنىڭ بىخەتەرلىك يېڭىلىنىشى ئېلان قىلىنغاندا، ئارقا سۇپىدا يېڭىلاش WordPress يادرولۇق نەشرىنىڭ ئۆزلۈكىدىن يېڭىلىنىشىغا كاپالەتلىك قىلىدۇ.','The scheduled event, %s, failed to run. Your site still works, but this may indicate that scheduling posts or automated updates may not work as intended.'=>'كۈنتەرتىپتىكى پائالىيەت %s نى ئىجرا قىلالمىدى. تور بېكىتىڭىز يەنىلا ئىشلەۋاتىدۇ ئەمما كۈنتەرتىپتىكى يازما ياكى ئۆزلۈكىدىن يېڭىلاش مۆلچەرلەنگەندىكىدەك ئىجرا بولماسلىقى مۇمكىن.','While trying to test your site&#8217;s scheduled events, the following error was returned: %s'=>'تور بېكىتىڭىزنىڭ كۈنتەرتىپتىكى پائالىيەتلىرىنى سىناۋاتقاندا، تۆۋەندىكى خاتالىقنى قايتۇردى: %s','It was not possible to check your scheduled events'=>'كۈنتەرتىپتىكى پائالىيەتلىرىڭىزنى تەكشۈرەلمەيدۇ','Scheduled events are what periodically looks for updates to plugins, themes and WordPress itself. It is also what makes sure scheduled posts are published on time. It may also be used by various plugins to make sure that planned actions are executed.'=>'كۈنتەرتىپتىكى پائالىيەت قىستۇرما، ئۆرنەك ۋە WordPress ئۆزىنىڭ يېڭىلىنىشى شۇنداقلا كۈنتەرتىپتىكى يازمىنىڭ ۋاقتىدا ئېلان قىلىنىشىنى قەرەللىك ھالدا تەكشۈرىدۇ. نۇرغۇن قىستۇرما كۈنتەرتىپتىكى پائالىيەت ئارقىلىق پىلانلانغان مەشغۇلاتنى ۋاقتىدا ئىجرا قىلىدۇ.','Scheduled events are running'=>'كۈنتەرتىپتىكى پائالىيەتلەر ئىجرا قىلىنىۋاتىدۇ','Your site can communicate securely with other services'=>'تور بېكىتىڭىز باشقا مۇلازىمەتلەر بىلەن بىخەتەر ئالاقە قىلالايدۇ','Learn more about why you should use HTTPS'=>'نېمە ئۈچۈن HTTPS ئىشلىتىش ھەققىدىكى تېخىمۇ كۆپ بىلدۈرگۈ','Your website does not use HTTPS'=>'تور بېكىتىڭىز HTTPS ئىشلەتمىگەن','Your site is unable to communicate securely with other services'=>'تور بېكىتىڭىز باشقا مۇلازىمەتلەر بىلەن بىخەتەر ئالاقە قىلالمايدۇ','Talk to your web host about OpenSSL support for PHP.'=>'تور بېكىتىڭىزنىڭ تور مۇلازىمەت تەمىنلىگۈچىسى بىلەن PHP دە OpenSSL قوللاش ھەققىدە سۆزلىشىڭ.','Your website is using an active HTTPS connection'=>'تور بېكىتىڭىز ئاكتىپ HTTPS باغلىنىشى ئىشلىتىۋاتىدۇ','Securely communicating between servers are needed for transactions such as fetching files, conducting sales on store sites, and much more.'=>'مۇلازىمېتىرلار ئارا بىخەتەر ئالاقە ھۆججەت يوللاش، تور بېكەت دۇكىنىدا سودا قىلىش قاتارلىق پائالىيەتلەر ئۈچۈن زۆرۈر.','You are accessing this website using HTTPS, but your <a href="%s">Site Address</a> is not set up to use HTTPS by default.'=>'بۇ تور بېكەتنى HTTPS ئارقىلىق زىيارەت قىلىۋاتىسىز، ئەمما كۆڭۈلدىكى ئەھۋالدا <a href="%s">بېكەت ئادرېسى</a>ڭىز تېخى HTTPS ئىشلىتىشكە تەڭشەلمەپتۇ.','Your site is set to display errors to site visitors'=>'تور بېكىتىڭىز زىيارەتچىلەرگە خاتالىقنى كۆرسىتىدىغان قىلىپ تەڭشەلدى','The value, %s, has been added to this website&#8217;s configuration file. This means any errors on the site will be written to a file which is potentially available to all users.'=>'قىممەت %s تور بېكەت سەپلىمە ھۆججىتىگە قوشۇلدى. بۇنداق بولغاندا تور بېكىتىڭىزدە خاتالىق يۈز بەرسە ھەممە ئىشلەتكۈچى كۆرەلىشى مۇمكىن بولغان ئاشكارا ھۆججەتكە يېزىلىدۇ.','Your site is set to log errors to a potentially public file'=>'تور بېكىتىڭىز خاتالىق كۈندىلىك خاتىرىسىنى ئاشكارا ئوقۇپ يازغىلى بولىدىغان ھۆججەتكە يېزىشقا تەڭشەلدى.','Debug mode is often enabled to gather more details about an error or site failure, but may contain sensitive information which should not be available on a publicly available website.'=>'سازلاش ھالىتى مەلۇم بىر خاتالىق ياكى تور بېكەت ئىقتىدارىنىڭ تەپسىلىي ئۇچۇرىغا ئېرىشىشكە ئىشلىتىلىدۇ، ئەمما تور بېكەتتە ئاشكارىلاشقا بولمايدىغان سەزگۈر ئۇچۇرلارنى ئۆز ئىچىگە ئېلىشى مۇمكىن.','Your site is not set to output debug information'=>'تور بېكىتىڭىزدە سازلاش ئۇچۇرىنى چىقىرىش تەڭشەلمىگەن','Could not reach WordPress.org'=>'WordPress.org غا ئۇلىشالمىدى','Can communicate with WordPress.org'=>'WordPress.org بىلەن ئالاقە قىلالايدۇ','utf8mb4 requires a newer client library'=>'utf8mb4 يېڭىلانغان خېرىدار ئامبىرىغا ئېھتىياجلىق','Your MariaDB version supports utf8mb4.'=>'سىزنىڭ MariaDB نەشرىڭىز utf8mb4 نى قوللايدۇ.','Your MySQL version supports utf8mb4.'=>'سىزنىڭ MySQL نەشرىڭىز utf8mb4 نى قوللايدۇ.','utf8mb4 requires a MySQL update'=>'utf8mb4 نىڭ تەلىپى MySQL يېڭىلاش.','utf8mb4 requires a MariaDB update'=>'utf8mb4 نىڭ تەلىپى MariaDB يېڭىلاش.','Severely outdated SQL server'=>'SQL مۇلازىمېتىر نەشرى بەك كونا','UTF8MB4 is supported'=>'UTF8MB4 نى قوللايدۇ','Your site is unable to reach WordPress.org at %1$s, and returned the error: %2$s'=>'تور بېكىتىڭىز %1$s دىكى WordPress.org بىلەن باغلىنالمىدى، قايتۇرغان خاتالىق: %2$s','Communicating with the WordPress servers is used to check for new versions, and to both install and update WordPress core, themes or plugins.'=>'WordPress مۇلازىمېتىر بىلەن ئالاقە قىلىشنىڭ مەقسىتى يېڭى نەشرى بار يوقلۇقىنى تەكشۈرۈش، WordPress يادروسى، ئۆرنەك ياكى قىستۇرما ئورنىتىش، يېڭىلاش ئۈچۈندۇر.','WordPress requires %1$s version %2$s or higher. Contact your web hosting company to correct this.'=>'WordPress ئۈچۈن %1$s نىڭ %2$s نەشرى ياكى ئۇنىڭدىن يۇقىرى نەشرىنى تەلەپ قىلىدۇ. تور بېكەت مۇلازىمىتى تەمىنلىگۈچى بىلەن ئالاقىلىشىپ بۇ مەسىلىنى تۈزىتىڭ.','For optimal performance and security reasons, you should consider running %1$s version %2$s or higher. Contact your web hosting company to correct this.'=>'ئەڭ ياخشى ئۈنۈم ۋە بىخەتەرلىك سەۋەبىدىن، %1$s نىڭ %2$s نەشرى ياكى ئۇنىڭدىن يۇقىرى نەشرىنى ئىشلىتىش تەۋسىيە قىلىنىدۇ. تور بېكەت مۇلازىمىتى تەمىنلىگۈچى بىلەن ئالاقىلىشىپ بۇ مەسىلىنى تۈزىتىڭ.','Outdated SQL server'=>'SQL مۇلازىمېتىر نەشرى كونا','One or more required modules are missing'=>'بىر ياكى بىر قانچە زۆرۈر بۆلەك كەم','One or more recommended modules are missing'=>'بىر ياكى بىر قانچە زۆرۈر تەۋسىيەلىك بۆلەك كەم','The optional module, %s, is not installed, or has been disabled.'=>'تاللانما بۆلەك %s ئورنىتىلمىغان ياكى چەكلەنگەن.','The required module, %s, is not installed, or has been disabled.'=>'زۆرۈر بۆلەك %s ئورنىتىلمىغان ياكى چەكلەنگەن.','Error'=>'خاتالىق','SQL server is up to date'=>'SQL مۇلازىمېتىر نەشرى ئەڭ يېڭى','Have a default theme available'=>'كۆڭۈلدىكى ئۆرنەك بار','Required and recommended modules are installed'=>'زۆرۈر ۋە تەۋسىيە قىلىنغان بۆلەكلەر ئورنىتىلدى','Your site does not have any default theme. Default themes are used by WordPress automatically if anything is wrong with your chosen theme.'=>'تور بېكىتىڭىزنىڭ كۆڭۈلدىكى ئۆرنىكى يوق. ئۆرنىكىڭىز بىرەر مەسىلىگە يولۇقسا، WordPress ئۆزلۈكىدىن كۆڭۈلدىكى ئۆرنەكنى ئىشلىتىدۇ.','To enhance your site&#8217;s security, you should consider removing any themes you are not using. You should keep %1$s, the default WordPress theme, %2$s, your active theme, and %3$s, its parent theme.'=>'تور بېكەتنىڭ بىخەتەرلىكىنى ئاشۇرۇش ئۈچۈن ئىشلەتمەيدىغان ھەر قانداق ئۆرنەكنى چىقىرىۋېتىش تەۋسىيە قىلىنىدۇ. WordPress نىڭ كۆڭۈلدىكى ئۆرنىكى %1$s نى ، نۆۋەتتىكى ئۆرنەك %2$s ۋە ئۇنىڭ ئانا ئۆرنىكى %3$s نى ساقلاپ قېلىڭ.','To enhance your site&#8217;s security, you should consider removing any themes you are not using. You should keep your active theme, %1$s, and %2$s, its parent theme.'=>'تور بېكەتنىڭ بىخەتەرلىكىنى ئاشۇرۇش ئۈچۈن ئىشلەتمەيدىغان ھەر قانداق ئۆرنەكنى چىقىرىۋېتىش تەۋسىيە قىلىنىدۇ. نۆۋەتتىكى ئاكتىپ ئۆرنەك %1$s  ۋە ئۇنىڭ ئانا ئۆرنىكى %2$s نى ساقلاپ قېلىڭ.','You should remove inactive plugins'=>'ئاكتىپسىز قىستۇرمىلارنى چىقىرىۋەتكىنىڭىز تۈزۈك','You have themes waiting to be updated'=>'ئۆرنەكلىرىڭىز يېڭىلاشنى كۈتۈۋاتىدۇ','Your site has %d installed theme, and it is up to date.'=>'بېكىتىڭىزگە %d ئۆرنەك ئۆرنىتىلغان بولۇپ، ھەممىسى ئەڭ يېڭى نەشرى.' . "\0" . 'بېكىتىڭىزگە %d ئۆرنەك ئۆرنىتىلغان بولۇپ، ھەممىسى ئەڭ يېڭى نەشرى.','Your site has %d theme waiting to be updated.'=>'بېكىتىڭىزدە %d ئۆرنەك يېڭىلاشنى كۈتۈۋاتىدۇ.' . "\0" . 'بېكىتىڭىزدە %d ئۆرنەك يېڭىلاشنى كۈتۈۋاتىدۇ.','Themes add your site&#8217;s look and feel. It&#8217;s important to keep them up to date, to stay consistent with your brand and keep your site secure.'=>'ئۆرنەك تور بېكىتىڭىزگە ھۆسۈن ۋە يېڭى تۇيغۇ قوشىدۇ. ئۆرنەكنى يېڭىلاپ تۇرۇش، تور بېكەت ماركىسىنىڭ روھى ۋە  تور بېكىتىڭىزنىڭ بىخەتەرلىكى ئۈچۈن ئىنتايىن مۇھىم.','Your themes are all up to date'=>'ئۆرنەكلىرىڭىزنىڭ ھەممىسى ئەڭ يېڭى ھالەتتە','You have plugins waiting to be updated'=>'قىستۇرمىلىرىڭىز يېڭىلاشنى كۈتۈۋاتىدۇ','Your site has %d active plugin, and it is up to date.'=>'بېكىتىڭىزگە %d ئاكتىپ قىستۇرما ئۆرنىتىلغان بولۇپ، ھەممىسى ئەڭ يېڭى نەشرى.' . "\0" . 'بېكىتىڭىزگە %d ئاكتىپ قىستۇرما ئۆرنىتىلغان بولۇپ، ھەممىسى ئەڭ يېڭى نەشرى.','Your site has %d plugin waiting to be updated.'=>'بېكىتىڭىزدە %d قىستۇرما يېڭىلاشنى كۈتۈۋاتىدۇ.' . "\0" . 'بېكىتىڭىزدە %d قىستۇرما يېڭىلاشنى كۈتۈۋاتىدۇ.','Plugins extend your site&#8217;s functionality with things like contact forms, ecommerce and much more. That means they have deep access to your site, so it&#8217;s vital to keep them up to date.'=>'قىستۇرما تور بېكىتىڭىزگە يېڭى ئىقتىدار قوشىدۇ، مەسىلەن، ئالاقىداش جەدۋىلى، ئېلېكترونلۇق سودا ۋە باشقىلار. بۇ قىستۇرمىلارنىڭ تور بېكىتىڭىزنى زىيارەت قىلىش ھوقۇقىنىڭ يۇقىرىلىقىنى بىلدۈرىدۇ، شۇڭا ئەڭ يېڭى نەشرى بولۇشىغا كاپالەتلىك قىلىش بەك مۇھىم.','Your plugins are all up to date'=>'قىستۇرمىلىرىڭىزنىڭ ھەممىسى ئەڭ يېڭى ھالەتتە','You are currently running the latest version of WordPress available, keep it up!'=>'تور بېكىتىڭىزدە WordPress نىڭ ئەڭ يېڭى نەشرى ئىجرا قىلىنىۋېتىپتۇ، يېڭىلاپ تۇرۇڭ!','A new minor update is available for your site. Because minor updates often address security, it&#8217;s important to install them.'=>'تور بېكىتىڭىزنى يېڭىلاشقا ماس كېلىدىغان ئازراق يېڭىلانغان نەشرى بار. چۈنكى ئازراق يېڭىلانغان نەشرى ئادەتتە بىخەتەرلىك مەسىلىلىرىنى ھەل قىلىدۇ، شۇڭا بۇ نەشرىنى ئورنىتىش بېكىتىڭىزنىڭ بىخەتەرلىكى ئۈچۈن مۇھىم.','A new version of WordPress is available.'=>'WordPress نىڭ يېڭى نەشرى بار.','Install the latest version of WordPress'=>'WordPress نىڭ ئەڭ يېڭى نەشرىنى ئورنىتىش','WordPress update available (%s)'=>'WordPress نىڭ يېڭىلىنىشى بار(%s).','Check for updates manually'=>'يېڭىلانمىلارنى قولدا تەكشۈر','WordPress security and maintenance releases are blocked by the %s filter.'=>'WordPress بىخەتەرلىك ۋە ئاسراش تارقىتىشىنى %s سۈزگۈچ توسۇۋالدى.','WordPress security and maintenance releases are blocked by %s.'=>'WordPress بىخەتەرلىك ۋە ئاسراش تارقىتىشىنى %s توسۇۋالدى.','WordPress development updates are blocked by the %s filter.'=>'WordPress ئىجادىيەت يېڭىلىنىشىنى %s سۈزگۈچ توسۇۋالدى.','All of your WordPress files are writable.'=>'WordPress ھۆججەتلىرىڭىزنىڭ ھەممىسىگە يېزىشقا بولىدۇ.','Some files are not writable by WordPress:'=>'WordPress بەزى ھۆججەتلەرگە يازالمايدۇ:','No version control systems were detected.'=>'ھېچقانداق يېڭى نەشر باشقۇرۇش سىستېمىسى بايقالمىدى.','The error code was %s.'=>'خاتالىق كودى %s.','You would have received an email because of this.'=>'مۇشۇ سەۋەبتىن ئېلخەت تاپشۇرۇۋالغان بولاتتىڭىز.','The %s filter is enabled.'=>'%s سۈزگۈچ قوزغىتىلدى.','The must use plugins directory'=>'ئىشلىتىش زۆرۈر قىستۇرما مۇندەرىجىسى','Theme features'=>'ئۆرنەك ئىقتىدارلىرى','Parent theme'=>'ئاتا ئۆرنەك','Author website'=>'يازغۇچى تور بېكىتى','(Latest version: %s)'=>'(يېڭى نەشرى: %s)','No version or author information is available.'=>'ھېچقانداق نەشر ياكى يازغۇچى ئۇچۇرى يوق.','Server version'=>'مۇلازىمېتىر نەشرى','Extension'=>'كېڭەيتىلمە','cURL version'=>'cURL نەشرى','Unable to determine some settings, as the %s function has been disabled.'=>'بەزى تەڭشەكلەرنى جەزملىيەلمىدى، %s فونكسىيەسى سۈپىتىدە چەكلەندى.','Server settings'=>'مۇلازىمېتىر تەڭشىكى','PHP SAPI'=>'PHP SAPI','(Does not support 64bit values)'=>'(64 بىتلىق قىممەتنى قوللىمايدۇ)','(Supports 64bit values)'=>'(64 بىتلىق قىممەتنى قوللايدۇ)','PHP version'=>'PHP نەشرى','Unable to determine what web server software is used'=>'قانداق تور مۇلازىمېتىر يۇمشاق دېتالى ئىشلىتىلگەنلىكىنى جەزملىيەلمىدى','Web server'=>'تور مۇلازىمېتىرى','Unable to determine server architecture'=>'مۇلازىمېتىر قۇرۇلمىسىنى جەزملىيەلمىدى','Server architecture'=>'مۇلازىمېتىر قۇرۇلمىسى','Ghostscript version'=>'Ghostscript نەشرى','Unable to determine if Ghostscript is installed'=>'Ghostscript ئورنىتىلغانلىقىنى جەزملىيەلمىدى.','GD version'=>'GD نەشرى','Imagick Resource Limits'=>'Imagick مەنبە چەكلىمىسى','ImageMagick version string'=>'ImageMagick نەشر تىزىقى','ImageMagick version number'=>'ImageMagick نەشر نومۇرى','Not available'=>'ئىشلەتكىلى بولمايدۇ','Active editor'=>'ئاكتىپ تەھرىرلىگۈچ','WordPress development updates are blocked by the %s constant.'=>'WordPress ئىجادىيەت يېڭىلىنىشىنى %s تۇراقلىق مىقدار توسۇۋالدى.','.htaccess rules'=>'.htaccess قائىدىسى','Is SUHOSIN installed?'=>'SUHOSIN ئورنىتىلغانمۇ؟','PHP memory limit'=>'PHP ئەسلەك چېكى','PHP time limit'=>'PHP ۋاقىت چېكى','Your %s file contains only core WordPress features.'=>'سىزنىڭ %s ھۆججىتىڭىز يادرولۇق WordPress ئىقتىدارلىرىنىلا ئۆز ئىچىگە ئالغان.','Custom rules have been added to your %s file.'=>'ئىختىيارىي قائىدە %s ھۆججىتىڭىزگە قوشۇلدى.','Is the Imagick library available?'=>'Imagick ئامبىرىنى ئىشلەتكىلى بولامدۇ يوق؟','PHP post max size'=>'PHP يازما چوڭلۇق چېكى','Upload max filesize'=>'يۈكلەيدىغان ھۆججەتنىڭ چوڭلۇق چېكى','Max input time'=>'ئەڭ ئۇزۇن يۈكلەش ۋاقتى','PHP max input variables'=>'PHP ئەڭ چوڭ كىرگۈزۈش ئۆزگەرگۈچىسى','Version %1$s by %2$s'=>'%1$s نەشرى، يازغۇچى %2$s','Unable to check if any new versions of WordPress are available.'=>'يېڭى نەشرىدىكى WordPress نەشرى بار يوقلۇقىنى تەكشۈرەلمىدى.','This could mean that connections are failing to WordPress.org.'=>'بۇ WordPress.org غا باغلىنالمىغانلىقىنى بىلدۈرۈشى مۇمكىن.','Couldn\'t retrieve a list of the checksums for WordPress %s.'=>'WordPress %s نىڭ تەكشۈرۈش تىزىمىغا ئېرىشەلمىدى.','Your installation of WordPress does not require FTP credentials to perform updates.'=>'سىز ئورناتقان WordPress تە FTP كىنىشكىسى ئارقىلىق يېڭىلاش ھاجەتسىز.','(Your site is performing updates over FTP due to file ownership. Talk to your hosting company.)'=>'(ھۆججەت ئىگىدارلىق ھوقۇقى سەۋەبىدىن، ھازىر تور بېكىتىڭىز FTP ئارقىلىق يېڭىلىنىدۇ. مۇلازىمېتىر تەمىنلىگۈچى شىركىتىڭىز بىلەن ئالاقىلىشىڭ.)','Your installation of WordPress prompts for FTP credentials to perform updates.'=>'سىز ئورناتقان WordPress تە FTP كىنىشكىسى ئارقىلىق يېڭىلاش كېرەك.','The folder %1$s was detected as being under version control (%2$s).'=>'مۇندەرىجە %1$s نەشر كونترول (%2$s) قىلىنىدىغانلىقى بايقالدى.','The folder %1$s was detected as being under version control (%2$s), but the %3$s filter is allowing updates.'=>'مۇندەرىجە %1$s نەشر كونترول (%2$s) قىلىنىدىغانلىقى بايقالدى. ئەمما %3$s سۈزگۈچ يېڭىلاشقا يول قويدى.','A plugin has prevented updates by disabling %s.'=>'بىر قىستۇرما %s نى چەكلەپ يېڭىلاشنىڭ ئالدىنى ئالدى.','A previous automatic background update could not occur.'=>'ئالدىنقى قېتىم ئارقا سۇپىدا ئۆزلۈكىدىن يېڭىلاش ئوڭۇشلۇق ئىجرا قىلىنمىغان.','When you\'ve been able to update using the "Update now" button on Dashboard > Updates, this error will be cleared for future update attempts.'=>'باشقۇرۇش تاختىسى › يېڭىلاشتىن «ھازىر يېڭىلا» توپچىنى چېكىپ يېڭىلىغاندا، بۇ خاتالىق تازىلىنىپ كېيىنكى يېڭىلاشنى سىناشقا قۇلايلىق يارىتىدۇ.','A previous automatic background update ended with a critical failure, so updates are now disabled.'=>'ئالدىنقى قېتىملىق ئارقا سۇپىدا ئۆزلۈكىدىن يېڭىلاش ئەجەللىك خاتالىققا يولۇققان، شۇڭلاشقا ھازىر يېڭىلاش چەكلەنگەن.','Total installation size'=>'ئومۇمىي ئورنىتىش چوڭلۇقى','Database size'=>'ساندان چوڭلۇقى','WordPress directory size'=>'WordPress مۇندەرىجە چوڭلۇقى','WordPress directory location'=>'WordPress مۇندەرىجە ئورنى','Plugins directory size'=>'قىستۇرما مۇندەرىجە چوڭلۇقى','Plugins directory location'=>'قىستۇرما مۇندەرىجە ئورنى','Themes directory size'=>'ئۆرنەك مۇندەرىجە چوڭلۇقى','Theme directory location'=>'ئۆرنەك مۇندەرىجە ئورنى','Uploads directory size'=>'يۈكلەنمە مۇندەرىجە چوڭلۇقى','Uploads directory location'=>'يۈكلەنمە مۇندەرىجە ئورنى','WordPress.org is reachable'=>'WordPress.org غا باغلىنالايدۇ','Communication with WordPress.org'=>'WordPress.org بىلەن ئالاقە قىلالايدۇ','Network count'=>'تور سانى','Site count'=>'بېكەت سانى','User count'=>'ئىشلەتكۈچى سانى','The themes directory'=>'ئۆرنەك مۇندەرىجىسى','The plugins directory'=>'قىستۇرما مۇندەرىجىسى','The uploads directory'=>'يۈكلەنمە مۇندەرىجىسى','The wp-content directory'=>'WordPress مەزمۇن مۇندەرىجىسى','Not writable'=>'يېزىلماس','Writable'=>'يېزىلىشچان','The main WordPress directory'=>'ئاساسىي WordPress مۇندەرىجىسى','Filesystem Permissions'=>'ھۆججەت سىستېما ئىجازەتلىرى','Undefined'=>'ئېنىقلىمىسىز','WordPress Constants'=>'WordPress تۇراقلىق مىقدارلىرى','Database'=>'ساندان','Server'=>'مۇلازىمېتىر','Inactive Plugins'=>'ئاكتىپسىز قىستۇرما','Active Plugins'=>'ئاكتىپ قىستۇرما','Must Use Plugins'=>'ئىشلىتىش زۆرۈر قىستۇرما','Active Theme'=>'ئاكتىپ ئۆرنەك','Unable to reach WordPress.org at %1$s: %2$s'=>'%1$s دىكى WordPress.org غا باغلىنالمىدى: %2$s','Media Handling'=>'ۋاسىتە بىر تەرەپ قىلىش','Shows whether WordPress is able to write to the directories it needs access to.'=>'WordPress نىڭ زۆرۈر بولغان مۇندەرىجىگە يازالايدىغان ياكى يازالمايدىغانلىقىنى كۆرسىتىدۇ.','The options shown below relate to your server setup. If changes are required, you may need your web host&#8217;s assistance.'=>'تۆۋەندە كۆرسىتىلگەن تاللانمىلار مۇلازىمېتىر تەڭشىكىڭىز بىلەن مۇناسىۋەتلىك. ئەگەر ئۆزگەرتىش زۆرۈر بولسا، تور بېكەت مۇلازىمىتى بىلەن تەمىنلىگۈچىنىڭ ياردىمىگە ئېھتىياجلىق بولۇشىڭىز مۇمكىن.','Directories and Sizes'=>'مۇندەرىجە ۋە چوڭلۇقى','Is this a multisite?'=>'بۇ كۆپ تور بېكەتمۇ؟','Default comment status'=>'كۆڭۈلدىكى ئىنكاس ھالىتى','Can anyone register on this site?'=>'بىرەرسى بۇ تور بېكەتكە تىزىملىتالامدۇ؟','Is this site using HTTPS?'=>'بۇ تور بېكەت HTTPS ئىشلىتىۋاتامدۇ؟','No permalink structure set'=>'ئۆزگەرمەس ئۇلانما