ef="%s">WordPress Planet</a>.'=>'<strong>WordPress پائالىيەت ۋە خەۋەرلەر</strong> &mdash; ئەتراپىڭىزدىكى پائالىيەت، WordPress قۇرۇلۇشى ۋە <a href="%s">WordPress Planet</a>نىڭ ئەڭ يېڭى ئۇچۇرلىرىنى كۆرسىتىدۇ.','You cannot update because <a href="%1$s">WordPress %2$s</a> requires MySQL version %3$s or higher. You are running version %4$s.'=>'يېڭىلىيالمايسىز چۈنكى <a href="%1$s">WordPress %2$s</a> ئۈچۈن MySQL نىڭ نەشرى %3$s ياكى ئۇنىڭدىن يۇقىرى بولۇشىنى تەلەپ قىلىدۇ. ئىشلىتىۋاتقىنىڭىز %4$s نەشرى ئىكەن.','You cannot update because <a href="%1$s">WordPress %2$s</a> requires PHP version %3$s or higher. You are running version %4$s.'=>'يېڭىلىيالمايسىز چۈنكى <a href="%1$s">WordPress %2$s</a> ئۈچۈن PHP نىڭ نەشرى %3$s ياكى ئۇنىڭدىن يۇقىرى بولۇشىنى تەلەپ قىلىدۇ. ئىشلىتىۋاتقىنىڭىز %4$s نەشرى ئىكەن.','Add menu items'=>'تىزىملىك ​​تۈرى قوش','Click the Save Menu button to save your changes.'=>'ئۆزگىرىشلەرنى ساقلاش ئۈچۈن تىزىملىكتىن ساقلا توپچىسى چېكىلىدۇ.','Create your first menu below.'=>'تۆۋەندە تۇنجى تىزىملىكىڭىزنى قۇرۇڭ.','Edit your menu below, or <a href="%s">create a new menu</a>. Do not forget to save your changes!'=>'تۆۋەندىكى تىزىملىكنى تەھرىرلەڭ ياكى <a href="%s">يېڭى تىزىملىك قۇر</a>ۇڭ. ئۆزگىرىشلەرنى ساقلاشنى ئۇنتۇماڭ!','or <a href="%s">create a new menu</a>. Do not forget to save your changes!'=>'ياكى <a href="%s">يېڭى تىزىملىك قۇر</a>ۇڭ. ئۆزگىرىشلەرنى ساقلاشنى ئۇنتۇماڭ!','Fill in the Menu Name and click the Create Menu button to create your first menu.'=>'تىزىملىك ئىسمىنى تولدۇرۇپ تىزىملىك قۇر توپچىنى چېكىپ تۇنجى تىزىملىكىڭىزنى قۇرۇڭ.','You cannot install because <a href="%1$s">WordPress %2$s</a> requires MySQL version %3$s or higher. You are running version %4$s.'=>'ئورنىتالمايسىز چۈنكى <a href="%1$s">WordPress %2$s</a> ئۈچۈن MySQL نىڭ نەشرى %3$s ياكى ئۇنىڭدىن يۇقىرى بولۇشىنى تەلەپ قىلىدۇ. ئىشلىتىۋاتقىنىڭىز %4$s نەشرى ئىكەن.','You cannot install because <a href="%1$s">WordPress %2$s</a> requires PHP version %3$s or higher. You are running version %4$s.'=>'ئورنىتالمايسىز چۈنكى <a href="%1$s">WordPress %2$s</a> ئۈچۈن PHP نىڭ نەشرى %3$s ياكى ئۇنىڭدىن يۇقىرى بولۇشىنى تەلەپ قىلىدۇ. ئىشلىتىۋاتقىنىڭىز %4$s نەشرى ئىكەن.','Learn more about updating PHP'=>'PHP نى يېڭىلاش ھەققىدىكى تەپسىلاتلار','What is PHP and how does it affect my site?'=>'PHP دېگەن نېمە؟ ئۇ تور بېكىتىمگە قانداق تەسىر كۆرسىتىدۇ؟','PHP Update Required'=>'PHP يېڭىلاش زۆرۈر','One or more plugins failed to load properly.'=>'بىر ياكى بىر نەچچە قىستۇرمىنى توغرا يۈكلىيەلمىدى.','Could not resume the plugin.'=>'بۇ قىستۇرمىنى ئەسلىگە كەلتۈرەلمىدى.','Could not remove the old translation.'=>'كونا تەرجىمىنى چىقىرىۋېتەلمىدى.','Removing the old version of the translation&#8230;'=>'كونا نەشرىنىڭ تەرجىمىسىنى چىقىرىۋېتىۋاتىدۇ…','<a href="%s" target="_parent">Click here to update WordPress</a>.'=>'<a href="%s" target="_parent"> WordPress نى يېڭىلاش ئۈچۈن بۇ يەرنى چېكىڭ</a>.','Add to: %s'=>'قوشۇش: %s','Track %s.'=>'ئۈن ئىزى %s','Custom PHP fatal error handler.'=>'ئىختىيارى PHP ئەجەللىك خاتالىقىنى بىر تەرەپ قىلغۇچى.','Custom PHP error message.'=>'ئىختىيارى PHP خاتالىق ئۇچۇرى.','Add widget: %s'=>'ئەپچە قوش: %s','You can find more details and make changes on the Plugins screen.'=>'قىستۇرمىلار ئېكرانىدا تېخىمۇ كۆپ تەپسىلاتلارنى تاپالايسىز ۋە ئۆزگەرتەلەيسىز.','<strong>Error:</strong> This plugin <strong>requires a newer version of PHP</strong>.'=>'<strong>خاتالىق:</strong> بۇ قىستۇرما <strong>يېڭىراق نەشرىدىكى WordPress نى تەلەپ قىلىدۇ</strong>.','<strong>Error:</strong> This plugin <strong>requires a newer version of WordPress</strong>.'=>'<strong>خاتالىق:</strong> بۇ قىستۇرما <strong>يېڭىراق نەشرىدىكى WordPress نى تەلەپ قىلىدۇ</strong>.','<a href="%s" target="_blank">Click here to learn more about updating PHP</a>.'=>'<a href="%s" target="_blank">بۇ جاينى چېكىپ PHP نى يېڭىلاش ھەققىدىكى تەپسىلاتنى ئۆگىنىڭ</a>.','My Network'=>'تورۇم','This plugin does not work with your version of PHP.'=>'بۇ قىستۇرما PHP نەشرىڭىزدە ئىشلىمەيدۇ.','This plugin does not work with your version of WordPress.'=>'بۇ قىستۇرما WordPress نەشرىڭىزدە ئىشلىمەيدۇ.','This plugin does not work with your versions of WordPress and PHP.'=>'بۇ قىستۇرما WordPress ۋە PHP نەشرىڭىزدە ئىشلىمەيدۇ.','https://wordpress.org/documentation/wordpress-version/version-%s/'=>'https://wordpress.org/documentation/wordpress-version/version-%s/','Resume'=>'داۋاملاشتۇر','pluginResume %s'=>'%s نى داۋاملاشتۇر','You can find more details and make changes on the Themes screen.'=>'ئۆرنەك ئېكرانىدا تېخىمۇ كۆپ تەپسىلاتلارنى تاپالايسىز ۋە ئۆزگەرتەلەيسىز.','One or more themes failed to load properly.'=>'بىر ياكى بىر نەچچە ئۆرنەكنى توغرا يۈكلىيەلمىدى.','Could not resume the theme.'=>'ئۆرنەكنى داۋاملاشتۇرالمىدى.','Deleting a category does not delete the posts in that category. Instead, posts that were only assigned to the deleted category are set to the default category %s. The default category cannot be deleted.'=>'سەھىپەلەرنى ئۆچۈرۈش بۇ سەھىپىدىكى يازمىلارنى ئۆچۈرۈش دىگەنلىك ئەمەس. ئەمما سەھىپە ئۆچۈرۈلگەندىن كېيىن، بۇ سەھىپىگىلا ئائىت يازمىلار %s سەھىپىگە ئائىت قىلىنىدۇ. كۆڭۈلدىكى سەھىپىنى ئۆچۈرگىلى بولمايدۇ.','The block widgets require JavaScript. Please enable JavaScript in your browser settings, or install the <a href="%s">Classic Widgets plugin</a>.'=>'بۆلەك ئەپچە JavaScript نى تەلەپ قىلىدۇ. توركۆرگۈ تەڭشىكىڭىزدىن JavaScript نى قوزغىتىڭ ياكى <a href="%s">ئەنئەنىۋى ئەپچە قىستۇرمىسى</a>نى ئورنىتىڭ.','A post type mismatch has been detected.'=>'يازما تىپى ماسلاشماسلىق بايقالدى.','A post ID mismatch has been detected.'=>'يازما كىملىكى ماسلاشماسلىق بايقالدى.','Please open the <a href="%s">classic editor</a> to use this meta box.'=>'بۇ مېتا قۇتىسىنى ئىشلىتىش ئۈچۈن <a href="%s">ئەنئەنىۋى تەھرىرلىگۈچ</a>نى ئېچىڭ.','Please activate the <a href="%s">Classic Editor plugin</a> to use this meta box.'=>'بۇ مېتا قۇتىسىنى ئىشلىتىش ئۈچۈن <a href="%s">ئەنئەنىۋى تەھرىرلىگۈچ قىستۇرما</a>نى ئاكتىپلاڭ.','Please install the <a href="%s">Classic Editor plugin</a> to use this meta box.'=>'بۇ مېتا قۇتىسىنى ئىشلىتىش ئۈچۈن <a href="%s">ئەنئەنىۋى تەھرىرلىگۈچ قىستۇرما</a>نى ئورنىتىڭ.','This meta box is not compatible with the block editor.'=>'بۇ مېتا قۇتىسى بۆلەك تەھرىرلىگۈچ بىلەن ماسلاشمايدۇ.','The 4th Freedom'=>'4-ئەركىنلىك','To distribute copies of your modified versions to others.'=>'سىز ئۆزگەرتكەن نەشرىڭىزنىڭ كۆپەيتىلمىسىنى باشقىلارغا تارقىتالايسىز.','To redistribute.'=>'قايتا تارقىتالايسىز.','The 3rd Freedom'=>'3-ئەركىنلىك','To study how the program works and change it to make it do what you wish.'=>'پىروگراممىنىڭ قانداق ئىشلەيدىغانلىقىنى تەتقىق قىلىپ، ئۇنى ئۆزگەرتىپ، ئارزۇيىڭىز بويىچە ئىجرا قىلالايسىز.','The 2nd Freedom'=>'2-ئەركىنلىك','To run the program for any purpose.'=>'پىروگراممىنى ھەر قانداق مەقسەتتە ئىجرا قىلغىلى بولىدۇ.','The 1st Freedom'=>'1-ئەركىنلىك','Created'=>'قۇرغان','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!'=>'WordPress كە خۇش كېلىپسىز. بۇ تۇنجى يازمىڭىز. ئۇنى تەھرىرلەپ ياكى ئۆچۈرۈڭ، ئاندىن يېزىشنى باشلاڭ!','As a new WordPress user, you should go to <a href="%s">your dashboard</a> to delete this page and create new pages for your content. Have fun!'=>'WordPress نىڭ يېڭى ئىشلەتكۈچىسى بولۇش سۈپىتىڭىز بىلەن، <a href="%s">باشقۇرۇش تاختىسى</a>غا يۆتكىلىپ، بۇ بەتنى ئۆچۈرۈپ، ئاندىن ئۆزىڭىزنىڭ مەزمۇنىدىكى يېڭى بەت قۇرۇڭ. خۇشاللىق يار بولغاي!','The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.'=>'XYZ Doohickey شىركىتى 1971-قۇرۇلغان بولۇپ، شۇ ۋاقىتتىن باشلاپ جامائەتكە سۈپەتلىك doohickeys تەمىنلەۋاتىدۇ. شىركەتنىڭ ئورنى گوتام شەھىرىدە، 2000 دىن ئارتۇق خىزمەتچىسى بار، گوتام جامائىتى ئۈچۈن قالتىس ئىشلارنى قىلىدۇ.','...or something like this:'=>'… ياكى مۇنداق:','Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)'=>'سالام! مەن كۈندۈزى داڭلىق چىشچى، كېچىسى ئۇستا ئەلنەغمىچى. بۇ مېنىڭ تور بېكىتىم. تەڭرىتاغدا ياشايمەن، بىر توپ پادام بار، بەزىدە دۇتتار تەمبۇر چېلىپ، مۇقام غەزەل توۋلاپمۇ قويىمەن.','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:'=>'بۇ مىسال بەت. بەت بىلەن بىلوگ يازمىسى پەرقلىق بولۇپ، ئۇنىڭ ئورنى مۇقىم، ئادەتتە تور بېكەتنىڭ يولباشچى بالداق (كۆپلىگەن ئۆرنەكلەر) تا كۆرۈنىدۇ. نۇرغۇن ئىشلەتكۈچىلەر ھەققىدە بېتىنى قۇرۇپ، زىيارەتچىلەرگە ئۆزىنى تونۇشتۇرىدۇ. مەسىلەن:','Export &#8220;%s&#8221; as JSON'=>'«%s»نى JSON غا چىقار','1 pattern not updated, somebody is editing it.'=>'1 ئەندىزە يېڭىلانمىدى، ئۇنى بىرەيلەن تەھرىرلەۋېتىپتۇ.','%s pattern restored from the Trash.'=>'%s ئەندىزە «ئەخلەتخانا» دىن ئەسلىگە قايتۇرۇلدى.' . "\0" . '%s ئەندىزە «ئەخلەتخانا» دىن ئەسلىگە قايتۇرۇلدى.','<strong>Error:</strong> "Table Prefix" must not be empty.'=>'<strong> خاتالىق: </strong> «جەدۋەل ئالدى قوشۇلغۇچىسى» بوش قالماسلىقى كېرەك.','This meta box, from the %s plugin, is not compatible with the block editor.'=>'%s قىستۇرمىنىڭ مېتا قۇتىسى بۆلەك تەھرىرلىگۈچ بىلەن ماسلاشمايدۇ.','personal data group labelAbout'=>'ھەققىدە','page titleAbout'=>'ھەققىدە','<a href="%1$s">Edit</a> or <a href="%2$s">preview</a> your Privacy Policy page content.'=>'شەخسىيەت تۈزۈمى بېتىڭىزنىڭ مەزمۇنىنى <a href="%1$s">تەھرىر</a> ياكى <a href="%2$s">ئالدىن كۆزەت</a> ەلەيسىز.','Privacy Policy Page'=>'شەخسىيەت تۈزۈمى بېتى','%s (Draft)'=>'%s (دەسلەپكى نۇسخا)','Privacy Policy page updated successfully.'=>'شەخسىيەت تۈزۈم بېتى مۇۋەپپەقىيەتلىك يېڭىلاندى.','The suggested privacy policy content should be added by using the %s (or later) action. Please see the inline documentation.'=>'تەۋسىيە قىلىنغان شەخسىيەت تۈزۈمىنىڭ مەزمۇنى %s (ياكى كېيىن) مەشغۇلاتى ئارقىلىق قوشۇلىدۇ. قوللانما ئىچىدىكى ئىزاھاتتىن كۆرۈڭ.','The suggested privacy policy content should be added only in wp-admin by using the %s (or later) action.'=>'تەۋسىيە قىلىنغان شەخسىيەت تۈزۈمىنىڭ مەزمۇنى wp-admin دا %s (ياكى كېيىن) مەشغۇلاتى ئارقىلىق قوشۇلىدۇ.','The suggested privacy policy text has changed. Please <a href="%s">review the guide</a> and update your privacy policy.'=>'تەۋسىيە قىلىنغان شەخسىيەت تۈزۈمىنىڭ مەزمۇنى ئۆزگەردى. <a href="%s">يېتەكچىنى قايتا تەكشۈرۈپ</a> شەخسىيەت تۈزۈمىڭىزنى يېڭىلاڭ.','There are no pages.'=>'ھېچقانداق بەت يوق.','Need help putting together your new Privacy Policy page? <a href="%1$s" %2$s>Check out our privacy policy guide%3$s</a> for recommendations on what content to include, along with policies suggested by your plugins and theme.'=>'يېڭى شەخسىيەت تۈزۈمى بېتىنى قۇرۇشتا ياردەم لازىممۇ؟ <a href="%1$s" %2$s>شەخسىيەت تۈزۈمى يېتەكچىمىز %3$s نى تەكشۈرۈپ</a>، شەخسىيەت تۈزۈمى بېتى قانداق مەزمۇنلارنى ئۆز ئىچىگە ئالىدىغانلىقىنى ھەققىدىكى تەۋسىيەنى چۈشىنىپ، ئورناتقان قىستۇرما ۋە ئۆرنەكلىرىڭىز تەۋسىيە قىلىدىغان شەخسىيەت تۈزۈمى ھەققىدىكى مەزمۇننى كۆرۈپ چىقىڭ.','Privacy Policy Guide'=>'شەخسىيەت تۈزۈمى','Visitor comments may be checked through an automated spam detection service.'=>'زىيارەتچىلەرنىڭ ئىنكاسى ئەخلەت خەت بايقاش مۇلازىمىتى ئارقىلىق ئۆزلۈكىدىن تەكشۈرۈلۈشى مۇمكىن.','In this subsection you should note what analytics package you use, how users can opt out of analytics tracking, and a link to your analytics provider&#8217;s privacy policy, if any.'=>'بۇ ماقالىدە، قانداق ئىستاتىستىكا پىروگرامما بولىقى ئىشلىتىدىغانلىقىڭىزنى بايان قىلىپ، ئىشلەتكۈچىنىڭ ئىستاتىستىكا ئىزلاشتىن قانداق ساقلىنىدىغانلىقى شۇنداقلا ئىستاتىستىكا مۇلازىمىتىنى تەمىنلىگۈچىنىڭ شەخسىيەت تۈزۈمى ئۇلانمىسىنى تەمىنلەڭ.','In this subsection you should note what information may be disclosed by users who can upload media files. All uploaded files are usually publicly accessible.'=>'بۇ بۆلەكتە، ئىشلەتكۈچى ۋاسىتە ھۆججىتى يۈكلىگەندە قانداق ئۇچۇرنى تەمىنلەيدىغانلىقىنى بىلدۈرۈڭ. ئادەتتە يۈكلەنگەن بارلىق ھۆججەتلەرنى ئاشكارا زىيارەت قىلغىلى بولىدۇ.','In this subsection you should note what information is captured through comments. We have noted the data which WordPress collects by default.'=>'بۇ بۆلەكتە، ئىشلەتكۈچى ئىنكاس قالدۇرغاندا قانداق ئۇچۇرلارنى توپلايدىغانلىقىڭىزنى بىلدۈرۈڭ. ئادەتتە WordPress توپلايدىغان سانلىق مەلۇماتلارنى مىسال بىلەن ئىزاھلىدۇق.','In this section you should note what personal data you collect from users and site visitors. This may include personal data, such as name, email address, personal account preferences; transactional data, such as purchase information; and technical data, such as information about cookies.'=>'بۇ بۆلەكتە، تور بېكەت زىيارەتچىلىرى ۋە ئىشلەتكۈچىلىرىدىن قانداق سانلىق مەلۇماتلارنى توپلايدىغانلىقىڭىزنى بىلدۈرۈڭ، ئۇلار ئىسىم، ئېلخەت ئادرېس، شەخسىي ھېسابات مايىللىقى قاتارلىق سانلىق مەلۇماتلار، يەنە سېتىۋېلىش ئۇچۇرىغا ئوخشاش سودا سانلىق مەلۇماتى، ساقلانمىدىكى ئۇچۇرغا ئوخشاش تېخنىكىلىق سانلىق مەلۇماتلارنىمۇ ئۆز ئىچىگە ئالىدۇ.','Suggested text:'=>'تەۋسىيە تېكىست:','The template contains a suggestion of sections you most likely will need. Under each section heading, you will find a short summary of what information you should provide, which will help you to get started. Some sections include suggested policy content, others will have to be completed with information from your theme and plugins.'=>'بۇ قېلىپ شەخسىيەت تۈزۈمى بېتى ئۆز ئىچىگە ئېلىشقا تېگىشلىك تەۋسىيە مەزمۇنلارنى ئۆز ئىچىگە ئالىدۇ. ھەر قايسى باب ماۋزۇسىنىڭ ئاستىدا، شەخسىيەت تۈزۈمىدە بولۇشقا تېگىشلىك قىسقىچە ئۇچۇرلار تەمىنلەنگەن، بۇلارنىڭ مۇناسىۋەتلىك مەزمۇنلارنى يېزىشقا ياردىمى بولىدۇ. بەزى بابلاردا تەۋسىيە قىلىنغان شەخسىيەت تۈزۈمىنىڭ مەزمۇنىنى بار، باشقا مەزمۇنى يوق بابلارنى ئۆرنەك ۋە قىستۇرما تەمىنلىشى زۆرۈر بولغان مەزمۇنلاردۇر.','Updated %s.'=>'%s يېڭىلانغان.','Removed %s.'=>'%s چىقىرىۋېتىلگەن.‏‎‏','Introduction'=>'تونۇشتۇرۇش','You deactivated this plugin on %s and may no longer need this policy.'=>'سىز %s بۇ قىستۇرمىنى ئاكتىپسىزلىدىڭىز، شۇڭلاشقا بۇ تۈزۈمگە ئېھتىياجلىق بولماسلىقىڭىز مۇمكىن.','Need help putting together your new Privacy Policy page? Check out our guide for recommendations on what content to include, along with policies suggested by your plugins and theme.'=>'يېڭى شەخسىيەت تۈزۈمى بېتىنى قۇرۇشتا ياردەم لازىممۇ؟ شەخسىيەت تۈزۈمى يېتەكچىمىزنى تەكشۈرۈپ، قانداق مەزمۇنلارنى ئۆز ئىچىگە ئالىدىغانلىقىنى ھەققىدىكى تەۋسىيەنى چۈشىنىپ، ئورناتقان قىستۇرما ۋە ئۆرنەكلىرىڭىز تەۋسىيە قىلىدىغان شەخسىيەت تۈزۈمى ھەققىدىكى مەزمۇننى كۆرۈپ چىقىڭ.','Erasing data...'=>'سانلىق مەلۇمات ئۆچۈرۈۋاتىدۇ…','Add Data Erasure Request'=>'سانلىق مەلۇمات ئۆچۈرۈش ئىلتىماسى قوش','Send export link'=>'چىقىرىش ئۇلانمىسى يوللا','Industry regulatory disclosure requirements'=>'كەسىپ نازارەت قىلىپ باشقۇرۇشنىڭ ئاشكارىلاش تەلىپى','If you are a member of a regulated industry, or if you are subject to additional privacy laws, you may be required to disclose that information here.'=>'ئەگەر شۇغۇللىۋاتقىنىڭىز نازارەت قىلىنىدىغان كەسىپ بولسا، ياكى باشقا شەخسىيەت قانۇنىنىڭ باشقۇرۇشىنىڭ تەسىرىگە ئۇچرىسا، بۇ جاينى ئۇ ئۇچۇرلارنى ئاشكارىلىشىڭىز كېرەك بولۇشى مۇمكىن.','If your website provides a service which includes automated decision making - for example, allowing customers to apply for credit, or aggregating their data into an advertising profile - you must note that this is taking place, and include information about how that information is used, what decisions are made with that aggregated data, and what rights users have over decisions made without human intervention.'=>'ئەگەر تور بېكىتىڭىزدە ئاپتوماتىك قارار چىقىرىش مۇلازىمىتى تەمىنلەيدىغان بولسىڭىز، مەسىلەن، خېرىدارنىڭ ئىناۋەتلىك كارتا ئىلتىماس قىلىشىغا يول قويۇلسا ياكى خېرىدارنىڭ ئۇچۇرى توپلىنىپ ئېلان ماتېرىيالىغا كىرگۈزۈلسە، ئۇچۇرنىڭ قانداق ئىشلىتىلىدىغانلىقى، قانداق ئۇسۇلدا توپلىنىپ قانداق قارار چىقىرىدىغانلىقى شۇنداقلا قارار چىقىرىشقا ئادەم تەسىر كۆرسەتمىگەندە ئىشلەتكۈچىلەرنىڭ قانداق ھوقۇقى بارلىقىنى ئېنىق كۆرسىتىش كېرەك.','What automated decision making and/or profiling we do with user data'=>'ئىشلەتكۈچى سانلىق مەلۇماتلىرىغا نىسبەتەن قايسى خىل ئاپتوماتىك قارار قىلىش ۋە ياكى تەھلىل قىلىش ئېلىپ بارىدۇ','If your website receives data about users from third parties, including advertisers, this information must be included within the section of your privacy policy dealing with third party data.'=>'ئەگەر تور بېكىتىڭىز ئۈچىنچى تەرەپ، مەسىلەن، ئېلان سودىگىرىدىن ئىشلەتكۈچى سانلىق مەلۇماتلىرىنى قوبۇل قىلسا، بۇ ئۇچۇرلار چوقۇم شەخسىيەت تۈزۈمىنىڭ ئۈچىنچى تەرەپكە مۇناسىۋەتلىك بابىدا بۇ ئۇچۇرلارنىڭ قانداق بىر تەرەپ قىلىنىدىغانلىقى گەۋدىلەندۈرۈلۈشى كېرەك.','What third parties we receive data from'=>'بىز قانداق ئۈچىنچى تەرەپتىن سانلىق مەلۇمات قوبۇل قىلىمىز','In this section you should explain what procedures you have in place to deal with data breaches, either potential or real, such as internal reporting systems, contact mechanisms, or bug bounties.'=>'بۇ بۆلەكتە، سانلىق مەلۇمات ئاشكارىلىپ كېتىش ئەھۋالى يۈز بەرسە قانداق تەرتىپ بويىچە تەدبىر قوللىنىپ بىر تەرەپ قىلىنىدىغانلىقى چۈشەندۈرۈلۈشى كېرەك، يەنى ئىچكى دوكلات سىستېمىسى، ئالاقە مىخانىزمى ۋە يۇمشاق دېتال كەمتۈكى بايقىغانلارنى مۇكاپاتلاش پىلانى قاتارلىق.','What data breach procedures we have in place'=>'سانلىق مەلۇمات سىزمىلىرىنى بىر تەرەپ قىلىدىغان تەرتىپلەر قانداق','In this section you should explain what measures you have taken to protect your users&#8217; data. This could include technical measures such as encryption; security measures such as two factor authentication; and measures such as staff training in data protection. If you have carried out a Privacy Impact Assessment, you can mention it here too.'=>'بۇ بۆلەكتە، قانداق تەدبىرلەرنى قوللىنىپ ئىشلەتكۈچىلەرنىڭ سانلىق مەلۇماتىنى قوغدىغانلىقىڭىزنى چۈشەندۈرۈشىڭىز كېرەك. بۇلار تېخنىكىلىق تەدبىر (مەسىلەن شىفىرلاش)، بىخەتەرلىك تەدبىرى (ئىككى پاكىتلىق دەلىللەش) ۋە باشقا تەدبىرلەر (مەسىلەن خىزمەتچىلەرنى سانلىق مەلۇمات بىخەتەرلىكى ھەققىدە تەربىيەلەش) نى ئۆز ئىچىگە ئېلىشى مۇمكىن. ئەگەر تور بېكىتىڭىز شەخسىيەت تەسىرىنى باھالاشتىن ئۆتكەن بولسا، مۇشۇ بابتا تىلغا ئالسىڭىز بولىدۇ.','How we protect your data'=>'سانلىق مەلۇماتلىرىڭىزنى قانداق قوغدايمىز','If you use your site for commercial purposes and you engage in more complex collection or processing of personal data, you should note the following information in your privacy policy in addition to the information we have already discussed.'=>'ئەگەر تور بېكىتىڭىزنى سودا ئۈچۈن ئىشلىتىدىغان بولسىڭىز، ئۇنىڭ ئۈستىگە تېخىمۇ مۇرەككەپ بولغان شەخسىي سانلىق مەلۇماتلارنى توپلاپ ۋە بىر تەرەپ قىلىدىغان بولسىڭىز، شەخسىيەت تۈزۈمىڭىزگە تۆۋەندىكى ئۇچۇرلارنى يېزىشىڭىز كېرەك.','Additional information'=>'قوشۇمچە ئۇچۇر','In this section you should provide a contact method for privacy-specific concerns. If you are required to have a Data Protection Officer, list their name and full contact details here as well.'=>'بۇ بۆلەكتە شەخسىيەت تۈزۈمىگە مۇناسىۋەتلىك مەسىلىلەردە ئىشلىتىدىغان ئالاقە ئۇسۇلىنى تەمىنلىشىڭىز كېرەك. ئەگەر قانۇن بويىچە تەيىنلىگەن سانلىق مەلۇمات باشقۇرۇش ئەمەلدارىڭىز بولسا، ئۇنىڭ ئىسىم ۋە تەگئاتى شۇنداقلا مۇكەممەل ئالاقىلىشىش ئۇچۇرىنى تەمىنلەڭ.','European data protection law requires data about European residents which is transferred outside the European Union to be safeguarded to the same standards as if the data was in Europe. So in addition to listing where data goes, you should describe how you ensure that these standards are met either by yourself or by your third party providers, whether that is through an agreement such as Privacy Shield, model clauses in your contracts, or binding corporate rules.'=>'ياۋروپا سانلىق مەلۇماتنى قوغداش قانۇنىنىڭ تەلىپى بويىچە، ياۋروپا ئىتتىپاقىدىكى پۇقرالارنىڭ بارلىق سانلىق مەلۇماتى، ئەگەر ياۋروپا ئىتتىپادىن باشقا جايغا يۆتكىلىدىغان بولسا، چوقۇم ياۋروپا ئىتتىپاقى دائىرىسىدىكى ئۆلچەم بىلەن ئوخشاش دەرىجىدە قوغدىلىشى كېرەك. شۇڭلاشقا بۇ سانلىق مەلۇماتلارنىڭ قەيەرگە يۆتكىلىدىغانلىقىدىن باشقا، سىز ۋە ئۈچىنچى تەرەپ تەمىنلىگۈچى سودىگەر بۇ ئۆلچەملەرگە قانداق يېتىدىغانلىقىڭىزنى بايان قىلىشىڭىز كېرەك. مەسىلەن شەخسىيەت قالقىنى(Privacy Shield) ياكى شۇنىڭغا ئوخشاش كېلىشىم، ئۆلچەملىك توختام ماددىلىرى ياكى قانۇنىي چەكلەش خاراكتېرلىك شىركەت بەلگىلىمىسى.','In this section you should list all transfers of your site data outside the European Union and describe the means by which that data is safeguarded to European data protection standards. This could include your web hosting, cloud storage, or other third party services.'=>'بۇ بۆلەكتە، تور بېكىتىڭىزنىڭ بارلىق سانلىق مەلۇماتلىرىنى ياۋروپا ئىتتىپاقىدىن ئېلىپ چىقىپ كېتىشتە قوللىنىدىغان تەدبىرلىرىڭىزنى بايان قىلىپ، بۇ سانلىق مەلۇماتلارنىڭ ياۋروپا ئىتتىپاقىنىڭ سانلىق مەلۇماتنى قوغداش ئۆلچىمىگە ماس كېلىدىغان قانداق ئۇسۇلدا قوغدالغانلىقىنى چۈشەندۈرىسىز. بۇ سانلىق مەلۇماتلار تور بېكىتىڭىز ئىشلىتىدىغان مەۋھۇم تور مۇلازىمېتىرى، بۇلۇت سۇپىسىدا ساقلاش ۋە باشقا ئۈچىنچى تەرەپ مۇلازىمىتىنى ئۆز ئىچىگە ئالىدۇ.','If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.'=>'ئەگەر بۇ تور بېكەتتە ھېساباتىڭىز بولسا ياكى ئىلگىرى ئىنكاس قالدۇرغان بولسىڭىز، بىزدىكى بارلىق سانلىق مەلۇماتلىرىڭىزنى ھۆججەتكە چىقىرىپ بېرىشنى تەلەپ قىلىش ئىلتىماسى يوللىسىڭىز بولىدۇ. بۇلار سىز بىزگە تەمىنلىگەن بارلىق ئۇچۇرلارنى ئۆز ئىچىگە ئالىدۇ. سىز بىزگە تەمىنلەپ بەرگەن بارلىق سانلىق مەلۇماتلارنى ئۆچۈرۈۋېتىشنى تەلەپ قىلسىڭىزمۇ بولىدۇ. بۇ ئۇچۇرلار باشقۇرۇش، قانۇن ياكى بىخەتەرلىك سەۋەبىدىن چوقۇم ساقلاپ قېلىش زۆرۈر بولغان سانلىق مەلۇماتلارنى ئۆز ئىچىگە ئالمايدۇ.','What rights you have over your data'=>'شەخسىي سانلىق مەلۇماتىڭىزغا نىسبەتەن قانداق ھوقۇقىڭىز بار','In this section you should explain what rights your users have over their data and how they can invoke those rights.'=>'بۇ بۆلەكتە، ئىشلەتكۈچىلەرنىڭ شەخسىي سانلىق مەلۇمات ھەققىدە قانداق ھوقۇقى بارلىقى ۋە بۇ ھوقۇقىنى يۈرگۈزۈش ئۇسۇلىنى بايان قىلىشىڭىز كېرەك.','For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.'=>'مەزكۇر تور بېكەتكە تىزىملاتقان ئىشلەتكۈچىلەر (ئەگەر بولسا) گە نىسبەتەن، ئۇلار تەمىنلىگەن شەخسىي سانلىق مەلۇماتلارنىمۇ ساقلايمىز. بارلىق ئىشلەتكۈچىلەر ھەر قانداق ۋاقىتتا ئۆزلىرىنىڭ شەخسىي سانلىق مەلۇماتلىرىنى كۆرۈپ، تەھرىرلەپ ياكى ئۆچۈرەلەيدۇ (ئىشلەتكۈچى ئىسمىنى ئۆزگەرتىشتىن باشقا)، تور بېكەت باشقۇرغۇچىمۇ ئۇ ئۇچۇرلارنى كۆرۈپ ۋە تەھرىرلىيەلەيدۇ.','If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.'=>'ئەگەر ئىنكاس قالدۇرسىڭىز، ئىنكاس ۋە ئۇنىڭ مېتا سانلىق مەلۇماتى مۇددەتسىز ساقلاپ قېلىنىدۇ. بۇنداق قىلىشىمىزنىڭ سەۋەبى كېيىنكى ئىنكاسنى تونۇش ۋە ئۆزلۈكىدىن تەستىقلاش ئۈچۈن بولۇپ، كېيىن يوللانغان ئىنكاسلار تەستىقلاش قاتارىغا تىزىلمايدۇ.','In this section you should explain how long you retain personal data collected or processed by the website. While it is your responsibility to come up with the schedule of how long you keep each dataset for and why you keep it, that information does need to be listed here. For example, you may want to say that you keep contact form entries for six months, analytics records for a year, and customer purchase records for ten years.'=>'بۇ بۆلەكتە، تور بېكىتىڭىز توپلايدىغان ياكى بىر تەرەپ قىلىدىغان شەخسىي سانلىق مەلۇماتلارنىڭ ساقلاش مۇددىتىنى بەلگىلىشىڭىز كېرەك. گەرچە سانلىق مەلۇمات توپلاشنىڭ ساقلاش قەرەلى ۋە ساقلاش سەۋەبىنى قارار قىلىش مەسئۇلىيىتىڭىز بولسىمۇ، بۇ ئۇچۇرلارنى مۇشۇ جايدا بايان قىلىشىڭىز كېرەك. مەسىلەن، ئالاقە جەدۋىلى ئالتە ئاي ساقلىنىدۇ، سىتاتىستىكا ئۇچۇرى بىر يىل ساقلىنىدۇ، خېرىدارنىڭ سېتىۋېلىش ئۇچۇرى ئون يىل ساقلىنىدۇ دېگەندەك.','How long we retain your data'=>'سانلىق مەلۇماتلىرىڭىزنى قاچانغىچە ساقلايمىز','By default WordPress does not share any personal data with anyone.'=>'ئادەتتە WordPress ھېچقانداق شەخسىي ئۇچۇرنى ھېچكىمگە ھەمبەھىرلىمەيدۇ.','In this section you should name and list all third party providers with whom you share site data, including partners, cloud-based services, payment processors, and third party service providers, and note what data you share with them and why. Link to their own privacy policies if possible.'=>'بۇ بۆلەكتە، تور بېكىتىڭىزدىكى سانلىق مەلۇماتنى ھەمبەھىرلەيدىغان بارلىق ئۈچىنچى تەرەپ تەمىنلىگۈچىلەرنىڭ تىزىمىنى كۆرسىتىسىز، ھەمكارلاشقۇچى، بۇلۇت سۇپىسى مۇلازىمىتى، چىقىم قىلىش مۇلازىمىتى ۋە باشقا ئۈچىنچى تەرەپ مۇلازىمەت تەمىنلىگۈچى. سىز ئۇلار بىلەن بولغان سانلىق مەلۇمات ھەمبەھىرلەشنىڭ تۈرى ۋە ھەمبەھىرلەش سەۋەبىنى ئېنىق يېزىشىڭىز كېرەك. ئەگەر مۇمكىن بولسا، ئۇلارنىڭ شەخسىيەت تۈزۈمىنىڭ ئۇلانمىسىنى تەمىنلەڭ.','Who we share your data with'=>'سانلىق مەلۇماتلىرىڭىزنى كىمگە ھەمبەھىرلەيمىز','By default WordPress does not collect any analytics data. However, many web hosting accounts collect some anonymous analytics data. You may also have installed a WordPress plugin that provides analytics services. In that case, add information from that plugin here.'=>'ئادەتتىكى ئەھۋالدا WordPress تەھلىل ئۇچۇرلىرىنى توپلىمايدۇ، ئەمما نۇرغۇن مەۋھۇم تور مۇلازىمىتېر تەمىنلىگۈچى ھېساباتى بەزى نامسىز تەھلىل قىلىش ئۇچۇرلىرىنى توپلايدۇ. ئەگەر WordPress نىڭ تەھلىل مۇلازىمىتى تەمىنلەيدىغان قىستۇرمىسىنى ئورناتقان بولسىڭىز، بۇ قىستۇرمىلارنىڭ ئۇچۇرىنى بۇ جايدا بايان قىلىڭ.','Analytics'=>'ئانالىز','These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.'=>'بۇ تور بېكەتلەر ساقلانما، سىڭدۈرمە ئۈچىنچى تەرەپ ئىزلىغۇچ ئىشلىتىپ سىزنىڭ سانلىق مەلۇماتلىرىڭىزنى توپلىشى مۇمكىن، بۇ سىڭدۈرمە مەزمۇن بىلەن بولغان تەسىرلىشىشنى نازارەت قىلىشى مۇمكىن، بۇ تور بېكەتتە ھېساباتىڭىز بولۇپ تىزىمغا كىرگەندە، سىز سىڭدۈرمە مەزمۇن بىلەن تەسىرلەشكەندە، سىزنى ئىزلىشى مۇمكىن.','Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.'=>'مەزكۇر تور بېكەتتىكى ماقالىلەردە سىڭدۈرمە مەزمۇن (مەسىلەن، سىن، سۈرەت، ماقالە قاتارلىق) بولۇشى مۇمكىن. ئۈچىنچى تەرەپ تور بېكەتتىن سىڭدۈرۈلگەن مەزمۇنىنىڭ شەخسىيەت تۈزۈمىنىڭ بىر تەرەپ قىلىنىش ئۇسۇلى زىيارەتچىلەر مەزكۇر بېكەتنى زىيارەت قىلغاندىكى بەلگىلىمە بىلەن تامامەن ئوخشاش بولىدۇ.','Embedded content from other websites'=>'باشقا تور بېكەتتىن سىڭدۈرۈلگەن مەزمۇن','If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.'=>'ئەگەر سىز ماقالە تەھرىرلەپ ياكى ئېلان قىلسىڭىز، توركۆرگۈڭىزگە قوشۇمچە ساقلانما (cookie) ساقلىنىدۇ. بۇ ساقلانما شەخسىي سانلىق مەلۇماتنى ئۆز ئىچىگە ئالمايدۇ ئەمما سىز بايا تەھرىرلىگەن ماقالىنىڭ كىملىكى خاتىرىلىنىدۇ. بۇ ساقلانما بىر كۈن ساقلىنىدۇ.','When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.'=>'سىز تىزىمغا كىرگەندە، بىر قانچە ساقلانمىغا تىزىمغا كىرىش ئۇچۇرى ۋە ئېكراندا كۆرسىتىش تاللانمىسىنى ساقلايمىز. تىزىمغا كىرىش ساقلانمىسى ئىككى كۈن ساقلىنىدۇ، ئېكراندا كۆرسىتىش تاللانما ساقلانمىسى بىر يىل ساقلىنىدۇ. ئەگەر «مېنى ئەستە تۇت» نى تاللىغان بولسىڭىز، تىزىمغا كىرىش ئۇچۇرى ئىككى ھەپتە ساقلىنىدۇ. ئەگەر تىزىمدىن چىقسىڭىز، تىزىمغا كىرىش ساقلانمىسى چىقىرىۋېتىلىدۇ.','If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.'=>'ئەگەر تىزىمغا كىرىش بېتىمىزنى زىيارەت قىلسىڭىز، بىز ۋاقىتلىق ساقلانما تەڭشەپ توركۆرگۈڭىزنىڭ ساقلانمىنى قوبۇل قىلىدىغان ياكى قىلمايدىغانلىقىنى جەزملەيمىز. بۇ ساقلانما شەخسىي سانلىق مەلۇماتلارنى ئۆز ئىچىگە ئالمايدۇ ھەمدە توركۆرگۈ تاقالغاندىن كېيىن تاشلىۋېتىلىدۇ.','If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.'=>'ئەگەر تور بېكىتىمىزدە ئىنكاس قالدۇرغان بولسىڭىز، ساقلانمىدا ئىسمىڭىز، ئېلخەت ئادرېس ۋە تور بېكەت ئادرېسىنى ساقلاشنى تاللىسىڭىز بولىدۇ. بۇنداق بولغاندا يەنە ئىنكاس يازغاندا مۇناسىۋەتلىك ئۇچۇرلارنى قايتا تولدۇرۇشىڭىز ھاجەتسىز. بۇ ساقلانما بىر يىل ساقلىنىدۇ.','In this subsection you should list the cookies your website uses, including those set by your plugins, social media, and analytics. We have provided the cookies which WordPress installs by default.'=>'بۇ تارماق بۆلەكتە، تور بېكىتىڭىزدە ئىشلىتىدىغان ساقلانما تىزىمىنى كۆرسىتىشىڭىز كېرەك، ئۇ تەڭشەكلەر قىستۇرما، ئىجتىمائىي تاراتقۇ ۋە سىتاتىستىكا پىروگراممىلىرىڭىزنى ئۆز ئىچىگە ئالىدۇ. بىز WordPress ئورنىتىلغاندىن كېيىن كۆڭۈلدىكى ئەھۋالدا ئىشلىتىدىغان ساقلانما تىزىمىنى تەمىنلىدۇق.','Cookies'=>'ساقلانما','An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.'=>'ئېلخەت ئادرېسىڭىزدىن ھاسىللانغان نامسىزلاشتۇرۇلغان ھەرپ تىزىقى (hash دەپمۇ ئاتىلىدۇ) بەلكىم Gravatar مۇلازىمېتىرغا تەمىنلىنلىنىپ سىزنىڭ مەزكۇر  مۇلازىمەتنى ئىشلىتىۋاتقان ياكى ئىشلەتمىگەنلىكىڭىزنى جەزملەيدۇ. بۇ Gravatar مۇلازىمېتىنىڭ شەخسىيەت تۈزۈمى: here: https://automattic.com/privacy/. ئىنكاسىڭىز تەستىقلانغاندىن كېيىن، تەرجىمىھال رەسىمىڭىز ئىنكاسىڭىزنىڭ يېنىدا ئاشكارە كۆرۈنىدۇ.','When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.'=>'زىيارەتچىلەر تور بېتىدە ئىنكاس يازغاندا،  ئىنكاس جەدۋىلىدىكى مەلۇماتلارنى يىغىپلا قالماي، ئەخلەت ئىنكاسلارنى بايقاشقا ياردىمى بولىشى ئۈچۈن، زىيارەتچىنىڭ IP ئادرىسى ۋە تور كۆرگۈچ ئۇچۇرلىرىنىمۇ تەڭ يىغىمىز.','By default, WordPress does not include a contact form. If you use a contact form plugin, use this subsection to note what personal data is captured when someone submits a contact form, and how long you keep it. For example, you may note that you keep contact form submissions for a certain period for customer service purposes, but you do not use the information submitted through them for marketing purposes.'=>'ئەسلىدە WordPressتە بىر ئالاقىلىشىش جەدۋىلى يوق. ئەگەر بىر ئالاقە قىستۇرمىسى ئىشلىتىۋاتقان بولسىڭىز، بۇ ماددىدا بىرسى ئالاقە جەدۋىلى ئەۋەتكەندە قايسى شەخسىي ئۇچۇرلارنىڭ يىغىلىدىغانلىقى ۋە قانچىلىك ساقلىنىدىغانلىقىنى ئەسكەرتىڭ. مەسىلەن، خېرىدارلارغا خىزمەت قىلىش مەقسىتىدە ئالاقە جەدۋىلىدە ئەۋەتىلگەن مەلۇماتلارنى مەلۇم مۇددەت ساقلايدىغانلىقىڭىزنى، ئەمما بۇ ئۇچۇرلارنى تىجارەت مەقسىتىدە ئىشلەتمەيدىغانلىقىڭىزنى يېزىڭ.','Contact forms'=>'ئالاقىلىشىش جەدۋىلى','If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.'=>'ئەگەر تو ربېكىتىڭىزگە رەسىم يۈكلىسىڭىز، ئورۇن مەلۇمات (EXIF GPS) ئۇچۇرلىرى قوشۇلۇپ قالمىغان رەسىملەرنى تاللىشىڭىز كېرەك.  چۈنكى باشقا زىيارەتچىلەر تور بېتىدىن رەسىملەرنى چۈشۈرۈپ ۋە ئۇنىڭ ئىچىكە قىستۇرۇلغان ئورۇن ئۇچۇرلىرىنى چىقىرىۋېلىشى مۈمكىن.','By default WordPress does not collect any personal data about visitors, and only collects the data shown on the User Profile screen from registered users. However some of your plugins may collect personal data. You should add the relevant information below.'=>'ئەسلىدە WordPress زىيارەتچىلەرنىڭ ھېچقانداق خۇسۇسىي ئۇچۇرلىرىنى يىغمايدۇ. تىزىملاتقان ئىشلەتكۈچىلەرنىڭ بولسا ئىشلەتكۈچى تەرجىمھالىدا كۆرۈنگەن مەلۇماتلارىنىلا يىغىدۇ. ئەمما بەزى قىستۇرمىلار خۇسۇىي ئۇچۇلارنى يىغىشى مۈمكىن. تۆۋەنگە مۇناسىۋەتلىك ئۇچۇرلارنى قوشۇشىڭىز كېرەك.','Personal data is not just created by a user&#8217;s interactions with your site. Personal data is also generated from technical processes such as contact forms, comments, cookies, analytics, and third party embeds.'=>'شەخسىي سانلىق مەلۇماتلار پەقەت ئىشلەتكۈچى بىلەن تور بېكىتىڭىز ئارىسىدىكى تەسىرلىشىشتىنلا ھاسىل بولمايدۇ، بەلكى باشقا تېخنىكىلىق جەرياندا شەكىللىنىدۇ، مەسىلەن، ئالاقە جەدۋىلى، ئىنكاس، ساقلانما، تەھلىل ۋە ئۈچىنچى تەرەپ سىڭدۈرمە مەزمۇن قاتارلىقلار.','In addition to listing what personal data you collect, you need to note why you collect it. These explanations must note either the legal basis for your data collection and retention or the active consent the user has given.'=>'توپلىغان شەخسىي سانلىق مەلۇماتلارنى كۆرسىتىشتىن سىرت، بۇ ئۇچۇرلارنى توپلاش سەۋەبىنى بايان قىلىشىڭىز كېرەك. بۇ جايدىكى چۈشەندۈرۈشتە شۇ سانلىق مەلۇماتلارنى توپلاش ۋە ساقلاپ قېلىشنىڭ قانۇنىي ئاساسىنى كۆرسىتىڭ ياكى ئىشلەتكۈچىنىڭ ماقۇللۇقىنى ئالغان ئالمىغانلىقىڭىزنى بايان قىلىڭ.','You should also note any collection and retention of sensitive personal data, such as data concerning health.'=>'سەزگۈر شەخسىي سانلىق مەلۇمات ئۇچۇرلىرىنى قانداق توپلاپ ۋە ساقلايدىغانلىقىڭىزنى ئەسكەرتىڭ، مەسىلەن، شەخسلەرنىڭ ساغلاملىقى ھەققىدىكى مۇناسىۋەتلىك سانلىق مەلۇماتلار.','Our website address is: %s.'=>'تور بېكەت ئادرېسىمىز: %s.','What personal data we collect and why we collect it'=>'بىز قانداق شەخسىي ئۇچۇرلارنى توپلايمىز ۋە نېمە ئۈچۈن توپلايمىز','The amount of information you may be required to show will vary depending on your local or national business regulations. You may, for example, be required to display a physical address, a registered address, or your company registration number.'=>'كۆرسىتىشكە تېگىشلىك ئۇچۇرلارنىڭ ئاز كۆپلۈكى سىز تۇرۇشلۇق دۆلەت ياكى جاينىڭ يەرلىك سودا قانۇنىدىكى بەلگىلىمىلەرنىڭ تەلىپىگە باغلىق بولىدۇ. مەسىلەن، سىز تۇرۇشلۇق ھەقىقىي ئادرېس، تىزىمغا ئالدۇرغان ئادرېس ياكى شىركەت تىزىملىتىش نومۇرى قاتارلىقلارنى كۆرسىتىشىڭىز كېرەك بولۇشى مۇمكىن.','Who we are'=>'بىز كىم','In this section you should note your site URL, as well as the name of the company, organization, or individual behind it, and some accurate contact information.'=>'بۇ بۆلەكتە، تور بېكىتىڭىزنىڭ تور ئادرېسى (URL)، تور بېكەتنى باشقۇرىدىغان شىركەت، تەشكىلات ياكى شەخس ۋە ئۇنىڭ ئالاقىلىشىش ئۇسۇلىنى ئەسكەرتىشىڭىز كېرەك.','It is your responsibility to write a comprehensive privacy policy, to make sure it reflects all national and international legal requirements on privacy, and to keep your policy current and accurate.'=>'شەخسىيەت تۈزۈمىنى ئەتراپلىق تولۇق يېزىش مەجبۇرىيىتىڭىز بار بولۇپلا قالماي يەنە بارلىق دۆلەت ئىچى قانۇنى ۋە خەلقئارا شەخسىيەت قانۇنىنىڭ تەلىپىگە ئۇيغۇن بولۇشى، شەخسىيەت تۈزۈمىڭىزنى ۋاقتىدا يېڭىلاپ توغرا بولۇشىغا كاپالەتلىك قىلىشىڭىز كېرەك.','Please edit your privacy policy content, making sure to delete the summaries, and adding any information from your theme and plugins. Once you publish your policy page, remember to add it to your navigation menu.'=>'شەخسىيەت تۈزۈمىڭىزنىڭ مەزمۇنىنى تەھرىرلەپ، ئۈلگىدە تەمىنلەنگەن قىسقىچە مەزمۇنلارنى ئۆچۈرۈپ، ئۆرنەك ۋە قىستۇرمىڭىزغا زۆرۈر بولغان مەزمۇنلارنى قوشۇڭ. شەخسىيەت تۈزۈمى بېتىڭىزنى ئېلان قىلغاندىن كېيىن، ئۇنى تور بېكەتنىڭ يېتەكچى تىزىملىكىگە قوشۇشنى ئۇنتۇپ قالماڭ.','This text template will help you to create your website&#8217;s privacy policy.'=>'بۇ تېكىست قېلىپى تور بېكىتىڭىزنىڭ شەخسىيەت تۈزۈمىنى قۇرۇشىڭىزغا ياردەم بېرىدۇ.','As a website owner, you may need to follow national or international privacy laws. For example, you may need to create and display a privacy policy.'=>'تور بېكەت ئىگىسى بولۇش سۈپىتىڭىزدە، دۆلەت ئىچى ياكى خەلقئارا شەخسىيەت تۈزۈمى قانۇنىغا بو سۇنۇشىڭىز كېرەك بولۇشى مۇمكىن، مەسىلەن، شەخسىيەت تۈزۈمىنى قۇرۇپ ئۇنى كۆرسىتىشىڭىز مۇمكىن.','website URLAt URL'=>'ئۇلىنىش','Force erasure has failed.'=>'مەجبۇرىي ئۆچۈرەلمىدى.','Email could not be sent.'=>'ئېلخەت يوللىيالمىدى.','date/timeOn'=>'ئوچۇق','website nameFor site'=>'بېكەت','email addressReport generated for'=>'دوكلات تەييارلاتقۇچى','Exporter array at index %s does not include a friendly name.'=>'ئىندېكس %s دىكى چىقارغۇچ سانلار قاتارى دوستانە ئاتنى ئۆز ئىچىگە ئالمىغان.','Invalid request type.'=>'ئىناۋەتسىز ئىلتىماس تىپى','Sorry, you are not allowed to erase personal data on this site.'=>'كەچۈرۈڭ، بۇ بېكەتنىڭ شەخسىي سانلىق مەلۇماتىنى ئۆچۈرۈش ئىجازىتىڭىز يوق.','Sorry, you are not allowed to export personal data on this site.'=>'كەچۈرۈڭ، بۇ بېكەتنىڭ شەخسىي سانلىق مەلۇماتىنى چىقىرىش ئىجازىتىڭىز يوق.','Eraser index is out of range.'=>'ئۆچۈرگۈچ ئىندېكس دائىرىدىن ھالقىپ كەتتى.','Missing eraser index.'=>'ئۆچۈرگۈچ ئىندېكس كەم.','Expected done (boolean) in response array from exporter: %s.'=>'چىقارغۇچ ئىنكاس سانلار قاتارى تامام (بۇلىن قىممىتى) نى قايتۇرىدىغانلىقىنى مۆلچەرلىگەن: %s','Expected data array in response array from exporter: %s.'=>'چىقارغۇچتىن ئىنكاس سانلار قاتارىدىكى سانلىق مەلۇمات سانلار قاتارىنى قايتۇرىدىغانلىقىنى مۆلچەرلىگەن: %s','Expected data in response array from exporter: %s.'=>'چىقارغۇچتىن ئىنكاس سانلار قاتارىدىكى سانلىق مەلۇماتنى قايتۇرىدىغانلىقىنى مۆلچەرلىگەن: %s.','Expected response as an array from exporter: %s.'=>'چىقارغۇچتىن سانلار قاتارى ئىنكاسى سۈپىتىدە قايتۇرىدىغانلىقىنى مۆلچەرلىگەن: %s.','Exporter callback is not a valid callback: %s.'=>'چىقارغۇچ چاقىرىق ئىنكاسى ئىناۋەتلىك چاقىرىق ئىنكاس ئەمەس: %s.','Exporter does not include a callback: %s.'=>'چىقارغۇچ چاقىرىق ئىنكاسىنى ئۆز ئىچىگە ئالمىغان: %s.','Expected an array describing the exporter at index %s.'=>'ئىندېكس %s دا بىر سانلار قاتارى چۈشەندۈرۈشى قايتۇرىدىغانلىقىنى مۆلچەرلىگەن.','Exporter index is out of range.'=>'چىقارغۇچ ئىندېكس دائىرىدىن ھالقىپ كەتتى.','Exporter index cannot be negative.'=>'چىقارغۇچ ئىندېكس مەنفى بولمايدۇ.','An exporter has improperly used the registration filter.'=>'چىقارغۇچ تىزىملاش سۈزگۈچىنى نامۇۋاپىق ئىشلەتتى.','Missing page index.'=>'بەت ئىندېكس كەم.','Missing exporter index.'=>'چىقارغۇچ ئىندېكس كەم.','Use This Page'=>'بۇ بەتنى ئىشلىتىڭ','Select a Privacy Policy page'=>'شەخسىيەت تۈزۈم بېتى تاللىنىدۇ','Change your Privacy Policy page'=>'شەخسىيەت تۈزۈم بېتى ئۆزگەرتىلىدۇ','<a href="%1$s">Edit</a> or <a href="%2$s">view</a> your Privacy Policy page content.'=>'شەخسىيەت تۈزۈمى بېتىڭىزنىڭ مەزمۇنىنى <a href="%1$s">تەھرىر</a> ياكى <a href="%2$s">كۆرسەت</a> ەلەيسىز.','You should also review your privacy policy from time to time, especially after installing or updating any themes or plugins. There may be changes or new suggested information for you to consider adding to your policy.'=>'ھەر قانداق يېڭى ئۆرنەك ياكى قىستۇرما ئورناتقاندىن كېيىن، شەخسىيەت تۈزۈمىنى پات-پات تەكشۈرۈپ تۇرۇشىڭىزنى تەۋسىيە قىلىمىز. چۈنكى ئۇلار شەخسىيەت تۈزىمىڭىزگە يېڭى ئۆزگىرىش ياكى ئۇچۇر قوشۇشنى تەۋسىيە قىلىشى مۇمكىن.','However, it is your responsibility to use those resources correctly, to provide the information that your privacy policy requires, and to keep that information current and accurate.'=>'ئەمما، بۇ مەنبەلەرنى توغرا ئىشلىتىش، شەخسىيەت تۈزۈمى تەلەپ قىلغان ئۇچۇرلارنى تەمىنلەش ۋە ئۇلارنىڭ ۋاقىتچانلىقى ۋە توغرىلىقىغا كاپالەتلىك قىلىش سىزنىڭ مەسئۇلىيىتىڭىزدۇر.','Unable to create a Privacy Policy page.'=>'شەخسىيەت تۈزۈم بېتى قۇرالمايدۇ.','privacy-policy'=>'شەخسىيەت تۈزۈمى','The new page will include help and suggestions for your privacy policy.'=>'يېڭى بەتتە شەخسىيەت تۈزۈمىڭىزنى قۇرۇشىڭىزغا ياردەم ۋە تەكلىپ ئۇچۇرلىرى بار.','If you already have a Privacy Policy page, please select it below. If not, please create one.'=>'ئەگەر شەخسىيەت تۈزۈمى بېتىڭىز ئاللىبۇرۇن بار بولسا، تۆۋەندىن ئۇنى تاللاڭ. ئەگەر يوق بولسا، بىرنى قۇرۇڭ.','The currently selected Privacy Policy page is in the Trash. Please create or select a new Privacy Policy page or <a href="%s">restore the current page</a>.'=>'نۆۋەتتە تاللىغان شەخسىيەت تۈزۈم بېتىڭىز ئەخلەتخانىدا. يېڭى شەخسىيەت تۈزۈم بېتىنى قۇرۇڭ ياكى تاللاڭ، ۋە ياكى <a href="%s">نۆۋەتتىكى بەتنى ئەسلىگە كەلتۈرۈڭ</a>.','The currently selected Privacy Policy page does not exist. Please create or select a new page.'=>'نۆۋەتتە تاللىغان شەخسىيەت تۈزۈم بېتىڭىز مەۋجۇت ئەمەس. يېڭى بىر بەت قۇرۇڭ ياكى تاللاڭ.','Privacy Policy page setting updated successfully. Remember to <a href="%s">update your menus</a>!'=>'شەخسىيەت تۈزۈم بېتى تەڭشەكلىرى ئوڭۇشلۇق يېڭىلاندى. <a href="%s">تىزىملىكلىرىڭىزنى يېڭىلاشنى</a> ئۇنۇتماڭ!','Copy suggested policy text from %s.'=>'تەۋسىيەلىك تۈزۈم تېكىستىنى %s دىن چاپلايدۇ.','Howdy,

Your request for an export of personal data has been completed. You may
download your personal data by clicking on the link below. For privacy
and security, we will automatically delete the file on ###EXPIRATION###,
so please download it before then.

###LINK###

Regards,
All at ###SITENAME###
