###SITEURL###','[%s] Personal Data Export'=>'[%s] شەخسىي ئۇچۇرنى چىقىرىش','Email sent.'=>'ئېلخەت يوللاندى.','Sending email...'=>'ئېلخەت يوللاۋاتىدۇ…','Download personal data again'=>'شەخسىي سانلىق مەلۇماتنى قايتا چۈشۈر','Unable to send personal data export email.'=>'شەخسىي سانلىق مەلۇمات چىقىرىش ئېلخەتنى يوللىيالمايدۇ.','A valid email address must be given.'=>'ئىناۋەتلىك ئېلخەت ئادرېسى بولۇشى كېرەك.','Personal Data Export for %s'=>'%s نىڭ شەخسىي ئۇچۇرىنى چىقىرىش','Personal Data Export'=>'شەخسىي ئۇچۇرنى چىقىرىش','Invalid request ID when sending personal data export email.'=>'شەخسىي سانلىق مەلۇمات چىقىرىش ئېلخەتنى يوللاۋاتقاندا ئىناۋەتسىز تەلەپ كىملىكى بايقالدى.','Invalid email address in request.'=>'تەلەپتىكى ئېلخەت ئادرېسى ئىناۋەتسىز .','Eraser index cannot be less than one.'=>'ئۆچۈرگۈچ كۆرسەتكۈچى بىردىن كەم بولسا بولمايدۇ.','Page index cannot be less than one.'=>'بەت كۆرسەتكۈچى بىردىن كەم بولسا بولمايدۇ.','Force erase personal data'=>'شەخسىي سانلىق مەلۇماتنى مەجبۇرىي ئۆچۈر','Remove request'=>'ئىلتىماسنى چىقىرىۋەت','Waiting for confirmation'=>'جەزملەشنى كۈتۈۋاتىدۇ','Retry'=>'قايتا سىنا','Downloading data...'=>'سانلىق مەلۇمات چۈشۈرۈۋاتىدۇ…','Download personal data'=>'شەخسىي سانلىق مەلۇماتنى چۈشۈر','Requested'=>'ئىلتىماس قىلىندى','Requester'=>'ئىلتىماسچى','Send Request'=>'ئىلتىماس يوللا','Username or email address'=>'ئىشلەتكۈچى ئاتى ياكى ئېلخەت ئادرېسى','Add Data Export Request'=>'سانلىق مەلۇمات چىقىرىش ئىلتىماسى قوش','Invalid request ID.'=>'ئىناۋەتسىز ئىلتىماس كىملىكى.','Confirmation request initiated successfully.'=>'جەزملەش ئىلتىماسى مۇۋەپپەقىيەتلىك دەسلەپلەشتۈرۈلدى.','Unable to add this request. A valid email address or username must be supplied.'=>'بۇ ئىلتىماسنى قوشالمايدۇ. ئىناۋەتلىك ئېلخەت ئادرېس ياكى ئىشلەتكۈچى ئاتى تەمىنلىنىشى كېرەك.','Confirmation request sent again successfully.'=>'جەزملەش ئىلتىماسى مۇۋەپپەقىيەتلىك ھالدا قايتا يوللاندى.','Unable to initiate confirmation request.'=>'جەزملەش ئىلتىماسىنى دەسلەپلەشتۈرەلمىدى.','Expected done flag in response array from %1$s eraser (index %2$d).'=>'ئۆچۈرگۈچ %1$s (ئىندېكىس %2$d) دىن تاپشۇرۇۋېلىشنى ئۈمىد قىلغان ئىنكاس سانلار قاتارىدىكى تامام بەلگىسى.','Expected messages key to reference an array in response array from %1$s eraser (index %2$d).'=>'ئۆچۈرگۈچ %1$s (ئىندېكس %2$d) دىن ئىنكاس سانلار قاتارىدىكى بىر سانلار قاتارىنى نەقىل ئالىدىغان ئۇچۇر ئاچقۇچىنى قايتۇرىدىغانلىقىنى مۆلچەرلىگەن.','Expected messages key in response array from %1$s eraser (index %2$d).'=>'ئۆچۈرگۈچ %1$s (ئىندېكس %2$d) دىن بىر سانلار قاتارىنى نەقىل ئالىدىغان ئۇچۇر ئاچقۇچىنى قايتۇرىدىغانلىقىنى مۆلچەرلىگەن.','Expected items_retained key in response array from %1$s eraser (index %2$d).'=>'ئۆچۈرگۈچ %1$s (ئىندېكس %2$d) دىن ئىنكاس سانلار قاتارى items_retained ئاچقۇچىنى قايتۇرىدىغانلىقىنى مۆلچەرلىگەن.','Expected items_removed key in response array from %1$s eraser (index %2$d).'=>'ئۆچۈرگۈچ %1$s (ئىندېكس %2$d) دىن ئىنكاس سانلار قاتارى items_removed ئاچقۇچىنى قايتۇرىدىغانلىقىنى مۆلچەرلىگەن.','Expected an array describing the eraser at index %d.'=>'ئىندېكس %d دىكى ئۆچۈرگۈچنىڭ بىر سانلار قاتارى چۈشەندۈرۈشى قايتۇرىدىغانلىقىنى مۆلچەرلىگەن.','Did not receive array from %1$s eraser (index %2$d).'=>'ئۆچۈرگۈچ %1$s (ئىندېكس %2$d) تىن سانلار قاتارى تاپشۇرۇۋالمىدى.','Eraser array at index %d does not include a friendly name.'=>'ئىندېكس %d دىكى ئۆچۈرگۈچ سانلار قاتارى دوستانە ئاتنى ئۆز ئىچىگە ئالمىغان.','Requires PHP Version:'=>'زۆرۈر PHP نەشرى:','This changeset cannot be further modified.'=>'بۇ ئۆزگەرتمە توپلىمىنى ئەمدى ئۆزگەرتكىلى بولمايدۇ.','This data is used to provide general enhancements to WordPress, which includes helping to protect your site by finding and automatically installing new updates. It is also used to calculate statistics, such as those shown on the <a href="%s">WordPress.org stats page</a>.'=>'بۇ مەلۇماتلارWordPress نى ئومۇمىي جەھەتتىن كۈچەيتىشكە ئىشلىتىلىدۇ. يېڭىلانمىلارنى ئاپتۇماتىك ئىزدەپ تېپىپ ئورنىتىپ تور بېكىتىنى قوغداشمۇ بۇنىڭ ئىچىدە. ئۇ ئوخشاشلا  <a href="%s">WordPress.org ئىستاتىسكا بېتى</a> دە كۆرسىتىلگەندەك ئىستاتىسكا ھېساپلىمىلىرى ئۈچۈنمۇ ئىشلىتىلىدۇ.','There is no need to change your CSS here &mdash; you can edit and live preview CSS changes in the <a href="%s">built-in CSS editor</a>.'=>'سىزنىڭ بۇ جايدا CSS كودىنى ئۆزگەرتىشىڭىزنىڭ ھاجىتى يوق ،سىز بۇنى <a href="%s">ئىچكى تەھرىرلىگۈچ</a> ئارقىلىق ئۆزگەرتەلەيسىز ۋە ئالدىن كۆزىتەلەيسىز.','Did you know?'=>'بىلەمسىز؟','Noteworthy Contributors'=>'مۇھىم تۆھپىكارلىرىمىز','If you decide to go ahead with direct edits anyway, use a file manager to create a copy with a new name and hang on to the original. That way, you can re-enable a functional version if something goes wrong.'=>'ئەگەر بىۋاستە تەھرىرلەشتە يەنىلا چىڭ تۇرسىڭىز، ھۆججەت باشقۇرغۇچ ئارقىلىق يېڭى بىر نۇسخىغا ئىسىم قويۇپ ۋە ئەسلى نۇسخىنى ساقلاپ قېلىڭ. بۇنداق قىلسىڭىز ياخشى كۈننىڭ يامىنى بولۇپ چاتاق چىقىپ قالغاندا نورمال ئىشلەيدىغان ھالەتكە قايتۇرالايسىز.','If you absolutely have to make direct edits to this plugin, use a file manager to create a copy with a new name and hang on to the original. That way, you can re-enable a functional version if something goes wrong.'=>'ئەگەر بۇ قىستۇرمىنى چوقۇم بىۋاستە تەھرىرلىشىڭىزگە توغرا كەلسە، ھۆججەت باشقۇرغۇچتا باشقا ئىسىمدا بىر كۆپەيتىلمىسىنى ساقلىۋېلىپ ئەسلىسى بىلەن ھەپىلىشىڭ. شۇنداق قىلسىڭىز بىرەر ئىقتىدارىدىن چاتاق چىقسا ئەسلىگە كەلتۈرەلەيسىز.','You appear to be making direct edits to your plugin in the WordPress dashboard. Editing plugins directly is not recommended as it may introduce incompatibilities that break your site and your changes may be lost in future updates.'=>'WordPress باشقۇرۇش تاختىسىدىكى قىستۇرمىڭىزنى بىۋاسىتە تەھرىرلەۋاتقاندەك قىلىسىز. ئۇنداق قىلماسلىقىڭىزنى تەۋسىيە قىلىمىز. قىستۇرمىلارنى بىۋاسىتە تەھرىرلەش ماسلاشماسلىقنى كەلتۈرۈپ چىقىرىپ بېكىتىڭىزنى بۇزۇۋېتىشى مۇمكىن، ئۇنىڭ ئۈستىگە ئۇ ئۆزگەرتىشلىرىڭىز سىستېما يېڭىلانسا يوقاپ كېتىشى مۇمكىن.','WordPress is not notifying any <a href="%1$s">Update Services</a> because of your site&#8217;s <a href="%2$s">visibility settings</a>.'=>'WordPress ھازىر <a href="%1$s">يېڭىلاش مۇلازىمەتلىرى</a> گە ئۇقتۇرۇش قىلالماۋاتىدۇ، چۈنكى
بېكىتىڭىزنىڭ <a href="%2$s">كۆرۈنۈش تەڭشەكلىرى</a> دە مەسىلە بار.','<strong>Error:</strong> The root directory of your site is not <a href="%1$s">writable</a>, so creating a file automatically was not possible. This is the URL rewrite rule you should have in your %2$s file. Create a new file called %2$s in the root directory of your site. Click in the field and press %3$s (or %4$s on Mac) to select all. Then insert this code into the %2$s file.'=>'<strong>خاتالىق:</strong>بېكىتىڭىزنىڭ غول مۇندەرىجىسى <a href="%1$s">يېزىشقا بولىدىغان</a> ئەمەس، شۇڭا ھۆججەتنى ئاپتوماتىك قۇرغىلى بولمايدۇ. شۇڭا %2$s ھۆججىتىڭىزدە بۇ تور ئادرېسىغا قايتا يېزىش قائىدىسى بولۇشى كېرەك. غول مۇندەرىجىدە %2$s نامىدا يېڭى ھۆججەت قۇرۇڭ. بۆلەككە چېكىپ %3$s (ياكى Mac تە %4$s) نى بېسىپ ھەممىنى تاللاڭ. ئاندىن %2$s دېگەن ھۆججەت ئىچىگە بۇ كودنى قىستۇرۇڭ.','Enter the same address here unless you <a href="%s">want your site home page to be different from your WordPress installation directory</a>.'=>'<a href="%s">بېكىتىڭىز باش بېتىنىڭ WordPress ئورنىتىش مۇندەرىجىسىدىن باشقا يەردە بولۇشىنى ئۈمىد قىلسىڭىز</a> بۇ يەرگە باش بەت ئادرېسىنى كىرگۈزۈڭ.','We take privacy and transparency very seriously. To learn more about what data we collect, and how we use it, please visit <a href="%s">our Privacy Policy</a>.'=>'بىز شەخسىيەت ۋە ئاشكارىلاش ئىشلىرىغا قەتئىي سەل قارىمايمىز. قانداق ئۇچۇرلارنى يىغىدىغىنىمىز ۋە ئۇلارنى قانداق ئىشلىتىدىغانلىقىمىز توغرىسىدىكى ئۇچۇرلارنى بىلمەكچى بولسىڭىز <a href="%s">شەخسىيەت تۈزۈمىمىز</a> نى زىيارەت قىلىڭ.','https://wordpress.org/about/license/'=>'https://wordpress.org/about/license/','From time to time, your WordPress site may send data to WordPress.org &#8212; including, but not limited to &#8212; the version you are using, and a list of installed plugins and themes.'=>'WordPress بىلەن ياسالغان تور بېكىتىڭىز WordPress.org غا سىز ئىشلىتىۋاتقان WordPress نەشرى، ئورناتقان قىستۇرما ۋە ئۆرنەك تىزىمىنى ئۆز ئىچىگە ئالغان ئۇچۇرلارنى پات-پات يوللىشى مۇمكىن، ئەمما يوللىغان ئۇچۇرلار بۇلار بىلەنلا چەكلەنمەيدۇ.','Uploaded on: %s'=>'يۈكلىنىۋاتىدۇ: %s','Downloading update from %s&#8230;'=>'يېڭىلانمىلار يۈكلىنىۋاتىدۇ، مەنزىل: %s&#8230؛','Downloading installation package from %s&#8230;'=>'ئورنىتىش بوغچىسى چۈشۈرىلىۋاتىدۇ، چۈشۈرۈش يېرى: %s&#8230;','Downloading translation from %s&#8230;'=>'تەرجىمە چۈشۈرۈۋاتقان ئورنى: %s&#8230;','Likely direct inclusion of %1$s in order to use %2$s. This is very wrong. Hook the %2$s call into the %3$s action instead.'=>'%2$s نى ئىشلىتىش ئۈچۈن %1$s نى بىۋاستىلا ئىچىگە قوشقاندەك قىلىسىز. بۇ بەك خاتا بوپتۇ. بۇنىڭ ئورنىغا %2$s نى چاقىرىشنى %3$s ھەركىتىگە ئىلىندىرىپ قويۇڭ.','Customization Draft'=>'خاسلاستۇرۇلغان دەسلەپكى نۇسخا','This draft comes from your <a href="%s">unpublished customization changes</a>. You can edit, but there is no need to publish now. It will be published automatically with those changes.'=>'بۇ دەسلەپكى نۇسخا سىزنىڭ <a href="%s"> ئېلان قىلىنمىغان خاسلاشتۇرۇلغان ئۆزگەرتىشلەر</a>ىڭىزدىن كەلگەن. تەھرىرلىسىڭىز بولىدۇ، ئەمما ھازىرچە ئېلان قىلىشنىڭ ھاجىتى يوق. ئۇ ئۆزگىرىشلەر بىلەن بىللە ئاپتۇماتىك ئېلان قىلىنغۇسى.','Theme Files'=>'ئۆرنەك ھۆججەتلىرى','folder'=>'قىسقۇچ','Unable to communicate back with site to check for fatal errors, so the PHP change was reverted. You will need to upload your PHP file change by some other means, such as by using SFTP.'=>'ئەجەللىك خاتالىقلارنى تەكشۈرۈش ئۈچۈن بېكەت بىلەن قايتا ئالاقىلاشقىلى بولمىغاچقا PHP ئۆزگىرىشلىرى ئەسلىگە قايتۇرۇلدى. PHP ھۆججىتىنى يېڭىلاش ئىشىنى باشقا ئاماللار بىلەن قىلىڭ، مەسىلەن SFTP ئىشلىتىش دېگەندەك.','Installation Required'=>'ئورنىتىش زۆرۈر','Could not fully remove the plugin %s.'=>'قىستۇرما %s نى پۈتۈنلەي ئۆچۈرەلمىدۇق.','User has been created, but could not be added to this site.'=>'قوللانغۇچى قۇرۇلۇپتۇ، ئەمما تور بېكىتىگە قوشماپسىز.','That user could not be added to this site.'=>'بۇ ئىشلەتكۈچىنى بۇ تور بېكىتىگە قوشقىلى بولمىدى.','Disable syntax highlighting when editing code'=>'كود تەھرىرلىگەندە گىرامماتىكىلىق يورۇتۇشنى چەكلەيدۇ','Syntax Highlighting'=>'گرامماتىكىلىق يورۇتۇش','Run the installation'=>'ئورنىتىشنى ئىجرا قىل','https://wordpress.org/about/privacy/'=>'https://wordpress.org/about/privacy/','Press This is not available. Please contact your site administrator.'=>'تېز ئېلان قىلىشنى ئشلەتكىلى بولمىدى. تور بېكىتى باشقۇرغۇچىڭىز بىلەن ئالاقىلىشىڭ.','Press This is not installed. Please install Press This from <a href="%s">the main site</a>.'=>'تېز ئېلان قىلىش ئورنىتىلمىغان. بۇ<a href="%s">باش بېكەت</a> نى بېسىپ تېز ئېلان قىلىشنى ئورنىتىڭ.','Activate Press This'=>'تېز ئېلان قىلىشنى قوزغات','I understand'=>'چۈشەندىم','Heads up!'=>'كۆزىڭىزگە قاراڭ!','<strong>Warning:</strong> Making changes to active plugins is not recommended.'=>'<strong>ئاگاھلاندۇرۇش:</strong> ئاكتىپ قىستۇرمىلارنى ئۆزگەرتىش تەسىيە قىلىنمايدۇ.','Selected file content:'=>'تاللانغان ھۆججەتنىڭ مەزمۇنى:','There was an error while trying to update the file. You may need to fix something and try updating again.'=>'ھۆججەتنى يېڭىلاشتا خاتالىق كۆرۈلدى. بەزى نەرسىلەرنى تۈزىتىپ، ئاندىن قايتىدىن يېڭىلاڭ.','Homepage: %s'=>'باش بەت: %s','%s (already used in permalink structure)'=>'%s (مەڭگۈلۈك ئۇلانما قۇرۇلمىسىدا ئىشلىتىلگەن)','%s (A sanitized version of the author name.)'=>'%s (ئاپتور ئىسمىنىڭ پاكىزلانغان شەكلى)','%s (Category slug. Nested sub-categories appear as nested directories in the URL.)'=>'%s (سەھىپىلارنىڭ باشقا ئىسمى. قاپلانغان قىسمى سەھىپىلەرURL دە قاپلانمىش مۇندەرىجە شەكلىدە كۆرۈنىدۇ.)','%s (The unique ID of the post, for example 423.)'=>'%s (يازمىنىڭ بىردىنبىركىملىك نومۇرى، مەسىلەن 0705)','%s (Hour of the day, for example 15.)'=>'%s ( كۈن سائەت قانچىدە، مەسىلەن 15.)','%s (Day of the month, for example 28.)'=>'%s (ئاينىڭ قانچىنجى كۈنى، مەسىلەن 28.)','%s (Month of the year, for example 05.)'=>'%s (يىلدىكى قايسى ئاي، مەسىلەن 07.)','%s (Second of the minute, for example 33.)'=>'%s (مىنۇتتىن قانچە سېكونت ئۆتكەندە، مەسىلەن 33.)','%s (Minute of the hour, for example 43.)'=>'%s (سائەتتىن قانچە مىنۇت ئۆتكەندە، مەسىلەن 37.)','Available tags:'=>'ئىشلىتىلىشچان بەلگىلەر:','%s added to permalink structure'=>'%s نى مەڭگۈلۈك قۇرۇلمىغا قوشتى','%s (The sanitized post title (slug).)'=>'%s (پاكىزلانغان يازما تېمىسى(قىسقارتما).)','%s (The year of the post, four digits, for example 2004.)'=>'%s(يازما يېزىلغان يىل، تۆت خانىلىق، مەسىلەن 2004)','%s is currently editing this post.'=>'%sمۇ بۇ يازمىنى تەھرىرلەۋاتىدۇ.','Theme Installation'=>'ئۆرنەك ئورنىتىش','%s is currently editing this post. Do you want to take over?'=>'%s مۇ بۇ يازمىنى تەھرىرلەۋاتاتتى، سىز قولىڭىزغا ئالاي دەمسىز ؟','Custom installation script.'=>'ئورنىتىش قوليازمىسىنى بېكىتىش.','Active Installations:'=>'ئاكتىپ ئورنىتىلمىلار:','Plugin Installation'=>'قىستۇرما ئورنىتىش','<strong>Settings</strong> &mdash; This page shows a list of all settings associated with this site. Some are created by WordPress and others are created by plugins you activate. Note that some fields are grayed out and say Serialized Data. You cannot modify these values due to the way the setting is stored in the database.'=>'<strong>تەڭشەش</strong> &mdash; بۇ بەت بېكەت بىلەن باغلىنىشلىق بارلىق تەڭشەكلەر تىزىملىكىنى كۆرسىتىدۇ. بەزىلىرىنى WordPress قۇرغان، يەنە بەزىلىرىنى سىز ئاڭتىپلىغان قىستۇرمىلار قۇرغان. بەزى بۆلەكلەرنىڭ كۈلرەڭلەشتۈرۈلۈپ ئۈزلۈكسىز ئۈچۇر دەپ قارالغانلىقىغا دىققەت قىلىڭ. ئۇ تەڭشەك ئامباردا ساقلانغان بولغاچقا ئۇنىڭ قىممەتلىرىنى ئۆزگەرتەلمەيسىز.','<strong>Themes</strong> &mdash; This area shows themes that are not already enabled across the network. Enabling a theme in this menu makes it accessible to this site. It does not activate the theme, but allows it to show in the site&#8217;s Appearance menu. To enable a theme for the entire network, see the <a href="%s">Network Themes</a> screen.'=>'<strong>ئۇسلۇبلار</strong> &mdash; بۇ بۆلەكتە پۈتۈن توردا قوزغىتىلمىغان ئۇسلۇبلار كۆرسىتىلىدۇ. بىر ئۇسلۇبنى بۇ تىزىملىكتە قوزغىتىش ئۇنى بېكەتتە كۆرۈنىدىغان قىلىدۇ. بۇنداق قىلىش ئۇسلۇبنى ئاكتىپلىمايدۇ، ئەمما ئۇنى كۆرۈنۈش تىزىملىكىدە كۆرۈنىدىغان قىلىدۇ. بىر ئۇسلۇبنى پۈتۈن توردا قوزغىتىش ئۈچۈن <a href="%s">تور ئۇسلۇبلىرى</a> ئېكرانىغا قاراڭ.','<strong>Users</strong> &mdash; This displays the users associated with this site. You can also change their role, reset their password, or remove them from the site. Removing the user from the site does not remove the user from the network.'=>'<strong>ئىشلەتكۈچىلەر</strong> &mdash; بۇ مەزمۇن ئىشلەتكۈچىلەر بېكەت بىلەن باغلانغاندا كۆرۈنىدۇ. ئۇلارنىڭ رولى ۋە پارولىنى ئۆزگەرتەلەيسىز ياكى ئۇلارنى بېكەتتىن يوقىتىۋېتەلەيسىز. ئىشلەتكۈچىنى بېكەتتىن يوقىتىۋەتكىلى بولغان بىلەن ئۇنى توردىن يوق قىلىۋەتكىلى بولمايدۇ.','<strong>Info</strong> &mdash; The site URL is rarely edited as this can cause the site to not work properly. The Registered date and Last Updated date are displayed. Network admins can mark a site as archived, spam, deleted and mature, to remove from public listings or disable.'=>'<strong>/ئۇچۇر</strong> &mdash; بېكەت URL سى بەك ئاز تەھرىرلىنىدۇ، چۈنكى تور بېكىتىنى نورمال ئىشلىمەيدىغان قىلىپ قويۇشى مۈمكىن. تور بېكىتىنىڭ تىزىملانغان ۋە ئاخىرقى يېڭىلانغان ۋەقتى ككرسىتىلدى. تور باشقۇرغۇچىلىرى بىر تور بېكىتىنى تىزىملىكتىن چىقىرىۋېتىش ئۈچۈن ئارخىپلانغان، ئەخلەت، ئۆچۈرۈلگەن ۋە چوڭلارغا خاس قىلىپ بەلگە سېلىپ قويالايدۇ.','Unable to write to file.'=>'ھۆججەتكە يېزىش مۈمكىن بولمىدى.','The menu is for editing information specific to individual sites, particularly if the admin area of a site is unavailable.'=>'بۇ تىزىملىك بەزى ئالاھىدە توربېكەتلىرىنىڭ ئۇچۇرلىرىنى تەھرىرلەش ئۈچۈن، بولۇپمۇ باشقۇرۇش رايونى ئىشلىمەيدىغان تور بېكەتلىرىگە ئىشلىنىدۇ.','Events and News dashboard widgethttps://wordpress.org/news/'=>'https://wordpress.org/news/','Your Recent Drafts'=>'يېقىنقى دەسلەپكى نۇسخىلىرىڭىز','Your PHP code changes were not applied due to an error on line %1$s of file %2$s. Please fix and try saving again.'=>'%2$s ھۆججىتىنىڭ %1$s قۇرىدا كۆرۈلگەن خاتالىق تۈپەيلىدىن PHP كودىڭىزدىكى ئۆزگەرتىش كەينىگە ياندۇرۇلدى. خاتالىقنى تۈزەتكەندىن كېيىن قايتا ساقلاشنى سىناڭ.','View posts by %s'=>'يازمىلارنى %s بويىچە كۆرۈش','nameUnknown'=>'نامەلۇم','No description'=>'چۈشەندۈرۈشى يوق','%s Active Installations'=>'%s ئاكتىپ ئورنىتىشلار','Theme installation failed.'=>'ئۆرنەك ئورنىتىلمىدى.','Plugin installation failed.'=>'قىستۇرما ئورنىتىلمىدى.','Your scheduled changes just published'=>'كۈنتەرتىپكە قويۇلغان ئۆزگەرتىشلەر ئېلان قىلىندى','Activate Plugin &amp; Go to Press This'=>'قىستۇرمىنى قوزغىتىش ۋە تېز ئېلان قىلىشقا قايتىش','Allow link notifications from other blogs (pingbacks and trackbacks) on new posts'=>'باشقا بلوگلاردىن يىڭى يازمىلارغا مۇناسىۋەتلىك (قايتۇرما ئىنكاس ۋە قايتۇرما ئىزلەش) ئۇلانما ئەسكەرتىشلىرىگە رۇخسەت قىلىش','Collapse Main menu'=>'ئاساسىي تىزىملىكنى يىغ','themeActivate'=>'ئاكتىپلا','pluginNetwork Activate %s'=>'%s توردىن قوزغات','pluginActivate %s'=>'%s نى ئاكتىپلا','No media files found.'=>'ۋاسىتە ھۆججىتى تېپىلمىدى.','Run Importer'=>'ئەكىرگۈچنى ئىجرا قىل','Run %s'=>'%s ئىجرا قىل','comment statusOpen'=>'ئاچ','Image Rotation'=>'سۈرەت ئايلاندۇرۇش','There are no events scheduled near you at the moment. Would you like to <a href="%s">organize a WordPress event</a>?'=>'ئەتراپىڭىزدا بۇ پەيتتە ئورۇنلاشتۇرۇلغان ھىچقانداق پائالىيەت يوق. <a href="%s">بىرەر پائالىيەت</a>? ئورۇنلاشتۇرغىڭىز بارمۇ ؟','Edit User %s'=>'ئىشلەتكۈچى %s نى تەھرىرلەش','Edit widget: %s'=>'ئەپچە تەھرىرلەش: %s','https://make.wordpress.org/community/handbook/meetup-organizer/welcome/'=>'https://make.wordpress.org/community/handbook/meetup-organizer/welcome/','Attend an upcoming event near %s.'=>'يېقىندا %s ئەتراپىدا ئۆتكۈزۈلمەكچى بولغان پائالىيەتكە قاتنىشىڭ.','WordCamps'=>'WordCamp لار','Meetups'=>'ئولتۇرۇش','WordPress Events and News'=>'WordPress پائالىيەتلىرى ۋە خەۋەرلەر','An error occurred. Please try again.'=>'خاتالىق كۆرۈلدى. قايتا سىناڭ.','There are no events scheduled near %1$s at the moment. Would you like to <a href="%2$s">organize a WordPress event</a>?'=>'بۇ پەيتتە %1$s ئەتراپىدا ئورۇنلاشتۇرۇلغان ھىچقانداق پائالىيەت يوق. <a href="%2$s">بىرەر پائالىيەت</a>? ئورۇنلاشتۇرغىڭىز بارمۇ؟','Cincinnati'=>'ئۈرۈمچى','City:'=>'شەھەر:','Unknown API error.'=>'يوچۇن API خاتالىقى.','Invalid API response code (%d).'=>'ئىناۋەتسىزAPI ئىنكاس كودى (%d)','l, M j, Y'=>'Y-n-j, I','Sorry, you are not allowed to delete users.'=>'كەچۈرۈڭ، ئىشلەتكۈچىلەرنى ئۆچۈرۈشىڭىشىزگە رۇخسەت بېرىلمىگەن.','Sorry, you are not allowed to create users.'=>'كەچۈرۈڭ، سىزگە ئىشلەتكۈچى قۇرۇشقا رۇخسەت بېرىلمىگەن.','short (~12 characters) label for hide controls buttonHide Controls'=>'كونتروللارنى يوشۇر','Expand Sidebar'=>'يانبالداقنى ياي','Display location'=>'ئورنىنى كۆرسەت','ID #%1$s: %2$s <strong>Sorry, you are not allowed to remove this user.</strong>'=>'ID #%1$s: %2$s <strong>كەچۈرۈڭ، سىزنىڭ بۇ ئىشلەتكۈچىنى چىقىرىۋېتىش ئىجازىتىڭىز يوق.</strong>','You can select the language you wish to use while using the WordPress administration screen without affecting the language site visitors see.'=>'WordPress كونترول سۇپىسىدا ئىشلنىدىغان تىلنى تاللىسىڭىز بولىدۇ. بۇ تاللىشىڭىز تور بېكىتىنىڭ زىيارەتچىلەرگە كۆرۈنىدىغان تىلىغا تەسىر قىلمايدۇ.','Clear current filters'=>'نۆۋەتتىكى سۈزگۈچلەرنى تازىلاش','Edit Filters'=>'سۈزگۈچ تەھرىر','Select one or more Theme features to filter by'=>'سۈزمەك ئۈچۈن بىر ياكى تېخىمۇ كۆپ ئۆرنەك خاسلىغىنى تاللاڭ','Set status'=>'ھالىتىنى بەلگىلەش','&#8220;%s&#8221; is locked'=>'&#8220;%s&#8221;قۇلۇپلىنىپ قالدى','(%s ratings)'=>'(%s نىسبىتى )','Current Background Image'=>'نۆۋەتتىكى تەگلىك سۈرىتى','Current Header Image'=>'نۆۋەتتىكى بەت قاش سۈرەت','Search plugins...'=>'قىستۇرما ئىزدە…','Active plugin installationsLess Than 10'=>'10 دىن ئاز','Sorry, you are not allowed to attach files to this post.'=>'كەچۈرۈڭ، بۇ يازمىغا قوشۇلما قوشۇشىڭىزغا رۇخسەت بېرىلمىگەن.','https://wordpress.org/plugins/'=>'https://wordpress.org/plugins/','The Customizer allows you to preview changes to your site before publishing them. You can navigate to different pages on your site within the preview. Edit shortcuts are shown for some editable elements. The Customizer is intended for use with non-block themes.'=>'خاسلاشتۇرغۇچنىڭ ياردىمىدە تور بېكىتىڭىزنى ئېلان قىلىشتىن بۇرۇن ئالدىن كۆزىتەلەيسىز. بېكىتىڭىزدىكى خالىغان بەتنى ئالدىن كۆزىتەلەيسىز. بەزى تەھرىرلىگىلى بولىدىغان ئېلىمېنتلارنىڭ ئۈستىدە تەھرىرلەش تېزلەتمىلىرى كۆرسىتىلگەن. خاسلاشتۇرغۇچ بۆلەكسىز ئۆرنەك ئىشلىتىشنى مەقسەت قىلغان.','Customize New Changes'=>'يېڭى ئۆزگىرىشلەرنى خاشلاشتۇرۇش','Background ScrollScroll'=>'چۆرگىلەت','Background RepeatRepeat'=>'تەكرارلا','<a href="https://wordpress.org/support/forums">Support</a>'=>'<a href="https://wordpress.org/support/forums">قوللاش</a>','%s updates failed.'=>'%s نى يېڭىلىيالمىدى.','%s update failed.'=>'%s نى يېڭىلىيالمىدى.','Search installed plugins...'=>'ئورنىتىلغان قىستۇرمىلاردىن ئىزدە…','You can find new plugins to install by searching or browsing the directory right here in your own Plugins section.'=>'ئۆزىڭىزنىڭ قىستۇرما رايونىغا كۆز يۈگۈرتۈپ ياكى ئىزدەپ ئورناتماقچى بولغان يېڭى قىستۇرمىلارنى تاپالايسىز.','Plugins hook into WordPress to extend its functionality with custom features. Plugins are developed independently from the core WordPress application by thousands of developers all over the world. All plugins in the official <a href="%s">WordPress Plugin Directory</a> are compatible with the license WordPress uses.'=>'WordPress قا قىستۇرۇلغان قىستۇرمىلار ئۇنىڭ ئىقتىدارىنى كېڭەيتىپ، خاس ئالاھىدىلىكلەرنى قوشىدۇ. قىستۇرمىلار WordPress نىڭ يادرولۇق قىسمىدىن مۇستەقىل بولۇپ، دۇنيا مىقياسىدا مىڭلىغان ئىجادكارلىرى بار. رەسمىي<a href="%s">WordPress قىستۇرما مۇندەرىجىسى</a> دىكى بارلىق قىستۇرمىلار WordPress رۇخسەتنامىسىغا ئۇيغۇن.','Search plugins by:'=>'قىستۇرما ئىزدەش ئاساسى:','Import posts, pages, comments, custom fields, categories, and tags from a WordPress export file.'=>'يازما، بەت، ئىنكاس، ئىختىيارى سۆز بۆلىكى، سەھىپە ۋە خەتكۈچلەرنى بىر WordPress چىقىرىش ھۆججىتىدىن ئەكىرىدۇ.','Import posts &amp; media from Tumblr using their API.'=>'Tumbir نىڭ API سىدىن پايدىلىنىپ يازما ۋە ۋاسىتە ھۆججەتلىرىنى ئەكىرىدۇ.','Import posts from an RSS feed.'=>'يازمىلارنى RSS مەنبەدىن ئەكىرىدۇ.','Import posts and comments from a Movable Type or TypePad blog.'=>'Movable Type ياكى TypePad بلوگلارىدىن يازما ۋە باھالارنى ئەكىرىدۇ.','Import posts from LiveJournal using their API.'=>'LiveJournal نىڭ API سىدىن پايدىلىنىپ يازمالارنى ئەكىرىدۇ.','Convert existing categories to tags or tags to categories, selectively.'=>'مەۋجۇت سەھىپىنى بەلگىگە ياكى بەلگىنى سەھىپىگە تاللاپ تۇرۇپ ئايلاندۇرىدۇ.','Import posts, comments, and users from a Blogger blog.'=>'يازما، ئىنكاس ۋە ئىشلەتكۈچىلەرنى Blogger بلوگىدىن ئەكىرىدۇ.','pluginNetwork Deactivate %s'=>'%s تورنى توختىتىش','pluginDeactivate %s'=>'%s نى ئاكتىپسىزلا','pluginDelete %s'=>'%s نى ئۆچۈر','By default, new users will receive an email letting them know they&#8217;ve been added as a user for your site. This email will also contain a password reset link. Uncheck the box if you do not want to send the new user a welcome email.'=>'ئادەتتە، يېڭى ئىشلەتكۈچىلەرگە تور بېكىتىڭىزگە ئەزا بولغانلىقى ھەققىدە بىر ئېلخەت ئەۋەتىلىدۇ. بۇ ئېلخەتكە پارول يېڭىلاش ئۇلانمىسىمۇ قوشۇلغان. ئەگەر بۇ قارشى ئېلىش ئېلخېتىنى ئەۋەتىلمىسۇن دېسىڭىز، قۇتىدىكى تاللانمىنى ئېلىۋېتىڭ.','New users are automatically assigned a password, which they can change after logging in. You can view or edit the assigned password by clicking the Show Password button. The username cannot be changed once the user has been added.'=>'يېڭى ئىشلەتكۈچىلەرگە تىزىملتىپ كىرگەندىن كېيىن ئۆزگەرتىۋالسا بولىدىغان بىر پارول ئاپتۇماتىك بېرىلىدۇ. سىز پارولنى كۆرسىتىش كۇنۇپكىسىنى بېسىپ ئۇنى كۆرەلەيسىز ياكى ئۆزگەرتەلەيسىز. ئىشلەتكۈچى قۇرۇلغاندىن كېيىن ئىشلەتكۈچى ئىسمىنى ئۆزگەرتكىلى بولمايدۇ.','plugin%s was successfully deleted.'=>'%s غەلىبىلىك ئۆچۈرۈلگەن.','The search for installed plugins will search for terms in their name, description, or author.'=>'قاچىلانغان قىستۇرمىلاردىن ئىزدەشتە قىستۇرمىلارنىڭ ئىسمى، چۈشەندۈرۈلىشى ياكى ئاپتورى قاتارلىق جايلاردىن ئىزدەيدۇ.','Custom Logo'=>'ئىختىيارىچە تۇغ','Sorry, you are not allowed to add users to this network.'=>'كەچۈرۈڭ، بۇ توردا ئىشلەتكۈچى قوشۇشىڭىزغا رۇخسەت يوق.','Sorry, you are not allowed to edit this changeset.'=>'كەچۈرۈڭ، سىزگە بۇ ئۆزگەرتىش توپلىمىنى ئۆزگەرتىشكە رۇخسەت بېرىلمىگەن.','Sorry, you are not allowed to remove users.'=>'كەچۈرۈڭ، ئىشلەتكۈچى چىقىرىۋېتىش ئىجازىتىڭىز يوق.','Sorry, you are not allowed to update this site.'=>'كۈچۈرۇڭ، بۇ تور بېكەتنى يېڭىلىشىڭىزغا رۇخسەت يوق.','Sorry, you are not allowed to update themes for this site.'=>'كەچۈرۈڭ، بۇ تور بېكىتىكى باش تېمىلارنى يېڭىلىشىڭىزغا رۇخسەت يوق.','New version available. <button class="button-link" type="button">Update now</button>'=>'يېڭى نەشرى بار. <button class="button-link" type="button">ھازىرلا يېڭىلا</button>','The Theme Installer screen requires JavaScript.'=>'ئۆرنەك ئورناتقۇچ ئېكرانى JavaScript نى تەلەپ قىلىدۇ.','Sorry, you are not allowed to edit templates for this site.'=>'كەچۈرۈڭ، بۇ بېكەتتىكى قېلىپنى تەھرىرىلىشىڭىزگە رۇخسەت يوق.','<strong>Error:</strong> "Table Prefix" is invalid.'=>'<strong>خاتالىق:</strong> «جەدۋەل ئالدى قوشۇلغۇچىسى» ئىناۋەتسىز.','Sorry, you are not allowed to deactivate plugins for this site.'=>'كەچۈرۈڭ، بۇ بېكەتتە قىستۇرمىلارنى توختىتىش ئىجازىتىڭىز يوق.','Sorry, you are not allowed to activate plugins for this site.'=>'كەچۈرۈڭ، بۇ بېكەتتە قىستۇرمىلارنى قوزغىتىش ئىجازىتىڭىز يوق.','Sorry, you are not allowed to edit plugins for this site.'=>'كەچۈرۈڭ، بۇ بېكەتتىكى قىستۇرمىلارنى تەھرىرلىشىڭىزگە رۇخسەت يوق.','Sorry, you are not allowed to modify unregistered settings for this site.'=>'كەچۈرۈڭ، سىزنىڭ بۇ تور بېكىتىنىڭ تىزىملانمىغان تەڭشەكلىرىنى ئۆزگەرتىشىڭىزگە رۇخسەت بېرىلمىگەن.','Sorry, you are not allowed to delete this site.'=>'كەچۈرۈڭ، بۇ تور بېكىتىنى ئۆچۈرۈشىڭىزگە رۇخسەت يوق.','Sorry, you are not allowed to manage options for this site.'=>'كەچۈرۈڭ، بۇ تور بېكەتنىڭ تاللانىملىرىنى باشقۇرۇش ئىجازىتىڭىز يوق.','Manage with Live Preview'=>'شۇئان ئالدىن كۆزىتىشنى باشقۇرۇش','Sorry, you are not allowed to add links to this site.'=>'كەچۈرۈڭ، سىزنىڭ بۇ تور بېكىتىگە ئۇلانما قوشىشىڭىزغا رۇخسەت بېرىلمىگەن.','Hi, this is a comment.
