سىزنىڭ بۇ بەتكە ئېرىشىشىڭىزگە رۇخسەت بېرىلمىگەن.','Embed Footer Template'=>'سىڭدۈرمە بەت ئاستى قېلىپى','Embed Header Template'=>'سىڭدۈرمە بەت قاش قېلىپى','Embed Content Template'=>'سىڭدۈرمە مەزمۇن قېلىپى','Embed 404 Template'=>'سىڭدۈرمە 404 قېلىپى','Embed Template'=>'سىڭدۈرمە قېلىپ','pluginActive'=>'ئاكتىپ','(Private post)'=>'(شەخسىي يازما)','Sorry, you are not allowed to edit the links for this site.'=>'كەچۈرۈڭ، سىزگە بۇ بېكەتتە ئۇلانمىلارنى تەھرىرلەشكە رۇخسەت بېرىلمىگەن.','Plugin could not be deleted.'=>'قىستۇرما ئۆچۈرىلەلمىدى.','Sorry, you are not allowed to update plugins for this site.'=>'كەچۈرۈڭ، سىزگە بۇ بېكەتتىكى قىستۇرمىلارنى يېڭىلاشقا رۇخسەت بېرىلمىگەن.','Sorry, you are not allowed to manage privacy options on this site.'=>'كەچۈرۈڭ، بۇ تور بېكەتتىكى شەخسىيەت تاللانمىلىرىنى باشقۇرۇش ئىجازىتىڭىز يوق.','Sorry, you are not allowed to activate plugins on this site.'=>'كەچۈرۈڭ، بۇ بېكەتتە قىستۇرما ئاكتىپلاش ئىجازىتىڭىز يوق.','Sorry, you are not allowed to import content into this site.'=>'كەچۈرۈڭ ، بۇ تور بېكەتكە مەزمۇن ئەكىرىشىڭىزگە رۇخسەت قىلىنمايدۇ.','Theme could not be deleted.'=>'ئۆرنەك ئۆچۈرۈلمەيدۇ.','Sorry, you are not allowed to delete themes on this site.'=>'كەچۈرۈڭ، سىزگە بۇ بېكەتتە ئۆرنەكلەرنى ئۆچۈرۈشكە رۇخسەت بېرىلمىگەن.','Sorry, you are not allowed to install themes on this site.'=>'كەچۈرۈڭ، سىزگە بۇ بېكەتتە ئۆرنەكلەرنى ئورنىتىشقا رۇخسەت بېرىلمىگەن.','No theme specified.'=>'ھىچقانداق ئۆرنەك بەلگىلەنمىدى.','Sorry, you are not allowed to export the content of this site.'=>'كەچۈرۈڭ، سىزنىڭ بۇ تور بېكىتىنىڭ مەزمۇنلىرىنى ئېكىسپورت قىلىشىڭىزغا رۇخسەت بېرىلمىگەن.','You can filter the list of posts by post status using the text links above the posts list to only show posts with that status. The default view is to show all posts.'=>'يازمىلار تىزىملىكىدىكى يازمىلارنى يازمىلارنىڭ ئۈستى تەرىپىدىكى تېكىست ئۇلانمىسىنى ئىشلىتىپ يازما ھالىتىگە ئاساسەن سۈزەلەيسىز. يادىدىكى كۆرۈنۈش بولسا ھەممىنى كۆرسىتىش.','Close the Customizer and go back to the previous page'=>'خاسلاشتۇرغۇچىنى ئەت ۋە ئالدىنقى بەتكە قايت','Sorry, you are not allowed to customize headers.'=>'كەچۈرۈڭ، بەت قېشىنى تەڭشىشىڭىزگە رۇخسەت بېرىلمىگەن.','Release Deputy'=>'تارقاتما ۋەكىلى','Release Design Lead'=>'تارقىتىش لايىھە باشلامچىسى','Custom fields can be used to add extra metadata to a post that you can <a href="%s">use in your theme</a>.'=>'"ئىختىيارى سۆز بۆلىكىنى يازمىغا كېڭەيتىلگەن مېتا سانلىق مەلۇماتلىرىنى قوشۇشتا ئىشلىتىشكە بولىدۇ. سىز ئۇلارنى <a href="%s"> ئۆرنەك ئىچىدە ئىشلىتەلەيسىز</a>.','Trackbacks are a way to notify legacy blog systems that you&#8217;ve linked to them. If you link other WordPress sites, they&#8217;ll be notified automatically using <a href="%s">pingbacks</a>, no other action necessary.'=>'ئىزچى (Trackback) بولسا ئۇلانما قىلىنغانلىق خەۋىرىنى ئەسلى ئادرېسقا ئۇقتۇرۇش قىلىشتا قوللىنىلغان بىر خىل ئۇسۇل بولۇپ، كونا نەشردىكى بىلوگلارغا ئىشلىتىلگەن. بىرەر WordPress تور بېتىنى ئۇلانما قىلغاندا، ئۇلانما قىلىنغان توربەت ئاپتوماتىك ھالدا  <a href="%s">قايتما</a> تاپشۇرۇپ ئالىدىغان بولغاچقا، باشقا ئىشنىڭ ھاجىتى يوق.','Excerpts are optional hand-crafted summaries of your content that can be used in your theme. <a href="%s">Learn more about manual excerpts</a>.'=>'ئۈزۈندە بولسا يازمىڭىزنىڭ قىسقىچە مەزمۇنىدىن ئىبارەت. سىز ئۇنى ئۆرنەكىڭىزدا ئىشلىتەلەيسىز. ئۇنىڭغا مۇناسىۋەتلىك<a href="%s">تەپسىلاتلارنى بۇ يەردىن كۆرۈڭ</a>.','The Text mode allows you to enter HTML along with your post text. Note that &lt;p&gt; and &lt;br&gt; tags are converted to line breaks when switching to the Text editor to make it less cluttered. When you type, a single line break can be used instead of typing &lt;br&gt;, and two line breaks instead of paragraph tags. The line breaks are converted back to tags automatically.'=>'تېكىست ھالىتىدە يازما تېكىستىگە HTML كودىنى كىرگۈزەلەيسىز.&lt;p&gt;ۋە&lt;br&gt; لەرگە دىققەت قىلىڭ، بۇ بەلگىلەر تېكىست ھالىتىگە ئالماشتۇرۇلغاندا ئاپتۇماتىك قۇر ئالمىشىشقا ئۆزگۈرىدۇ. خەت كىرگۈزگەندە &lt;br&rt; نىڭ ئورنىغا قۇر ئالماشتۇرۇش كۇنۇپكىسىنى،  پاراگرافقا ئالماشتۇرۇشنىڭ ئورنىغا ئارقىمۇ-ئاقا ئىككى قۇر ئالماشتۇرۇش كۇنۇپكىسىنى ئىشلەتسىڭىز بولىدۇ.بۇ قۇر ئالمىشىشلار مۇناسىپ بەلگىلەرگە ئاپتۇماتىك ئۆزگۈرىدۇ.','Visual mode gives you an editor that is similar to a word processor. Click the Toolbar Toggle button to get a second row of controls.'=>'كۆرۈنۈشلۈك ھالىتى سىزگە يازما تەھرىرلىگۈچكە ئوخشاپ كېتىدىغان بىر تەھرىرلىگۈچ تەمىنلەيدۇ. قورال بالدىقىدىكى يىغما كۇنۇپكىسىنى بېسىپ ئىككىنچى قۇر كونترول كۇنۇپكىلىرىنى يايالايسىز.','Error saving media file.'=>'ساقلانغان ۋاسىتە ھۆججىتىنى ئۆچۈرۈش.','%s media file restored from the Trash.'=>'%s ۋاسىتە ھۆججىتى ئەخلەتخانىدىن ئەسلىگە قايتۇرۇلدى.' . "\0" . '%s ۋاسىتە ھۆججىتى ئەخلەتخانىدىن ئەسلىگە قايتۇرۇلدى.','%s media file moved to the Trash.'=>'%s ۋاسىتە ھۆججىتى ئەخلەتخانىغا يۈتكەلدى.' . "\0" . '%s ۋاسىتە ھۆججىتى ئەخلەتخانىغا يۈتكەلدى.','Media file detached.'=>'ۋاسىتە ھۆججىتى ئايرىلدى.','Media file attached.'=>'ۋاسىتە ھۆججىتى قوشۇلدى.','%s media file permanently deleted.'=>'%s  ۋاسىتە ھۆججىتى مەڭگۈلۈك ئۆچۈرۈلدى.' . "\0" . '%s  ۋاسىتە ھۆججىتى مەڭگۈلۈك ئۆچۈرۈلدى.','%s media file detached.'=>'%s ۋاسىتە ھۆججىتى ئايرىۋېتىلدى.' . "\0" . '%s ۋاسىتە ھۆججىتى ئايرىۋېتىلدى.','%s media file attached.'=>'%s ۋاسىتە ھۆججىتى قوشۇلدى.' . "\0" . '%s ۋاسىتە ھۆججىتى قوشۇلدى.','Media file updated.'=>'ۋاسىتە ھۆججىتىنى يېڭىلاندى.','View %1$s version %2$s details'=>'%1$s نەشرىنىڭ  %2$s تەپسىلاتلىرىنى كۆرۈش','dashboard%1$s, %2$s'=>'%2$s، %1$s','<strong>Publish</strong> &mdash; You can set the terms of publishing your post in the Publish box. For Status, Visibility, and Publish (immediately), click on the Edit link to reveal more options. Visibility includes options for password-protecting a post or making it stay at the top of your blog indefinitely (sticky). The Password protected option allows you to set an arbitrary password for each post. The Private option hides the post from everyone except editors and administrators. Publish (immediately) allows you to set a future or past date and time, so you can schedule a post to be published in the future or backdate a post.'=>'<strong>ئېلان قىلىش</strong>&mdash; ئېلان قىلىش قۇتىسىدا يازمىڭىزنىڭ خۇسۇسىيەتلىرىنى بەلگىلىيەلەيسىز. يامىڭىزنىڭ ھالىتى، كۆرۈنۈشچانلىغى ۋە ئېلان قىلىش(دەرھال) كۇنۇپكىلىرى، ئۇنىڭ يېنىدىكى تەھرىر كۇنۇپكىسىنى بېسىپ تېخىمۇ كۆپ تاللاشلارنى بەلگىلىيەلەيسىز. يازمىنىڭ كۆرۈنۈشچانلىغىنى پارول بېكىتىش ياكى چوققىلاش ئارقىلىق بەلگىلىيەلەيسىز. ھەر بىر يازمىغا خالىغىنىڭىزچە پارول بېكىتەلەيسىز. خۇسۇسىي تاللاشلار يازمىڭىزنى باشقۇرغۇچى ۋە تەھرىرلەردىن باشقا كىشىلەرگە مىگپىي تۇتالايدۇ. ئېلان قىلىش(دەرھال) تاللاشىلىرى بىلەن ئۆتمۈش ياكى كەلگۈسى بىر كۈندە، بېكىتكەن ۋاقىت جەدۋىلى بويىچە ئېلان قىلالايسىز.','Error while saving the new email address. Please try again.'=>'يېڭى ئېلخەت ئادرېسىنى ساقلاشتا خاتالىق كۆرۈلدى، قايتا سىناڭ.','There is a pending change of your email to %s.'=>'ئېلخېتىڭىزنى %s گە ئۆزگەرتمەكچى بولۇۋاتىسىز.','You can narrow the list by file type/status or by date using the dropdown menus above the media table.'=>'ۋاسىتە جەدۋىلىنىڭ يۇقۇرىسىدىكى سىيرىما تىزىملىك ئارقىلىق ھۆججەت تىپى، ھالىتى ياكى چىسلاسىغا ئاساسەن تىزىملىكنى تارايتالايسىز.','The following themes are installed but incomplete.'=>'تۆۋەندىكى ئۆرنەكلەر قاچىلىنىپتۇ، ئەمما تاماملانماپتۇ.','New theme activated.'=>'يېڭى ئۆرنەك قوزغىتىلدى.','Settings saved and theme activated.'=>'سەپلىمىلىرىڭىز ساقلاندى ھەم ئۆرنەكىڭىز قوزغىتىلدى.','https://wordpress.org/themes/'=>'https://wordpress.org/themes/','Sorry, you are not allowed to delete that user.'=>'كەچۈرۈڭ، سىزنىڭ بۇ ئىلەتكۈچىنى ئۆچۈرىشىڭىزگە رۇخسەت بېرىلمىگەن.','Your database password.'=>'ساندان ئىمىڭىز.','Your database username.'=>'ساندان ئىشلەتكۈچى ئاتىڭىز.','The name of the database you want to use with WordPress.'=>'WordPress ئۈچۈن ئىشلەتمەكچى بولغان سانداننىڭ ئىسمى.','plugin%1$s by %2$s'=>'%1$s يازغۇچى %2$s','%1$s by %2$s (will also <strong>delete its data</strong>)'=>'%1$s يازغۇچى %2$s‏ (تەڭ ۋاقىتتا <strong>ئۇچۇرلىرىمۇ ئۆچۈرۈلىدۇ</strong>)','There is a pending change of the admin email to %s.'=>'باشقۇرغۇچى ئېلخەت ئادرېسنى %s غا ئۆزگەرتمەكچى بولىۋاتىسىز.','Dismiss the welcome panel'=>'قارشى ئېلىش تاختىسىنى بىكار قىلىش','WordPress has been installed. Thank you, and enjoy!'=>'WordPress ئورنىتىلدى. رەھمەت سىزگە، قېنى ھوزۇرلىنىڭ!','The constant %s cannot be defined when installing WordPress.'=>'تۇراقلىق مىقدار %s نى WordPress نى ئورنىتىش جەريانىدا بەلگىلىيەلمەيسىز.','Your %s file has an empty database table prefix, which is not supported.'=>'ھۆججىتىڭىز %s نىڭ ساندان جەدۋەل ئالدى قوشۇلمىسى بوشكەن، بۇ قوللانمايدۇ.','Reviews'=>'باھالاشلار','Click the image to edit or update'=>'تەھرىرلەش ياكى يېڭىلاش ئۈچۈن رەسىمنى چېكىڭ','Theme zip file'=>'ئۆرنەك zip ھۆججىتى','Attach to existing content'=>'مەۋجۇت مەزمۇنغا قوش','Read all reviews on WordPress.org or write your own!'=>'WordPress.org دىكى بارلىق باھالاشلارنى ئوقۇش ياكى ئۆز باھاسىنى يېزىش!','You are using a development version of WordPress. These feature plugins are also under development. <a href="%s">Learn more</a>.'=>'ئىشلىتىۋاتقىنىڭىز WordPress نىڭ تەتقىقات نەشرىنى ئىشلىتىۋېتىپسىز، بۇ ئىقتىدار قىستۇرمىلىرىمۇ تەتقىقات ئۈستىدىكەن. <a href="%s">تەپسىلاتىنى كۆرۈڭ</a>.','Reviews with %1$d star: %2$s. Opens in a new tab.'=>'%1$d يۇلتۇزلۇق باھا:  %2$s. يېڭى كۆزنەكتە ئېچىش.' . "\0" . '%1$d يۇلتۇزلۇق باھا:  %2$s. يېڭى كۆزنەكتە ئېچىش.','crop ratio width'=>'كەڭلىك كېسىلىش بىسبىتى','crop ratio height'=>'ئىگىزلىك كېسىلىش نىسبىتى','selection width'=>'تاللانغان كەڭلىگى','selection height'=>'تاللانغان ئىگىزلىگى','Thumbnail Settings Help'=>'نادىر سۈرەت سەپلىمىلىرىگە ياردەم','Scale Image Help'=>'رەسىم ئۆلچۈسىدىن ياردەم','New dimensions:'=>'يېڭى ئۆلچەملىرى:','scale height'=>'ئىگىزلىك ئۆلچىمى','Image Crop Help'=>'سۈرەت كېسىشتىن ياردەم','dashboard%1$s on %2$s %3$s'=>'%2$s يازمىسىدىكى %1$s %3$s','Single Page'=>'يالغۇز بەت','Singular Template'=>'بىرلىك قېلىپ','Dismiss the browser warning panel'=>'تور كۆرگۈچنىڭ ئاگاھلاندۇرۇش تاختىسىنى ئىتىۋېتىش','Date Template'=>'چىسلا قېلىپى','Taxonomy Template'=>'تۈرلىنىش قېلىپى','View more comments'=>'تېخىمۇ كۆپ ئىنكاسلارنى كۆرسەت','View this comment'=>'بۇ ئىنكاسنى كۆرسەت','Update progress'=>'يېڭىلاش جەريانى','Another update is currently in progress.'=>'نۆۋەتتە باشقا بىر يېڭىلاش ئىجرا قىلىنىۋاتىدۇ.','Search for plugins in the WordPress Plugin Directory.'=>'WordPressنىڭ قىستۇرمىلار مۇندەرىجىسىدىن قىستۇرمىلارنى ئىزدەش.','Quick edit &#8220;%s&#8221; inline'=>'&#8220;%s&#8221; نى تۇرغان يېرىدە تېزلىكتە تەھرىرلەس','View &#8220;%s&#8221; archive'=>'«%s"» نىڭ ئارخىپىنى كۆرسەت','Delete &#8220;%s&#8221;'=>'«%s» نى ئۆچۈر','Restore &#8220;%s&#8221; from the Trash'=>'«%s» نى ئەخلەتخانىدىن ئەسلىگە كەلتۈر','Delete &#8220;%s&#8221; permanently'=>'«%s» نى مەڭگۈلۈك ئۆچۈر','Move &#8220;%s&#8221; to the Trash'=>'«%s» نى ئەخلەتخانىغا يۆتكە','Attach &#8220;%s&#8221; to existing content'=>'«%s» نى مەۋجۇت مەزمۇنغا قوش','&#8220;%s&#8221; (Edit)'=>'"%s" (تەھرىرلەش)','Detach from &#8220;%s&#8221;'=>'"%s"  نى ئايرىۋېتىش','attachment filterTrash'=>'ئەخلەتخانا','Quick edit this comment inline'=>'بۇ ئىنكاسنى تېزلىكتە تەھرىرلەش','Edit this comment'=>'بۇ ئىنكاسنى تەھرىرلەش','Restore this comment from the spam'=>'بۇ ئىنكاسنى ئەخلەت خەتتىن ئەسلىگە كەلتۈر','The %s importer is invalid or is not installed.'=>'ئىمپورت قىلغۇچى %s ئىناۋەتسىز ياكى قاچىلانمىغان.','user autocomplete result%1$s (%2$s)'=>'%1$s (%2$s)','comment statusPending'=>'كۈتۈۋاتىدۇ','%d pixels'=>'%d پىكسەل','Images should be at least %s tall.'=>'رەسىم ئەڭ ئازىندا %s ئۇزۇنلۇقتا بولىشى كېرەك.','Suggested width is %s.'=>'كەڭلىگى %s بولۇشىنى تەۋسىيە قىلىمىز.','Suggested height is %s.'=>'تەسىيە قىلىنغان ئىگىزلىگى %s.','Images should be at least %s wide.'=>'رەسىم ئەڭ ئازىندا %s كەڭلىكتە بولىشى كېرەك.','Send User Notification'=>'ئىشلەتكۈچىگە ئۇقتۇرۇش ئەۋەتىش','Send the new user an email about their account'=>'يېڭى ئىشلەتكۈچىگە ئۇلارنىڭ ھېساباتى ھەققىدە بىر ئېلخەت ئەۋەتىدۇ','menu location(Currently set to: %s)'=>'(نۆۋەتتە تەڭشەلگىنى: %s )','<strong>Version %s</strong> addressed one security issue.'=>'<strong> %s نەشرى</strong>  بىر ىخەتەرلىك يوچۇغىنى تۈزەتتى.','https://en.gravatar.com/'=>'https://en.gravatar.com/','Profile Picture'=>'باش سۈرىتى','Maintenance Releases'=>'ئاسراش تارقىتىلمىسى','Security Releases'=>'بىخەتەرلىك تارقىتىلمىسى','Maintenance and Security Releases'=>'ئاسراش ۋە بىخەتەرلىك تارقىتىلمىسى','Plain'=>'تەكشىلىك','WordPress offers you the ability to create a custom URL structure for your permalinks and archives. Custom URL structures can improve the aesthetics, usability, and forward-compatibility of your links. A <a href="%s">number of tags are available</a>, and here are some examples to get you started.'=>'WordPress سىزگە ئۆزگەرمەس ئۇلانما ۋە ئارخىپلىرىڭىز ئۈچۈن خاس ئۇلانما قۇرۇش ئىمكانىيىتى بېرىدۇ. خاس ئۇلانما قۇرۇلمىلىرى  سىزنىڭ ئۇلانمىلىرىڭىزنىڭ كۆركەملىكى، قوللىنىشچانلىقى ھەم ئالدىغا سىغىشچانلىغىنى ئاشۇرىدۇ.ئىش باشلىشىڭىز ئۈچۈن بۇ يەردە <a href="%s"> ئىشلەتكىلى بولىدىغان خەتكۈچلەر</a> ۋە بەزى ئۆرنەكلەرنى تاپالايسىز.','Permalinks can contain useful information, such as the post date, title, or other elements. You can choose from any of the suggested permalink formats, or you can craft your own if you select Custom Structure.'=>'ئۆزگەرمەس ئۇلانما ئېلان ۋاقتى، تېمىسى ياكى باشقا ئېلىمېنتلاردەك پايدىلىق ئۇچۇرلارنى ئۆز ئىچىگە ئالالايدۇ. بىز تەۋسىيە قىلغان خالىغان بىر ئۆزگەرمەس ئۇلانما شەكلىنى قۇللانسىڭىزمۇ ياكى ئۆزىڭىز خالىغان بىر ئۆزگەرمەس ئۇلانما قۇرۇلمىسنى قوللانسىڭىزمۇ بولىدۇ.','You can create the %s file manually and paste the following text into it.'=>'سىز %s نى قولدا قۇرۇپ تۆۋەندىكى تېكىستنى چاپلىسىڭىزمۇ بولىدۇ.','You should be able to get this info from your web host, if %s does not work.'=>'ئەگەر %s ئىشلىمىسە، بۇ ئۇچۇرنى تور مۇلازىمېتىرىڭىزدىن ئالالايسىز.','If for any reason this automatic file creation does not work, do not worry. All this does is fill in the database information to a configuration file. You may also simply open %1$s in a text editor, fill in your information, and save it as %2$s.'=>'ئەگەر بىرەر سەۋەبتىن بۇ ئاپتوماتىك ھۆججەتنى قۇرۇش ئىشقا ئاشمىغان بولسا، ئەنسىرىمەڭ. سىز پەقەت ساندان ئۇچۇرلىرىنى سەپلىمە ھۆججىتىگە تولدۇرسىڭىزلا ھەممە ئىش پۈتىدۇ. سىز %1$s نى  تېكىست تەھرىرلىگۈچتە ئېچىپ ئۇچۇرلىرىڭىزنى تولدۇرۇپ، %2$s نامىدا ساقلاپ قويسىڭىزمۇ بولىدۇ.','Default is %s'=>'كۆڭۈلدىكى %s','The language pack is missing either the %1$s or %2$s files.'=>'تىل بوغچىسىنىڭ %1$s ياكى %2$s ھۆججىتىدىن بىرسى كەم.','The theme is missing the %s stylesheet.'=>'ئۆرنەكنىڭ %s ئۇسلۇبى يۈتكەن.','The %s stylesheet does not contain a valid theme header.'=>'ئۇسلۇب جەدۋىلى %s نىڭ ئئىناۋەتلىك ئۆرنەك بەت قېشى يوق.','If you have marked themes as favorites on WordPress.org, you can browse them here.'=>'ئەگەر WordPress.org دا ئۆرنەككە ياقتۇرىدىغان ئۆرنەك بەلگىسى قويغان بولسىڭىز، ئۇلارنى بۇ يەردە كۆرەلەيسىز.','themesFavorites'=>'ياقتۇرىدىغانلار','Database repair results'=>'ساندان ئوڭشاش نەتىجىلىرى','Allow automatic database repair'=>'سانداننى ئاپتۇماتىك ئوڭشاشقا يول قويۇش','Before getting started'=>'باشلاشتىن بۇرۇن','Successful database connection'=>'ساندان ئۇلانمىسى غەلىبىلىك','Set up your database connection'=>'ساندان باغلىنىش سەپلىمىسى تەڭشىلىدۇ','WordPress database repair'=>'WordPress ساندانىنى ئوڭشاش','Check secret keys'=>'بىخەتەرلىك ئاچقۇچلىرىنى تەكشۈرۈش','%s has been updated.'=>'%s يېڭىلاندى.','The Walker class named %s does not exist.'=>'%s  ئىسىملىك Walker تۈرى مەۋجۇت ئەمەس.','Requires %1$s in %2$s file.'=>'%2$s ھۆججىتىدە %1$s بولۇشى كېرەك.','Daylight saving time begins on: %s.'=>'يازلىق ۋاقىتنىڭ باشلىنىش ۋاقتى: %s.','Standard time begins on: %s.'=>'ئۆلچەملىك ۋاقىتنىڭ باشلىنىشى: %s.','You are about to delete %s.'=>'%s نى ئۆچۈرمەكچى بولۇۋاتىسىز.','Files in the %s directory are executed automatically.'=>'%s مۇندەرىجىسىدىكى ھۆججەتلەر ئاپتۇماتىك ئىجرا قىلىنىدۇ.','This will clear all items from the inactive widgets list. You will not be able to restore any customizations.'=>'ئاكتىپسىز ئەپچە تىزىملىكىدىكى ھەممە تۈرنى تازىلايدۇ. ھېچقانداق خاسلاشتۇرغانلىرىڭىزنى ئەسلىگە كەلتۈرەلمەيسىز.','One of the selected users is not a member of this site.'=>'تاللانغان ئىشلەتك