ن&#8221; كۇنۇپكىسىنى بېسىشىڭىز بىلەن، بۇ ئىشلەتكۈچى ماڭگۈلۈك ئۆچۈرۈلىدۇ.','Select a user'=>'بىر ئىشلەتكۈچى تاللاش','Warning! User %s cannot be deleted.'=>'دىققەت! ئىشلەتكۈچى %s ئۆچۈرىلەمىدى.','You have chosen to delete the user from all networks and sites.'=>'ئىشلەتكۈچىنى ھەممە تور ۋە توربېكەتلەردىن ئۆچۈرىشنى تاللىدىڭىز.','You have chosen to delete the following users from all networks and sites.'=>'سىز تۆۋەندىكى ئىشلەتكۈچىلەرنى ھەممە تو ۋە توربېكەتلەردىن ئۆچۈرىشنى تاللىدىڭىز.','Warning! User cannot be deleted. The user %s is a network administrator.'=>'دىققەت! ئىشلەتكۈچى ئۆچۈرىلەمىدى. ئىشلەتكۈچى %s تور باشقۇرغۇچىسى.','Invalid image URL.'=>'ئىناۋەتسىز سۈرەت تور ئادرېسى.','Theme Header'=>'ئۆرنەك بەت قېشى','Theme Footer'=>'ئۆرنەك بەت ئاستى','no user rolesNone'=>'يوق','From %1$s %2$s'=>'%1$s تەرىپىدىن %2$s','An error occurred while updating %1$s: %2$s'=>'%1$s نى يېڭىلىۋاتقاندا بىر خاتالىق كۆرۈلدى: %2$s','No role'=>'رول يوق','View mode'=>'كۆرۈش ھالىتى','View all drafts'=>'ھەممە دەسلەپكى نۇسخىلارنى كۆرسەت','Additional settings'=>'قوشۇمچە تەڭشەكلەر','Items list'=>'تۈر تىزىمى','Items list navigation'=>'تۈر تىزىمى يولباشچى','M jS Y'=>'Y-m-d','%s column'=>'%s رەت' . "\0" . '%s رەت','End date:'=>'ئاخىرلىشىش چىسلاسى:','User %s added'=>'ئىشلەتكۈچى %s قوشۇلدى','Network Only'=>'پەقەتلا توردا','No pending comments'=>'تەستىق كۈتىۋاتقان باھالار يوق','Failed to initialize a SFTP subsystem session with the SSH2 Server %s'=>'SSH2 مۇلازىمېتىرى %s بىلەن SFTP تارماق سېستىما ئۇلانمىسى قۇرالمىدۇق','column nameSubmitted on'=>'يوللاندى','Filter items list'=>'سۈزگۈچ تۈر تىزىمى','Network Active'=>'تور ئاكتىپ','commentsTrash <span class="count">(%s)</span>'=>'ئەخلەتخانا <span class="count">(%s)</span>' . "\0" . 'ئەخلەتخانا <span class="count">(%s)</span>','commentsSpam <span class="count">(%s)</span>'=>'ئەخلەت خەت <span class="count">(%s)</span>' . "\0" . 'ئەخلەت خەت <span class="count">(%s)</span>','commentsApproved <span class="count">(%s)</span>'=>'تەستىقلانغان <span class="count">(%s)</span>' . "\0" . 'تەستىقلانغان <span class="count">(%s)</span>','commentsPending <span class="count">(%s)</span>'=>'تەستىق كۈتۈۋاتقىنى <span class="count">(%s)</span>' . "\0" . 'تەستىق كۈتۈۋاتقىنى <span class="count">(%s)</span>','commentsAll <span class="count">(%s)</span>'=>'بارلىق<span class="count">(%s)</span>' . "\0" . 'بارلىق<span class="count">(%s)</span>','Content to export'=>'ئېكىسپورت قىلىندىغان مەزمۇن','You can view posts in a simple title list or with an excerpt using the Screen Options tab.'=>'يازمىلارنى ئېكران تاللانمىلىرىدىن تالللىغىنىڭىز بويىچە يىغىنچاق تېما تىزىملىكى شەكلىدە ياكى قىسقىچە مەزمۇنى بىلەن كۆرەلەيسىز.','Submitted on: %s'=>'يوللانغان اقتى: %s','commentPermalink:'=>'ئۆزگەرمەس ئۇلانما:','Page scheduled for: %s.'=>'بەت توغۇرلانغان ۋاقىت جەدۋىلى: %s.','Page draft updated.'=>'بەت دەسلەپكى نۇسخىسى يېڭىلاندى.','Page submitted.'=>'بەت تاپشۇرۇلدى.','Post submitted.'=>'يازما تاپشۇرۇلدى.','Post scheduled for: %s.'=>'يازما توغۇرلانغان ۋاقىت جەدۋىلى: %s.','Post draft updated.'=>'يازما دەسلەپكى نۇسخا يېڭىلاندى.','View page'=>'بەتنى كۆرۈش','Filter comments list'=>'باھالارتىزىمىنى سۈزۈش','Comments list navigation'=>'باھالار تىزىمى يولباشلىغۇچى','Preview page'=>'بەتنى ئالدىن كۆرۈش','Preview post'=>'يازمىنى ئالدىن كۆرۈش','Comments list'=>'باھالار تىزىملىكى','In the <strong>Submitted on</strong> column, the date and time the comment was left on your site appears. Clicking on the date/time link will take you to that comment on your live site.'=>'<strong>تاپشۇرۇلغان</strong> رەتتە، بۇ ئىنكاسنىڭ تور بېكىتىڭىزدە قالدۇرۇلغان چىسلاسى ۋە ۋاقتى كۆرسىتىلگەن. چىسلا ۋە ۋاقىت ئۇلانمىسىنى چەكسىڭىز، بۇ ئىنكاسنىڭ تور بېكىتىڭىزدە قالدۇرۇلغان جايىغا باشلايدۇ.','In the <strong>Comment</strong> column, hovering over any comment gives you options to approve, reply (and approve), quick edit, edit, spam mark, or trash that comment.'=>'<strong>باھا</strong> ستونىدا، مائۇس ئىستىرىلكىسىنى قايسىلا باھانىڭ ئۈستىگە ئەكەلسىڭىزباھانى تەستىقلاش، جاۋاپلاش(تەستىقلاش)، تېزلىكتە تەھرىرلەش، تەھرىرلەش، ئەخلەت خەت قىلىش، ياكى ئەخلەت قىلىش قاتارلىق تاللاشلار چىقىدۇ.','Comments (%s)'=>'ئىنكاسلار (%s)','Sorry, you are not allowed to modify themes.'=>'كەچۈرۈڭ، ئۆرنەك ئۆزگەرتىش ئىجازىتىڭىز يوق.','The active theme does not support a flexible sized header image.'=>'ئاكتىپ ئۆرنەك ماسلىشىشچان چوڭلۇقتىكى بەت قاش سۈرەتنى قوللىمايدۇ.','Comments (%1$s) on &#8220;%2$s&#8221;'=>'«%2$s» غا (%1$s) ئىنكاس بار','The active theme does not support uploading a custom header image.'=>'ئاكتىپ ئۆرنەك خاسلاشتۇرۇلغان بەت قېشى سۈرىتى يوللاشنى قوللىمايدۇ.','You are using the auto-generated password for your account. Would you like to change it?'=>'ھېساباتىڭىزغا ئۆزلۈكىدىن ھاسىللانغان ئىم ئىشلىتىۋاتىسىز. ئۇنى ئۆزگەرتەمسىز؟','You have specified this user for removal:'=>'بۇ ئىشلەتكۈچىنى چىقىرىۋەتمەكچى بولۇۋاتىسىز:','Log %s out of all locations.'=>'%s نى ھەممە يەردىن چېكىندۈرىدۇ.','Did you lose your phone or leave your account logged in at a public computer? You can log out everywhere else, and stay logged in here.'=>'يانفونىڭىزنى يۈتتۈرگەن بولىشىڭىز ياكى ئاممىۋى كومپۇتېردا ھېسابىڭىزنى ئوچۇق قويغان بولىشىڭىز مۈمكىن. باشقا بارلىق يەرلەردىن چېكىنىپ، بۇ يەرنىلا قالدۇرۇپ قويالايسىز.','Account Management'=>'ھېسابات باشقۇرۇش','Cancel password change'=>'پارول ئۆزگەرتىشنى بىكار قىلىش','Log Out Everywhere Else'=>'ھەممە يەردىن چېكىنىش','Generate password'=>'پارول ھاسىللاش','Sessions'=>'ئەڭگىمە','You will need this password to log&nbsp;in. Please store it in a secure location.'=>'بۇ ئىمنى كىرىشتە ئىشلىتىسىز. بىخەتەر جايدا ساقلاڭ.','No approved comments'=>'تەستىقلانغان ئىنكاس يوق','%s pending comment'=>'%s ئىنكاس تەستىق كۈتۈۋاتىدۇ' . "\0" . '%s ئىنكاس تەستىق كۈتۈۋاتىدۇ','%s approved comment'=>'%s ئىنكاس تەستىقلانغان' . "\0" . '%s ئىنكاس تەستىقلانغان','Image could not be processed.'=>'رەسىمنى بىر تەرەپ قىلغىلى بولمىدى','Confirm Password'=>'ئىم جەزملەڭ','Remove Site Icon'=>'بېكەت سىنبەلگىسىنى چىقىرىۋەت','While you are editing your %1$s file, take a moment to make sure you have all 8 keys and that they are unique. You can generate these using the <a href="%2$s">WordPress.org secret key service</a>.'=>'%1$s ھۆججىتىڭىزنى تەھرىرلىگەندە، ئازراق ۋاقىت سەرپ قىلىپ بارلىق 8 ئاچقۇچنىڭ بار يوقلىغى ھەم ئۇلارنىڭ بىردىنبىر ئىكەنلىگىننى جەزىملەشتۈرۈڭ. <a href="%2$s">WordPress.org بىخەتەر ئاچقۇچ مۇلازىمىتى</a> ئارقىلىق بۇلارنى ھاسىل قىلالايسىز.','Choose a Site Icon'=>'بېكەت سىنبەلگىسى تاللىنىدۇ','Set as Site Icon'=>'بېكەت سىنبەلگىسى سۈپىتىدە تەڭشەيدۇ','Show more details'=>'تېخىمۇ كۆپ تەپسىلاتلار','Your theme supports %s menu. Select which menu appears in each location.'=>'سىزنىڭ ئۆرنەكىڭىز %s تىزىملىكىنى قوللايدۇ. قايسى تىزىملىكنىڭ نەدە كۆرۈنۈشى كېرەكلىكىنى تاللاڭ.','Live Preview &#8220;%s&#8221;'=>'شۇئان ئالدىن كۆزىتىش: &#8220;%s&#8221;','%s post by this author'=>'بۇ يازغۇچى %s يازما يوللىدى' . "\0" . 'بۇ يازغۇچى %s يازما يوللىدى','Date and time'=>'چىسلا ۋە ۋاقىت','In response to: %s'=>'%s گە ئىنكاس قايتۇرۇش','Comment status'=>'ئىنكاس ھالىتى','You can also embed media from many popular websites including Twitter, YouTube, Flickr and others by pasting the media URL on its own line into the content of your post/page. <a href="https://wordpress.org/documentation/article/embeds/">Learn more about embeds</a>.'=>'سىز يەنە Twitter, YouTube, Flickr ۋە باشقىلارغا ئوخشاش نۇرغۇن داڭلىق تور بېكەتلەردىن يازما ياكى بېتىڭىزنىڭ مەزمۇنىدىكى ئۆزىنىڭ قۇرىدا مېدىيا URL نى چاپلاش ئارقىلىق مېدىيا قىستۇرالايسىز. Codex نى<a href="https://wordpress.org/support/article/embeds/">قىستۇرۇش ھەققىدە تېخىمۇ كۆپ ئۇچۇرلارنى بىلىۋېلىش</a>غا قارىتىڭ.','<a href="https://codex.wordpress.org/Appearance_Background_Screen">Documentation on Custom Background</a>'=>'<a href="https://codex.wordpress.org/Appearance_Background_Screen" target="_blank">خاس تەگلىككە ئائىت ماتېرىياللار</a>','<a href="https://codex.wordpress.org/Links_Link_Categories_Screen">Documentation on Link Categories</a>'=>'<a href="https://codex.wordpress.org/Links_Link_Categories_Screen" target="_blank">ئۇلانما سەھىپىلىرىگە ئائىت ماتېرىياللار</a>','<a href="https://codex.wordpress.org/Links_Add_New_Screen">Documentation on Creating Links</a>'=>'<a href="https://codex.wordpress.org/Links_Add_New_Screen" target="_blank">ئۇلانما قۇرۇشقا ئائىت ماتېرىياللار</a>','<a href="https://codex.wordpress.org/Links_Screen">Documentation on Managing Links</a>'=>'<a href="https://codex.wordpress.org/Links_Screen" target="_blank">ئۇلانما باشقۇرۇش قوللانمىسى</a>','<a href="https://codex.wordpress.org/Appearance_Header_Screen">Documentation on Custom Header</a>'=>'<a href="https://codex.wordpress.org/Appearance_Header_Screen" target="_blank">خاس بەت بېشىغا ئائىت ماتېرىياللار</a>','<a href="https://codex.wordpress.org/Dashboard_My_Sites_Screen">Documentation on My Sites</a>'=>'<a href="https://codex.wordpress.org/Dashboard_My_Sites_Screen" target="_blank">تور بېكىتىم قوللانمىسى</a>','The theme you are currently using is not widget-aware, meaning that it has no sidebars that you are able to change. For information on making your theme widget-aware, please <a href="https://developer.wordpress.org/themes/functionality/widgets/">follow these instructions</a>.'=>'ئىشلىتىۋاتقان باشتېمىڭىز يانبالداق كىچىك قورالىنى قوللىمايدىغان بولغاچقا، يانبالداقنى ئۆزگەرتەلمەيسىز. باشتېمىنى كىچىك قوراللارنى قوللايدىغان قىلىش ئۈچۈن <a href="https://developer.wordpress.org/themes/functionality/widgets/">بۇ يەردىكى كۆرسەتمىلەردىن پايدىلىنىڭ</a>.','When you publish a new post, WordPress automatically notifies the following site update services. For more about this, see the <a href="%s">Update Services</a> documentation article. Separate multiple service URLs with line breaks.'=>'يېڭى يازما يوللىغان ۋاقتىڭىزدا، WordPress ئاپتوماتىك ھالدا تۆۋەندىكى تور بېكەتلەرگە يېڭىلانغانلىق ئۇقتۇرۇشى ئەۋەتىدۇ. تەپسىلاتىنى بىلەي دېسىڭىز <a href="%s">يېڭىلاش مۇلازىمىتى</a> قوللانما ماقالىسىدىن كۆرۈڭ. بىر نەچچە مۇلازىمېتىر تور ئادرېسىنى يازماقچى بولسىڭىز ھەر بىرىنى ئايرىم بىر قۇرغا يېزىڭ.','The <a href="https://wordpress.org/documentation/article/wordpress-glossary/#character-set">character encoding</a> of your site (UTF-8 is recommended)'=>'تور بېتىڭىزنىڭ <a href="https://wordpress.org/support/article/glossary/#character-set">كودلىنىش شەكلى</a> (UTF-8 تەۋسىيە قىلىنىدۇ)','example: www.wordpress.org'=>'ئۈلگە: www.wordpress.org','The search for installed themes will search for terms in their name, description, author, or tag.'=>'ئورنىتىلغان ئۆرنەكلەرنى ئىسمى، چۈشەندۈرۈشى، يازغۇچى ياكى بەلگە ئۇچۇرىدىكى ئاتالغۇلار ئارقىلىق ئىزدىگىلى بولىدۇ.','You can Search for themes by keyword, author, or tag, or can get more specific and search by criteria listed in the feature filter.'=>'ئۆرنەكلەرنى ئاچقۇزلۇق سۆز، ئاپتور، خەتكۈچلەر بويىچە ئىزدىيەلەيسىز ياكى تېخىمۇ ئېنىق قىلىپ ئالاھىدىلىك سۈزگۈچىدىكى شەرتلەر بويىچىمۇ ئىزدىيەلەيسىز.','Number of Themes found: %d'=>'تېپىلغان ئۆرنەكلەرنىڭ سانى: %d','Alternately, you can browse the themes that are Popular or Latest. When you find a theme you like, you can preview it or install it.'=>'ئۇنىڭدىن سىرت، ئالقىشلانغان ياكى ئەڭ يېڭى ئۆرنەكلەرنى زىيارەت قىلالايسىز. ئەگەر ياقتۇرىدىغان ئۆرنەكنى بايقىسىڭىز ئۇنى ئالدىن كۆزىتەلەيسىز ياكى ئورنىتالايسىز.','Custom time format:'=>'ئىختىيارى ۋاقىت پىچىمى:','enter a custom time format in the following field'=>'تۆۋەندىكى جايغا ئىختىيارى ۋاقىت پىچىمىڭىزنى كىرگۈزۈڭ','Custom date format:'=>'ئىختىيارى چىسلا پىچىمى:','enter a custom date format in the following field'=>'تۆۋەندىكى جايغا ئىختىيارى چىسلا پىچىمىڭىزنى كىرگۈزۈڭ','Plugins updated successfully.'=>'قستۇرمىلار غەلىبىلىك يېڭىلاندى.','Active plugin installations%s+ Million'=>'%s+ مىليون' . "\0" . '%s+ مىليون','XML Error: %1$s at line %2$s'=>'XML خاتالىقى:%2$s-قۇردا  %1$s','Main menu'=>'ئاساسىي تىزىملىك','Enter the location on the server where the public and private keys are located. If a passphrase is needed, enter that in the password field above.'=>'مۇلازىمېتىردىكى ئاشكارە ۋە شەخسىي ئاچقۇچلار ساقلانغان يەرنى كىرگۈزۈڭ. ئەگەر پارول لازىم بولسا، پارولنى ئاستىدىكى پارول ئورنىغا كىرگۈزۈڭ.','What should be done with content owned by these users?'=>'بۇ ئىشلەتكۈچىلەرنىڭ مەزمۇنلىرى قانداق بىرتەرەپ قىلىنىدۇ؟','You have specified these users for deletion:'=>'بۇ ئىشلەتكۈچىلەرنى تاللاپ ئۆچۈرمەكچى بولۇۋاتىسىز:','%s user deleted.'=>'%s ئىشلەتكۈچى ئۆچۈرۈلدى.' . "\0" . '%s ئىشلەتكۈچى ئۆچۈرۈلدى.','1 post not updated, somebody is editing it.'=>'1 يازما يېڭىلانمىدى، بەزىلەر تەھرىرلەۋېتىپتۇ.','You are about to remove the following plugins:'=>'تۆۋەندىكى قىستۇرمىلارنى چىقىرىۋەتمەكچى بولۇۋاتىسىز:','These plugins may be active on other sites in the network.'=>'بۇ قىستۇرمىلار بەلكى توردىكى باشقا توربېكەتلىرىدە قوزغىتىلغان بولۇشى مۈمكىن.','Delete Plugins'=>'قىستۇرمىلارنى ئۆچۈر','1 page not updated, somebody is editing it.'=>'1 بەت يېڭىلانمىدى، بەزىلەر تەھرىرلەۋېتىپتۇ.','Posts Page'=>'يازمىلار بېتى','timezone date formatY-m-d H:i:s'=>'Y-m-d H:i:s','New translations are available.'=>'يېڭى تەرجىمىلىرى بار.','You can log out of other devices, such as your phone or a public computer, by clicking the Log Out Everywhere Else button.'=>'ھەممە يەردىن چېكىنىش توپچىسى چېكىلسە، يانفون، كومپيۇتېر قاتارلىق باشقا ئۈسكۈنىلەردىن چېكىنىپ چىقالايسىز.','This theme has not been rated yet.'=>'بۇ ئۆرنەككە تېخى باھا بېرىلمىگەن.','To add a custom link, <strong>expand the Custom Links section, enter a URL and link text, and click Add to Menu</strong>'=>'ئىختىيارى ئۇلانما قوشۇش ئۈچۈن <strong>ئۇلانمىلار بۆلىكىنى يېيىپ، بىر تور ئادرېسى ۋە ئۇلانما تېكىستى كىرگۈزۈپ، «تىزىملىككە قوش»نى چېكىڭ</strong>','Close details dialog'=>'تەپسىلات سۆزلەشكۈنى ياپ','You are currently editing the page that shows your latest posts.'=>'تەھرىرلەۋاتقىنىڭىز ئاخىرقى يازمىڭىز دەپ كۆرسىتىلگەن بەت.','Number of items per page:'=>'ھەر بەتتىكى تۈر سانى:','Howdy ###USERNAME###,

