','Mystery Person'=>'سىرلىق ئادەم','You cannot delete a theme while it has an active child theme.'=>'قوزغىتىلغان بالا ئۆرنىكى بار ئۆرنەكنى ئۆچۈرەلمەيسىز.','Usernames can have only alphanumeric characters, spaces, underscores, hyphens, periods, and the @ symbol.'=>'ئىشلەتكۈچى ئاتى پەقەت ھەرپ ۋە سان، بوشلۇق، ئاستى سىزىق، تەرى ۋە @ بەلگىسى قاتارلىقلاردىن تۈزۈلىدۇ.','Enable full-height editor and distraction-free functionality.'=>'تولۇق ئېگىزلىك ۋە دەخلىسىز يېزىش ئىقتىدارىنى قوزغىتىش','https://planet.wordpress.org/feed/'=>'https://planet.wordpress.org/feed/','https://planet.wordpress.org/'=>'https://planet.wordpress.org/','Untested with your version of WordPress'=>'سىز ئىشلىتىۋاتقان WordPress نەشرى بىلەن سىنالمىغان','You can now manage and live-preview Custom Header in the <a href="%s">Customizer</a>.'=>'نۆۋەتتە «خاس بەت بېشىنى» <a href="%1$s">خاسلاشتۇرۇش</a> بېتىدىن باشقۇرالايسىز ۋە نەق مەيدان ئالدىن كۆرۈپ باقالايسىز.','You can now manage and live-preview Custom Backgrounds in the <a href="%s">Customizer</a>.'=>'نۆۋەتتە «خاس ئارقا كۆرۈنۈش رەڭگىنى» <a href="%1$s">خاسلاشتۇرۇش</a> بېتىدىن باشقۇرالايسىز ۋە نەق مەيدان ئالدىن كۆرۈپ باقالايسىز.','All categories'=>'بارلىق سەھىپىلەر','You are now logged out everywhere else.'=>'سىز ھازىر باشقا بىر جايدا چېكىنىپ كەتتىڭىز.','%s has been logged out.'=>'%s چېكىنىپ كەتتى.','Could not log out user sessions. Please try again.'=>'ئىشلەتكۈچى ئۇلىنىشىدىن چېكىنەلمىدى، قايتا سىناڭ.','This preview is unavailable in the editor.'=>'بۇنى تەھرىرلىگۈچتە ئالدىن كۆرۈپ بېقىشقا بولمىدى.','<strong>Post editor</strong> &mdash; Enter the text for your post. There are two modes of editing: Visual and Text. Choose the mode by clicking on the appropriate tab.'=>'<strong>يازما تەھرىرلىگۈچ</strong>- يازما تېكىستى كىرگۈزۈڭ. ئىككى خىل تەھرىرلەش شەكلى بار: كۆرۈنمە شەكلى ۋە تېكىست شەكلى.بەتكۈشتىن ئۆزىڭىز ياقتۇرغان شەكىلنى تاللاڭ.','You can insert media files by clicking the button above the post editor and following the directions. You can align or edit images using the inline formatting toolbar available in Visual mode.'=>'يازما تەھرىرلىگۈچنىڭ ئۈستىدىكى سىن بەلگىنى چېكىپ كۆرسەتمىلەرگە ئاساسەن ۋاسىتە ھۆججىتىنى قىستۇرالايسىز. قۇردىكى فورماتلاش قورالىدىن پايدىلىنىپ رەسىملەرنى توغرىلىيالايسىز ياكى تەھرىرلىيەلەيسىز.','Filter by comment type'=>'ئىنكاس تىپىغا ئاساسەن سۈزىدۇ','Welcome panelWelcome'=>'خۇش كەلدىڭىز','link nameName'=>'ئاتى','usersAll <span class="count">(%s)</span>'=>'ھەممىسى: <span class="count">(%s)</span>' . "\0" . 'ھەممىسى: <span class="count">(%s)</span>','If you like, you may enter custom structures for your category and tag URLs here. For example, using <code>topics</code> as your category base would make your category links like <code>%s/topics/uncategorized/</code>. If you leave these blank the defaults will be used.'=>'ئەگەر خالىسىڭىز سەھىپە ۋە بەلگە ئۈچۈن ئىختىيارى قۇرۇلما تور ئادرېسى كىرگۈزسىڭىزمۇ بولىدۇ. مەسىلەن: <code>تېمىلار</code> سىزنىڭ سەھىپە يىلتىزىڭىز بولسا <code>%s/topics/uncategorized/</code> شەكلىدە بولىدۇ. ئەگەر بوش قويسىڭىز نۆۋەتتىكى تەڭشەك كۈچكە ئېگە بولىدۇ.','Release Lead'=>'تارقىتىش باشلامچىسى','Use the arrow buttons at the top of the dialog, or the left and right arrow keys on your keyboard, to navigate between media items quickly.'=>'دىيالوگ رامكىسىنىڭ ئۈستىدىكى ئىسترېلكا ياكى كۇنۇپكا تاختىسىدىكى ئوڭ-سول ئىسترېلكا كۇنۇپكىلىرى ئارقىلىق ۋاسىتەلەرنى تېز كۆرۈڭ.','You can also delete individual items and access the extended edit screen from the details dialog.'=>'تەپسىلاتلار دىيالوگ رامكىسىدىكى كېڭەيتىلگەن تەھرىرلەش ئېكرانىدىكى خاس نەرسىلەرنى ئۆچۈرەلەيسىز ياكى زىيارەت قىلالايسىز.','Clicking an item will display an Attachment Details dialog, which allows you to preview media and make quick edits. Any changes you make to the attachment details will be automatically saved.'=>'بىرەر نەرسىنى چەكسىڭىز، «قوشۇمچە ھۆججەت تەپسىلاتلىرى» دىيالوگ رامكىسىدا كۆرۈنىدۇ، ۋاسىتەنى كۆرەلەيسىز ياكى تېز تەھرىرلىيەلەيسىز. قوشۇمچە ھۆججەت تەپسىلاتلىرىغا قىلغان ھەرقانداق ئۆزگەرتىشىڭىز ئاپتوماتىك ساقلىنىدۇ.','To delete media items, click the Bulk Select button at the top of the screen. Select any items you wish to delete, then click the Delete Selected button. Clicking the Cancel Selection button takes you back to viewing your media.'=>'ۋاسىتەلەرنى ئۆچۈرۈش ئۈچۈن ئېكراننىڭ ئۈستىدىكى «توپ ئۆچۈرۈش» كۇنۇپكىسىنى چېكىڭ. ئۆچۈرمەكچى بولغان ھەرقانداق نەرسىلەرنى تاللاپ، «تاللانغانلارنى ئۆچۈرۈش» كۇنۇپكىسىنى باسسىڭىز بولىدۇ. ۋاسىتەرىڭىزنى قايتا كۆرۈش ئۈچۈن «تاللاش ئىناۋەتسىز» كۇنۇپكىسىنى باسسىڭىز بولىدۇ.','You can view your media in a simple visual grid or a list with columns. Switch between these views using the icons to the left above the media.'=>'ئاددىي تور كاتەكچە ياكى تىزىملىك شەكلىدە ۋاسىتەرىڭىزنى كۆرەلەيسىز. ۋاسىتەنىڭ سول تەرەپ ئۈستىدىكى سىنبەلگە بىلەن بۇ كۆرۈنۈش ئارىسىدا ئالمىشالايسىز.','If you just want to get an idea of what&#8217;s available, you can browse Featured and Popular plugins by using the links above the plugins list. These sections rotate regularly.'=>'سىز نېمە يېڭىلىقلارنىڭ بارلىقىنى بىلمەكچى بولسىڭىز، ئېكراننىڭ ئۈستى سول تەرەپتىكى ئۇلىنىش ئارقىلىق تەۋسىيەلىك ھەم ئاۋات قىستۇرمىلارنى كۆرەلەيسىز.','All the files you&#8217;ve uploaded are listed in the Media Library, with the most recent uploads listed first.'=>'سىز تورغا يوللىغان بارلىق ھۆججەتلەر ۋاسىتە ئامبىرىدا كۆرسىتىلدى، ئەڭ يېقىنقىلىرى ئالدىدا تىزىلدى.','Browse Plugins'=>'قىستۇرمىلارغا كۆز يۈگۈرت','Add Plugins'=>'قىستۇرما قوش','The %1$s constant in your %2$s file is no longer needed.'=>'تۇراقلىق مىقدار %s نىڭ ئەمدى كېرىكى يوق، ئۇ ھۆججىتىڭىز %s دە.','Invalid translation type.'=>'ئىناۋەتسىز تەرجىمە تىپى.','Welcome to the famous five-minute WordPress installation process! Just fill in the information below and you&#8217;ll be on your way to using the most extendable and powerful personal publishing platform in the world.'=>'داڭلىق بەش مىنۇتلۇق WordPress نى ئورنىتىش باسقۇچىغا مەرھابا! پەقەت تۆۋەندىكى ئۇچۇرلارنى تولدۇرسىڭىزلا، دۇنيادىكى ئەڭ كۈچلۈك ۋە كېڭىيىشچانلىقى يۇقىرى بولغان شەخسىي ئېلان قىلىش سۇپىسىنى ئىشلىتىش يولىغا كىرىپ كېتىسىز.','<strong>Incompatible</strong> with your version of WordPress'=>'سىز ئىشلىتىۋاتقان WordPress نىڭ نەشرى بىلەن <strong>ماسلىشىشچان ئەمەس</strong> ئىكەن.','<strong>Compatible</strong> with your version of WordPress'=>'سىز ئىشلىتىۋاتقان WordPress نىڭ نەشرى بىلەن <strong>ماسلىشىشچان</strong> ئىكەن.','%d star'=>'%d يۇلتۇز' . "\0" . '%d يۇلتۇز','Select bulk action'=>'توپ مەشغۇلات تاللاش','The grid view for the Media Library requires JavaScript. <a href="%s">Switch to the list view</a>.'=>'ۋاسىتە ئامبىرىنىڭ تورسىمان كۆرۈنۈشى JavaScript نى تەلەپ قىلىدۇ. <a href="%s">تىزىملىك كۆرۈنۈشكە ئالمىشىش</a>.','Add the user without sending an email that requires their confirmation'=>'ئىشلەتكۈچىگە دەلىللەش ئېلخېتىنى ئەۋەتمەيلا ئىشلەتكۈچىنى قوشىدۇ','Plugin InstallerBeta Testing'=>'Beta نەشرى سىناق قىلىنىۋاتىدۇ','More Details'=>'تېخىمۇ كۆپ تەپسىلاتلار','Number/count of itemsCount'=>'سانى','themesRecently Updated'=>'يېقىندا يېڭىلانغان','Contributors'=>'تۆھپىكارلار','%s failed to embed.'=>'%s قىستۇرۇشتا مەغلۇپ بولدى','Plugin installer group titlePerformance'=>'ئىقتىدارى','Plugin installer group titleSocial'=>'ئىجتىمائىي','Plugin installer group titleTools'=>'قوراللار','Plugin installer section titleReviews'=>'ئىنكاسلار','Donate to this plugin &#187;'=>'بۇ قىستۇرمىغا ئىئانە قىلىش','The WordPress team is willing to help you. Forward this email to %s and the team will work with you to make sure your site is working.'=>'WordPress گۇرۇپپىسى سىزگە ياردەم بېرىشنى خالايدۇ. بۇ ئېلېكىرونلۇق خەتنى %s گە يوللاپ بەرسىڭىز شۇ گۇرۇپپا سىز بىلەن بىرگە تور بېكىتىڭىزنىڭ نورمال يۈرۈشىگە كاپالەتلىك قىلىدۇ.','Filtering by:'=>'سۆزگۈچى:','To crop the image, click on it and drag to make your selection.'=>'رەسىمنى كېسىش ئۈچۈن،رەسىمنىڭ ئۈستىگە چېكىپ ھەم مائۇسنى سۆرەپ دائىرە تاللاڭ.','You can proportionally scale the original image. For best results, scaling should be done before you crop, flip, or rotate. Images can only be scaled down, not up.'=>'رەسىمنى نىسبەت بويىچە چوڭلۇقىنى ئۆزگەرتەلەيسىز. ياخشى ئۈنۈمگە ئېرىشىش ئۈچۈن رەسىمنى كېسىش، ئۆرۈش، ئايلاندۇرۇشتىن بۇرۇن چوڭلۇقىنى ئۆزگەرتىڭ. رەسىمنىڭ نىسبىتىنى كىچىكلىتىشكىلا بولىدۇ، چوڭايتىشقا بولمايدۇ.','A red bar on the left means the comment is waiting for you to moderate it.'=>'سول تەرەپتىكى قىزىل بالداق ئىنكاسنىڭ بىر تەرەپ قىلىشنى كۈتۈۋاتقانلىقىنى بىلدۈرىدۇ.','The aspect ratio is the relationship between the width and height. You can preserve the aspect ratio by holding down the shift key while resizing your selection. Use the input box to specify the aspect ratio, e.g. 1:1 (square), 4:3, 16:9, etc.'=>'كۆرۈنۈش نىسبىتى بولسا كەڭلىك بىلەن ئېگىزلىك ئوتتۇرىسىدىكى مۇناسىۋەتتتۇر. كۆرۈنۈش نىسبىتىنى ساقلاپ قېلىش ئۈچۈن تاللاشنى تەڭشىگەندە shift كۇنۇپكىسىنى بېسىپ تۇرسىڭىز بولىدۇ. كۆرۈنۈش نىسبىتىنى بېكىتىش ئۈچۈن كىرگۈزۈش ساندۇقىنى ئىشلىتىڭ، مەسىلەن: 1:1 (كىۋادرات)، 4:3، 16:9 قاتارلىق.','Once you have made your selection, you can adjust it by entering the size in pixels. The minimum selection size is the thumbnail size as set in the Media settings.'=>'تاللاپ بولغاندىن كېيىن، پىكسىلنى بىرلىك قىلىپ سان كىرگۈزۈش ئارقىلىق ئۇنى تەڭشىيەلەيسىز. ئەڭ كىچىك تاللاش چوڭلۇقى مېدىئادىكى كىچىك رەسىمنىڭ تەڭشەلگەن چوڭلۇقى بىلەن ئوخشاش.','You can edit the image while preserving the thumbnail. For example, you may wish to have a square thumbnail that displays just a section of the image.'=>'رەسىملەرنى ئەسلى كىچىك رەسىمىنى ساقلاپ قالغان ئاساستا تەھرىرلىيەلەيسىز. مەسىلەن:  سىز بەلكىم رەسىمنىڭ بىر قىسمىنىلا كۆرسىتىدىغان بىر كىچىك كىۋادرات رەسىمگە  ئېھتىياجلىقتۇرسىز.','Displayed on attachment pages.'=>'قوشۇمچە ھۆججەت بەتلىرىدە كۆرسىتىلدى','Keyboard users: When you are working in the visual editor, you can use %s to access the toolbar.'=>'ھەرپتاختا ئىشلەتكۈچىلەر: كۆرۈنۈشچان تەھرىرلىگۈچنى ئىشلىتىۋاتقىنىڭىزدا %s كۇنۇپكىسى ئارقىلىق قورال بالدىقىنى زىيارەت قىلالايسىز.','All comment types'=>'بارلىق باھالار تىپى','themesPopular'=>'ئالقىشلانغان','themesLatest'=>'ئەڭ يېڭى','themesFeatured'=>'تەۋسىيەلىك','<strong>Box Controls</strong> &mdash; Click the title bar of the box to expand or collapse it. Some boxes added by plugins may have configurable content, and will show a &#8220;Configure&#8221; link in the title bar if you hover over it.'=>'<strong>ساندۇق كونتروللىرى</strong> -ساندۇقنىڭ تېما بالدىقىنى چىكىپ ئۇنى يىغىڭ ياكى ئېچىڭ. قىستۇرمىلار قوشقان ساندۇقلارنىڭ تەڭشىلىشچان مەزمۇنى بولۇشى مۇمكىن، مائۇسنى ئۇنىڭ ئۈستىگە ئاپارسىڭىز تېما بالدىقىدا تەڭشەك ئۇلىنىشىنى كۆرسىتىپ بېرىدۇ.','https://wordpress.org/support/forum/how-to-and-troubleshooting'=>'https://wordpress.org/support/forum/how-to-and-troubleshooting','Attribute all content to:'=>'بارلىق مەزمۇننىڭ خاسلىقى:','Delete all content.'=>'بارلىق مەزمۇنلارنى ئۆچۈرىدۇ.','What should be done with content owned by this user?'=>'بۇ ئىشلەتكۈچىنىڭ مەزمۇنى قانداق بىرتەرەپ قىلىنىدۇ؟','themeDetails &amp; Preview'=>'تەپسىلات ۋە ئالدىن كۆزەت','Search themes...'=>'ئۆرنەك ئىزدە…','Search Themes'=>'ئۆرنەك ئىزدەش','Add Themes'=>'ئۆرنەك قوش','Sorry, you are not allowed to resume this theme.'=>'كەچۈرۈڭ، بۇ ئۆرنەكنى ئەسلىگە كەلتۈرۈش ئىجازىتىڭىز يوق.','<strong>Delete</strong> brings you to the Delete Users screen for confirmation, where you can permanently remove a user from your site and delete their content. You can also delete multiple users at once by using bulk actions.'=>'<strong>«ئۆچۈر»</strong> سىزنى دەلىللىشىڭىز ئۈچۈن ئىشلەتكۈچىلەرنى ئۆچۈرۈش ئېكرانىغا باشلاپ بارىدۇ.  شۇ يەردە بېكىتىڭىزدىكى ئىشلەتكۈچىنى مەڭگۈلۈك چىقىرىۋېتىپ، ئۇلارنىڭ مەزمۇنىنى ئۆچۈرۈۋېتەلەيسىز. توپ مەشغۇلات ئارقىلىق بىر قېتىمدا كۆپ ئىشلەتكۈچىنى ئۆچۈرۈۋېتەلەيسىز.','<strong>Remove</strong> allows you to remove a user from your site. It does not delete their content. You can also remove multiple users at once by using bulk actions.'=>'<strong>چىقىرىۋەت</strong> نى بېسىپ بېكىتىڭىزدىن بىر ئىشلەتكۈچىنى چىقىرىۋېتەلەيسىز. ئۇ ئىشلەتكۈچىنىڭ يوللىغان مەزمۇنلىرىنى ئۆچۈرمەيدۇ. توپ مەشغۇلات بىلەن بىر قېتىمدا كۆپ ئىشلەتكۈچىنى چىقىرىۋېتەلەيسىز.','<strong>At a Glance</strong> &mdash; Displays a summary of the content on your site and identifies which theme and version of WordPress you are using.'=>'<strong>بېكەت ئەھۋالى</strong>- تور بېكىتىڭىزدىكى مەزمۇنلارنىڭ ئۈزۈندىسى ۋە WordPress ئىشلىتىۋاتقان ئۆرنەك ۋە نەشرىنى كۆرسىتىپ بېرىدۇ.','Edit status'=>'ھالەت تەھرىرلەش','Edit visibility'=>'كۆرۈنۈشچانلىقىنى تەھرىرلەش','Browse revisions'=>'تۈزىتىلگەن نۇسخىسىنى كۆرۈش','Edit date and time'=>'چېسلا ۋە ۋاقىتنى تەھرىرلەش','Thank you for creating with <a href="%s">WordPress</a>.'=>'<a href="%s">WordPress</a> تىن پايدىلىنىپ قۇرغانلىقىڭىزغا رەھمەت.','<a href="https://wordpress.org/support/forum/multisite/">Support forums</a>'=>'<a href="https://wordpress.org/support/forum/multisite/">قوللاش مۇنبىرى</a>','Search installed themes...'=>'قاچىلانغان ئۆرنەكلەرنى ئىزدەش...','If an update is available, you&#8127;ll see a notification appear in the Toolbar and navigation menu.'=>'يېڭىلانمىنى ئىشلەتكىلى بولسا «قورالبالداق» ياكى «يولباشچى» تىزىملىكىدە ئۇقتۇرۇشىنى كۆرىسىز.','In most cases, WordPress will automatically apply maintenance and security updates in the background for you.'=>'نۇرغۇن ئەھۋالدا WordPress ئاسىراش ۋە بىخەتەرلىك يېڭىلانمىلىرىنى ئارقا سۇپىدا ئاپتوماتىك قوللىنىدۇ.','<strong>Translations</strong> &mdash; The files translating WordPress into your language are updated for you whenever any other updates occur. But if these files are out of date, you can <strong>click the &#8220;Update Translations&#8221;</strong> button.'=>'<strong>تەرجىمە</strong> &mdash; تىلىڭىزدىكى WordPress نىڭ تەرجىمە ھۆججەتلىرى باشقا ھەرقانداق يېڭىلانما يېڭىلانغاندا بىرلىكتە يېڭىلايدۇ. ئەمما بۇ ھۆججەتلەرنىڭ ۋاقتى ئۆتكەن بولسا،  <strong>«تەرجىمىلەرنى يېڭىلاش»</strong>توپچىسىنى چەكسىڭىز بولىدۇ.','<strong>WordPress</strong> &mdash; Updating your WordPress installation is a simple one-click procedure: just <strong>click on the &#8220;Update now&#8221; button</strong> when you are notified that a new version is available.'=>'<strong>WordPress</strong>نى يېڭىلاش بىر چېكىش بىلەنلا ئەمەلگە ئاشىدىغان ئاددىي مەشغۇلات. يېڭى نەشرىنى ئىشلەتكىلى بولىدىغان ئۇقتۇرۇشنى كۆرگەندە <strong>«ھازىر يېڭىلا» توپچە</strong>نى چەكسىڭىزلا بولىدۇ.','<strong>Themes and Plugins</strong> &mdash; To update individual themes or plugins from this screen, use the checkboxes to make your selection, then <strong>click on the appropriate &#8220;Update&#8221; button</strong>. To update all of your themes or plugins at once, you can check the box at the top of the section to select all before clicking the update button.'=>'<strong>«ئۆرنەكلەر ۋە قىستۇرۇلمىلار»</strong> &mdash; بۇ ئېكراندا ئايرىم ئۆرنەكلەر ياكى قىستۇرۇلمىلارنى يېڭىلاش ئۈچۈن «تەكشۈرۈش رامكىسى» ئارقىلىق تاللاشنى جەزملەشتۈرۈڭ، ئاندىن <strong>مۇۋاپىق «يېڭىلاش» توپچىسى</strong>نى چېكىڭ. بارلىق ئۆرنەكلەر ياكى قىستۇرۇلمىلارنى بىرلا قېتىمدا يېڭىلاش ئۈچۈن ئەڭ ئۈستىدىكى تەكشۈرۈش رامكىسىنى تاللىسىڭىزلا بولىدۇ.','On this screen, you can update to the latest version of WordPress, as well as update your themes, plugins, and translations from the WordPress.org repositories.'=>'بۇ ئېكراندا ئەڭ يېڭى نەشردىكى WordPress كە يېڭىلاش مەشغۇلاتى، شۇنداقلا ئۆرنەك ۋە قىستۇرمىلارنى WordPress.org يېڭىلاش بوشلۇقىدىن يېڭىلاش مەشغۇلاتىنى ئورۇنلىغىلى بولىدۇ.','If you would like to see more themes to choose from, click on the &#8220;Add New Theme&#8221; button and you will be able to browse or search for additional themes from the <a href="%s">WordPress Theme Directory</a>. Themes in the WordPress Theme Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they&#8217;re free!'=>'تېخىمۇ كۆپ ئۆرنەك ئارىسىدىن تاللىماقچى بولسىڭىز، «يېڭى ئۆرنەك قوش» توپچەنى چەكسىڭىز، <a href="%s" target="_blank">WordPress.org «ئۆرنەك مۇندەرىجىسى»</a>دىكى قوشۇمچە ئۆرنەكلەرنى كۆرەلەيسىز ياكى ئىزدىيەلەيسىز. WordPress.org ئۆرنەك مۇندەرىجىسىدىكى ئۆرنەكلەرنى ئۈچىنچى تەرەپ لايىھەلەپ ياسىغان بولۇپ، WordPress ئىشلىتىۋاتقان ئىجازەتنامە بىلەن ماسلىشىدۇ. ئەلۋەتتە، ئۇلار پۈتۈنلەي ھەقسىز!','%s MB Space Allowed'=>'%sMB بوشلۇقنى ئىشلەتكىلى بولىدۇ','%1$s MB (%2$s%%) Space Used'=>'ئىشلىتىلگەن بوشلۇق: %1$s MB، جەمئىي %2$s','M jS'=>'n-ئاينىڭ j-كۈنى','%s Page'=>'%s بەت' . "\0" . '%s بەت','%s Post'=>'%s يازما' . "\0" . '%s يازما','At a Glance'=>'بىر نەزەر','When this setting is in effect, a reminder is shown in the At a Glance box of the Dashboard that says, &#8220;Search engines discouraged&#8221;, to remind you that you have directed search engines to not crawl your site.'=>'بۇ تەڭشەكلەر كۈچكە ئىگە بولغاندا، «باشقۇرۇش تاختىسى» دىكى «كۆز يۈگۈرتۈش» رامكىسىدا «ئىزدەش ماتورلىرى ئىناۋەتسىز قىلىندى» دېگەن ئەسكەرتىش كۆرۈنۈپ، ئىزدەش موتورى ئۆمۈچۈكىنىڭ تور بېكىتىڭىزنى ئاپتوماتىك زىيارەت قىلمايدىغانلىقىنى ئەسكەرتىدۇ.','themeActive:'=>'ئاكتىپ:','Accessibility Ready'=>'زىيارەتكە قۇلاي','This is a child theme of %s.'=>'بۇ %s نىڭ بالا ئۆرنەكى','The active theme is displayed highlighted as the first theme.'=>'ئاكتىپ ئۆرنەك يورۇتۇلغان تۇنجى ئۆرنەك سۈپىتىدە كۆرسىتىلىدۇ.','Click on the theme to see the theme name, version, author, description, tags, and the Delete link'=>'ئۆرنەك چېكلسە، ئۆرنەك ئىسمى، نەشرى، يازغۇچى، چۈشەندۈرۈشى، بەلگىلىرى ۋە «ئۆچۈرۈش ئۇلانمىسىنى كۆرسىتىدۇ','Hover or tap to see Activate and Live Preview buttons'=>'نىشانلانسا ياكى چېكىلسە ئاكتىپ ۋە شۇئان ئالدىن كۆزىتىش توپچىسىنى كۆرگىلى بولىدۇ.','This screen is used for managing your installed themes. Aside from the default theme(s) included with your WordPress installation, themes are designed and developed by third parties.'=>'بۇ ئېكران ئورنىتىلغان ئۆرنەكلەرنى باشقۇرۇش ئۈچۈن ئىشلىتىلىدۇ. WordPress ئورنىتىش پىروگراممىڭىز ئۆز ئىچىگە ئالغان كۆڭۈلدىكى ئۆرنەكلەردىن باشقىلىرىنى ئۈچۈنچى تەرەپ لايىھەلەپ ۋە ئىجاد قىلغان.','When previewing on smaller monitors, you can use the collapse icon at the bottom of the left-hand pane. This will hide the pane, giving you more room to preview your site in the new theme. To bring the pane back, click on the collapse icon again.'=>'كىچىكرەك ئېكرانلاردا ئالدىن كۆزەتكەندە، سول تەرەپتىكى رامكىنىڭ ئاستىدىكى «يىغىش» سىنبەلگىسىنى ئىشلەتسىڭىز بولىدۇ. بۇ رامكىنى يوشۇرۇپ تور بېكىتىڭىزنى يېڭى ئۆرنەكتە ئالدىن كۆزىتىش ئۈچۈن كۆپرەك بوشلۇق بىلەن تەمىنلەيدۇ. رامكىنى ئەسلىگە قايتۇرۇش ئۈچۈن، «يىغىش» سىنبەلگىسى قايتا چېكىلىدۇ.','Tap or hover on any theme then click the Live Preview button to see a live preview of that theme and change theme options in a separate, full-screen view. You can also find a Live Preview button at the bottom of the theme details screen. Any installed theme can be previewed and customized in this way.'=>'ھەرقانداق ئۆرنەكنى چېكىپ ياكى ئۈستىدە توختاپ، شۇئان ئالدىن كۆزىتىش توپچىسىنى چېكىپ، ئۆرنەكلەرنى شۇئان ئالدىن كۆزەتكىلى بولىدۇ. ئاندىن پۈتۈن ئېكرانلىق كۆرۈنۈشتە ئۆرنەك تاللانمىلىرىنى ئايرىم ئۆزگەرتكىلى بولىدۇ. سىز يەنە ئۆرنەك تەپسىلاتلىرى ئېكرانىنىڭ ئاستىدىن شۇئان ئالدىن كۆزەت توپچىسىنى تاپالايسىز. ئورنىتىلغان ھەر قانداق ئۆرنەكنى مۇشۇ ئۇسۇل بىلەن ئالدىن كۆزەتكىلى ۋە خاسلاشتۇرغىلى بولىدۇ.','Click Customize for the active theme or Live Preview for any other theme to see a live preview'=>'نۆۋەتتىكى ئاكتىپ ئۆرنەكنى خاسلاشتۇرۇش ياكى باشقا ئۆرنەكنىڭ شۇئان ئالدىن كۆزىتىش توپچىسىنى چېكىپ شۇئان ئالدىن كۆزەتكىلى بولىدۇ','The theme being previewed is fully interactive &mdash; navigate to different pages to see how the theme handles posts, archives, and other page templates. The settings may differ depending on what theme features the theme being previewed supports. To accept the new settings and activate the theme all in one step, click the Activate &amp; Publish button above the menu.'=>'نۆۋەتتە ئالدىن كۆزىتىۋاتقان ئۆرنىكىڭىز تولۇق تەسىرلىشىشچان بولۇپ، ئوخشىمىغان بەتلەرگە يۆتكىلىش ئارقىلىق ئۆرنەكنىڭ يازما، ئارخىپ ۋە باشقا بەت قېلىپلىرىنى قانداق بىر تەرەپ قىلىدىغانلىقىنى كۆرەلەيسىز. ئۆرنەكنىڭ ئىقتىدارىغا ئاساسەن تەڭشەكلەر ئوخشاش بولماسلىقى مۇمكىن. يېڭى تەكشەكلەرنى قوللىنىپ ۋە ئۆرنەكنى بىرلا باسقۇچتا ئاكتىپلاش ئۈچۈن ئۈستىدىكى تىزىملىكتىكى «ئاكتىپلاپ تارقات» توپچىسىنى چېكىڭ.','To activate a widget drag it to a sidebar or click on it. To deactivate a widget and delete its settings, drag it back.'=>'ئەپچە ئاكتىپلاش ئۈچۈن ئۇلارنى بۇ يەردىن يانبالداققا سۆرەپ ئەكىرىڭ ياكى ئۇنى چېكىڭ. ئەپچەنى ئاكتىپسىزلاپ، تەڭشەكلىرىنى ئۆچۈرۈۋېتىش ئۈچۈن بۇ يەرگە قايتا سۆرەپ ئەكىرىڭ.','%s rating'=>'%s دەرىجە','%1$s rating based on %2$s rating'=>'%1$s دەرىجە، جەمئىي %2$s دەرىجە' . "\0" . '%1$s دەرىجە، جەمئىي %2$s دەرىجە','This screen shows an individual user all of their sites in this network, and also allows that user to set a primary site. They can use the links under each site to visit either the front end or the dashboard for that site.'=>'بۇ ئېكران بۇ توردىكى يەككە ئىشلەتكۈچىنىڭ بارلىق تور بېكەتلىرىنى كۆرسىتىپ بېرىدۇ، شۇنداقلا ئۇ ئىشلەتكۈچىنىڭ ئاۋۋال ئىشلىتىلىدىغان بېكەت بەلگىلىشىگە رۇخسەت قىلىدۇ. ئۇ ئىشلەتكۈچى ھەر بىر بېكەتنىڭ ئاستىدىكى ئۇلانمىنى ئىشلىتىپ ئۇ تور بېكەتنىڭ كۆرۈرمەن قىسىمى ياكى باشقۇرۇش تاختىسىنى زىيارەت قىلالايدۇ.','Rollback Error: [%1$s] %2$s'=>'Rollback خاتالىقى:  [%1$s] %2$s','Error: [%1$s] %2$s'=>'خاتالىق:  [%1$s] %2$s','The following plugins were successfully updated:'=>'تۆۋەندىكى قىستۇرمىلار ئوڭۇشلۇق يېڭىلاندى:','The following translations were successfully updated:'=>'تۆۋەندىكى تەرجىمىلەر ئوڭۇشلۇق يېڭىلاندى:','The following translations failed to update:'=>'تۆۋەندىكى تەرجىمىلەرنى يېڭىلىيالمىدى:','The following themes failed to update:'=>'تۆۋەندىكى ئۆرنەكلەرنى يېڭىلىيالمىدى:','The following plugins failed to update:'=>'تۆۋەندىكى قىستۇرمىلارنى يېڭىلىيالمىدى:','The following themes were successfully updated:'=>'تۆۋەندىكى ئۆرنەكلەر ئوڭۇشلۇق يېڭىلاندى:','<strong>Screen Options</strong> &mdash; Use the Screen Options tab to choose which Dashboard boxes to show.'=>'<strong>«ئېكران تاللانمىلىرى»</strong> - «ئېكران تاللانمىلىرى» بەتكۈشى ئارقىلىق كۆرسىتىدىغان «باشقۇرۇش تاختىسى» رامكىلىرىنى تاللاڭ.','<strong>Activity</strong> &mdash; Shows the upcoming scheduled posts, recently published posts, and the most recent comments on your posts and allows you to moderate them.'=>'<strong>«پائالىيەت»</strong> - كېلىۋاتقان كۈنتەرتىپتىكى يازمىلار، يېقىندا ئېلان قىلىنغان يازمىلار ۋە يازمىڭىزدىكى ئەڭ يېقىنقى باھالارنى كۆرسىتىدۇ ھەمدە ئۇلارنى باشقۇرۇشقا رۇخسەت قىلىدۇ.','Add Widget'=>'ئەپچە قوش','Show next theme'=>'كېيىنكى ئۆرنەكنى كۆرسەت','Show previous theme'=>'ئالدىنقى ئۆرنەكنى كۆرسەت','Update Available'=>'يېڭىلانما بار','Add New Theme'=>'يېڭى ئۆرنەك قوش','Are you sure you want to delete this theme?

Click \'Cancel\' to go back, \'OK\' to confirm the delete.'=>'بۇ ئۆرنەكنى راستتىنلا ئۆچۈرەمسىز؟
«ۋاز كەچ» نى چېكىلسە قايتىدۇ، «جەزملە» چېكىلسە ئۆچۈرۈشنى جەزملەيدۇ.','Unable to submit this form, please refresh and try again.'=>'بۇ جەدۋەلنى تاپشۇرالمىدى، يېڭىلاپ قايتا سىناڭ.','<strong>Quick Draft</strong> &mdash; Allows you to create a new post and save it as a draft. Also displays links to the 3 most recent draft posts you\'ve started.'=>'<strong>«تېز دەسلەپكى نۇسخا»</strong> - يېڭى يازما يېزىش ۋە ئۇنى دەسلەپكى نۇسخا قىلىپ ساقلاشقا رۇخسەت قىلىدۇ. ئۇنىڭدىن باشقا يەنە سىز يېزىشقا باشلىغان ئەڭ يېقىنقى 3 دەسلەپكى نۇسخا ئۇلانمىسى كۆرسىتىلىدۇ.','Activity'=>'پائالىيەت','Tomorrow'=>'ئەتە','WordPress site: %s'=>'WordPress بېكىتى: %s','SUCCESS: WordPress was successfully updated to %s'=>'ئوڭۇشلۇق بولدى: WordPress نى %s گە يېڭىلاش ئوڭۇشلۇق بولدى','SUCCESS: %s'=>'ئوڭۇشلۇق بولدى: %s','FAILED: %s'=>'مەغلۇپ بولدى: %s','What&#8217;s on your mind?'=>'نېمىنى ئويلاۋاتىسىز؟','Publishing Soon'=>'يېقىندا ئېلان قىلىنىدۇ','Recently Published'=>'يېقىندا ئېلان قىلىنغانلىرى','No activity yet!'=>'پائالىيەت يوق','Popular Plugin'=>'ئالقىشلانغان قىستۇرما','Manage Uploads'=>'يۈكلەشنى باشقۇرۇش','WordPress %1$s running %2$s theme.'=>'WordPress %1$s ئىجرا بولۇۋاتقان ئۆرنەك %2$s','Quick Draft'=>'تېز دەسلەپكى نۇسخا','FAILED: WordPress failed to update to %s'=>'مەغلۇپ بولدى: WordPress نى %s گە يېڭىلىيالمىدى','WordPress %s is also now available.'=>'ھازىر WordPress %s نى ئىشلەتكىلى بولىدۇ.','Your site at %1$s experienced a critical failure while trying to update WordPress to version %2$s.'=>'%1$s دىكى بېكىتىڭىز WordPress نەشرىنى %2$s غا يېڭىلىۋاتقاندا ئەجەللىك خاتالىققا يولۇقتى.','Your site was running version %s.'=>'بېكىتىڭىزدە ئىجرا بولۇۋاتقان نەشرى %s.','The update cannot be installed because your site is unable to copy some files. This is usually due to inconsistent file permissions.'=>'يېڭىلانمىنى ئورنىتالمىدى، چۈنكى تور بېكىتىڭىز بەزى ھۆججەتلەرنى كۆچۈرەلمىدى. بۇنىڭ ئاساسىي سەۋەبى ھۆججەت ئىجازىتى بىردەك ئەمەس.','Updating translations for %1$s (%2$s)&#8230;'=>'%1$s (%2$s) نىڭ تەرجىمىسى يېڭىلىنىۋاتىدۇ...','Translations for %s'=>'%s نىڭ تەرجىمىسى','[%1$s] Your site has updated to WordPress %2$s'=>'[%1$s] تور بېكىتىڭىز WordPress %2$ غا يېڭىلاندى','[%1$s] WordPress %2$s is available. Please update!'=>'[%1$s] WordPress %2$s نى ئىشلەتكىلى بولىدۇ. يېڭىلىۋېلىڭ!','[%1$s] URGENT: Your site may be down due to a failed update'=>'[%1$s] جىددىي: بېكىتىڭىز يېڭىلاشتا مەغلۇپ بولغانلىقتىن تاقىلىدۇ.','Howdy! Your site at %1$s has been updated automatically to WordPress %2$s.'=>'ئەسسالامۇئەلەيكۇم! %1$s دىكى بېكىتىڭىز WordPress %2$s غا ئاپتوماتىك يېڭىلاندى.','No further action is needed on your part.'=>'سىز يەنە بىرنەرسە قىلمىسىڭىزمۇ بولىدۇ','Please update your site at %1$s to WordPress %2$s.'=>'بېكىتىڭىز %1$s دىكى WordPress %2$s نى يېڭىلىۋېلىڭ.','Updating is easy and only takes a few moments:'=>'يېڭىلاش ئاسان، پەقەت بىرنەچچە مىنۇت ۋاقىت كېتىدۇ:','Your site at %1$s experienced a critical failure while trying to update to the latest version of WordPress, %2$s.'=>'%1$s دىكى بېكىتىڭىز WordPress نىڭ %2$s ئەڭ يېڭى نەشرىگە يېڭىلىۋاتقاندا ئەجەللىك خاتالىققا يولۇقتى.','This means your site may be offline or broken. Don\'t panic; this can be fixed.'=>'بۇ بېكىتىڭىز توردىن ئۈزۈلگەن ياكى بۇزۇلغان دېمەكچى. كۆڭلىڭىزنى يېرىم قىلماڭ، بۇنى ئوڭشاشقا بولىدۇ.','Please check out your site now. It\'s possible that everything is working. If it says you need to update, you should do so:'=>'تور بېكىتىڭىزنى دەرھال تەكشۈرۈڭ. ھەممە نورمال ئىشلىسۇن. ئەگەر ئۇ يېڭىلاشنى تەلەپ قىلسا، سىز مۇنداق قىلىڭ:','Keeping your site updated is important for security. It also makes the internet a safer place for you and your readers.'=>'بېكىتىڭىزنى يېڭىلاپ تۇرۇش بىخەتەرلىكنىڭ مۇھىملىقىدۇر. بۇنىڭدىن باشقا ئۇ سىز ۋە سىزنىڭ ئوقۇرمەنلىرىڭىزنى ئىنتېرنېتتتا تېخىمۇ بىخەتەر قىلىدۇ.','If you experience any issues or need support, the volunteers in the WordPress.org support forums may be able to help.'=>'ھەرقانداق مەسىلىگە يولۇقسىڭىز ياكى قوللاشقا ئېھتىياجلىق بولسىڭىز، WordPress.org قوللاش مۇنبىرىدىكى پىدائىيلار ياردەم بېرەلىشى مۇمكىن.','The WordPress Team'=>'WordPress كوللېكتىپى','Your hosting company, support forum volunteers, or a friendly developer may be able to use this information to help you:'=>'سىزنىڭ غول كومپيۇتېر(مۇلازىمىتېر) بىلەن تەمىنلىگەن شىركىتىڭىز، قوللاش مۇنبىرىدىكى پىدائىيلار ياكى دوستانە ئىجادىيەتچىلەر بۇ ئۇچۇرلار ئارقىلىق سىزگە ياردەم بېرىدۇ:','Error code: %s'=>'خاتالىق كود: %s','Your translations are all up to date.'=>'تەرجىمىلىرىڭىزنىڭ ئەڭ يېڭى ئىكەن.','Background updates'=>'تەگلىك يېڭىلانمىلىرى','Translations'=>'تەرجىمىسى','You also have some plugins or themes with updates available. Update them now:'=>'سىزنىڭ يەنە يېڭىلانمىلىرىنى ئىشلەتكىلى بولىدىغان بەزى قىستۇرۇلمىلىرىڭىز ياكى ئۆرنەكىڭىز بار. ئۇلارنى دەرھال يېڭىلاڭ:','For more on version %s, see the About WordPress screen:'=>'%s نەشرىدىكى تېخىمۇ كۆپ ئۇچۇرلارنى «WordPress ھەققىدە» ئېكرانىدىن كۆرۈۋېلىڭ:','Update Translations'=>'تەرجىمىلەرنى يېڭىلا','Translation update failed.'=>'تەرجىمە يېڭىلانمىدى.','Translation updated successfully.'=>'تەرجىمە ئوڭۇشلۇق يېڭىلاندى.','There is not enough free disk space to complete the update.'=>'يېڭىلانمىنى تاماملاش ئۈچۈن يېتەرلىك بوش دىسكا بوشلۇقى يوق.','Updating plugin: %s'=>'يېڭىلىنىۋاتقان قىستۇرما: %s','Updating theme: %s'=>'يېڭىلىنىۋاتقان ئۆرنەك: %s','Some of your translations need updating. Sit tight for a few more seconds while they are updated as well.'=>'بەزى تەرجىمىلىرىڭىزنى يېڭىلاش زۆرۈر. ئۇلارنى يېڭىلاۋاتقاندا بىر نەچچە سېكۇنت سەۋر قىلىڭ.','Create a brand new user and add them to this site.'=>'يېڭىدىن ئىشلەتكۈچى قۇرۇپ، ئۇلارنى بۇ بېكەتكە قوشۇڭ.','Upgrading to a newer version of the same theme will override changes made here. To avoid this, consider creating a <a href="%s">child theme</a> instead.'=>'ئوخشاش ئۆرنەكنىڭ يېڭىراق نۇسخىسىغا يېڭىلىغاندا بۇ يەردە ئېلىپ بارغان ئۆزگەرتىشلەرنى قاپلاپ يېزىۋېتىدۇ. بۇنىڭدىن ساقلىنىش ئۈچۈن ئۇنىڭ ئورنىغا <a href="%s" target="_blank">بالا ئۆرنەك</a> قۇرۇشنى ئويلىشىپ بېقىڭ.','The sizes listed below determine the maximum dimensions in pixels to use when adding an image to the Media Library.'=>'تۆۋەندە كۆرسىتىلگەن چوڭلۇق پىكسېل بويىچە «ۋاسىتە ئامبىرى»غا رەسىملەرنى قوشقاندىكى ئەڭ يۇقىرى ئۆلچەمنى بەلگىلەيدۇ.','Comment must be manually approved'=>'ئىنكاس قولدا تەستىقلانسۇن','Looking for %1$s in %2$s'=>'%2$s دىن %1$s نى ئىزدەۋاتىدۇ','WordPress %s'=>'WordPress %s','The checksum of the file (%1$s) does not match the expected checksum value (%2$s).'=>'بۇ ھۆججەتنىڭ تەكشۈرۈلمىسى (%1$s) ئۈمىد قىلغان تەكشۈرۈلمە قىممەت (%2$s) غا ماس كەلمىدى.','This password will not be stored on the server.'=>'بۇ پارول بۇ مۇلازىمىتېرغا ساقلىنالمىدى.','Copying the required files&#8230;'=>'تەلەپ قىلىنغان ھۆججەتلەر كۆچۈرۈلۈۋاتىدۇ...','Menus can be displayed in locations defined by your theme, even used in sidebars by adding a &#8220;Navigation Menu&#8221; widget on the <a href="%1$s">Widgets</a> screen. If your theme does not support the navigation menus feature (the default themes, %2$s and %3$s, do), you can learn about adding this support by following the documentation link to the side.'=>'تىزىملىك ھەتتا <a href="%1$s">«كىچىك قوراللار»</a> ئېكرانىدىكى ئىختىيارى تىزىملىك كىچىك قورالىنى قوشۇش ئارقىلىق يانبالداقلاردىمۇ ئىشلىگەن بولۇشىدىن قەتئىي نەزەر باشتېمىڭىز تەرىپىدىن ئېنىقلانغان جايدا كۆرسىتىلىدۇ. ئەگەر باشتېمىڭىز ئىختىيارى تىزىملىك ئىقتىدارىنى (يەنى سۈكۈتتىكى باشتېما، %2$s ۋە %3$s) قوللىمايدىغان بولسىمۇ، يان تەرەپ تۆۋەندىكى «ھۆججەتلەر» ئۇلانمىسى ئارقىلىق بۇنداق قوللاشنى قوشۇش ھەققىدە تېخىمۇ كۆپ مەزمۇنلارنى ئۆگىنەلەيسىز.','<strong>Clicking the arrow to the right of any menu item</strong> in the editor will reveal a standard group of settings. Additional settings such as link target, CSS classes, link relationships, and link descriptions can be enabled and disabled via the Screen Options tab.'=>'تەھرىرلىگۈچتىكى <strong>«ھەرقانداق تىزىملىك تۈرلىرىنىڭ ئوڭ تەرىپىدىكى يا ئوقنى چېكىش»</strong> ئارقىلىق تەڭشەكلەرنىڭ ئۆلچەملىك گۇرۇپپىسىنى كۆرسىتىشكە بولىدۇ. ئۇلانما نىشانى، CSS تۈرلىرى، ئۇلانما مۇناسىۋەتلىرى ۋە ئۇلانما چۈشەندۈرۈشىگە ئوخشاش قوشۇمچە تەڭشەكلەر «ئېكران تاللانمىلىرى بەتكۈچى» ئارقىلىق قوزغىتىپ ۋە چەكلىيەلەيدۇ.','Your theme does not natively support menus, but you can use them in sidebars by adding a &#8220;Navigation Menu&#8221; widget on the <a href="%s">Widgets</a> screen.'=>'باش تېمىڭىز تېگىدىن تىزىملىكلەرنى قوللىمايدۇ، ئەمما &#8220;«ئىختىيارى تىزىملىك»&#8221 نى قوشۇش ئارقىلىق ئۇلارنى يانبالداقتا ئىشلىتەلەيسىز. ئەپچەلەر <a href="%s">ئەپچەلەر</a>ئېكرانىدا.','You must provide an email address.'=>'بىر ئېلخەت ئادرېسى تەمىنلەڭ.','Your passwords do not match. Please try again.'=>'ئىم ماس كەلمىدى. قايتا سىناڭ','The username you provided has invalid characters.'=>'تەمىنلىگەن ئىشلەتكۈچى ئاتىڭىزدا ئىناۋەتسىز ھەرپ-بەلگە بار.','Please provide a valid username.'=>'ئىناۋەتلىك ئىشلەتكۈچى ئاتى بىلەن تەمىنلەڭ.','Preparing to install the latest version&#8230;'=>'ئەڭ يېڭى نەشرىنى ئورنىتىشقا تەييارلىنىۋاتىدۇ...','Updating to WordPress %s'=>'WordPress %s غا يېڭىلاۋاتىدۇ','Due to an error during updating, WordPress has been restored to your previous version.'=>'يېڭىلاۋاتقاندا خاتالىق كۆرۈلگەن بولغاچقا، WordPress ئىلگىرىكى نەشرىڭىزگە ئەسلىگە قايتۇرۇلىدۇ.','Sorry, that is not a valid email address. Email addresses look like <code>username@example.com</code>.'=>'كەچۈرۈڭ، بۇ ئىناۋەتلىك ئېلخەت ئادرېسى ئەمەس. ئېلخەت ئادرېسى <code>username@example.com</code> غا ئوخشاش بولىدۇ.','Category added.'=>'سەھىپە قوشۇلدى.','Category deleted.'=>'سەھىپە ئۆچۈرۈلدى.','Category updated.'=>'سەھىپە يېڭىلاندى.','Category not added.'=>'سەھىپە قوشۇلمىدى.','Category not updated.'=>'سەھىپە يېڭىلانمىدى.','Categories deleted.'=>'سەھىپىلەر ئۆچۈرۈلدى.','Tag added.'=>'بەلگە قوشۇلدى.','Tag deleted.'=>'بەلگە ئۆچۈرۈلدى.','Tag updated.'=>'بەلگە يېڭىلاندى.','Tag not added.'=>'بەلگە قوشۇلمىدى.','Tag not updated.'=>'بەلگە يېڭىلاندى.','Tags deleted.'=>'بەلگىلەر ئۆچۈرۈلدى.','%s page restored from the Trash.'=>'%s بەت «ئەخلەتخانا»تىن ئەسلىگە قايتۇرۇلدى.','%s page moved to the Trash.'=>'%s بەت «ئەخلەتخانا»غا يۆتكەلدى.','%s page permanently deleted.'=>'%s بەت مەڭگۈلۈك ئۆچۈرۈلدى.','%s page not updated, somebody is editing it.'=>'%s بەت يېڭىلانمىدى، بىرەيلەن ئۇنى تەھرىرلەۋاتىدۇ.','%s page updated.'=>'%s بەت يېڭىلاندى.','%s post restored from the Trash.'=>'%s يازما «ئەخلەتخانا» دىن ئەسلىگە قايتۇرۇلدى.','%s post moved to the Trash.'=>'%s يازما «ئەخلەتخانا»غا يۆتكەلدى.','%s post permanently deleted.'=>'%s يازما مەڭگۈلۈك ئۆچۈرۈلدى.','%s post not updated, somebody is editing it.'=>'%s يازما يېڭىلانمىدى، بىرەيلەن ئۇنى تەھرىرلەۋاتىدۇ.','Compare two different revisions by <strong>selecting the &#8220;Compare any two revisions&#8221; box</strong> to the side.'=>'يان تەرەپتىكى <strong>&#8220;ھەرقانداق ئىككى تۈزىتىلگەن نۇسخىنى سېلىشتۇرۇش&#8221; رامكىسىنى تاللاش</strong> ئارقىلىق ئوخشىمىغان ئىككى خىل تۈزىتىلگەن نۇسخىنى سېلىشتۇرۇڭ.','Compare any two revisions'=>'خالىغان ئىككى تۈزىتىلمەنى سېلىشتۇرىدۇ','"%1$s" from %2$s by %3$s.'=>'%1$s: %2$s%3$s دىكى ئىنكاس','"%1$s" from %2$s.'=>'"%1$s"، ئورنى %2$s.','"%1$s" by %2$s.'=>'%1$s:%2$s','"%s".'=>'"%s".','Restore This Autosave'=>'بۇ «ئاپتوماتىك ساقلاش»نى ئەسلىگە قايتۇر','Current Revision by %s'=>'نۆۋەتتىكى تۈزىتىلمە يازغۇچى: %s','Autosave by %s'=>'ئاپتوماتىك ساقلىغۇچى: %s','revisionsBrowse'=>'كۆز يۈگۈرت','Revisions: %s'=>'تۈزىتىلمە: %s','Revision by %s'=>'تۈزىتىلمە يازغۇچى: %s','<strong>Connection lost.</strong> Saving has been disabled until you are reconnected.'=>'<strong>ئۇلىنىش ئۈزۈك.</strong> قايتا ئۇلانغۇچە «ساقلاش» چەكلىنىدۇ.','Sorry, something went wrong. The requested comparison could not be loaded.'=>'كەچۈرۈڭ، مەسىلە كۆرۈلدى. ئىلتىماس قىلىنغان سېلىشتۇرۇشنى يۈكلىگىلى بولمىدى.','Repeat New Password'=>'يېڭى پارولنى تەكرارلاڭ','Repeat Password'=>'ئىمنى تەكرارلاڭ','Add menu items from the column on the left.'=>'سول تەرەپتىكى ئىستوندىن تىزىملىك تۈرلىرى قوشۇڭ','Plugins extend and expand the functionality of WordPress. You may install plugins in the <a href="%s">WordPress Plugin Directory</a> right from here, or upload a plugin in .zip format by clicking the button at the top of this page.'=>'قىستۇرما WordPress نىڭ ئىقتىدارىنى كېڭەيتىپ ۋە ئاشۇرىدۇ. <a href="%s">WordPress قىستۇرما مۇندەرىجىسى</a>دىن قىستۇرمىنى ئورناتسىڭىزمۇ ياكى بۇ بەتنىڭ چوققىسىدىكى توپچىنى چەكىپ قىستۇرمىنى zip پىچىمىدا يۈكلىسىڭىزمۇ بولىدۇ.','http://wordpress.org/plugins/hello-dolly/'=>'http://wordpress.org/plugins/hello-dolly/','The theme contains no files.'=>'بۇ باشتېمىدا ھېچقانداق ھۆججەت يوق ئىكەن.','The package contains no files.'=>'بۇ بوغچىدا ھېچقانداق ھۆججەت يوق ئىكەن.','To navigate between revisions, <strong>drag the slider handle left or right</strong> or <strong>use the Previous or Next buttons</strong>.'=>'تۈزىتىلگەن نۇسخىلار ئارىسىدا يۆتكىلىش ئۈچۈن <strong>سىيرىغۇچ تۇتقۇچىنى ئوڭغا ياكى سولغا سۆرەڭ</strong>ياكى <strong>«ئالدىنقى» ياكى «كېيىنكى» توپچەنى ئىشلىتىڭ</strong>.','Loading&hellip;'=>'يۈكلىنىۋاتىدۇ...','This item has already been deleted.'=>'بۇ تۈر ئۆچۈرۈلگەن ئىكەن.','The item you are trying to restore from the Trash no longer exists.'=>'«ئەخلەتخانا» دىن ئەسلىگە قايتۇرماقچى بولغان تۈرلەر ئەمدى مەۋجۇت ئەمەس.','The item you are trying to move to the Trash no longer exists.'=>'«ئەخلەتخانا»غا يۆتكىمەكچى بولغان تۈرلەر ئەمدى مەۋجۇت ئەمەس.','Drag the items into the order you prefer. Click the arrow on the right of the item to reveal additional configuration options.'=>'ھەربىر تۈرنى سىز ياقتۇرىدىغان تەرتىپ بويىچە سۆرەڭ. تۈرنىڭ ئوڭ تەرىپىدىكى يا ئوقنى چېكىپ، تېخىمۇ كۆپ سەپلىمە تاللانمىلىرىنى كۆرسىتىڭ.','If you have not yet created any menus, <strong>click the &#8217;create a new menu&#8217; link</strong> to get started'=>'ھازىرغىچە ھېچقانداق تىزىملىك قۇرمىغان بولسىڭىز، <strong>«يېڭى تىزىملىك قۇر» ئۇلانمىسى</strong>نى چېكىپ، ئىشلىتىشنى باشلاڭ','To restore a revision, <strong>click Restore This Revision</strong>.'=>'تۈزىتىلگەن نۇسخىنى ئەسلىگە قايتۇرۇش ئۈچۈن <strong>«بۇ تۈزىتىلگەن نۇسخىنى ئەسلىگە قايتۇر» نى چېكىڭ</strong>.','From this screen you can review, compare, and restore revisions:'=>'بۇ ئېكراندىن تۈزىتىلگەن نۇسخىلارنى قايتا تەكشۈرۈش، سېلىشتۇرۇش ۋە ئەسلىگە قايتۇرۇش مەشغۇلاتىنى قىلالايسىز:','Revisions are saved copies of your post or page, which are periodically created as you update your content. The red text on the left shows the content that was removed. The green text on the right shows the content that was added.'=>'تۈزىتىلگەن نۇسخىنىڭ مەزمۇنىنى يېڭىلىغاندا قەرەللىك قۇرۇلغان يازما ياكى بەتلىرىڭىزنىڭ كۆچۈرۈلمىسىنى ساقلايدۇ. سول تەرەپتىكى قىزىل تېكىست چىقىرىۋېتىلگەن مەزمۇننى كۆرسىتىدۇ، ئوڭ تەرەپتىكى يېشىل تېكىست قوشۇلغان مەزمۇننى كۆرسىتىدۇ.','This screen is used for managing your content revisions.'=>'بۇ ئېكران مەزمۇن تۈزىتىلمەلىرىڭىزنى باشقۇرۇشقا ئىشلىتىلىدۇ.','Followed by post revision infoTo:'=>'قوبۇللىغۇچى:','Followed by post revision infoFrom:'=>'ئەۋەتكۈچى:','Button label for a previous revisionPrevious'=>'ئالدىنقى','Button label for a next revisionNext'=>'كېيىنكى','Menu locations updated.'=>'تىزىملىك ئورنى يېڭىلاندى.','%1$s by %2$s.'=>'%1$s، ئاپتورى: %2$s.','Released: %d.'=>'تارقىتىلغان چېسلا: %d.','Track %1$s of %2$s.'=>'%1$s - كۈي، جەمئىي كۈي %2$s.','Genre: %s.'=>'ژانىرى: %s.','Audio Codec:'=>'ئۈن كودى:','This screen is used for managing your navigation menus.'=>'بۇ ئېكران ئىختىيارى يولباشچى تىزىملىكلەرنى باشقۇرۇش ئۈچۈن ئىشلىتىلىدۇ','From this screen you can:'=>'بۇ ئېكراندا مۇنداق ئىشلارنى قىلالايسىز:','Create, edit, and delete menus'=>'تىزىملىكلەرنى قۇرۇش، تەھرىرلەش ۋە ئۆچۈرۈش','The menu management box at the top of the screen is used to control which menu is opened in the editor below.'=>'ئۈستىدىكى ئېكراننىڭ تىزىملىك باشقۇرۇش رامكىسى تۆۋەندىكى تەھرىرلىگۈچتە ئېچىلغان تىزىملىكلەرنى كونترول قىلىشقا ئىشلىتىلىدۇ.','Menu Management'=>'تىزىملىك باشقۇرۇش','Editing Menus'=>'تىزىملىك تەھرىرلەش','Manage Locations'=>'ئورۇن باشقۇرۇش','menuUse new menu'=>'يېڭى تىزىملىك ئىشلىتىش','To assign menus to one or more theme locations, <strong>select a menu from each location&#8217;s dropdown</strong>. When you are finished, <strong>click Save Changes</strong>'=>'تىزىملىكلەرنى بىر ياكى بىرنەچچە باشتېما ئورنىغا تەقسىملەش ئۈچۈن <strong>ھەربىر ئورۇندىكى ئېسىلما تىزىملىكلەردىن تىزىملىك تاللاڭ</strong>. تاماملاپ بولغىنىڭىزدا، <strong>«ئۆزگەرتىشلەرنى ساقلاش»نى چېكىڭ</strong>','menuEdit'=>'تەھرىر','Select a Menu'=>'بىر تىزىملىك تاللىنىدۇ','Assigned Menu'=>'تەقسىملەنگەن تىزىملىك','Theme Location'=>'ئۆرنەك ئورنى','Edit Menus'=>'تىزىملىك تەھرىر','To add a new menu instead of assigning an existing one, <strong>click the &#8217;Use new menu&#8217; link</strong>. Your new menu will be automatically assigned to that theme location'=>'مەۋجۇت بىرسىگە تەقسىملەشنىڭ ئورنىغا يېڭى تىزىملىك قۇرۇش ئۈچۈن <strong>«يېڭى تىزىملىك ئۇلانمىسىنى ئىشلىتىش»نى چېكىڭ</strong>. يېڭى تىزىملىكىڭىز بۇ ئۆرنەك ئورنىغا ئاپتوماتىك تەقسىملىنىدۇ.','To edit a menu currently assigned to a theme location, <strong>click the adjacent &#8217;Edit&#8217; link</strong>'=>'نۆۋەتتە ئۆرنەك ئورنىغا تەقسىملەنگەن تىزىملىكلەرنى تەھرىرلەش ئۈچۈن <strong>قوشنا تەھرىرلەشنىڭ ئۇلانمىسىنى چېكىڭ</strong>','This screen is used for globally assigning menus to locations defined by your theme.'=>'بۇ ئېكران تىزىملىكلەرنى ئۆرنەكىڭىز تەرىپىدىن ئېنىقلانغان ئورۇنغا ئومۇمىي جەھەتتىن تەقسىملەش ئۈچۈن ئىشلىتىلىدۇ.','Delete a menu item by <strong>expanding it and clicking the Remove link</strong>'=>'تىزىملىك ئۆچۈرۈشتە <strong>تىزىملىك تۈرلىرىنى يېيىپ، «ئۇلانما چىقىرىۋەت»</strong> چېكىلىدۇ','To reorganize menu items, <strong>drag and drop items with your mouse or use your keyboard</strong>. Drag or move a menu item a little to the right to make it a submenu'=>'تىزىملىك تۈرلىرىنى قايتا رەتلەش ئۈچۈن <strong>مائۇس ياكى كۇنۇپكا تاختىسى ئارقىلىق تۈرلەرنى سۆرەپ تاشلاڭ</strong>. تىزىملىك تۈرلىرىنى ئوڭغا ئازراق سۆرەپ ياكى يۆتكەپ، تارماق تىزىملىك قۇرۇڭ.','Add one or several items at once by <strong>selecting the checkbox next to each item and clicking Add to Menu</strong>'=>'بىر قېتىمدا <strong>ھەربىر تۈرنىڭ يېنىدىكى تەكشۈرۈش رامكىسىنى تاللاش ۋە «تىزىملىككە قوش» نى چېكىش ئارقىلىق</strong>بىر ياكى بىرنەچچە تۈرنى قوشۇڭ','Each navigation menu may contain a mix of links to pages, categories, custom URLs or other content types. Menu links are added by selecting items from the expanding boxes in the left-hand column below.'=>'ھەربىر ئىختىيارى تىزىملىك ئۇلىنىدىغان بەتلەر، سەھىپىلەر، ئىختىيارى URL لار ياكى باشقا مەزمۇن تىپلىرىنىڭ ئارىلاشمىسىنى ئۆز ئىچىگە ئالالايدۇ. تىزىملىك ئۇلانمىلىرى تۆۋەندىكى سول قول تەرەپتىكى رەتتە يېيىلغان رامكىلاردىن ئەزالارنى تاللاش ئارقىلىق قوشۇلىدۇ.','Add, organize, and modify individual menu items'=>'خاس تىزىملىك تۈرلىرىنى قۇرۇش، رەتلەش ۋە ئۆزگەرتىش','Your latest changes were saved as a revision.'=>'ئەڭ ئاخىرقى ئۆزگەرتىشلىرىڭىز بىر تۈزىتىلمە سۈپىتىدە ساقلاندى.','Audio Format:'=>'ئۈن پىچىمى:','You can assign theme locations to individual menus by <strong>selecting the desired settings</strong> at the bottom of the menu editor. To assign menus to all theme locations at once, <strong>visit the Manage Locations tab</strong> at the top of the screen.'=>'ئۆرنەك ئورنىنى تىزىملىك تەھرىرلىگۈچنىڭ ئاستىدىكى <strong>ئارزۇ قىلغان تەڭشەكلەرنى تاللاش</strong> ئارقىلىق خاس تىزىملىكلەرگە تەقسىملىيەلەيسىز. تىزىملىكنى بىر قېتىمدا ھەممە ئۆرنەكلەرنىڭ ئورنىغا تەقسىملەشتە، ئېكران چوققىسىدىكى <strong>ئورۇن باشقۇرۇش بەتكۈچنى زىيارەت</strong> قىلىڭ.','To edit an existing menu, <strong>choose a menu from the dropdown and click Select</strong>'=>'مەۋجۇت تىزىملىكلەرنى تەھرىرلەش ئۈچۈن <strong>ئېسىلما تىزىملىكتىن بىر تىزىملىكنى تاللاپ، «تاللاش»نى چېكىڭ</strong>','Restore This Revision'=>'بۇ تۈزىتىلمەنى ئەسلىگە قايتۇر','Capabilities'=>'ماسلىشىشچانلىقى','Denied: %s'=>'رەت قىلىندى: %s','Up one'=>'بىرنى ئۈستىگە','Down one'=>'بىرنى ئاستىغا','To the top'=>'ئەڭ ئۈستىگە','Menu structure'=>'تىزىملىك قۇرۇلمىسى','Menu Settings'=>'تىزىملىك تەڭشەكلىرى','Move'=>'يۆتكە','Draft created on %1$s at %2$s'=>'دەسلەپكى نۇسخا قۇرۇلغان ۋاقىت %1$s،  %2$s','%s has taken over and is currently editing.'=>'%s ئېلىپ بېرىلىۋاتىدۇ ھەمدە نۆۋەتتە تەھرىرلىنىۋاتىدۇ.','You cannot move this item to the Trash. %s is currently editing.'=>'بۇ تۈرنى «ئەخلەتخانا»غا يۆتكىيەلمەيسىز. %s تەھرىرلىنىۋاتىدۇ.','Select a menu to edit:'=>'تەھرىرلەيدىغان تىزىملىك تاللاش:','Thank you for Updating! Please visit the <a href="%s">Upgrade Network</a> page to update all your sites.'=>'يېڭىلىماقچى بولغانلىقىڭىز ئۈچۈن رەھمەت! <a href="%s">«دەرىجە ئۆستۈرۈش تورى»</a>بېتىنى زىيارەت قىلىپ، بارلىق بېكىتىڭىزنى يېڭىلاڭ.','All right, sparky! You&#8217;ve made it through this part of the installation. WordPress can now communicate with your database. If you are ready, time now to&hellip;'=>'بولىدۇ، مۇبارەك بولسۇن! بۇ بۆلەكتىكى ئورنىتىشنى تاماملىدىڭىز. ھازىر WordPress ساندانىڭىز بىلەن ئالاقىلىشىۋاتىدۇ. ئەگەر تەييارلانغان بولسىڭىز، ۋاقىت توشتى.','Client version'=>'خېرىدار نەشرى','Selected menus have been successfully deleted.'=>'تاللانغان تىزىملىكلەر ئوڭۇشلۇق ئۆچۈرۈلدى.','Edit your default menu by adding or removing items. Drag the items into the order you prefer. Click Create Menu to save your changes.'=>'ئەزالارنى قوشۇش ياكى چىقىرىۋېتىش ئارقىلىق سۈكۈتتىكى تىزىملىكىڭىزنى تەھرىرلەڭ. ھەربىر ئەزانى سىز ياقتۇرىدىغان تەرتىپ بويىچە سۆرەڭ. «تىزىملىك قۇرۇش»نى چېكىپ، ئۆزگەرتىشلىرىڭىزنى ساقلاڭ.','Auto add pages'=>'ئۆزلۈكىدىن بەت قوش','Give your menu a name, then click Create Menu.'=>'تىزىملىكىڭىزگە بىر ئىسىم قويۇڭ، ئاندىن «تىزىملىك قۇر» نى چېكىڭ.','The documentation menu below the editor lists the PHP functions recognized in the plugin file. Clicking Look Up takes you to a web page about that particular function.'=>'تۆۋەندىكى تەھرىرلىگۈچتىكى «ھۆججەت» تىزىملىكى قىستۇرما ھۆججەتتىكى PHP فۇنكسىيەلىرىنى كۆرسىتىدۇ. «ئىزدەش»نى چېكىش سىزنى ئالاھىدە ئىقتىدارى بار تور بېكەتكە ئېلىپ بارىدۇ.','Look Up'=>'ئىزدە','For PHP files, you can use the documentation dropdown to select from functions recognized in that file. Look Up takes you to a web page with reference material about that particular function.'=>'PHP ھۆججەتلىرى ئۈچۈن «ھۆججەت» ئېسىلما تىزىملىكى ئارقىلىق ھۆججەتتىكى تونۇيدىغان فۇنكسىيەلەردىن تاللىيالايسىز. ئىزدەش سىزنى ئالاھىدە ئىقتىدار ھەققىدىكى پايدىلىنىش ماتېرىيالى بار بولغان تور بەتكە باشلاپ بارىدۇ.','%s is currently editing'=>'%s نۆۋەتتە تەھرىرلىنىۋاتىدۇ','You can upload and insert media (images, audio, documents, etc.) by clicking the Add Media button. You can select from the images and files already uploaded to the Media Library, or upload new media to add to your page or post. To create an image gallery, select the images to add and click the &#8220;Create a new gallery&#8221; button.'=>'«ۋاسىتە قوشۇش» كۇنۇپكىسىنى چېكىش ئارقىلىق (رەسىم، ئاۋاز، ھۆججەت،...قاتارلىق) ۋاسىتەلەرنى يۈكلىپ قىستۇرالايسىز. «ۋاسىتە ئامبىرى»غا يوللانغان رەسىم ۋە ھۆججەتلەرنى تاللىيالايسىز ياكى يېڭى ۋاسىتەنى يوللاپ بەت ياكى يازمىلىرىڭىزغا قوشالايسىز. رەسىم ئامبىرى قۇرۇش ئۈچۈن رەسىملەرنى تاللاپ، يېڭى ئامبار «قۇرۇش»نى چېكىڭ.','Image rotation is not supported by your web host.'=>'تور غول كومپيۇتېرىڭىز رەسىم ئايلاندۇرۇشنى قوللىمايدۇ.','If you are looking to use the link manager, please install the <a href="%s">Link Manager plugin</a>.'=>'ئۇلانما باشقۇرۇشنى ئىشلىتىپ باقماقچى بولسىڭىز، <a href="%s">ئۇلانما باشقۇرۇش قىستۇرمىسى</a>نى ئورنىتىڭ.','The title field and the big Post Editing Area are fixed in place, but you can reposition all the other boxes using drag and drop. You can also minimize or expand them by clicking the title bar of each box. Use the Screen Options tab to unhide more boxes (Excerpt, Send Trackbacks, Custom Fields, Discussion, Slug, Author) or to choose a 1- or 2-column layout for this screen.'=>'تېما ۋە «يازما تەھرىرلەش رايونى»نىڭ ئورنى مۇقىم بولۇپ، باشقا ھەرقانداق رامكىنى سۆرەپ تاشلاشنى ئىشلىتىپ خالىغان ئورۇنغا يۆتكىيەلەيسىز. ھەربىر رامكىنىڭ تېما بالدىقىنى چېكىش ئارقىلىق ئۇنى كىچىكلىتىپ چوڭايتالايسىز. «ئېكران تاللانمىلىرى» بەتكۈشىنى ئىشلىتىپ تېخىمۇ كۆپ رامكىلار («ئۈزۈندە»، «نەقىل ئەۋەتىش»، «ئىختىيارىي بۆلەكلەر»، «مۇنازىرە»، «ئاپتور»)نى يوشۇرالايسىز ياكى بۇ ئېكراننىڭ جايلىشىشىنى بىر ئىستون ياكى ئىككى ئىستون قىلىپ بەلگىلىيەلەيسىز.','Several boxes on this screen contain settings for how your content will be published, including:'=>'بۇ ئېكراندىكى بىر نەچچە رامكا يازمىلارنىڭ ئېلان قىلىنىش ئۇسۇلىنى بەلگىلەيدىغان تۆۋەندىكى تەڭشەكلەرنى ئۆز ئىچىگە ئالغان:','Do not forget to click &#8220;Save Changes&#8221; when you are done!'=>'تاماملىغاندىن كېيىن «ئۆزگەرتىشلەرنى ساقلاش» نى چېكىشنى ئۇنتۇماڭ!','When changing themes, there is often some variation in the number and setup of widget areas/sidebars and sometimes these conflicts make the transition a bit less smooth. If you changed themes and seem to be missing widgets, scroll down on this screen to the Inactive Widgets area, where all of your widgets and their settings will have been saved.'=>'ئۆرنەك ئۆزگەرتكەندە، سان ۋە ئەپچە رايونى (ياكى يانبالدىقى) نىڭ تەڭشىلىشىدە بەزى پەرقلەر بولىدۇ، شۇنداقلار بۇ پەرقلەر ئۆرنەك ئالماشتۇرۇشقا ئازراق ئاۋارىچىلىك ئېلىپ كېلىدۇ. ئەگەر ئۆرنەك ئۆزگەرتىپ بەزى ئەپچەلەر كۆرۈنمىگەن بولسا، بۇ ئېكراننى تۆۋەنگە سىيرىپ «ئاكتىپسىز ئەپچە» رايونىغا ئەكېلىڭ، بۇ يەردە  بارلىق ئەپچەلىرىڭىز ۋە ئۇلارنىڭ تەڭشەكلىرى ساقلىنىدۇ.','Inserting Media'=>'ۋاسىتە قىستۇرۇش','To use a background image, simply upload it or choose an image that has already been uploaded to your Media Library by clicking the &#8220;Choose Image&#8221; button. You can display a single instance of your image, or tile it to fill the screen. You can have your background fixed in place, so your site content moves on top of it, or you can have it scroll with your site.'=>'تەگلىك سۈرىتى ئىشلىتىش ئۈچۈن، «سۈرەت تاللاش»&#8221; كۇنۇپكىسىنى چېكىپ سۈرەت يوللىسىڭىز ياكى ۋاسىتە ئامبىرىغا يوللانغان سۈرەتنى تاللىسىڭىز بولىدۇ. تاللىغان سۈرەتنىڭ مەلۇم بىر بۆلىكىنى كۆرسەتسىڭىزمۇ ياكى ئۇنى يېيىپ ئېكرانغا تولدۇرسىڭىزمۇ بولىدۇ. تەگلىك سۈرىتىڭىزنى مەلۇم بىر ئورۇنغا مۇقىملاپ ، ئۇنىڭ ئۈستىدە تور بېكەتتىكى مەزمۇنلار يۆتكىلىپ تۇرالايدىغان قىلسىڭىزمۇ ياكى ئۇنى تور بېكەت بىلەن بىرگە سىيرىلىدىغان قىلسىڭىزمۇ بولىدۇ.','<strong>Parent</strong> &mdash; Categories, unlike tags, can have a hierarchy. You might have a Jazz category, and under that have child categories for Bebop and Big Band. Totally optional. To create a subcategory, just choose another category from the Parent dropdown.'=>'<strong>ئانا سەھىپە</strong> - سەھىپىنىڭ بەلگىگە ئوخشىمايدىغان يېرى شۇكى، ئۇ قاتلاملىق مۇناسىۋەتكە ئىگە. سىز «خەلق ناخشىلىرى» دەپ بىر سەھىپە قۇرۇپ، بۇ سەھىپىنىڭ ئاستىدا يەنە «ئىلى خەلق ناخشىلىرى» ياكى «ئاتۇش خەلق ناخشىلىرى» دېگەندەك قىسمىي سەھىپىلەرنى ئىختىيارىڭىزچە قۇرالايسىز. قىسمىي سەھىپە قۇرۇش ئۈچۈن «ئانا سەھىپە» تىزىملىكىدىن ماس سەھىپىنى تاللاڭ.','You are using the multi-file uploader. Problems? Try the <a href="%1$s" %2$s>browser uploader</a> instead.'=>'كۆپ ھۆججەت يۈكلىگۈچىسىنى ئىشلىتىۋاتىسىز. مەسىلە كۆرۈلدىمۇ؟ ئۇنداقتا <a href="%1$s" %2$s>تور كۆرگۈچ يۈكلىگۈچىسى</a>نى سىناپ بېقىڭ.','media itemEdit'=>'تەھرىر','colorDefault: %s'=>'كۆڭۈلدىكى: %s','column nameUploaded to'=>'يۈكلىنىدىغان ئورۇن:','The uploaded file is not a valid image. Please try again.'=>'يۈكلەنگىنى ئىناۋەتلىك سۈرەت ھۆججىتى ئەمەسكەن. قايتا سىناپ بېقىڭ.','Choose a Background Image'=>'تەگلىك سۈرىتىنى تاللاڭ','Choose a Custom Header'=>'خاس بەت بېشىنى تاللاڭ','You can also choose a background color by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.'=>'سىز يەنە «رەڭ تاللاش» كۇنۇپكىسىنى چېكىپ، ئۈنۈملۈك HTML قىممەت (ئون ئالتىلىق سىستېمىدا) كىرگۈزسىڭىزمۇ  مەسىلەن، قىزىل رەڭ ئۈچۈن &#8220;#ff0000&#8221; ياكى رەڭ تاللىغۇچنى ئىشلىتىپ رەڭ تاللىسىڭىزمۇ بولىدۇ.','In the Header Text section of this page, you can choose whether to display this text or hide it. You can also choose a color for the text by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.'=>'بۇ بەتنىڭ «بەت بېشى تېكىستى» بۆلىكىدە، بۇ تېكىستنى كۆرسىتىش ياكى يوشۇرۇشنى تاللىيالايسىز. تېكىست رەڭگىنى تاللاش ئۈچۈن، «رەڭ تاللاش» كۇنۇپكىسىنى چېكىپ، ئۈنۈملۈك HTML قىممەت (ئون ئالتىلىق سىستېمىدا) كىرگۈزسىڭىزمۇ ( مەسىلەن، قىزىل رەڭ ئۈچۈن &#8220;#ff0000&#8221;) ياكى رەڭ تاللىغۇچنى ئىشلىتىپ رەڭ تاللىسىڭىزمۇ بولىدۇ.','In the <strong>In response to</strong> column, there are three elements. The text is the name of the post that inspired the comment, and links to the post editor for that entry. The View Post link leads to that post on your live site. The small bubble with the number in it shows the number of approved comments that post has received. If there are pending comments, a red notification circle with the number of pending comments is displayed. Clicking the notification circle will filter the comments screen to show only pending comments on that post.'=>'<strong>«ئىنكاس»</strong> رەت ئۈچ مەزمۇندىن تۈزۈلگەن. باھالاش يېزىشقا ئىلھاملاندۇرىدىغان يازما نامى، ئۇ ئادەتتە يازما تەھرىرلەشكە ئۇلانما قىلىنىدۇ. «يازما كۆرۈش» ئۇلانمىسى ئارقىلىق تور بېكىتىڭىزدىكى يازمىلارنى شۇئان كۆرۈشكە بولىدۇ. ئىچىدە رەقەملەر بار بولغان كۆپۈكچە بولسا يازمىغا يوللىنىپ تەستىقلانغان باھالارنىڭ سانىنى كۆرسىتىپ بېرىدۇ. ئەگەر تەستىقلاشنى كۈتۈۋاتقان ئىنكاسلار بولسا قىزىل رەڭلىك چەمبەرگە ئېلېنغان تەستىقلاشنى كۈتۈۋاتقان سان بار كۆپۈكچىنى كۆرسىتىدۇ. ئۇقتۇرۇش چەمبىرىنى چەكسىڭىز، ئىنكاس كۆرۈنۈشىنى سۈزۈپ، پەقەت ئاشۇ يازمىغا چۈشكەن تېخى تەستىقلانمىغان ئىنكاسلارنىلا كۆرسىتىپ بېرىدۇ.','Used: %1$s%% of %2$s'=>'ئىشلىتىلگەن بوشلۇق: %1$s%% :جەمئىي %2$s','ID #%1$s: %2$s <strong>The current user will not be deleted.</strong>'=>'ID #%1s: %2s <strong>نۆۋەتتىكى ئىشلەتكۈچىنى ئۆچۈرگىلى بولمايدۇ.</strong>','ID #%1$s: %2$s'=>'ID #%1$s: %2$s','Please select an option.'=>'بىر تاللانمىنى تاللاڭ.','Welcome to WordPress!'=>'WordPress كە خۇش كېلىپسىز!','Welcome to WordPress %1$s. You will be redirected to the About WordPress screen. If not, click <a href="%2$s">here</a>.'=>'WordPress  %1$s نەشرىگە خۇش كېلىپسىز. نۆۋەتتە سىزنى «WordPress ھەققىدە»دىكى ئېكرانىغا باشلايمىز. بۇنى خالىمىسىڭىز <a href="%2$s">بۇ يەرنى</a> چېكىڭ.','Discourage search engines from indexing this site'=>'ئىزدەش موتورىلىرىنىڭ بۇ بېكەتنى رەتكە تۇرغۇزۇشىنى ئىناۋەتسىز قىلىش','It is up to search engines to honor this request.'=>'بۇ ئىزدەش موتورىلىرىنىڭ بۇ ئىلتىماسقا رىئايە قىلىش قىلماسلىقىغا باغلىق.','After you&#8217;ve done that, click &#8220;Run the installation&#8221;.'=>'ئۇنى تاماملىغاندىن كېيىن «ئورنىتىشنى ئىجرا قىل» چېكىلىدۇ.','If you want to install a plugin that you&#8217;ve downloaded elsewhere, click the Upload Plugin button above the plugins list. You will be prompted to upload the .zip package, and once uploaded, you can activate the new plugin.'=>'ئەگەر باشقا&#8217 يەردىن چۈشۈرگەن قىستۇرمىلارنى ئورناتماقچى بولسىڭىز، قىستۇرمىلار تىزىمىنىڭ سول ئۈستى تەرەپتىكى «قىستۇرما يۈكلە» توپچىنى چېكىڭ. .zip بولىقى يوللاش ھەققىدە ئەسكەرتىلىسىز. يوللانسىلا، يېڭى قىستۇرمىنى ئاكتىپلىيالايسىز.','You can also browse a user&#8217;s favorite plugins, by using the Favorites link above the plugins list and entering their WordPress.org username.'=>'سىز يەنە ئېكراننىڭ سول ئۈستى تەرىپىدىكى «ياقتۇرىدىغان قىستۇرمىلار» ئۇلانمىسىنى ئىشلىتىپ، ئىشلەتكۈچىلەرنىڭ WordPress.org دىكى ئىسمىنى كىرگۈزۈپ، ئۇلارنىڭ ياقتۇرغان قىستۇرمىلىرىنى كۆرەلەيسىز.','Allow search engines to index this site'=>'ئىزدەش موتورلىرىنىڭ بۇ توربەتنى ئىندېكسلىشىغا رۇخسەت','Search engine visibility'=>'ئىزدەش ماتورىنىڭ كۆرۈنۈشچانلىقى','Get Favorites'=>'ياقتۇرىدىغانغا ئېرىشىش','Your WordPress.org username:'=>'WordPress.org دىكى ئىشلەتكۈچى ئاتىڭىز:','If you have marked plugins as favorites on WordPress.org, you can browse them here.'=>'WordPress.org دا قىستۇرمىلارنى ياقتۇرىدىغان قىلىپ بەلگە سالغان بولسىڭىز، ئۇلارنى بۇ يەردە كۆرەلەيسىز.','Search engines discouraged'=>'ئىزدەش موتورلىرى توستى','If you know what you are looking for, Search is your best bet. The Search screen has options to search the WordPress Plugin Directory for a particular Term, Author, or Tag. You can also search the directory by selecting popular tags. Tags in larger type mean more plugins have been labeled with that tag.'=>'نېمە ئىزدىمەكچى بولغانلىقىڭىزنى بىلسىڭىز، ئۇنداقتا ئىزدەش سىزنىڭ ئەڭ ياخشى تاللىشىڭىز. ئىزدەش ئېكرانىدا مەلۇم ئاتالغۇ، ئاپتور ياكى بەلگە ئۈچۈن WordPress.org قىستۇرما مۇندەرىجىسىنى  ئىزدەيدىغان تاللانمىلار بار. سىز يەنە كۆپ ئىزدەلگەن بەلگىلەرنى تاللاش ئارقىلىق مۇندەرىجىدىن ئىزدەلەيسىز. چوڭ بەلگىلەر بولسا ئۇنى ئىشلەتكەن قىستۇرمىلارنىڭ تېخىمۇ كۆپ ئىكەنلىكىنى بىلدۈرىدۇ.','This <a href="%1$s">child theme</a> requires its parent theme, %2$s.'=>'بۇ <a href="%1$s">تارماق ئۆرنەك</a> ئۆزىنىڭ باش باشتېمىسى %2$s نى تەلەپ قىلىدۇ.','Plugin InstallerFavorites'=>'ياقتۇرىدىغانلار','Type of search'=>'ئىزدەش تىپى','To install the theme so you can preview it with your site&#8217;s content and customize its theme options, click the "Install" button at the top of the left-hand pane. The theme files will be downloaded to your website automatically. When this is complete, the theme is now available for activation, which you can do by clicking the "Activate" link, or by navigating to your Manage Themes screen and clicking the "Live Preview" link under any installed theme&#8217;s thumbnail image.'=>'ئۆرنەك ئورنىتىپ، ئۇنىڭ بىلەن تور بېكىتىڭىزنىڭ مەزمۇنىنى كۆرۈپ بېقىش ھەمدە ئۆرنەك تاللانمىلىرىنى ئىختىيارىي قىلىش ئۈچۈن، سول تەرەپتىكى رامكىنىڭ ئۈستىدىكى "ئورنىتىش" كۇنۇپكىسىنى چەكسىڭىز، ئۆرنەك ھۆججەتلىرى تور بېكىتىڭىزگە ئاپتوماتىك چۈشۈرۈلىدۇ. بۇ تاماملانغان ھامان ئۆرنەكنى قوزغىتىشقا بولىدىغان بولۇپ، "قوزغىتىش" ئۇلانمىسىنى چېكىپ ياكى «ئۆرنەك باشقۇرۇش» ئېكرانىغا يۆتكىلىپ، خالىغان قاچىلانغان ئۆرنەكنىڭ  كىچىك كۆرۈنۈش رەسىمى ئاستىدىكى «جانلىق كۆرۈپ بېقىش» ئۇلانمىسىنى چېكىپ قوزغاتسىڭىزبولىدۇ.','widgetAdd'=>'قوش','widgetEdit'=>'تەھرىر','Search by tag'=>'بەلگە بويىچە ئىزدەيدۇ','Search by author'=>'ئاپتور بويىچە ئىزدەيدۇ','Search by keyword'=>'ئاچقۇچلۇق سۆز بويىچە ئىزدەيدۇ','Screen Options Tab'=>'ئېكران تاللانمىلىرى بەتكۈچى','Contextual Help Tab'=>'ئالاقىدار ياردەم بەتكۈچى','Select %s'=>'%s نى تاللاڭ','Creating a Page is very similar to creating a Post, and the screens can be customized in the same way using drag and drop, the Screen Options tab, and expanding/collapsing boxes as you choose. This screen also has the distraction-free writing space, available in both the Visual and Text modes via the Fullscreen buttons. The Page editor mostly works the same as the Post editor, but there are some Page-specific features in the Page Attributes box.'=>'«بەت» قۇرۇش «يازما» قۇرغانغا ئوخشاش بولۇپ ، ئېكرانلارنى سۆرەپ تاشلاش،  «ئېكران تاللانمىلىرى» بەتكۈشى ۋە يېيىش ياكى يىغىش رامكىلىرىنى  ئىشلەتكەنگە ئوخشاش ئۇسۇل بىلەن ئېكراننى ئىختىيارىي قىلىشقا بولىدۇ. بۇ ئېكراندا يەنە «تولۇق ئېكران» كۇنۇپكىلىرى ئارقىلىق كۆرۈنمە ۋە تېكىستلىك ھالەتنىڭ ھەر ئىككىلىسىدە ئىشلەتكىلى بولىدىغان دەخلىسىز يېزىش بوشلۇقى بار. «بەت» تەھرىرلىگۈچ «يازما» تەھرىرلىگۈچكە ئوخشاش ئىشلەيدۇ، لېكىن «بەت خاسلىقى» رامكىسىدا بەزى «بەت»كىلا خاس ئىقتىدارلار بار.','Select comment'=>'ئىنكاس تاللاڭ','You can delete Link Categories in the Bulk Action pull-down, but that action does not delete the links within the category. Instead, it moves them to the default Link Category.'=>'«تۈركۈملەپ مەشغۇلات قىلىش» ئاسما تىزىملىكىدىكى «ئۇلانما سەھىپە»لەرنى ئۆچۈرەلەيسىز، لېكىن سەھىپە ئىچىدىكى ئۇلانمىلار ئۆچۈرۈلمەي كۆڭۈلدىكى «ئۇلانما سەھىپە»گە يۆتكىلىدۇ.','You can select an image to be shown at the top of your site by uploading from your computer or choosing from your media library. After selecting an image you will be able to crop it.'=>'كومپيۇتېرىڭىزدىن  سۈرەت يوللاش ياكى ۋاسىتە ئامبىرىڭىزدىن سۈرەت تاللاش ئارقىلىق تور بېكىتىڭىزنىڭ ئۈستىدە كۆرسىتىلىدىغان سۈرەتنى تاللىيالايسىز. سۈرەت تاللىغاندىن كېيىن ئۇنى قىرقىپ تەھرىرلىيەلەيسىز.','Skip to main content'=>'ئاساسىي مەزمۇنغا ئاتلا','Tags can be selectively converted to categories using the <a href="%s">tag to category converter</a>.'=>'بەلگىنى <a href="%s">بەلگىنى سەھىپىگە ئايلاندۇرغۇچ</a> تىن پايدىلىنىپ تاللاپ تۇرۇپ سەھىپىگە ئايلاندۇرۇشقا بولىدۇ.','You can set a custom image header for your site. Simply upload the image and crop it, and the new header will go live immediately. Alternatively, you can use an image that has already been uploaded to your Media Library by clicking the &#8220;Choose Image&#8221; button.'=>'بېكىتىڭىزنىڭ سۈرەتلىك بەت بېشىنى ئىختىيارى بەلگىلىيەلەيسىز. سۈرەتنى يوللىسىڭىزلا يېڭى بەت بېشى دەرھال كۆرۈنىدۇ. ياكى &#8220;«سۈرەت تاللاش»&#8221; كۇنۇپكىسىنى چېكىپ، ۋاسىتە ئامبىرىغا يوللانغان سۈرەتلەرنى تاللىسىڭىزمۇ بولىدۇ.','Skip Cropping, Publish Image as Is'=>'سۈرەتنى قىرقىمايلا تۆۋەندىكىدەك ئېلان قىلىش','Select Image'=>'سۈرەت تاللاش','Choose Image'=>'سۈرەت تاللاش','Or choose an image from your media library:'=>'ياكى ۋاسىتە ئامبىرىدىكى سۈرەتتىن بىرنى تاللاڭ:','Collapse'=>'يىغ','If you do not want a header image to be displayed on your site at all, click the &#8220;Remove Header Image&#8221; button at the bottom of the Header Image section of this page. If you want to re-enable the header image later, you just have to select one of the other image options and click &#8220;Save Changes&#8221;.'=>'ئەگەر بەت بېشى سۈرەتنى كۆرۈنمىسۇن دېسىڭىز، بۇ بەتتىكى بەت قاش سۈرەت بۆلىكىنىڭ ئاستىدىكى «بەت قاش سۈرەتنى چىقىرىۋەت» توپچىسىنى چېكىڭ. ئەگەر بەت بېشى سۈرەتنى قايتىدىن كۆرسەتمەكچى بولسىڭىز، سۈرەتتىن بىرنى تاللاپ «ئۆزگەرتىشلەرنى ساقلا» نى چەكسىڭىزلا بولىدۇ.','This theme is already installed and is up to date'=>'بۇ ئۆرنەك ئورنىتىپ بولۇنغان ھەم ئەڭ يېڭى ھالەتتە','pluginInstalled'=>'ئورنىتىلدى','Once you have generated a list of themes, you can preview and install any of them. Click on the thumbnail of the theme you are interested in previewing. It will open up in a full-screen Preview page to give you a better idea of how that theme will look.'=>'باشتېمىلارنىڭ تىزىملىكىنى تۇرغۇزۇۋالسىڭىز، ئۇلارنى خالىغانچە كۆرۈپ باقالايسىز ياكى قاچىلىيالايسىز. ئالدىن كۆرۈۋاتقاندا ئۆزىڭىز قىزىققان باشتېمىنىڭ كىچىك كۆرۈنۈشىنى چەكسىڭىز، ئۇنىڭ ئۈنۈمىنى تولۇق ئېكران ھالىتىدە كۆرەلەيسىز.','Previewing and Customizing'=>'ئالدىن كۆزىتىش ۋە خاسلاشتۇرۇشئ','Previewing and Installing'=>'ئالدىن كۆزىتىش ۋە ئورنىتىش','You are using the browser&#8217;s built-in file uploader. The WordPress uploader includes multiple file selection and drag and drop capability. <a href="#">Switch to the multi-file uploader</a>.'=>'تور كۆرگۈچنىڭ ئىچكى ھۆججەت يوللىغۇچىنى ئىشلىتىۋاتىسىز. WordPress يوللىغۇچىسىنىڭ كۆپ ھۆججەت تاللاش ۋە سۆرەپ تاشلاش ئىقتىدارى بار. <a href="#">كۆپ ھۆججەت يوللىغۇچقا ئالمىشىش</a>.','Preview %s'=>'%s نى ئالدىن كۆزەت','Categories have hierarchy, meaning that you can nest sub-categories. Tags do not have hierarchy and cannot be nested. Sometimes people start out using one on their posts, then later realize that the other would work better for their content.'=>'سەھىپىلەر دەرىجە-قاتلامغا بۆلۈنگەن بولۇپ، تارماق سەھىپىلەرنى ئىشلەتسىڭىزمۇ بولىدۇ. بەلگىلەر دەرىجە-قاتلامغا ئايرىلمىغان بولۇپ، بۆلۈپ  ئىشلىتىشكە بولمايدۇ. بەزىدە كىشىلەر يازمىلىرىغا بىر سەھىپە ئىشلىتىپ بىر مەزگىل ئۆتكەندىن كېيىن، باشقا بىر سەھىپىنىڭ ئۆزىگە تېخىمۇ ياخشى ماس كېلىدىغانلىقىنى بايقايدۇ.','The Categories and Tags Converter link on this screen will take you to the Import screen, where that Converter is one of the plugins you can install. Once that plugin is installed, the Activate Plugin &amp; Run Importer link will take you to a screen where you can choose to convert tags into categories or vice versa.'=>'بۇ ئېكراندىكى «سەھىپە ۋە بەلگە ئايلاندۇرغۇچ» ئۇلانمىسى ئارقىلىق «ئايلاندۇرغۇچ»نى قىستۇرما سۈپىتىدە ئورنىتىشقا بولىدىغان «كىرگۈزۈش» ئېكرانىغا يۆتكىلەلەيسىز. ئۇ قىستۇرما قاچىلانغاندىن كېيىن، «ئاكتىپلاش قىستۇرمىسى» &amp; «كىرگۈزگۈچنى ئىجرا قىلىش» ئۇلانمىسى ئارقىلىق بەلگە بىلەن سەھىپىنى ئۆز-ئارا ئايلاندۇرۇشقا بولىدىغان ئېكرانغا يۆتكىلەلەيسىز.','Some themes come with additional header images bundled. If you see multiple images displayed, select the one you would like and click the &#8220;Save Changes&#8221; button.'=>'بەزى باشتېمىلارغا قوشۇمچە سۈرەتلەر باغلانغان بولۇپ، كۆپ سۈرەتلەرنى كۆرسىڭىز، ئۆزىڭىز ياقتۇرغان بىرسىنى تاللاپ، &#8220;ئۆزگەرتىشلەرنى ساقلاش&#8221; كۇنۇپكىسىنى چېكىڭ.','If your theme has more than one default header image, or you have uploaded more than one custom header image, you have the option of having WordPress display a randomly different image on each page of your site. Click the &#8220;Random&#8221; radio button next to the Uploaded Images or Default Images section to enable this feature.'=>'ئەگەر ئۆرنەكىڭىزدا بىردىن ئارتۇق كۆڭۈلدىكى بەت قېشى سۈرىتى بار بولسا، ياكى بىردىن ئارتۇق ئىختىيارىي بەت قېشى سۈرىتىنى يوللىغان بولسىڭىز، WordPress نى تور بېكىتىڭىزنىڭ ھەربىر بېتىدە رەسىملەر خالىغانچە ئالمىشىپ كۆرۈنىدىغان قىلىپ تەڭشىيەلەيسىز.','You can choose from the theme&#8217;s default header images, or use one of your own. You can also customize how your Site Title and Tagline are displayed.'=>'ئۆرنەكنىڭ كۆڭۈلدىكى بەت قېشى سۈرەتلىرى ئىچىدىن ياكى ئۆزىڭىز خالىغان باشقا بىر رەسىمنى تاللىسىڭىز بولىدۇ. سىز يەنە «تور بېكەت تېمىسى» ۋە «يانداش تېما»نىڭ كۆرۈنۈش ئۇسۇلىنى ئىختىيارىي قىلالايسىز.','This screen is used to customize the header section of your theme.'=>'بۇ ئېكران ئۆرنەكىڭىزنىڭ بەت بېشى قىسمىنى خاسلاشتۇرۇشقا ئىشلىتىلىدۇ.','For most themes, the header text is your Site Title and Tagline, as defined in the <a href="%s">General Settings</a> section.'=>'كۆپ ساندىكى ئۆرنەككە نىسبەتەن، بەت قاش تېكىستى تور بېكەتنىڭ ماۋزۇ ۋە قوشۇمچە ماۋزۇسىنى كۆرسىتىدۇ، <a href="%s">ئادەتتىكى تەڭشەكلەر</a>بۆلىكىدە ئېنىقلىما بېرىلىدۇ.','Configuration Error'=>'سەپلەش خاتالىقى','Revert to the <strong>Browser Uploader</strong> by clicking the link below the drag and drop box.'=>'سىيرىلما تىزىملىكنىڭ ئاستىدىكى ئۇلانمىنى چېكىپ <strong>تور كۆرگۈچ يۈكلىگۈچىسى</strong>گە ئالماشتۇرۇڭ.','User deleted.'=>'ئىشلەتكۈچى ئۆچۈرۈلدى.','Could not copy files. You may have run out of disk space.'=>'ھۆججەتنى كۆچۈرگىلى بولمىدى. دىسكا بوشلۇقىڭىزنى ئىشلىتىپ بوپسىز.','Find a theme based on specific features.'=>'كۆرسىتىلگەن ئىقتىدار بويىچە ئۆرنەك ئىزدىلىدۇ.','Search for themes by keyword.'=>'ئاچقۇچلۇق سۆزگە ئاساسەن ئۆرنەك ئىزدەيدۇ','In all likelihood, these items were supplied to you by your web host. If you do not have this information, then you will need to contact them before you can continue. If you are ready&hellip;'=>'ئادەتتىكى ئەھۋالدا، بۇ ئۇچۇرلارنى تور مۇلازىمەتچىڭىز تەمىنلەيدۇ. ئەگەر بۇ ئۇچۇرلارغا تېخى ئېرىشمىگەن بولسىڭىز، ئۇنداقتا داۋاملاشتۇرۇشتىن بۇرۇن ئۇلار بىلەن ئالاقىلىشىشىڭىزغا توغرا كېلىدۇ. تەييار بولغان بولسىڭىز&hellip;','This theme is broken.'=>'بۇ ئۆرنەك بۇزۇلغان.','Set as background'=>'تەگلىك قىلىپ بەلگىلەش','Set as header'=>'توربەت رەسىمى قىلىپ بەلگىلەش','Customize &#8220;%s&#8221;'=>'&#8220;%s&#8221; نى خاسلاشتۇرۇش','Word count: %s'=>'سۆز سانى: %s','All'=>'ھەممە','Plugin'=>'قىستۇرما','Version:'=>'نەشرى:','No comments yet.'=>'تېخى ئىنكاس يېزىلمىدى.','Link URL'=>'ئۇلانما ئادرېسى','Enter a link URL or click above for presets.'=>'ئالدىن بەلگىلەش ئۈچۈن ئۇلانما ئادرېسىنى كىرگۈزۈڭ ياكى ئۈستىدىكىنى چېكىڭ.','Save as Pending'=>'تەستىق كۈتۈۋاتقان قىلىپ ساقلاش','Privately Published'=>'شەخسىي ئېلان قىلىنغان','Public, Sticky'=>'ئاشكارا، چوققىلانغان','https://wordpress.org/about/'=>'https://wordpress.org/about/','(required)'=>'(زۆرۈر)','Edit Link'=>'ئۇلانما تەھرىر','Select All'=>'ھەممىنى تاللا','Collapse Sidebar'=>'يانبالداقنى يىغ','Edit comment'=>'ئىزاھات تەھرىر','Preview:'=>'ئالدىن كۆزەت:','E-mail'=>'ئېلخەت','<strong>Error:</strong> This email is already registered. Please choose another one.'=>'<strong>خاتالىق:</strong> بۇ ئېلخەت ئادرېسى تىزىملىتىلغان. باشقا بىرىنى تاللاڭ.','<strong>Error:</strong> Please enter a nickname.'=>'<strong>خاتالىق:</strong>تەخەللۇس كىرگۈزۈڭ.','Successfully installed the parent theme, <strong>%1$s %2$s</strong>.'=>'ئانا ئۆرنەك <strong>%1$s %2$s</strong> ئوڭۇشلۇق ئورنىتىلدى.','The parent theme, <strong>%1$s %2$s</strong>, is currently installed.'=>'ئانا ئۆرنەك <strong>%1$s %2$s</strong> قاچىلىنىپ بولغان.','Preparing to install <strong>%1$s %2$s</strong>&#8230;'=>'<strong>%1$s %2$s</strong> نى ئورنىتىشقا تەييارلىق قىلىنىۋاتىدۇ&#8230;','This theme requires a parent theme. Checking if it is installed&#8230;'=>'بۇ ئۆرنەك ئانا ئۆرنەكنى لازىم قىلىدۇ. قاچىلانغان بولسا تاللاپ بېرىڭ&#8230;','<strong>The parent theme could not be found.</strong> You will need to install the parent theme, %s, before you can use this child theme.'=>'<strong>ئانا ئۇسلۇب تېپىلمىدى.</strong> بۇ تارماق ئۆرنەكنى ئىشلىتىشتىن بۇرۇن ئانا ئۆرنەك %s نى ئورنىتىڭ.','Show header text with your image.'=>'بەت بېشى تېكىستى رەسىم بىلەن بىللە كۆرسىتىلسۇن.','Header Text'=>'بەت بېشى تېكىستى','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a> or <a href="%5$s" %6$s>update now</a>.'=>'يېڭىدىن %1$s نەشرى چىقتى. <a href="%2$s" class="thickbox" title="%3$s">%4$s نەشرىنىڭ تەپسىلاتىنى بۇ يەردىن كۆرۈڭ</a> ياكى <a href="%5$s">ھازىر يېڭىلاڭ</a>.','By %s.'=>'ئاپتورى: %s','Add Comment'=>'ئىزاھات قوش','Add New Comment'=>'يېڭى ئىنكاس قوش','Hello Dolly'=>'سالام دوللى!','http://ma.tt/'=>'http://ma.tt/','This is not just a plugin, it symbolizes the hope and enthusiasm of an entire generation summed up in two words sung most famously by Louis Armstrong: Hello, Dolly. When activated you will randomly see a lyric from <cite>Hello, Dolly</cite> in the upper right of your admin screen on every page.'=>'بۇ مۇنداقلا قوشۇپ قويۇلغان قىستۇرما ئەمەس. ئۇ Louis Armstrong تەرىپىدىن ئېيتىلىپ داڭ چىقارغان ئىككى سۆز «سالام، دوللى» غا مۇجەسسەملەنگەن شۇ دەۋردىكى بارلىق كىشىلەرنىڭ ئۈمىد ۋە قىزغىنلىقلىرىنىڭ سىمۋولى. بۇ قىستۇرما قوزغىتىلسا، باشقۇرۇش بېتىدىكى ھەر بىر ئېكراننىڭ سول تەرەپ يۇقىرى بۈرجىكىدە <cite>سالام، دوللى</cite> ناخشىسىنىڭ تېكىستى بىر مىسرادىن ئىختىيارى تەرتىپتە كۆرسىتىلىدۇ.','<strong>Welcome</strong> &mdash; Shows links for some of the most common tasks when setting up a new site.'=>'<strong>مەرھابا</strong> - يېڭى توربەتنى تەڭشەشتە كۆپ ئورۇنلىنىدىغان مەشغۇلاتلارغا قارىتىلغان ئۇلانمىلار كۆرسىتىلىدۇ.','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>. <em>Automatic update is unavailable for this theme.</em>'=>'%1$s نىڭ يېڭى نەشرى چىقتى. <a href="%2$s" %3$s> نەشرىنىڭ تەپسىلاتىنى %4$s بۇ يەردىن كۆرۈڭ</a>. <em>بۇ ئۆرنەكنى ئاپتوماتىك يېڭىلىغىلى بولمايدۇ</em>.','HowdyWelcome'=>'خۇش كەلدىڭىز','Sorry, the link you clicked is stale. Please select another option.'=>'كەچۈرۈڭ، سىز چەككەن ئۇلانما خاتا ئىكەن. باشقا تاللانمىنى تاللاڭ.','If you do not want to use your %s site any more, you can delete it using the form below. When you click <strong>Delete My Site Permanently</strong> you will be sent an email with a link in it. Click on this link to delete your site.'=>'%s تور بېكىتىڭىزنى قايتا ئىشلىتىشنى خالىمىسىڭىز، تۆۋەندىكى مۇنبەرنى ئىشلىتىپ ئۇنى ئۆچۈرۈۋەتسىڭىز بولىدۇ. <strong>«تور بېكىتىمنى مەڭگۈلۈك ئۆچۈرۈش»</strong> نى چەكسىڭىز، سىزگە بىر پارچە ئىچىدە ئۇلانما بار ئېلېكتىرونلۇق خەت ئەۋەتىلىدۇ. ئۇ ئۇلانمىنى چېكىپ تور بېكىتىڭىزنى ئۆچۈرۈڭ.','Delete My Site Permanently'=>'تور بېكىتىمنى مەڭگۈلۈك ئۆچۈر','Remember, once deleted your site cannot be restored.'=>'ئېسىڭىزدە بولسۇن، تور بېكىتىڭىزنى ئۆچۈرۈۋەتسىڭىز قايتا ئەسلىگە كەلتۈرگىلى بولمايدۇ.','Thank you. Please check your email for a link to confirm your action. Your site will not be deleted until this link is clicked.'=>'رەھمەت. مەشغۇلاتىڭىزنى جەزملەش ئۈچۈن ئېلخېتىڭىزگە ئەۋەتىلگەن ئۇلانمىنى تەكشۈرۈڭ. بۇ ئۇلانما چېكىلگۈچە تور بېكىتىڭىز ئۆچۈرۈلمەيدۇ.','Thank you for using %s, your site has been deleted. Happy trails to you until we meet again.'=>'%sنى ئىشلەتكەنلىكىڭىزگە رەھمەت. تور بېكىتىڭىز ئۆچۈرۈۋېتىلدى. قايتا كېلىشىڭىزنى قارشى ئالىمىز.','I\'m sure I want to permanently delete my site, and I am aware I can never get it back or use %s again.'=>'تور بېكىتىمنى راستتىنلا مەڭگۈلۈك ئۆچۈرىمەن شۇنداقلا ئۇنى قايتا ئەسلىگە كەلتۈرەلمەيدىغانلىقىمنى ياكى %s نى قايتا ئىشلىتەلمەيدىغانلىقىمنى ئېنىق بىلىمەن.','Primary Site'=>'ئاساسىي توربەت','[%s] New Admin Email Address'=>'[%s] يېڭى باشقۇرغۇچى ئېلېكتىرونلۇق خەت ئادرېسى','If you reached this screen by accident and meant to visit one of your own sites, here are some shortcuts to help you find your way.'=>'ئەگەر بۇ ئېكرانغا بىلمەي كېلىپ قالغان، شۇنداقلا مەلۇم بىر بېكىتىڭىزنى زىيارەت قىلماقچى بولسىڭىز، سىزگە قانداق قىلىشىڭىزنى ئېيتىپ بېرىدىغان بەزى قىسقا يوللار بۇ يەردە.','You attempted to access the "%1$s" dashboard, but you do not currently have privileges on this site. If you believe you should be able to access the "%1$s" dashboard, please contact your network administrator.'=>'"%1$s" باشقۇرۇش تاختىسىنى زىيارەت قىلىشقا ئۇرۇندىڭىز، لېكىن نۆۋەتتە بۇ بېكەتنى زىيارەت قىلىش ھوقۇقىڭىز يوقكەن. ئەگەر راستتىنلا "%1$s" نى زىيارەت قىلالايتتىم دەپ قارىسىڭىز، تور باشقۇرغۇچىڭىز بىلەن ئالاقىلىشىڭ.','British English'=>'ئەنگلىيە ئىنگلىزچە','American English'=>'ئامېرىكا ئىنگلىزچە','View Site'=>'بېكەت كۆرسەت','Visit Dashboard'=>'باشقۇرۇش تاختا زىيارەت','Your Sites'=>'تور بېكىتىڭىز','MB (Leave blank for network default)'=>'MB (تورنىڭ كۆڭۈلدىكى قىممىتى بولسا بوش قويۇڭ)','Disabled'=>'چەكلەنگەن','Paused <span class="count">(%s)</span>'=>'توختىتىلغان<span class="count">(%s)</span>','The primary site you chose does not exist.'=>'سىز تاللىغان ئاساسىي توربەت مەۋجۇد ئەمەس.','Global Settings'=>'ئومۇمىيەت تەڭشەكلەر','You must be a member of at least one site to use this page.'=>'بۇ بەتنى ئىشلىتىش ئۈچۈن ئاز دېگەندە بىر توربېكەتكە ئەزا بولۇشىڭىز كېرەك.','Database host'=>'ساندان مۇلازىمېتىرى','Let&#8217;s go!'=>'باشلايلى!','Database Host'=>'ساندان مۇلازىمېتىرى','Table Prefix'=>'جەدۋەل ئالدى قوشۇمچىسى','Table prefix (if you want to run more than one WordPress in a single database)'=>'جەدۋەل ئالدى قوشۇلغۇچىسى (بىر سانداندا بىردىن ئارتۇق WordPress ئىشلەتمەكچى بولسىڭىز)','If you want to run multiple WordPress installations in a single database, change this.'=>'بىرقانچە WordPress نى بىرلا ساندانغا ئورنىتىپ ئىشلەتمەكچى بولسىڭىز بۇ يەرنى ئۆزگەرتىڭ.','example passwordpassword'=>'ئىم','example usernameusername'=>'ئىشلەتكۈچى ئاتى','Database Name'=>'ساندان ئاتى','Below you should enter your database connection details. If you are not sure about these, contact your host.'=>'تۆۋەندە ساندانغا باغلىنىش تەپسىلاتىنى كىرگۈزۈشىڭىز كېرەك. ئەگەر ئۇلارنى جەزملىيەلمىسىڭىز، مۇلازىمېتىر تەمىنلىگۈچى بىلەن ئالاقىلىشىڭ.','Database password'=>'ساندان ئىم','Database username'=>'ساندان ئىشلەتكۈچى ئاتى','Database name'=>'ساندان ئىسمى','WordPress &rsaquo; Setup Configuration File'=>'WordPress &rsaquo; سەپلىمە ھۆججىتى تەڭشەش','The file %1$s already exists one level above your WordPress installation. If you need to reset any of the configuration items in this file, please delete it first. You may try <a href="%2$s">installing now</a>.'=>'%1$s ھۆججىتى WordPress ئورنىتىش مۇندەرىجىسىنىڭ بىر دەرىجە يۇقىرى مۇندەرىجىسىدە بار ئىكەن. ئەگەر بۇ ھۆججەتتىكى بىرەر سەپلىمىنى قايتا بەلگىلىمەكچى بولسىڭىز، ئالدى بىلەن ئۇنى ئۆچۈرۈڭ. <a href="%2$s">ھازىر ئورنىتىپ</a> كۆرۈپ باقسىڭىز بولىدۇ.','The file %1$s already exists. If you need to reset any of the configuration items in this file, please delete it first. You may try <a href="%2$s">installing now</a>.'=>'%1$s ھۆججىتى بار ئىكەن. ئەگەر بۇ ھۆججەتتىكى بىرەر سەپلىمىنى قايتا بەلگىلىمەكچى بولسىڭىز، ئالدى بىلەن ئۇنى ئۆچۈرۈپ تاشلاڭ. <a href="%2$s">ھازىر ئورنىتىپ</a> كۆرۈپ باقسىڭىز بولىدۇ.','Sorry, I need a %s file to work from. Please re-upload this file to your WordPress installation.'=>'كەچۈرۈڭ، ماڭا %s ھۆججىتى لازىم. بۇ ھۆججەتنى WordPress ئورنىتىش مۇندەرىجىڭىزدىن قايتا يۈكلەپ بېرىڭ.','To allow use of this page to automatically repair database problems, please add the following line to your %s file. Once this line is added to your config, reload this page.'=>'بۇ بەتنىڭ ساندان مەسىلىلىرىنى ئاپتوماتىك ھەل قىلىشقا رۇخسەت قىلىش ئۈچۈن، تۆۋەندىكى قۇرنى <code>wp-config.php</code> ھۆججىتىڭىزگە قوشۇڭ. بۇ ھۆججەت config ڭىزگە قوشۇلغاندىن كېيىن، بۇ بەتنى قايتا يۈكلەڭ.','No comments awaiting moderation.'=>'نۆۋەتتە تەستىق كۈتۈۋاتقان ئىنكاس يوق.','Plugin installer section titleOther Notes'=>'باشقا ئەسكەرتمىلەر','Plugin installer section titleDescription'=>'چۈشەندۈرۈش','Plugin installer section titleChangelog'=>'ئۆزگىرىش خاتىرىسى','Plugin installer section titleScreenshots'=>'ئېكران كەسمىسى','Plugin installer section titleInstallation'=>'ئورنىتىش','Plugin installer section titleFAQ'=>'كۆپ سورالغان سوئاللار','Plugin Homepage &#187;'=>'قىستۇرما باش بېتى &#187;','Failed to repair the %1$s table. Error: %2$s'=>'%1$s جەدۋىلىنى ئوڭشىيالمىدى. خاتالىق: %2$s','You can export a file of your site&#8217;s content in order to import it into another installation or platform. The export file will be an XML file format called WXR. Posts, pages, comments, custom fields, categories, and tags can be included. You can choose for the WXR file to include only certain posts or pages by setting the dropdown filters to limit the export by category, author, date range by month, or publishing status.'=>'باشقا بىر WordPress كە ياكى باشقا بىر سۇپىغا ئەكىرىش ئۈچۈن توربەتتىكى مەزمۇنلىرىڭىزنى WXR دەپ ئاتىلىدىغان XML ھۆججىتى شەكلىدە چىقىرىۋالالايسىز. بۇ ھۆججەت يازما، بەت، ئىنكاس، خاس بۆلەك، سەھىپە ۋە بەلگەلەرنى ئۆز ئىچىگە ئالالايدۇ. سىيرىلما تىزىملىك ھالىتىدىكى سۈزگۈچتە سەھىپە، يازغۇچى، ئاي بويىچە كۆرسىتىلگەن ۋاقىت ئارىلىقى ياكى ئېلان قىلىنىش ھالىتىنى چەكلەش ئارقىلىق WXR ھۆججىتىگە ساقلىنىدىغان يازما ياكى بەتلەرنى تاللاپ كۆرسىتىپ بېرەلەيسىز.','New users will receive an email letting them know they&#8217;ve been added as a user for your site. This email will also contain their password. Check the box if you do not want the user to receive a welcome email.'=>'يېڭى ئىشلەتكۈچىلىرىڭىز تور بېكىتىڭىزگە ئەزا بولغانلىقى ھەققىدە بىر ئېلخەت تاپشۇرۇۋالىدۇ. بۇ ئېلخەتكە پارول يېڭىلاش ئۇلانمىسىمۇ قوشۇلغان. ئەگەر بۇ قارشى ئېلىش ئېلخېتى ئەۋەتىلمىسۇن دېسىڭىز، قۇتىدىكى ئىشارەتنى ئېلىۋېتىڭ.','There are unsaved changes that will be lost. \'OK\' to continue, \'Cancel\' to return to the Image Editor.'=>'بۇ يەردىكى ساقلانمىغان ئۆزگەرتىشلەر يوققا چىقىدۇ. داۋاملاشتۇرۇش ئۈچۈن \'OK\' نى، سۈرەت تەھرىرلىگۈچكە قايتىش ئۈچۈن \'Cancel\'  بېسىڭ.','In previous versions of WordPress, all importers were built-in. They have been turned into plugins since most people only use them once or infrequently.'=>'WordPress نىڭ بۇرۇنقى نەشرلىرىدە بارلىق كىرگۈزگۈچلەر WordPress كە قوشۇۋېتىلگەن بولسىمۇ، كۆپلىگەن كىشىلەر ئۇلارنى بىر ياكى بىر قانچە قېتىملا ئىشلىتىدىغان بولغاچقا، كېيىنچە قىستۇرما ھالىتىگە ئۆزگەرتىلگەن.','Post via email settings allow you to send your WordPress installation an email with the content of your post. You must set up a secret email account with POP3 access to use this, and any mail received at this address will be posted, so it&#8217;s a good idea to keep this address very secret.'=>'ئېلخەتتە يوللاش تەڭشىكى ئارقىلىق يازمىلارنى WordPress قا ئېلخەت بىلەن يوللىيالايسىز. بۇنىڭ ئۈچۈن چوقۇم POP3 نى قوللايدىغان بىخەتەر بىر ئېلخەت ھېساباتى تۇرغۇزۇشىڭىز كېرەك. بۇ ئادرېستا قوبۇللانغان ھەر قانداق ئېلخەت ئېلان قىلىنىدۇ. شۇڭا بۇ ئادرېسنى قەتئىي مەخپىي تۇتۇش ئاقىلانىلىكتۇر.','You can filter the list of users by User Role using the text links above the users list to show All, Administrator, Editor, Author, Contributor, or Subscriber. The default view is to show all users. Unused User Roles are not listed.'=>'ھەممىسى، باشقۇرغۇچى، تەھرىرلىگۈچى، ئاپتور ، تۆھپە قوشقۇچى ياكى مۇشتەرى بولغۇچىنى كۆرسىتىش ئۈچۈن،  «ئىشلەتكۈچى رولى»نىڭ سول ئۈستى تەرەپتىكى تېكىست ئۇلانمىسىنى ئىشلىتىپ ئىشلەتكۈچى تىزىملىكىنى سۈزسىڭىز بولىدۇ. كۆڭۈلدىكى ھالەتتە ھەممە ئىشلەتكۈچى كۆرسىتىلىدۇ. «ئىشلىتىلمىگەن ئىشلەتكۈچى روللىرى» تىزىملىككە تىزىلمايدۇ.','Image could not be processed. Please go back and try again.'=>'سۈرەتنى بىر تەرەپ قىلغىلى بولمىدى. قايتىپ قايتا سىناپ بېقىڭ.','There is an autosave of this post that is more recent than the version below. <a href="%s">View the autosave</a>'=>'بۇ يازمىنىڭ تۆۋەندىكىدىنمۇ يېڭىراق ئاپتوماتىك ساقلانغان نۇسخىسى بار. <a href="%s">ئاپتوماتىك ساقلانغىنىنى كۆرۈڭ</a>.','Repairs complete. Please remove the following line from wp-config.php to prevent this page from being used by unauthorized users.'=>'تۈزىتىش تاماملاندى. ھوقۇق بېرىلگەن ئىشلەتكۈچىلەرنىڭ بۇ بەتنى كۆرەلىشى ئۈچۈن تۆۋەندىكى قۇرلارنى wp-config.php ھۆججىتىڭىزدىن ئۆچۈرۈۋېتىڭ.','The %1$s table is not okay. It is reporting the following error: %2$s. WordPress will attempt to repair this table&hellip;'=>'%1$s جەدۋىلىدە مەسىلە بار. تۆۋەندىكى خاتالىق مەلۇم قىلىندى:  %2$s. WordPress بۇ table&hellip; نى ئوڭشاپ سىناپ باقىدۇ.','WordPress can automatically look for some common database problems and repair them. Repairing can take a while, so please be patient.'=>'WordPress ساندانغا مۇناسىۋەتلىك بەزىبىر مەسىلىلەرنى ئاپتوماتىك تېپىپ تۈزىتەلەيدۇ. بۇنىڭغا بىر ئاز ۋاقىت كېتىدۇ، شۇڭا سەۋرچانلىق بىلەن ساقلاپ تۇرۇڭ.','WordPress can also attempt to optimize the database. This improves performance in some situations. Repairing and optimizing the database can take a long time and the database will be locked while optimizing.'=>'WordPress تە سانداننى ئەلالاشتۇرۇشقىمۇ بولىدۇ. بۇ ئارقىلىق بەزىبىر مەشغۇلاتلارنى تېزلەشتۈرگىلى بولىدۇ. سانداننى ئەلالاشتۇرۇش ۋە تۈزىتىشكە بىر ئاز ۋاقىت كېتىشى مۇمكىن. بۇ جەرياندا ساندان قۇلۇپلاقلىق ھالەتتە تۇرىدۇ.','Enter the email address of an existing user on this network to invite them to this site. That person will be sent an email asking them to confirm the invite.'=>'بۇ توردىكى ئىشلەتكۈچىلەرنى بۇ تور بېكىتىگە تەكلىپ قىلىش ئۈچۈن ئۇلارنىڭ ئېلېكتىرونلۇق خەت ئادرېسىنى كىرگۈزۈڭ. ئېلېكتىرونلۇق خەت ئەۋەتىلگەن ئادەم تەكلىپنى دەلىللەش ھەققىدە سورىلىدۇ.','The active theme is broken. Reverting to the default theme.'=>'ئىشلىتىلىۋاتقان ئۆرنەك بۇزۇلغان بولغاچقا كۆڭۈلدىكى ئۆرنەككە قايتىۋاتىدۇ.','Enter the email address or username of an existing user on this network to invite them to this site. That person will be sent an email asking them to confirm the invite.'=>'بۇ توردىكى ئىشلەتكۈچىلەرنى بۇ تور بېكىتىگە تەكلىپ قىلىش ئۈچۈن ئۇلارنىڭ ئېلېكتىرونلۇق خەت ئادرېسى ياكى ئىشلەتكۈچى ئاتىنى كىرگۈزۈڭ. ئېلېكتىرونلۇق خەت ئەۋەتىلگەن ئادەم تەكلىپنى دەلىللەش ھەققىدە سورىلىدۇ.','Show Toolbar when viewing site'=>'توربەتنى كۆرگەندە قورال ئىستونى كۆرۈنسۇن','For more information, see <a href="%s">the release notes</a>.'=>'تەپسىلاتىنى <a href="%s">تارقىتىش خاتىرىلىرى</a>دىن كۆرۈڭ.','<strong>Version %1$s</strong> addressed some security issues and fixed %2$s bug.'=>'<strong>%1$s نەشرىدە</strong> بىر قىسىم بىخەتەرلىك مەسىلىلىرى ھەل قىلىنىپ، %2$s  خاتالىق تۈزىتىلدى..','<strong>Version %1$s</strong> addressed a security issue and fixed %2$s bug.'=>'<strong>%1$s نەشرىدە</strong> بىر بىخەتەرلىك مەسىلىسى بايقالغان ھەم %2$s خاتالىق ئوڭشالغان.','<strong>Version %1$s</strong> addressed %2$s bug.'=>'<strong>%1$s نەشرىدە</strong> %2$s يوچۇق بايقالدى.','What&#8217;s New'=>'قانداق يېڭىلىقلار بار','Maintenance and Security Release'=>'ئاسراش ۋە بىخەتەرلىك تارقىتىلمىسى','Security Release'=>'بىخەتەرلىك تارقىتىلمىسى','Maintenance Release'=>'ئاسراش تارقىتىلمىسى','<strong>Version %s</strong> addressed some security issues.'=>'<strong>نەشرى %s</strong>دە بىر بىخەتەرلىك مەسىلىسى ھەل قىلىندى.','This screen allows you to choose your permalink structure. You can choose from common settings or create custom URL structures.'=>'بۇ ئېكران ئارقىلىق كۆڭۈلدىكى ئۆزگەرمەس ئۇلانمىڭىزنىڭ قۇرۇلمىسىنى تاللىيالايسىز. ئادەتتىكى تەڭشەكلەردىن تاللىسىڭىزمۇ ياكى ئىختىيارىي تور ئادرېسى قۇرۇلمىسى قۇرسىڭىزمۇ بولىدۇ.','Welcome to WordPress %1$s. <a href="%2$s">Learn more</a>.'=>'WordPress %1$s نەشرىگە خۇش كېلىپسىز. <a href="%2$s">تەپسىلاتىنى كۆرۈش</a>.','Adding Categories'=>'سەھىپە قوشۇش','You can upload media files here without creating a post first. This allows you to upload files to use with posts and pages later and/or to get a web link for a particular file that you can share. There are three options for uploading files:'=>'يازما قۇرماي تۇرۇپمۇ بۇ يەرگە ۋاسىتە ھۆججىتى يوللىيالايسىز. بۇنداق بولغاندا بۇ ھۆججەتلەرنى كېيىن يازما ۋە بەتلەرگە  قوشۇپ ئىشلىتەلەيسىز ياكى مەلۇم بىر ھۆججەتنى تاللاپ ئۇنىڭ ئۇلانمىسىنى ئورتاقلاشتۇرالايسىز. ھۆججەت يوللاشنىڭ ئۈچ خىل ئۇسۇلى بار.','Troubleshooting'=>'مەسىلىنى بىر تەرەپ قىلىش','Adding Tags'=>'بەلگە قوشۇش','Authors can publish and manage their own posts, and are able to upload files.'=>'ئاپتورلار يازما ئېلان قىلالايدۇ ھەم ئۆز يازمىلىرىنى باشقۇرالايدۇ، شۇنداقلا ھۆججەت يۈكلىيەلەيدۇ.','Adding Plugins'=>'قىستۇرمىلارنى قوشۇش','If the importer you need is not listed, <a href="%s">search the plugin directory</a> to see if an importer is available.'=>'ئېھتىياجلىق كىرگۈزگۈچ بۇ تىزىملىكتە بولمىسا، شۇنداق كىرگۈزگۈچنىڭ بار- يوقلۇقىنى <a href="%s">قىستۇرما مۇندەرىجىسىدىن ئىزدەپ كۆرۈڭ</a>.','Screen Content'=>'ئېكران مەزمۇنى','You can customize the display of this screen&#8217;s contents in a number of ways:'=>'بۇ بەتنىڭ كۆرۈنۈشىنى بىر قانچە خىل ئۇسۇلدا ئۆزگەرتەلەيسىز:','Available Actions'=>'كۈچكە ئىگە مەشغۇلاتلار','Remember to click the Add New User button at the bottom of this screen when you are finished.'=>'تۈگەتكەندە بۇ بەتنىڭ ئاستىدىكى «يېڭى ئىشلەتكۈچى قوشۇش» كۇنۇپكىسىنى چېكىشنى ئۇنتۇماڭ.','User Roles'=>'ئىشلەتكۈچى دەرىجىلىرى','Here is a basic overview of the different user roles and the permissions associated with each one:'=>'ئوخشىمىغان ئىشلەتكۈچى روللارنىڭ قىسقىچە چۈشەندۈرۈلىشى ۋە ھەربىر رول بىلەن باغلانغان ھوقۇقلار بۇ يەردە كۆرسىتىلدى:','Subscribers can read comments/comment/receive newsletters, etc. but cannot create regular site content.'=>'مۇشتەرى سالاھىيىتىدىكىلەر باھانى ئوقۇيالايدۇ، خەۋەرلەرنى قوبۇللىيالايدۇ، لېكىن تور بېكەتتە مەزمۇن قۇرالمايدۇ.','This screen provides access to all of your posts. You can customize the display of this screen to suit your workflow.'=>'بۇ ئېكران ئارقىلىق بارلىق يازمىلىرىڭىزنى زىيارەت قىلالايسىز. بۇ ئېكراننىڭ كۆرۈنىشىنى ئىختىيارىيلاشتۇرۇپ خىزمەت تەرتىپىڭىزگە ماس قىلالايسىز.','You can also edit or move multiple posts to the Trash at once. Select the posts you want to act on using the checkboxes, then select the action you want to take from the Bulk actions menu and click Apply.'=>'بىرلا ۋاقىتتا كۆپ يازما تەھرىرلىيەلەيسىز ياكى ئۇلارنى سېۋەتكە يوللىيالايسىز. تەكشۈرۈش رامكىسىنى ئىشلىتىپ مەشغۇلات ئېلىپ بارماقچى بولغان يازمىلارنى تاللاپ، ئاندىن «تۈركۈملەپ مەشغۇلات قىلىش» تىزىملىكىدىن ئېلىپ بارماقچى بولغان مەشغۇلاتنى تاللاپ، «قوللىنىش»نى باسسىڭىز بولىدۇ.','How to Update'=>'قانداق يېڭىلايدۇ','Once you&#8217;ve saved the download file, you can use the Import function in another WordPress installation to import the content from this site.'=>'چۈشۈرۈش ھۆججىتىنى ساقلىۋالسىڭىز، كېيىن ئۇنى ئەكىرىش ئىقتىدارىدىن پايدىلىنىپ باشقا بىر WordPress كە ئىمپورتلىيالايسىز.','If you want to convert your categories to tags (or vice versa), use the <a href="%s">Categories and Tags Converter</a> available from the Import screen.'=>'سەھىپىلەرنى خەتكۈچكە ياكى خەتكۈچلەرنى سەھىپىلەرگە ئايلاندۇرماقچى بولسىڭىز، «ئەكىر» ئېكرانىدىكى <a href="%s">سەھىپە ۋە خەتكۈچلەرنى ئايلاندۇرغۇچ</a>نى ئىشلىتىڭ.','Adding Themes'=>'ئۆرنەك قوشۇش','To add a new user to your site, fill in the form on this screen and click the Add New User button at the bottom.'=>'يېڭى ئىشلەتكۈچىنى تور بېكىتىڭىزگە قوشۇش ئۈچۈن تۆۋەندىكى رامكىلارنى تولدۇرۇپ بولۇپ ئاستى تەرەپتىكى «يېڭى ئىشلەتكۈچى قوشۇش» كۇنۇپكىسىنى چېكىڭ.','Attaching Files'=>'ھۆججەت يۈكلەش','Moderating Comments'=>'ئىنكاس تەستىقلاش','Common Settings'=>'ئاساسىي تەڭشەكلەر','Custom Structures'=>'ئىختىيارىچە قۇرۇلمىلار','Permalinks are the permanent URLs to your individual pages and blog posts, as well as your category and tag archives. A permalink is the web address used to link to your content. The URL to each post should be permanent, and never change &#8212; hence the name permalink.'=>'ئۆزگەرمەس ئۇلانمىنىڭ تور ئادرېسلىرى خۇسۇسىي بەت، بىلوگ يازمىلىرى، سەھىپە ۋە بەلگە ئارخىپلىرىڭىزغا قۇرۇلغان ئۆزگەرمەس تور ئادرېسلىرى بولۇپ، مەزمۇنىڭىزغا ئۇلانما قىلىش ئۈچۈن ئىشلىتىلىدىغان تور ئادرېسىنى كۆرسىتىدۇ. ھەر بىر يازمىنىڭ تور ئادرېسى ئۆزگەرمەس ئۇلانما بولۇشى، ئۆزگەرتىلمەسلىكى كېرەك بولغانلىقتىن ئۇ ئۆزگەرمەس ئۇلانما ھېسابلىنىدۇ.','You can submit content in several different ways; this screen holds the settings for all of them. The top section controls the editor within the dashboard, while the rest control external publishing methods. For more information on any of these methods, use the documentation links.'=>'سىز مەزمۇنلارنى ئوخشىمىغان بىر قانچە ئۇسۇلدا يوللىيالايسىز. بۇ ئېكراندا شۇ ئۇسۇللارنىڭ ھەممىسىگە ئىشلەيدىغان تەڭشەكلەر تەمىنلەنگەن. ئۈستى تەرەپتىكى بۆلەكتە باشقۇرۇش بېتىدىكى تەھرىرلىگۈچلەرنى، قالغانلىرىدا قوشۇمچە ئېلان قىلىش ئۇسۇللىرىنى باشقۇرغىلى بولىدۇ. بۇ ئۇسۇللار ھەققىدە تەپسىلىي بىلمەكچى بولسىڭىز ئاستىدىكى ئۇلانمىلاردا تەمىنلەنگەن ماتېرىياللاردىن پايدىلىنىڭ.','Uploading Files allows you to choose the folder and path for storing your uploaded files.'=>'يۈكلىگەن ھۆججەتلەردە يۈكلەنگەن ھۆججەتلىرىڭىزنى ساقلايدىغان قىسقۇچ ۋە يولىنى تاللىيالايسىز.','Installing themes on Multisite can only be done from the Network Admin section.'=>'Installing themes on Multisite can only be done from the Network Admin section.','If desired, WordPress will automatically alert various services of your new posts.'=>'ئەگەر خالىسىڭىز، WordPress يېڭى يازمىلىرىڭىزنىڭ ھەر خىل مۇلازىمەتلىرىنى ئۆزلۈكىدىن ئاگاھلاندۇرىدۇ.','Post Via Email'=>'ئېلخەت ئارقىلىق يوللا','This screen provides many options for controlling the management and display of comments and links to your posts/pages. So many, in fact, they will not all fit here! :) Use the documentation links to get information on what each discussion setting does.'=>'بۇ ئېكراندا باھالار ۋە يازما ياكى بەتلەرگە قارىتىلغان ئۇلانمىلارنى كۆرسىتىش ۋە باشقۇرۇش قاتارلىقلارنى كونترول قىلىدىغان بىرقانچە تاللانمىلار تەمىنلەنگەن. بۇ تاللانمىلار ئەمەلىيەتتە بۇ يەرگە پاتمىغۇدەك دەرىجىدە كۆپ! ھەر بىر مۇھاكىمە تەڭشىكىنىڭ قانداق رولى بارلىقىنى بىلمەكچى بولسىڭىز ئاستى تەرەپتىكى ئۇلانمىلاردا تەمىنلەنگەن ماتېرىياللاردىن پايدىلىنىڭ.','You can change your password, turn on keyboard shortcuts, change the color scheme of your WordPress administration screens, and turn off the WYSIWYG (Visual) editor, among other things. You can hide the Toolbar (formerly called the Admin Bar) from the front end of your site, however it cannot be disabled on the admin screens.'=>'پارولىڭىزنى ئۆزگەرتەلەيسىز، ھەرپتاختا قىسقا يوللىرىنى ئېچىپ قويالايسىز، WordPress باشقۇرغۇچىلىق ئېكرانلىرىنىڭ رەڭ تۈسىنى ئۆزگەرتەلەيسىز، كۆرۈنۈشچان تەھرىرلىگۈچنى تاقىۋېتەلەيسىز ۋە باشقا ئىشلارنى قىلالايسىز. قورال بالدىقى (ئىلگىرىكى نەشرىدىكى «باشقۇرۇش بالدىقى»)نى بېكىتىڭىزنىڭ ئالدى قىرىدىن يوشۇرۇپ قويالايسىز، لېكىن ئۇنى باشقۇرۇش ئېكرانىدا ئىناۋەتسىز قىلغىلى بولمايدۇ.','Inactive Sidebar (not used)'=>'قوزغىتىلمىغان يانبالداق (ئىشلىتىلمىگەن)','This sidebar is no longer available and does not show anywhere on your site. Remove each of the widgets below to fully remove this inactive sidebar.'=>'تور بېكىتىڭىزدە بۇ يانبالداقنى ئەمدى ئىشلەتكىلى بولمايدۇ. بۇ ئاكتىپسىز يانبالداقنى تەلتۆكۈس چىقىرىۋېتىش ئۈچۈن تۆۋەندىكى ئەپچەلەرنىڭ ھەممىسىنى چىقىرىۋېتىش كېرەك.','<strong>Drag and drop</strong> your files into the area below. Multiple files are allowed.'=>'ھۆججەتلىرىڭىزنى تۆۋەندىكى ئورۇنغا <strong>سۆرەپ تاشلاڭ</strong>. كۆپ ھۆججەت بولسىمۇ بولىدۇ.','Clicking <strong>Select Files</strong> opens a navigation window showing you files in your operating system. Selecting <strong>Open</strong> after clicking on the file you want activates a progress bar on the uploader screen.'=>'<strong>ھۆججەت تاللاش</strong>نى چەكسىڭىز، مەشغۇلات سىستېمىسىدىكى ھۆججەتلىرىڭىزنى كۆرسىتىپ بېرىدىغان يۆتكىلىش كۆزنىكى ئېچىلىدۇ. خالىغان بىر ھۆججەتنى چەككەندىن كېيىن <strong>ئېچىش</strong>نى تاللىسىڭىز، يوللاش ئېكرانىدىكى جەريان بالدىقى قوزغىتىلىدۇ.','You can create groups of links by using Link Categories. Link Category names must be unique and Link Categories are separate from the categories you use for posts.'=>'«ئۇلانما سەھىپىلىرى»نى ئىشلىتىپ گۇرۇپپا ئۇلانمىلىرى قۇرالايسىز. «ئۇلانما سەھىپەسى»نىڭ نامى بىردىنبىر بولۇشى ھەمدە «ئۇلانما سەھىپىلىرى» سىز يازما ئۈچۈن ئىشلەتكەن سەھىپىلەردىن ئايرىلغان بولۇشى كېرەك.','Missing Widgets'=>'يوقالغان ئەپچەلەر','Removing and Reusing'=>'چىقىرىۋېتىش ۋە قايتا ئىشلىتىش','You can assign keywords to your posts using <strong>tags</strong>. Unlike categories, tags have no hierarchy, meaning there is no relationship from one tag to another.'=>'<strong>بەلگىلەر</strong>نى ئىشلىتىپ يازمىلىرىڭىزغا ھالقىلىق سۆز باغلىيالايسىز. بەلگىلەرنىڭ سەھىپىلەرگە ئوخشىمايدىغان يېرى، بەلگىلەر دەرىجە-قاتلامغا ئايرىلمايدۇ، بۇ دېگەنلىك بىر بەلگە بىلەن يەنە بىر بەلگە ئوتتۇرىسىدا ھېچقانداق باغلىنىش بولمايدۇ.','Deleting Links'=>'ئۇلانمىلارنى ئۆچۈرۈش','Links in the Toolbar at the top of the screen connect your dashboard and the front end of your site, and provide access to your profile and helpful WordPress information.'=>'ئېكراننىڭ يۇقىرى قىسمىدىكى «قورالبالداق»ئۇلانمىلىرى باشقۇرۇش تاختىڭىزنى تور بېكىتىڭىزنىڭ ئالدى قىرى بىلەن ئۆز-ئارا ئۇلايدۇ، شۇڭا بۇ ئۇلانمىلار ئارقىلىق ئارخىپىڭىزنى زىيارەت قىلالايسىز ھەمدە ياردىمى تېگىدىغان WordPress ئۇچۇرلىرىغا ئېرىشەلەيسىز.','Managing pages is very similar to managing posts, and the screens can be customized in the same way.'=>'«بەت باشقۇرۇش» يازما باشقۇرغانغا ئاساسەن ئوخشاش بولۇپ، ئېكرانلارنى ئوخشاش ئۇسۇل بىلەن ئىختىيارىي قىلىشقا بولىدۇ.','Pages are similar to posts in that they have a title, body text, and associated metadata, but they are different in that they are not part of the chronological blog stream, kind of like permanent posts. Pages are not categorized or tagged, but can have a hierarchy. You can nest pages under other pages by making one the &#8220;Parent&#8221; of the other, creating a group of pages.'=>'«بەت» يازمىغا ئوخشاش بولۇپ، ئۇنىڭمۇ تېمىسى، مەزمۇن تېكىستى ۋە باغلانغان مەلۇمات ئۇچۇرى بار، لېكىن ئوخشىمايدىغان يېرى بەتلەرنىڭ مەڭگۈلۈك يازمىلارغا ئوخشاش ئىلگىرى كېيىنلىك بىلوگ تەرتىپى بولمايدۇ. بەتلەر سەھىپىگە ئايرىلمايدۇ، بەلگە قويۇلمايدۇ، لېكىن دەرىجە-قاتلامغا ئايرىشقا بولىدۇ. مەلۇم بىر بەتنى باشقا بەتلەرنىڭ &#8220;بېشى&#8221; قىلىپ بەت گۇرۇپپىسى قۇرۇپ، باشقا بەتلەرنى ئۇنىڭ ئاستىغا قەۋەتلىيەلەيسىز.','Many people take advantage of keyboard shortcuts to moderate their comments more quickly. Use the link to the side to learn more.'=>'باھالارنى تېخىمۇ تېز تەستىقلاش ئۈچۈن نۇرغۇن كىشىلەر تېزلەتمە كۇنۇپكىلاردىن پايدىلىنىدۇ. تەپسىلاتىنى تۆۋەندىكى ئۇلانمىدىن كۆرۈڭ.','If a media file has not been attached to any content, you will see that in the Uploaded To column, and can click on Attach to launch a small popup that will allow you to search for existing content and attach the file.'=>'ۋاسىتە ھۆججىتى ھېچقانداق يازمىغا باغلانمىغان بولسا، ئۇنى رەتكە يۈكلەشتىن كۆرەلەيسىز. «ھۆججەت باغلاش»نى چېكىش ئارقىلىق كىچىك قاڭقىش كۆزنەكىنى قوزغىتىپ، يازما ئىزدەپ، ھۆججەت باغلىسىڭىز بولىدۇ.','All the files you&#8217;ve uploaded are listed in the Media Library, with the most recent uploads listed first. You can use the Screen Options tab to customize the display of this screen.'=>'سىز يوللىغان بارلىق ھۆججەتلەر «ۋاسىتە ئامبىرى» دا ساقلاندى. يېقىندا يوللىغان ھۆججەت ئەڭ بېشىدا تىزىلىدۇ. بۇ «ئېكران تاللانمىلىرى» بەتكۈچىنى ئىشلىتىپ، بۇ ئېكراننىڭ كۆرۈنۈشىنى ئىختىيارىي قىلالايسىز.','In the <strong>Author</strong> column, in addition to the author&#8217;s name, email address, and site URL, the commenter&#8217;s IP address is shown. Clicking on this link will show you all the comments made from this IP address.'=>'<strong>يازغۇچى</strong> رېتىدە ئاپتورنىڭ نام-شەرىپى، ئېلېكتىرونلۇق خەت ئادرېسى ۋە تور بېكەت ئادرېسىغا قوشۇپ ئىنكاس يازغۇچىنىڭ IP ئادرېسىنى كۆرسەتكىلى بولىدۇ. بۇ ئۇلانمىنى چەكسىڭىز، شۇ IP دىن يوللانغان بارلىق ئىنكاسلارنى كۆرەلەيسىز.','You can also perform the same types of actions, including narrowing the list by using the filters, acting on a page using the action links that appear when you hover over a row, or using the Bulk actions menu to edit the metadata for multiple pages at once.'=>'ئوخشاش تىپتىكى مەشغۇلاتلارنى ئورۇندىيالايسىز. مەسىلەن، سۈزگۈچ ئىشلىتىپ تىزىملىكتىكى ئەزالارنى سۈزۈپ كۆرسىتىش، قۇر ئۈستىدە مائۇسنى توختىتىپ تۇرغاندا كۆرۈنىدىغان مەشغۇلات ئۇلانمىلىرى ئارقىلىق بەت ئالمىشىش، توپ مەشغۇلات تىزىملىكىنى ئىشلىتىپ، كۆپ بەتنىڭ مەلۇمات ئۇچۇرلىرىنى بىراقلا ئۆزگەرتىش قاتارلىقلار.','You can manage comments made on your site similar to the way you manage posts and other content. This screen is customizable in the same ways as other management screens, and you can act on comments using the on-hover action links or the bulk actions.'=>'يازما ۋە باشقا مەزمۇنلارنى باشقۇرغانغا ئوخشاشلا تور بېتىڭىزدىكى ئىنكاسنىمۇ باشقۇرالايسىز. بۇ ئېكراننىمۇ باشقىلىرىغا ئوخشاشلا ئۆزىڭىز تەڭشىيەلەيسىز. ئىنكاسقا نىسبەتەن ئۈستىدىكى تېز تىزىملىك ياكى توپ مەشغۇلات تىزىملىكى ئارقىلىق مەشغۇلات قىلالايسىز.','Links may be separated into Link Categories; these are different than the categories used on your posts.'=>'ئۇلانمىلار «ئۇلانما سەھىپىلىرى» دەپ ئايرىلىشى مۇمكىن؛ بۇ يازمىلىرىڭىزدا ئىشلىتىلگەن سەھىپىلەردىن پەرقلىنىدۇ.','<a href="%1$s">Learn more about WordPress %2$s</a>.'=>'<a href="%1$s">WordPress ھەققىدىكى تەپسىلاتلار %2$s</a>.','Managing Pages'=>'بەتلەرنى باشقۇرۇش','Hovering over a row in the users list will display action links that allow you to manage users. You can perform the following actions:'=>'مائۇسنى يازما تىزىملىكىدىكى بىرەر قۇر ئۈستىگە ئەكەلسىڭىز، يازمىلارنى باشقۇرۇشقا تەمىنلەنگەن مەشغۇلات ئۇلانمىلىرى كۆرسىتىلىدۇ. سىز تۆۋەندىكى مەشغۇلاتلارنى ئورۇنلىيالايسىز:','You can hide/display columns based on your needs and decide how many users to list per screen using the Screen Options tab.'=>'«ئېكران تاللانمىلىرى» بەتكۈچىدە ئىستونلارنى ئېھتىياجىڭىزغا ئاساسەن يوشۇرالايسىز ياكى كۆرسىتەلەيسىز، شۇنداقلا ھەر ئېكراندا كۆرسىتىلىدىغان يازما سانىنى بەلگىلىيەلەيسىز.','<strong>Quick Edit</strong> provides inline access to the metadata of your post, allowing you to update post details without leaving this screen.'=>'<strong>تېز تەھرىرلەش</strong> ئارقىلىق يازمىڭىزنىڭ مەلۇمات ئۇچۇرلىرىنى ئىچكى زىيارەت قىلىپ، يازما تەپسىلاتلىرىنى تۇرۇۋاتقان ئېكراندىن ئايرىلماي تۇرۇپ يېڭىلىيالايسىز.','<strong>Edit</strong> takes you to the editing screen for that post. You can also reach that screen by clicking on the post title.'=>'<strong>تەھرىرلەش</strong> ئارقىلىق يازما تەھرىرلەش ئېكرانىغا يۆتكىلەلەيسىز. بۇ ئېكرانغا يەنە يازما تېمىسىنى چېكىش ئارقىلىقمۇ يۆتكىلەلەيسىز.','You can view all posts made by a user by clicking on the number under the Posts column.'=>'«يازمىلار» ئىستونى ئاستىدىكى رەقەمنى چېكىش ئارقىلىق مەلۇم بىر ئىشلەتكۈچى يوللىغان بارلىق يازمىلارنى كۆرەلەيسىز.','<strong>Trash</strong> removes your post from this list and places it in the Trash, from which you can permanently delete it.'=>'<strong>سېۋەت</strong> يازمىڭىزنى بۇ ئۇلانمىدىن چىقىرىۋېتىپ، ئۇنى ئەخلەت سېۋىتىگە قويۇپ قويىدۇ. ئۇ يەردە ئۇنى مەڭگۈلۈك ئۆچۈرۈۋېتەلەيسىز.','<strong>Edit</strong> takes you to the editable profile screen for that user. You can also reach that screen by clicking on the username.'=>'<strong>تەھرىرلەش</strong> ئارقىلىق ئىشلەتكۈچىنىڭ تەھرىرلەشكە بولىدىغان ئارخىپ ئېكرانىغا يۆتكىلەلەيسىز. بۇ ئېكرانغا يەنە ئىشلەتكۈچى ئاتىنى چېكىش ئارقىلىقمۇ يۆتكىلەلەيسىز.','<strong>Preview</strong> will show you what your draft post will look like if you publish it. View will take you to your live site to view the post. Which link is available depends on your post&#8217;s status.'=>'<strong>ئالدىن كۆزەت</strong>نى ئىشلىتىپ يازمىنىڭ دەسلەپكى نۇسخىسى ئېلان قىلىنغاندىن كېيىنكى كۆرۈنۈش ئۈنۈمىنى كۆرەلەيسىز. «كۆرۈنۈش» ئارقىلىق يازما كۆرىدىغان شۇئان تور بېكىتىڭىزگە يۆتكىلەلەيسىز. قايسى ئۇلانمىنى ئىشلەتكىلى بولۇشى يازمىڭىزنىڭ ھالىتىگە باغلىق.','Because this is a multisite installation, you may add accounts that already exist on the Network by specifying a username or email, and defining a role. For more options, such as specifying a password, you have to be a Network Administrator and use the hover link under an existing user&#8217;s name to Edit the user profile under Network Admin > All Users.'=>'بۇ كۆپ بېكەت قاچىلىنىشى بولغانلىقى ئۈچۈن، بۇرۇنقى توردىكى ھېساباتلارنى ئىشلەتكۈچى ئاتى ياكى ئېلېكتىرونلۇق خەت ئادرېسىنى كۆرسىتىپ رول بەلگىلەش ئارقىلىق قوشالىشىڭىز مۇمكىن. پارول بەلگىلەشكە ئوخشاش تېخىمۇ كۆپ تاللانمىلار ئۈچۈن، سىزدە «تور باشقۇرغۇچى» كىملىكى بولۇشى كېرەك. مەۋجۇت ئىشلەتكۈچى ئاتى ئاستىدىكى توختىتىپ تۇرۇش ئۇلانمىسىنى ئىشلىتىپ، «تور باشقۇرغۇچى» > «بارلىق ئىشلەتكۈچى » ئاستىدىن ئىشلەتكۈچى ئارخىپىنى تەھرىرلىمسىڭىز بولمايدۇ.','Welcome to WordPress %s'=>'WordPress %s كە خۇش كېلىپسىز!','Go to Dashboard &rarr; Home'=>'باشقۇرۇش بېتى &rarr; باش بەتكە يۆتكىلىش','Go to Dashboard &rarr; Updates'=>'باشقۇرۇش تاختا &rarr; يېڭىلاش بېتىگە يۆتكەل','Profile updated.'=>'تەرجىمىھال يېڭىلاندى.','Hi,

You\'ve been invited to join \'%1$s\' at
%2$s with the role of %3$s.

Please click the following link to confirm the invite:
%4$s'=>'ياخشىمۇسىز،

سىز %3$s سالاھىيىتىدە %2$s تورىدىكى «%1$s» غا قاتنىشىشقا تەكلىپ قىلىندىڭىز.

