%4$s','Core Developer'=>'غوللۇق ئىجادىيەتچى','The plugin contains no files.'=>'قىستۇرمىنىڭ ھېچقانداق ھۆججىتى يوق ئىكەن.','No valid plugins were found.'=>'ئۈنۈملۈك قىستۇرما تېپىلمىدى.','The package could not be installed.'=>'بوغچا ئورنىتالمىدى.','Attachment Post URL'=>'قوشۇمچە ھۆججەت يازما ئادرېسى','admin menuAll Links'=>'بارلىق ئۇلانمىلار','%s plugin'=>'%s قىستۇرما','%s plugins'=>'%s قىستۇرما','Successfully optimized the %s table.'=>'%s جەدۋىلى ئوڭۇشلۇق ئەلالاشتۇرۇلدى.','Failed to optimize the %1$s table. Error: %2$s'=>'%1$s جەدۋىلىنى ئەلالاشتۇرالمىدى. خاتالىق: %2$s','The %s table is okay.'=>'%s جەدۋىلى تەييار بولدى.','The %s table is already optimized.'=>'%s جەدۋىلى ئەلالاشتۇرۇلغان.','Successfully repaired the %s table.'=>'%s جەدۋىلى ئوڭۇشلۇق ئوڭشالدى.','View version %s details.'=>'%s نەشرىنىڭ تەپسىلاتىنى كۆرسىتىدۇ.','Tumblr'=>'Tumblr','<a href="%1$s" class="update-browser-link">Update %2$s</a> or learn how to <a href="%3$s" class="browse-happy-link">browse happy</a>'=>'<a href="%1$s" class="update-browser-link">%2$ نى يېڭىلاڭs</a> ياكى <a href="%3$s" class="browse-happy-link">بەھۇزۇر زىيارەت قىلىش</a> ئۇسۇلىنى ئۆگىنىڭ.','Scale images to match the large size selected in %1$simage options%2$s (%3$d &times; %4$d).'=>'سۈرەت ئورنىنى %1$sسۈرەت تاللانمىلىرى%2$s (%3$d &times; %4$d) دا تاللانغان چوڭ سېغىمغا ماسلىشىدىغان قىلىڭ.','Audio, Video, or Other File'=>'ئۈن، سىن ياكى باشقا ھۆججەتلەر','Insert media from another website'=>'باشقا بىر توربەتتىن ۋاسىتە قىستۇرۇش','<strong>Error:</strong> Could not connect to the server. Please verify the settings are correct.'=>'<strong>خاتالىق:</strong> مۇلازىمېتىرغا باغلىنالمىدى. تەڭشەكلەرنىڭ توغرا-خاتالىقىنى تەكشۈرۈڭ.','<strong>Drag and Drop</strong> &mdash; To rearrange the boxes, drag and drop by clicking on the title bar of the selected box and releasing when you see a gray dotted-line rectangle appear in the location you want to place the box.'=>'<strong>سۆرەپ تاشلاش</strong> - رامكىلارنى قايتا ئورۇنلاشتۇرۇش ئۈچۈن، تاللانغان رامكىنىڭ تېما بالدىقىنى چېكىپ، ئاندىن ئۇ رامكىنى سىز قويماقچى بولغان ئورۇنغا سۆرەپ، كۈل رەڭلىك ئۈزۈك سىزىقلىق تىك تۆتبۇلۇڭ ھاسىل بولغاندا ئاندىن ئۇنى قويۇپ بېرىڭ.','The left-hand navigation menu provides links to all of the WordPress administration screens, with submenu items displayed on hover. You can minimize this menu to a narrow icon strip by clicking on the Collapse Menu arrow at the bottom.'=>'سول تەرەپتىكى يۆتكىلىش تىزىملىكى ئارقىلىق WordPress نىڭ بارلىق باشقۇرۇش ئېكرانلىرىغا يۆتكىلەلەيسىز، مائۇسنى توختىتىپ تۇرغاندا تارماق تىزىملىكتىكى ئەزالار كۆرۈنىدۇ . ئاستى تەرەپتىكى «يىغىش» تىزىملىكىنى چېكىش ئارقىلىق بۇ تىزىملىكنى تار سىنبەلگە ھالىتىگە كىچىكلىتەلەيسىز.','You can use the following controls to arrange your Dashboard screen to suit your workflow. This is true on most other administration screens as well.'=>'تۆۋەندىكى كونتروللارنى ئىشلىتىپ «باشقۇرۇش تاختىڭىز»نى خىزمەت تەرتىپىڭىزگە ماسلاشتۇرالايسىز. باشقا كۆپ قىسىم باشقۇرۇش ئېكرانلىرىدىمۇ بۇنى قىلغىلى بولىدۇ.','Overview'=>'قىسقىچە بايان','Caution:'=>'دىققەت:','Version %s'=>'نەشرى %s','Settings saved.'=>'تەڭشەكلەر ساقلاندى.','For more information:'=>'تەپسىلاتى بۇ يەردە:','User added.'=>'ئىشلەتكۈچى قوشۇلدى.','Search Users'=>'ئىشلەتكۈچى ئىزدەش','Add Existing User'=>'مەۋجۇد ئىشلەتكۈچىنى قوشۇش','All Users'=>'بارلىق ئىشلەتكۈچىلەر','Super Admin'=>'ئالىي باشقۇرغۇچى','Updates %s'=>'%s يېڭىلاش‎‏','Installed Plugins'=>'ئورنىتىلغان قىستۇرمىلار','Plugins %s'=>'%s‏ قىستۇرما','Role'=>'رول','User removed from this site.'=>'ئىشلەتكۈچى توربەتتىن چىقىرىۋېتىلدى.','Changed roles.'=>'رولى ئۆزگەرتىلدى.','Add New User'=>'يېڭى ئىشلەتكۈچى قوش','Deactivate'=>'ئاكتىپلىما','Delete Site'=>'بېكەت ئۆچۈر','Confirm Deletion'=>'ئۆچۈرۈش جەزملەش','Update Available <span class="count">(%s)</span>'=>'<span class="count">(%s)</span> يېڭىلانما بار' . "\0" . '<span class="count">(%s)</span> يېڭىلانما بار','Customizing This Display'=>'بۇ كۆرۈنۈشنى خاسلاشتۇرۇش','About Pages'=>'بەتلەر ھەققىدە','Title and Post Editor'=>'تېما ۋە يازما تەھرىرلىگۈچ','Note: Neither of these options blocks access to your site &mdash; it is up to search engines to honor your request.'=>'ئەسكەرتىش: بۇ تاللانمىلارنىڭ ھېچقايسىسى تور بېكىتىڭىزنى نورمال زىيارەت قىلىشتىن توسۇپ قويمايدۇ &mdash; ئۇ پەقەت ئىزدەش موتورلىرىغا بولغان تەلىپىڭىزنى ئەكس ئەتتۈرىدۇ.','sample permalink basearchives'=>'ئارخىپلار','Post name'=>'يازما نامى','sample permalink structuresample-post'=>'يازما-مىسالى','This importer is not installed. Please install importers from <a href="%s">the main site</a>.'=>'بۇ كىرگۈزگۈچ قاچىلانمىدى. كىرگۈزگۈچلەرنى <a href="%s">ئاساسىي بېكەت</a>تىن قاچىلاڭ.','Site Language'=>'تور بېكەت تىلى','Attempt to notify any blogs linked to from the post'=>'يازمىنى ئۇلانما قىلغان بارلىق بىلوگلارغا ئۇقتۇرۇش قىلىنسۇن','Hi,
