%%s','Post Formats'=>'يازما پىچىمى','Full Width Template'=>'تولۇق كەڭلىكتىكى قېلىپ','Featured Images'=>'تەۋسىيەلىك سۈرەت','Featured Image Header'=>'تەۋسىيەتلىك سۈرەت بەت قاش','It looks like you\'re using an old version of %s. For the best WordPress experience, please update your browser.'=>'سىز كونا نەشىردىكى <%s تور كۆرگۈچىسىنى ئىشلىتىۋېتىپسىز. WordPress تە ئەڭ ياخشى ئۈنۈمگە ئېرىشمەكچى بولسىڭىز تور كۆرگۈچىڭىزنىڭ نەشرىنى يېڭىلاڭ.','It looks like you\'re using an insecure version of %s. Using an outdated browser makes your computer unsafe. For the best WordPress experience, please update your browser.'=>'سىز بىخەتەر بولمىغان كونا نەشىردىكى %s تور كۆرگۈچنى ئىشلىتىۋېتىپسىز. ۋاقتى ئۆتكەن تور كۆرگۈچ بىخەتەر ئەمەس. WordPress تە ئەڭ ياخشى ئۈنۈمگە ئېرىشمەكچى بولسىڭىز تور كۆرگۈچىڭىزنىڭ نەشرىنى يېڭىلاڭ.','There are some invalid menu items. Please check or delete them.'=>'بەزىبىر تىزىملىك تۈرلىرى ئۈنۈمسىز. ئۇلارنى تەكشۈرۈڭ ياكى ئۆچۈرۈۋېتىڭ.','term nameName'=>'ئاتى','meta nameName'=>'ئاتى','theme nameName'=>'ئاتى','You can find additional themes for your site by using the Theme Browser/Installer on this screen, which will display themes from the <a href="%s">WordPress Theme Directory</a>. These themes are designed and developed by third parties, are available free of charge, and are compatible with the license WordPress uses.'=>'بۇ ئېكراندىكى، <a href="%s" target="_blank">WordPress.org ئۆرنەك مۇندەرىجىسى</a>دىكى ئۆرنەكلەرنى كۆرسىتىپ بېرىدىغان، «ئۆرنەك كۆرگۈچ ۋە قاچىلىغۇچ»نى ئىشلىتىپ تور بېكىتىڭىز ئۈچۈن قوشۇمچە ئۆرنەك ئىزدەپ تاپالايسىز. بۇ ئۆرنەكلەر ئۈچىنچى تەرەپ تەرىپىدىن لايىھەلىنىپ ياسالغان بولۇپ، ھەقسىز، ھەمدە ئىجازەتنامە ئالغان WordPress تە بىردەك ئىشلەتكىلى بولىدۇ.','If you would like to see more plugins to choose from, click on the &#8220;Add New Plugin&#8221; button and you will be able to browse or search for additional plugins from the <a href="%s">WordPress Plugin Directory</a>. Plugins in the WordPress Plugin Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they&#8217;re free!'=>'تېخىمۇ كۆپ قىستۇرما ئارىسىدىن تاللىماقچى بولسىڭىز، «يېڭى قىستۇرما قوش» توپچىنى چەكسىڭىز، <a href="%s">WordPress قىستۇرما مۇندەرىجىسى</a>دىكى قوشۇمچە قىستۇرمىلارنى ئىزدەپ ۋە كۆز يۈگۈرتەلەيسىز. WordPress.org قىستۇرما مۇندەرىجىسىدىكى قىستۇرمىلار ئۈچىنچى تەرەپ تەرىپىدىن لايىھەلىنىپ ياسالغان بولۇپ، ئىجازەتنامە ئالغان WordPress تە بىردەك ئىشلەتكىلى بولىدۇ. ئەلۋەتتە، ئۇلار ھەقسىز!','The uploaded file exceeds the %s directive that was specified in the HTML form.'=>'يۈكلەنگەن ھۆججەتنىڭ سىغىمى HTML جەدۋىلىدە بەلگىلەنگەن %s دىن ئېشىپ كەتتى.','External Libraries'=>'تاشقى ئامبارلار','Available Tools'=>'تەييار قوراللار','Network Setup'=>'تور ئورنىتىش','Translate this to be the equivalent of English Translators in your language for the credits page Translators sectionTranslators'=>'تەرجىمانلار','WordPress grows when people like you tell their friends about it, and the thousands of businesses and services that are built on and around WordPress share that fact with their users. We are flattered every time someone spreads the good word, just make sure to <a href="%s">check out our trademark guidelines</a> first.'=>'سىزگە ئوخشاش كىشىلەر دوستلىرىغا WordPress ھەققىدە كۆپرەك ئېيتىپ بەرسە، ھەمدە WordPress ئارقىلىق ئېلىپ بېرىلىدىغان مىڭلىغان سودا ۋە مۇلازىمەت ئىگىلىرى ئىشلەتكۈچىلىرى بىلەن ئۆز تەسىراتلىرىنى ئورتاقلاشسا، WordPress تېخىمۇ زورىيىدۇ. ھەرقېتىم بىرەيلەن بىزنىڭ كىچىككىنە ياخشى گېپىمىزنى باشقىلارغا ئېيتقىنىنى ئاڭلىساق بەك ھاياجانلىنىپ كېتىمىز.  ئالدى بىلەن <a href="%s">تاۋار ماركىسى يېتەكلىمىلىرى</a>نى تەكشۈرگەنلىكىڭىزنى جەزملەشتۈرۈڭ.','Every plugin and theme in WordPress.org&#8217;s directory is 100%% GPL or a similarly free and compatible license, so you can feel safe finding <a href="%1$s">plugins</a> and <a href="%2$s">themes</a> there. If you get a plugin or theme from another source, make sure to <a href="%3$s">ask them if it&#8217;s GPL</a> first. If they do not respect the WordPress license, it is not recommended to use them.'=>'WordPress.org مۇندەرىجىسىدىكى ھەربىر قىستۇرما ۋە ئۆرنەك %%100 GPL ياكى ئاساسەن ھەقسىز ھەمدە ئىجازەتنامە بىلەن سىغىشىدۇ. شۇڭا ئۇ يەردىكى <a href="%1$s">قىستۇرمىلار</a> ۋە <a href="%2$s">ئۆرنەكلەر</a>نى خاتىرجەم ئىشلەتسىڭىز بولىدۇ. ئەگەر قىستۇرما ياكى ئۆرنەكلىرىڭىز باشقا مەنبەدىن كەلگەن بولسا، ئىشلىتىشتىن ئاۋۋال <a href="%3$s">ئۇلار GPL مۇ ئەمەسمۇ</a> شۇنى سورىۋېلىڭ. ئەگەر ئۇلار WordPress ئىجازەتنامىسىگە ئەمەل قىلمىسا، ئۇلارنى ئىشلىتىشىڭىزنى تەۋسىيە قىلمايمىز.','All Comments'=>'بارلىق ئىنكاسلار','Lead Developer'=>'باشلامچى ئىجادىيەتچى','Cofounder, Project Lead'=>'ياردەمچى ئاساسچى، قۇرۇلۇش باشلامچىسى','Core Contributors to WordPress %s'=>'WordPress %s نىڭ غوللۇق تۆھپىكارلىرى','Project Leaders'=>'قۇرۇلۇش باشقۇرغۇچىلىرى','Credits'=>'تەشەككۈر','removing-widgetDeactivate'=>'ئاكتىپلىما','Your browser is out of date!'=>'تور كۆرگۈچىڭىزنىڭ ۋاقتى ئۆتكەن!','You are using an insecure browser!'=>'بىخەتەر بولمىغان تور كۆرگۈچنى ئىشلىتىۋېتىپسىز!','Freedoms'=>'ئەركىنلىكىڭىز','You can use one of these cool headers or show a random one on each page.'=>'بۇ ئاقسا بەت قاشلىرىنىڭ بىرسىنى ئىشلەتسىڭىزمۇ ياكى ھەر بىر بەتتە خالىغانچە ئالماشتۇرۇپ ئىشلەتسىڭىزمۇ بولىدۇ.','You can choose one of your previously uploaded headers, or show a random one.'=>'ئىلگىرى يوللىغان بەت قاشلىرىدىن بىرسىنى تاللىسىڭىزمۇ ياكى خالىغانچە ئالماشتۇرۇپ ئىشلەتسىڭىزمۇ بولىدۇ.','If you do not want to upload your own image, you can use one of these cool headers, or show a random one.'=>'ئۆزىڭىزنىڭ سۈرىتىنى يوللاشنى خالىمىسىڭىز، بۇ قالتىس بەت قاشلىرىنىڭ بىرسىنى ئىشلەتسىڭىزمۇ ياكى خالىغانچە ئالماشتۇرۇپ ئىشلەتسىڭىزمۇ بولىدۇ.','Collapse menu'=>'تىزىملىكنى يىغ','Uploaded Images'=>'يۈكلەنگەن سۈرەتلەر','<strong>Random:</strong> Show a different image on each page.'=>'<strong>ئىختىيارىي:</strong> ھەربىر بەتتە ئوخشىمىغان رەسىم كۆرسىتىپ بېرىدۇ.','You have specified this user for deletion:'=>'بۇ ئىشلەتكۈچىنى ئۆچۈرمەكچى بولۇۋاتىسىز:','%s Page Template'=>'%s بەت قېلىپى','This plugin may be active on other sites in the network.'=>'بۇ قىستۇرما توردىكى باشقا توربەتلەردە قوزغىتىلغان بولۇشى مۇمكىن.','You cannot delete a plugin while it is active on the main site.'=>'ئاساسىي توربېكتىدە قوزغىتىلغان قىستۇرمىنى ئۆچۈرەلمەيسىز.','Default Post Format'=>'كۆڭۈلدىكى يازما پىچىمى','Any edits to files from this screen will be reflected on all sites in the network.'=>'بۇ ئېكراندىكى ھۆججەتلەرگە بولغان ئۆزگەرتىش توردىكى بارلىق توربەتلەرگە تەسىر كۆرسىتىدۇ.','The boxes on your Dashboard screen are:'=>'باشقۇرۇش بېتىڭىزدىكى بۆلەكلەر:','This screen lists all the existing users for your site. Each user has one of five defined roles as set by the site admin: Site Administrator, Editor, Author, Contributor, or Subscriber. Users with roles other than Administrator will see fewer options in the dashboard navigation when they are logged in, based on their role.'=>'تور بېكىتىڭىزدىكى بارلىق ئىشلەتكۈچىلەر بۇ ئېكراندا تىزىلدى. ھەربىر ئىشلەتكۈچىدە تور بېكەت باشقۇرغۇچىسى بېكىتكەن تۆۋەندىكى بەش خىل رولنىڭ بىرى بار: تور بېكەت باشقۇرغۇچىسى، تەھرىر، ئاپتور ، تۆھپىكار ياكى مۇشتەرى بولغۇچى. باشقۇرغۇچىلىق رولى بار بولمىغان ئىشلەتكۈچىلەر تىزىملاپ كىرگەندە ئۆزىنىڭ رولىغا قاراپ باشقۇرۇش تاختىسى بۆلىكىدە چەكلىك تاللانمىلارنى ئىشلىتەلەيدۇ.','If you want to make changes but do not want them to be overwritten when the plugin is updated, you may be ready to think about writing your own plugin. For information on how to edit plugins, write your own from scratch, or just better understand their anatomy, check out the links below.'=>'ئەگەر ئۆزگەرتىش ئېلىپ بارماقچى ھەمدە قىستۇرما يېڭىلانغاندا بۇ ئۆزگەرتىشلەرنىڭ بىكار قىلىنماسلىقىنى خالىسىڭىز، ئۆزىڭىزنىڭ خۇسۇسىي قىستۇرمىسىنى قۇرۇش ھەققىدە ئويلىشىپ بېقىڭ. قىستۇرما تەھرىرلەش، خۇسۇسىي قىستۇرما قۇرۇش ئۇسۇللىرى ھەققىدە تېخىمۇ كۆپ ئۇچۇرغا ئېرىشىش ياكى ئۇنىڭ ئىنچىكە ھالقىلىرىنى چۈشىنىش ئۈچۈن، تۆۋەندىكى ئۇلانمىلارنى تەكشۈرۈپ بېقىڭ.','Sample Page'=>'ئۈلگە بەت','sample-page'=>'ئۈلگە بەت','Retro (Generated)'=>'Retro (ھاسىل قىلىنغان)','You only have one theme enabled for this site right now. Visit the Network Admin to <a href="%1$s">enable</a> or <a href="%2$s">install</a> more themes.'=>'نۆۋەتتە بۇ توربەتتە بىرلا ئۆرنەك بار ئىكەن. تېخىمۇ كۆپ ئۆرنەكلەرنى<a href="%1$s">قوزغىتىش</a> ياكى <a href="%2$s">ئورنىتىش</a> ئۈچۈن تور باشقۇرغۇچىسى بېتىنى زىيارەت قىلىڭ.','You only have one theme enabled for this site right now. Visit the Network Admin to <a href="%s">enable</a> more themes.'=>'نۆۋەتتە بۇ تور بېكەتتە بىرلا ئاكتىپ ئۆرنەك بار ئىكەن. تېخىمۇ كۆپ ئۆرنەكنى<a href="%s">قوزغات</a>ىش ئۈچۈن تور باشقۇرغۇچىسى بېتىنى زىيارەت قىلىڭ.','Super admin privileges cannot be removed because this user has the network admin email.'=>'بۇ ئىشلەتكۈچىنىڭ تور باشقۇرغۇچىلىق ئېلېكتىرونلۇق خەت ئادرېسى بار بولغاچقا ئالاھىدە باشقۇرغۇچى ئىمتىيازىنى ئۆچۈرۈۋەتكىلى بولمايدۇ.','You only have one theme installed right now. Live a little! You can choose from over 1,000 free themes in the WordPress Theme Directory at any time: just click on the <a href="%s">Install Themes</a> tab above.'=>'سىز پەقەت بىرلا ئۆرنەكنى ئورنىتىپسىز. سىزمۇ ياشاپ قويۇڭ! خالىغان ۋاقىتتا WordPress.org ئۆرنەك مۇندەرىجىسىدىكى مىڭدىن ئارتۇق ھەقسىز باشتېمىدىن بىرەرنى تاللىۋالالايسىز: ئۈستى تەرەپتىكى <a href="%s">ئۆرنەك ئورنىتىش</a> ئۇلانمىسىنى چەكسىڭىزلا بولىدۇ.','One or more database tables are unavailable. To allow WordPress to attempt to repair these tables, press the &#8220;Repair Database&#8221; button. Repairing can take a while, so please be patient.'=>'بىر ياكى بىرقانچە ساندان جەدۋىلى ئىشلىمىدى. WordPress نىڭ بۇ جەدۋەللەرنى ئوڭشىشىغا رۇخسەت قىلماقچى بولسىڭىز، &#8220;سانداننى ئوڭشاش&#8221; نى بېسىڭ. بۇنىڭغا بىر ئاز ۋاقىت كېتىدۇ، شۇڭا سەۋرچانلىق بىلەن ساقلاپ تۇرۇڭ.','Visual Editor RTL Stylesheet'=>'كۆرۈنمىلىك تەھرىرلىگۈچنىڭ RTL ئۇسلۇب ھۆججىتى','This is a file in your current parent theme.'=>'بۇ ھۆججەت نۆۋەتتىكى ئانا ئۆرنەكىڭىزنىڭ بىر قىسمى.','This child theme inherits templates from a parent theme, %s.'=>'بۇ تارماق ئۆرنەك باش ئۆرنەك %s نىڭ قېلىپىغا ۋارىسلىق قىلغان.','Network Enable'=>'تور ئوچۇق','Update Complete'=>'يېڭىلاش ئاياغلاشتى','No Update Required'=>'يېڭىلاش ھاجەتسىز','WordPress &rsaquo; Update'=>'WordPress &rsaquo; يېڭىلاش','The database update process may take a little while, so please be patient.'=>'سانداننى يېڭىلاشقا ئازراق ۋاقىت كېتىدۇ، سەۋرچانلىق بىلەن ساقلاپ تۇرۇڭ.','Your WordPress database has been successfully updated!'=>'WordPress ساندانىڭىز ئوڭۇشلۇق يېڭىلاندى!','Update WordPress Database'=>'WordPress ساندانىنى يېڭىلاش','Database Update Required'=>'ساندان يېڭىلاش زۆرۈر','You are about to install WordPress %s <strong>in English (US)</strong>. There is a chance this update will break your translation. You may prefer to wait for the localized version to be released.'=>'سىز WordPress %s نىڭ <strong>ئىنگلىزچە (ئا ق ش)</strong> نەشرىنى ئورناتماقچى بولۇۋاتىسىز. بۇ يېڭىلاشنىڭ تەرجىمە قىلىنغان ھۆججەتلىرىڭىزنى بۇزۇۋېتىش ئېھتىمالى بار. تەرجىمە نۇسخىسى تارقىتىلغىچە ساقلاپ تۇرغىنىڭىز ئەۋزەل.','Plugin updated successfully.'=>'قىستۇرما ئوڭۇشلۇق يېڭىلاندى.','Plugin update failed.'=>'قىستۇرمىنى يېڭىلاش مەغلۇب بولدى.','Update Plugin'=>'قىستۇرمىنى يېڭىلاش','Update package not available.'=>'يېڭىلاش بولىقىنى ئىشلەتكىلى بولمايدۇ.','Update Theme'=>'ئۆرنەكنى يېڭىلاش','Theme updated successfully.'=>'ئۆرنەك ئوڭۇشلۇق يېڭىلاندى.','Theme update failed.'=>'ئۆرنەك يېڭىلاش مەغلۇب بولدى.','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>. <em>Automatic update is unavailable for this plugin.</em>'=>'%1$s نىڭ يېڭى نەشرى چىقتى. <a href="%2$s" %3$s>مەزكۇر %4$s نەشرىنىڭ تەپسىلاتىنى بۇ يەردىن كۆرۈڭ</a>. <em>بۇ ئۆرنەكنى ئاپتوماتىك يېڭىلىغىلى بولمايدۇ</em>.','Date range:'=>'ۋاقىت دائىرىسى:','Choose what to export'=>'ئېكسپورتلاش ئوبيېكتىنى تاللاڭ','All content'=>'بارلىق مەزمۇن','Authors:'=>'يازغۇچىلار:','This will contain all of your posts, pages, comments, custom fields, terms, navigation menus, and custom posts.'=>'بۇسىزنىڭ بارلىق يازما، بەت، باھا، ئىختىيارى سۆز بۆلىكى، ئىبارە، يولباش تىزىملىكى ۋە خاس يازمىلىرىڭىزنىڭ ھەممىسىنى ئۆز ئىچىگە ئالغۇسى.','commentsMine <span class="count">(%s)</span>'=>'مېنىڭ <span class="count">(%s)</span>' . "\0" . 'مېنىڭ <span class="count">(%s)</span>','%s &#8212; WordPress'=>'%s &#8212; WordPress','column nameIn Response To'=>'ماس يازما','Note that you crop the image by clicking on it (the Crop icon is already selected) and dragging the cropping frame to select the desired part. Then click Save to retain the cropping.'=>'ئىزاھات: سۈرەتنى چېكىپ («قىرقىش» سىنبەلگىسى ئاللىبۇرۇن تاللانغان)، قىرقىش رامكىسىنى مۇۋاپىق ئورۇنغا سۆرەش ئارقىلىق سۈرەتنى قىرقالايسىز. قىرقىشنى ساقلاپ قېلىش ئۈچۈن «ساقلاش»نى باسسىڭىز بولىدۇ.','For images only, you can click on Edit Image under the thumbnail to expand out an inline image editor with icons for cropping, rotating, or flipping the image as well as for undoing and redoing. The boxes on the right give you more options for scaling the image, for cropping it, and for cropping the thumbnail in a different way than you crop the original image. You can click on Help in those boxes to get more information.'=>'تۆۋەندىكى مەزمۇن سۈرەتلەرگىلا خاس. سۈرەتنى قىرقىش، چۆرگۈلىتىش ياكى ئايلاندۇرۇش،  يېنىۋېلىش ياكى ياندۇرۇش ئۈچۈن «كىچىك كۆرۈنۈش» ئاستىدىكى «سۈرەتنى تەھرىرلەش»نى چېكىپ (سىنبەلگىسى بار) ئىچكى سۈرەت تەھرىرلىگۈچنى يايسىڭىز بولىدۇ. ئوڭ تەرەپتىكى رامكىلار سىزنى سۈرەتنى ئورۇنلاشتۇرۇش، قىرقىش، كىچىك كۆرۈنۈشنى ئەسلى سۈرەتنى قىرقىغانغا ئوخشىمىغان ئۇسۇل بىلەن قىرقىش قاتارلىق مەشغۇلاتلار ئۈچۈن تېخىمۇ كۆپ تاللانمىلار بىلەن تەمىنلەيدۇ. تېخىمۇ كۆپ ئۇچۇرغا ئېرىشمەكچى بولسىڭىز، بۇ رامكىلاردىكى «ياردەم»نى چېكىڭ.','The Available Widgets section contains all the widgets you can choose from. Once you drag a widget into a sidebar, it will open to allow you to configure its settings. When you are happy with the widget settings, click the Save button and the widget will go live on your site. If you click Delete, it will remove the widget.'=>'«تەييار ئەپچە» بۆلىكى سىز تاللىيالايدىغان بارلىق ئەپچەلەرنى ئۆز ئىچىگە ئالغان. مەلۇم بىر ئەپچەنى يانبالداققا سۆرىسىڭىز، ئۇ ئېچىلىپ ئۇنىڭ تەڭشەكلىرىنى سەپلىشىڭىزگە رۇخسەت قىلىدۇ. ئەپچە تەڭشەكلىرى ئۆزىڭىز رازى بولغىدەك تەڭشەپ بولغاندىن كېيىن، «ساقلا» توپچەنى چەكسىڭىز، ئەپچە تور بېكىتىڭىزدە ئاكتىپ ھالەتكە ئۆتىدۇ. ئەپچە چىقىرىۋېتىش ئۈچۈن، ئۆچۈرۈشنى چەكسىڭىز بولىدۇ.','Remember to click Update to save metadata entered or changed.'=>'مېتا سانلىق مەلۇماتلىرىنى كىرگۈزگەن ياكى ئۆزگەرتكەندىن كېيىن «يېڭىلا» نى چېكىپ ساقلىۋېتىشنى ئۇنتۇماڭ.','This screen allows you to edit fields for metadata in a file within the media library.'=>'بۇ ئېكراندا ۋاسىتە ئامبىرىڭىزدىكى ھۆججەتنىڭ مېتا سانلىق مەلۇمات خاسلىق بۆلىكىنى تەھرىرلىيەلەيسىز.','Email or Username'=>'ئېلخەت ياكى ئىشلەتكۈچى ئاتى','Search Installed Themes'=>'قاچىلانغان ئۆرنەكلەردىن ئىزدەش','<strong>Please Note:</strong> Any customizations you have made to theme files will be lost. Please consider using <a href="%s">child themes</a> for modifications.'=>'<strong>سەمىڭىزدە بولسۇن:</strong> ئۆرنەك ھۆججىتىگە قارىتا ئۆزگەرتىشلەرنىڭ ھەممىسى يوققا چىقىدۇ. تەھرىرلىگەندە <a href="%s">بالا ئۆرنەك</a> ئىشلىتىشنى ئويلىشىپ بېقىڭ.','postsSticky <span class="count">(%s)</span>'=>'چوققىلانغان <span class="count">(%s)</span>','Please select one or more plugins to update.'=>'يېڭىلىماقچى بولغان بىر ياكى بىر قانچە قىستۇرمىنى تاللاڭ.','Check again.'=>'قايتا تەكشۈر','Please select one or more themes to update.'=>'يېڭىلىماقچى بولغان بىر ياكى بىرقانچە ئۆرنەكنى تاللاڭ.','Last checked on %1$s at %2$s.'=>'ئاخىرقى تەكشۈرۈلگەن ۋاقىت: %1$s سائەت %2$s','The update process is starting. This process may take a while on some hosts, so please be patient.'=>'يېڭىلاش مەشغۇلاتى باشلاندى. بۇنىڭغا ئازراق ۋاقىت كېتىدۇ، سەۋرچانلىق بىلەن ساقلاپ تۇرۇڭ.','Apply Filters'=>'سۈزگۈچ قوللان','Editor Style'=>'تەھرىرلىگۈچ ئۇسلۇبى','Sorry, you are not allowed to edit users.'=>'كەچۈرۈڭ، ئىشلەتكۈچىنى تەھرىرلەش ئىجازىتىڭىز يوق.','To perform the requested action, WordPress needs to access your web server.'=>'تەلەپ قىلىنغان مەشغۇلاتنى ئىجرا قىلىش ئۈچۈن WordPress تور مۇلازىمېتىرىڭىزنى زىيارەت قىلىشى كېرەك.','Current Page'=>'نۆۋەتتىكى بەت','No themes match your request.'=>'تەلىپىڭىزگە ماس كېلىدىغان ئۆرنەك يوق.','You have %1$s and %2$s.'=>'ئېرىشكىنىڭىز %1$s ۋە %2$s.','Create a New User'=>'يېڭى ئىشلەتكۈچى قۇرۇش','Search Sites'=>'ئىزدەش تور بېكەتلىرى','%s site'=>'%s بېكەت','%s user'=>'%s ئىشلەتكۈچى','https://wordpress.org/news/'=>'http://wordpress.org/news/','https://wordpress.org/news/feed/'=>'https://wordpress.org/news/feed/','(Signup has been disabled. Only members of this site can comment.)'=>')تىزىملىتىش چەكلەنگەن. پەقەت بۇ تور بېكەتنىڭ ئەزالىرى ئىنكاس يازالايدۇ.)','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>.'=>'يېڭى نەشرى %1$s چىقتى. <a href="%2$s" class="thickbox" title="%3$s">%4$s نەشرىنىڭ تەپسىلاتىنى بۇ يەردىن كۆرۈڭ</a>.','Go to WordPress Updates page'=>'WordPress يېڭىلاش بېتىگە يۆتكىلىش','Go to Themes page'=>'ئۆرنەك بەتكە يۆتكەل','Go to Plugins page'=>'قىستۇرما بەتكە يۆتكەل','Click Save Menu to make pending menu items public.'=>'تەستىق كۈتۈۋاتقان تىزىملىك تۈرىنى ئاشكارا قىلىش ئۈچۈن «تىزىملىكنى ساقلاش» نى چېكىڭ.','Storage Space'=>'ساقلاش بوشلۇقى','Create a New Site'=>'يېڭى توربەت قۇرۇش','Images of exactly <strong>%1$d &times; %2$d pixels</strong> will be used as-is.'=>'<strong>كەڭلىكى %1$d، ئېگىزلىكى %2$d پىكسېل</strong> بولغان سۈرەتنى ئىشلىتىشكە بولىدۇ.','Crop and Publish'=>'كېسىش ۋە ئېلان قىلىش','XFN stands for <a href="https://gmpg.org/xfn/">XHTML Friends Network</a>, which is optional. WordPress allows the generation of XFN attributes to show how you are related to the authors/owners of the site to which you are linking.'=>'XFN تاللاشچان بولۇپ، <a href="https://gmpg.org/xfn/">XHTML دوستلار تورى</a>نى كۆرسىتىدۇ. WordPress  سىز ئۇلانما بەرگەن تور بېكەتنىڭ قۇرغۇچىسى ياكى ئىگىسى بىلەن بولغان مۇناسىۋىتىڭىزنى كۆرسىتىش ئۈچۈن XFN خاسلىقلىرى ھاسىل قىلىشىڭىزغا رۇخسەت قىلىدۇ.','FTP/SSH Password'=>'FTP/SSH پارولى','FTP Password'=>'FTP ئىم','FTP Username'=>'FTP ئىشلەتكۈچى ئاتى','FTP/SSH Username'=>'FTP/SSH ئىشلەتكۈچى ئاتى','Many themes show some sidebar widgets by default until you edit your sidebars, but they are not automatically displayed in your sidebar management tool. After you make your first widget change, you can re-add the default widgets by adding them from the Available Widgets area.'=>'كۆپلىگەن ئۆرنەكلەر ئادەتتە يانبالدىقىڭىزنى تەھرىرلەشتىن بۇرۇن يانبالداق ئەپچەلىرىنى كۆرسىتىپ بەرسىمۇ، لېكىن بۇلار يانبالداق باشقۇرۇش قورالىڭىزدا ئاپتوماتىك كۆرسىتىلمەيدۇ. تۇنجى قېتىم ئەپچەنى ئۆزگەرتكەندىن كېيىن كۆڭۈلدىكى ئەپچەلەرنى «ئىشلەتكىلى بولىدىغان ئەپچەلەر» رايونىدىن قايتا قوشسىڭىز بولىدۇ.','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two <a href="%s">Pages</a>. One will become the homepage, and the other will be where your posts are displayed.'=>'سىز باش بەتتە نېمىلەرنى كۆرسىتىشنى تاللىيالايسىز. بۇ كۆرسىتىشلەر بۇرۇنقى بىلوگلاردەك يازمىلارنى تەتۈر ۋاقىت تەرتىپى بويىچە كۆرسىتىش ياكى مۇقىم ياكى تۇراقلىق بەتتە كۆرسىتىش قاتارلىقلارنى ئۆز ئىچىگە ئالىدۇ. تۇراقلىق ھالەتتىكى باش بەتنى بەلگىلەش ئۈچۈن ئاۋال ئىككى <a href="%s">بەت</a> قۇرۇشىڭىز كېرەك. بىرى باش بەت بولىدۇ، يەنە بىرى يازمىلىرىڭىزنى كۆرسىتىدىغان بەت بولىدۇ.','The Optional fields let you customize the &#8220;category&#8221; and &#8220;tag&#8221; base names that will appear in archive URLs. For example, the page listing all posts in the &#8220;Uncategorized&#8221; category could be <code>/topics/uncategorized</code> instead of <code>/category/uncategorized</code>.'=>'«ئىختىيارىي» بۆلەكلەر سىزنى ئارخىپ URL لىرىدا كۆرۈنىدىغان &#8220;سەھىپە&#8221; ۋە &#8220;بەلگە&#8221; ئاساسىي نامىنى ئىختىيارىي قىلىش ئىمكانىيىتىگە ئىگە قىلىدۇ. مەسىلەن، &#8220;سەھىپىگە ئايرىلمىغان&#8221; سەھىپەسىدىكى بارلىق يازمىلارنىڭ بەت تىزىلىشى <code>/category/uncategorized</code> بولماي <code>/topics/uncategorized</code> بولسىمۇ بولىدۇ.','When you assign multiple categories or tags to a post, only one can show up in the permalink: the lowest numbered category. This applies if your custom structure includes %1$s or %2$s.'=>'يازمىغا بىردىن ئارتۇق سەھىپە ياكى بەلگە باغلىسىڭىز، مۇقىم ئۇلانمىدا پەقەت بىرسى، يەنى ئەڭ كىچىك ساندىكى سەھىپە كۆرۈنىدۇ. ئەگەر ئىختىيارىي قورۇلمىڭىز %1$s ياكى %2$s نى ئۆز ئىچىگە ئالسا بۇ قوللىنىلىدۇ.','If you pick an option other than Plain, your general URL path with structure tags (terms surrounded by %s) will also appear in the custom structure field and your path can be further modified there.'=>'«كۆڭۈلدىكى» دىن باشقا تاللانما تاللىسىڭىز، قورۇلما بەلگىسى بار دائىمىي تور ئادرېسى يولىڭىز، %s بىلەن قورشالغان ئاتالغۇلار ئىختىيارىي بۆلەكتىمۇ كۆرۈنىدۇ ھەمدە يولىڭىزنى كېيىن بۇ يەردە ئۆزگەرتىشكە بولىدۇ.','To add a new user for your site, click the Add New button at the top of the screen or Add New in the Users menu section.'=>'تور بېكىتىڭىزگە يېڭى ئىشلەتكۈچى قۇرۇش ئۈچۈن ئېكراننىڭ ئۈستى تەرىپىدىكى «يېڭىدىن قوشۇش» كۇنۇپكىسىنى ياكى «ئىشلەتكۈچىلەر» تىزىملىكىدىكى «يېڭىدىن قوشۇش» كۇنۇپكىسىنى چېكىڭ.','If you want to remove the widget but save its setting for possible future use, just drag it into the Inactive Widgets area. You can add them back anytime from there. This is especially helpful when you switch to a theme with fewer or different widget areas.'=>'ئەپچەنى چىقىرىۋەتمەكچى لېكىن ئۇنىڭ تەڭشەكلىرىنى كېيىن ئىشلىتىش ئۈچۈن ساقلاپ قالماقچى بولسىڭىز، ئۇنى «ئاكتىپسىز ئەپچەلەر» رايونىغا سۆرىسىڭىزلا بولىدۇ. ئۇنى كېيىن خالىغان ۋاقىتتا بۇ يەردىن قوشالايسىز. ئەپچە رايونلىرى ئاز بولغان ياكى بۇرۇنقىسىغا ئوخشىمايدىغان ئۆرنەككە ئالماشقىنىڭىزدا، بۇ ئۇسۇلنىڭ كۆپ ياردىمى بولىدۇ.','You can set maximum sizes for images inserted into your written content; you can also insert an image as Full Size.'=>'سىز يېزىۋاتقان مەزمۇنغا قىستۇرۇلىدىغان سۈرەت چوڭلۇقىنىڭ چېكىنى بەلگىلىيەلەيسىز؛ سىز يەنە سۈرەتنى ئەسلى چوڭلۇقتا قىستۇرالايسىز.','Most themes show the site title at the top of every page, in the title bar of the browser, and as the identifying name for syndicated feeds. Many themes also show the tagline.'=>'كۆپلىگەن ئۆرنەكلەردە تور بېكەت ماۋزۇسى ھەر بىر بەتنىڭ ئەڭ ئۈستىدە، تور كۆرگۈچنىڭ تېما بالدىقىدا، ماس ھالدىكى تەرمىلەردە كۆرسىتىلىدۇ. بىر قىسىم ئۆرنەكلەر يانداش تېمىنىمۇ قوشۇپ كۆرسىتىدۇ.','<strong>Order</strong> &mdash; Pages are usually ordered alphabetically, but you can choose your own order by entering a number (1 for first, etc.) in this field.'=>'strong>تىزىش</strong> - بەتلەر ئادەتتە ئېلىپبە تەرتىپى بويىچە تىزىلىدىغان بولۇپ، بۇ بۆلەككە ماس سان (مەسىلەن بىرىنچىسىگە 1) كىرگۈزۈش ئارقىلىق ئۆزىڭىز خالىغان تەرتىپتە تىزالايسىز.','Please enter your FTP or SSH credentials to proceed.'=>'داۋاملاشتۇرۇش ئۈچۈن FTP ياكى SSH ئۇچۇرلىرىڭىزنى كىرگۈزۈڭ.','Please enter your FTP credentials to proceed.'=>'داۋاملاشتۇرۇش ئۈچۈن FTP ئۇچۇرلىرىڭىزنى كىرگۈزۈڭ.','If you do not remember your credentials, you should contact your web host.'=>'كىملىك ئۇچۇرلىرىڭىزنى ئۇنتۇپ قالغان بولسىڭىز، تور مۇلازىمەت تەمىنلىگۈچىڭىز بىلەن ئالاقىلىشىڭ.','Your profile contains information about you (your &#8220;account&#8221;) as well as some personal options related to using WordPress.'=>'تەرجىمىھالىڭىز سىز ( &#8220;ھېساباتىڭىز&#8221;) ۋە WordPress نى ئىشلىتىشكە مۇناسىۋەتلىك بەزى خۇسۇسىي تاللانمىلار ھەققىدىكى ئۇچۇرلارنى ئۆز ئىچىگە ئالىدۇ.','You can Upload a theme manually if you have already downloaded its ZIP archive onto your computer (make sure it is from a trusted and original source). You can also do it the old-fashioned way and copy a downloaded theme&#8217;s folder via FTP into your %s directory.'=>'ئۆرنەكنىڭ ZIP ئارخىپىنى كومپيۇتېرىڭىز چۈشۈرۈپ بولغان بولسىڭىز (ئۇنىڭ ئىشەنچلىك ئەسلى مەنبەدىن كەلگەنلىكىنى جەزملەشتۈرۈڭ)، ئۇنى قولدا يوللىيالايسىز. سىز يەنە كونا ئۇسۇل بويىچە FTP ئارقىلىق چۈشۈرۈلگەن ئۆرنەكنىڭ قىسقۇچىنى %s مۇندەرىجىڭىزگە قىستۇرۇپ قويسىڭىزمۇ بولىدۇ.','<strong>Send Trackbacks</strong> &mdash; Trackbacks are a way to notify legacy blog systems that you&#8217;ve linked to them. Enter the URL(s) you want to send trackbacks. If you link to other WordPress sites they&#8217;ll be notified automatically using pingbacks, and this field is unnecessary.'=>'<strong>ئىزچى ئەۋەتىش</strong> - ئىزچى (Trackback) بولسا ئۇلانما قىلىنغانلىق خەۋىرىنى ئەسلى ئادرېسقا ئۇقتۇرۇش قىلىشتا قوللىنىلغان بىر خىل ئۇسۇل بولۇپ، كونا نەشردىكى بىلوگلاردا ئىشلىتىلگەن. ئىزچى ئەۋەتمەكچى بولغان ئادرېسنى كىرگۈزۈڭ. باشقا WordPress تور بېتىنى ئۇلانما قىلسىڭىز ئۇلارغا ئاپتوماتىك ھالدا قايتما ئارقىلىق خەۋەر قىلىنىدىغان بولغاچقا بۇ يەرنى تولدۇرۇشىڭىزنىڭ ھاجىتى يوق.','Administrators have access to all the administration features.'=>'باشقۇرغۇچى سالاھىيىتىدىكىلەر باشقۇرۇش خاسلىقلىرىنىڭ ھەممىسىنى ئىشلىتەلەيدۇ.','Contributors can write and manage their posts but not publish posts or upload media files.'=>'تۆھپىكارلار ئۆزىنىڭ يازمىسىنى يېزىپ تەھرىرلىيەلىسىمۇ، يازمىلارنى ئېلان قىلالمايدۇ ۋە ۋاسىتە ھۆججەتلىرىنى يۈكلىيەلمەيدۇ.','If you delete a link, it will be removed permanently, as Links do not have a Trash function yet.'=>'ئۇلانمىنى ئۆچۈرۈۋەتسىڭىز، ئۇلانمىغا قارىتا ئەخلەتخاناغا تاشلاش ئىقتىدارى بولمىغاچقا  مەڭگۈلۈك ئۆچۈپ كېتىدۇ.','You can add links here to be displayed on your site, usually using <a href="%s">Widgets</a>. By default, links to several sites in the WordPress community are included as examples.'=>'ئادەتتە، <a href="%s">ئەپچەلەر</a>نى ئىشلىتىپ، بۇ يەردە ئۇلانما قوشۇپ تور بېكىتىڭىزدە كۆرسىتەلەيسىز. سۈكۈت بويىچە، WordPress تىكى بىرنەچچە تور بېكەتلەرگە قۇرۇلغان ئۇلانمىلار مىسال تەرىقىسىدە بېرىلگەن.','You can use the plugin file editor to make changes to any of your plugins&#8217; individual PHP files. Be aware that if you make changes, plugins updates will overwrite your customizations.'=>'قىستۇرما ھۆججەت تەھرىرلىگۈچ ئارقىلىق ھەرقانداق قىستۇرمىنىڭ ئۆزىگە خاس PHP ھۆججەتلىرىنى ئۆزگەرتەلەيسىز. سەمىڭىزدە بولسۇنكى، قىستۇرمىلارنى يېڭىلىغاندا ئۆزگەرتىشلىرىڭىزنىڭ ھەممىسى قاپلىنىپ كېتىدۇ.','<strong>Slug</strong> &mdash; The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.'=>'<strong>باشقا نام</strong> - &#8221; باشقىچە نام&#8220; بولسا ئۇلىنىش ئىچىدە ئىشلەتكىلى بولىدىغان ئىسىم بولۇپ، ئادەتتە كىچىك ھالەتتە يېزىلغان ھەرپ-بەلگىلەردىن تۈزۈلىدۇ. پەقەت ھەرپ، سان ۋە ئۇلانما بەلگىلەرنىلا ئىشلىتىشكە بولىدۇ.','Do not forget to click on the Save Changes button when you are finished.'=>'تاماملىغاندىن كېيىن «تاللاشلارنى ساقلاش» كۇنۇپكىسىنى چېكىشنى ئۇنتۇماڭ.','You can customize the look of your site without touching any of your theme&#8217;s code by using a custom background. Your background can be an image or a color.'=>'ئۆزىڭىز بەلگىلىگەن تەگلىك ئىشلىتىش ئارقىلىق ئۆرنەكنىڭ ھېچقانداق كودىنى ئۆزگەرتمەستىلا تور بېكىتىڭىزنى كۆركەملەشتۈرەلەيسىز. تەگلىك ئۈچۈن سۈرەت ياكى ساپ رەڭ ئىشلىتەلەيسىز.','You can also create posts with the <a href="%s">Press This bookmarklet</a>.'=>'سىز يەنە <a href="%s">تېز تارقىتىش خەتكۈچى</a> ئارقىلىق يازما يازالايسىز.','Editors can publish posts, manage posts as well as manage other people&#8217;s posts, etc.'=>'تەھرىر سالاھىيىتىدىكىلەر يازما ئېلان قىلىش، باشقىلارنىڭ يازمىلىرىنىمۇ باشقۇرۇش مەشغۇلاتلىرىنى ئورۇنلىيالايدۇ.','Remember to click the Update Profile button when you are finished.'=>'تۈگەتكەندە «تەرجىمىھال يېڭىلا» توپچەنى چېكىشنى ئۇنتۇماڭ.','Required fields are indicated; the rest are optional. Profile information will only be displayed if your theme is set up to do so.'=>'كۆرسىتىلگەنلەر تولدۇرۇش تەلەپ قىلىنىدىغان بۆلەكلەر، قالغانلىرى ئىختىيارى. ئارخىپ ئۇچۇرلىرى پەقەت ئۆرنەكىڭىزدا كۆرسىتىش بەلگىلەنگەندىلا كۆرسىتىلىدۇ.','Your username cannot be changed, but you can use other fields to enter your real name or a nickname, and change which name to display on your posts.'=>'ئىشلەتكۈچى ئاتىڭىزنى ئۆزگەرتەلمەيسىز، لېكىن باشقا يەرلەرگە ئەسلى ئىسمىڭىز ياكى تەخەللۇسىڭىزنى كىرگۈزۈپ، يازمىڭىزدا كۆرسىتىلىدىغان ئىسىمنى ئۆزگەرتەلەيسىز.','You can also moderate the comment from this screen using the Status box, where you can also change the timestamp of the comment.'=>'بۇ ئېكراندىكى ھالەت رامكىسى ئارقىلىق باھالارنى تەستىقلاشتىن باشقا، باھا ۋاقىت تامغىسىنىمۇ ئۆزگەرتەلەيسىز.','You can edit the information left in a comment if needed. This is often useful when you notice that a commenter has made a typographical error.'=>'زۆرۈر تېپىلسا باھا ئۇچۇرلىرىنى تەھرىرلىيەلەيسىز. بۇنىڭ باھادا خاتا ئىشلىتىلگەن سۆز قاتارلىقلارنى ئەسكەرتىشكە ياردىمى بولىدۇ.','This screen contains the settings that affect the display of your content.'=>'بۇ ئېكران مەزمۇنلىرىڭىزنى كۆرسىتىشكە مۇناسىۋەتلىك تەڭشەكلەرنى مۇجەسسەم قىلغان.','UTC means Coordinated Universal Time.'=>'UTC بولسا خەلقئارالىق ئۆلچەملىك ۋاقىتنى كۆرسىتىدۇ.','The fields on this screen determine some of the basics of your site setup.'=>'بۇ ئېكراندا تور بېكىتىڭىزنىڭ ئاساسىي تەڭشەكلىرى تەمىنلەنگەن.','You must click the Save Changes button at the bottom of the screen for new settings to take effect.'=>'يېڭى تەڭشەكلەرنى كۈچكە ئىگە قىلىش ئۈچۈن ئېكراننىڭ ئاستىدىكى «ئۆزگەرتىشلەرنى ساقلا» توپچەنى چېكىڭ.','You can also control the display of your content in RSS feeds, including the maximum number of posts to display and whether to show full text or an excerpt. <a href="%s">Learn more about feeds</a>.'=>'سىز يەنە مەزمۇنلىرىڭىزنىڭ RSS مەنبەسىدىكى كۆرۈنۈشىنى تىزگىنلىيەلەيسىز. بۇلار كۆرسىتىلىدىغان يازمىنىڭ سانى، تولۇق تېكىست ياكى ئاساسىي مەزمۇننى كۆرسىتىش، كودلىنىشى قاتارلىقلارنى ئۆز ئىچىگە ئالىدۇ. <a href="%s">مەنبە ھەققىدىكى تەپسىلاتلار</a>.','The boxes for link name, web address, and description have fixed positions, while the others may be repositioned using drag and drop. You can also hide boxes you do not use in the Screen Options tab, or minimize boxes by clicking on the title bar of the box.'=>'ئۇلانما ئىسمى، تور ئادرېسى ۋە چۈشەندۈرۈش رامكىلىرىنىڭ ئورنى مۇقىم بولىدۇ، باشقا رامكىلارنىڭ ئورنىنى سۆرەپ تاشلاشنى ئىشلىتىپ ئۆزگەرتەلەيسىز. سىز ئىشەنچلىك ئەمەس دەپ قارىغان رامكىلارنى «ئېكران تاللانمىلىرى» بەتكۈچىدە يوشۇرۇپ قويالايسىز ياكى رامكىنىڭ تېما بالدىقىنى چېكىپ، ئۇ رامكىنى كىچىكلىتەلەيسىز.','Your plugins are all up to date.'=>'قىستۇرمىلىرىڭىزنىڭ ھەممىسى ئەڭ يېڭى ھالەتتە.','You have the latest version of WordPress.'=>'ئەڭ يېڭى نەشردىكى WordPress نى ئىشلىتىۋېتىپسىز.','An updated version of WordPress is available.'=>'WordPress نىڭ يېڭىلانغان نەشرى چىقتى.','Your themes are all up to date.'=>'ئۆرنەكلىرىڭىزنىڭ ھەممىسى ئەڭ يېڭى ھالەتتە.','While your site is being updated, it will be in maintenance mode. As soon as your updates are complete, this mode will be deactivated.'=>'تور بېكىتىڭىز يېڭىلىنىۋاتقاندا، ئاسراش ھالىتىگە ئۆتىدۇ. يېڭىلاش تاماملانغان ھامان، بۇ ھالەت ئاكتىپسىزلىنىدۇ.','Function Name&hellip;'=>'فۇنكسىيە ئاتى&hellip;','You can add or edit links on this screen by entering information in each of the boxes. Only the link&#8217;s web address and name (the text you want to display on your site as the link) are required fields.'=>'ھەربىر رامكىغا ئۇچۇر كىرگۈزۈش ئارقىلىق ئۇلانما قوشالايسىز ياكى بۇ يەردىكى ئۇلانمىلارنى تەھرىرلىيەلەيسىز. پەقەت ئۇلانمىنىڭ تور ئادرېسى ۋە نامى (تورىڭىزدا ئۇلانما ھالەتتە كۆرسەتمەكچى بولغان تېكىست) چوقۇم تولدۇرۇلىدىغان بۆلەك ھېسابلىنىدۇ.','Activate Plugin &amp; Run Importer'=>'قىستۇرمىنى ۋە كىرگۈزگۈچنى قوزغىتىش','Categories can be selectively converted to tags using the <a href="%s">category to tag converter</a>.'=>'<a href="%s">سەھىپىنى بەلگىگە ئايلاندۇرغۇچ</a> تىن پايدىلىنىپ، سەھىپىنى تاللاپ تۇرۇپ بەلگىگە ئايلاندۇرۇشقا بولىدۇ.','Once generated, your WXR file can be imported by another WordPress site or by another blogging platform able to access this format.'=>'ھاسىل قىلىنغان WXR ھۆججىتىنى باشقا بىر WordPress تور بېتىگە ياكى بۇ خىل ھۆججەت تىپىنى قوللايدىغان باشقا بىر بىلوگ سۇپىسىغا ئىمپورتلىغىلى بولىدۇ.','This screen lists links to plugins to import data from blogging/content management platforms. Choose the platform you want to import from, and click Install Now when you are prompted in the popup window. If your platform is not listed, click the link to search the plugin directory for other importer plugins to see if there is one for your platform.'=>'بۇ ئېكراندا باشقا بىلوگ ياكى مەزمۇن باشقۇرۇش سۇپىسىدىكى سانلىق مەلۇماتلارنى ئىمپورتلىيالايدىغان قىستۇرمىلارنىڭ ئۇلانمىسى تىزىپ كۆرسىتىلگەن. ئىمپورتلىماقچى بولغان سۇپىنى تاللاپ، كۆرسىتىلگەن سەكرىمە تىزىملىكتە «ھازىر ئورنىتىش» نى چېكىڭ. سىزنىڭ سۇپىڭىز تىزىملىكتە بولمىسا، ئىزدەش ئۇلانمىسىنى چېكىپ، سۇپىڭىزدىن ئىمپورتلىيالايدىغان قىستۇرمىلارنىڭ بار- يوقلۇقىنى قىستۇرما مۇندەرىجىسىدىن ئىزدەپ كۆرۈپ بېقىڭ.','You can customize the display of this screen using the Screen Options tab and/or the dropdown filters above the links table.'=>'«ئېكران تاللانمىلىرى» بەتكۈشى ۋە (ياكى) ئۇلانما جەدۋىلى ئۈستىدىكى ئاسما سۈزگۈچنى ئىشلىتىپ بۇ ئېكراننىڭ كۆرۈنىشىنى ئىختىيارىي قىلالايسىز.','Choose a plugin to edit from the dropdown menu and click the Select button. Click once on any file name to load it in the editor, and make your changes. Do not forget to save your changes (Update File) when you are finished.'=>'سول تەرەپ ئۈستىدىكى ئېسىلما تىزىملىكتىن تەھرىرلىمەكچى بولغان قىستۇرمىنى تاللاپ، «تاللاش» توپچىسىنى چېكىڭ. خالىغان ھۆججەتنىڭ ئىسمىنى چېكىپ ھۆججەتنى تەھرىرلىگۈچكە يۈكلىگەندىن كېيىن ئۆزگەرتسىڭىز بولىدۇ. تۈگەتكەندى كېيىن ئۆزگەرتىشلىرىڭىز (يېڭىلانغان ھۆججەت) نى ساقلاشنى ئۇنتۇماڭ.','Most of the time, plugins play nicely with the core of WordPress and with other plugins. Sometimes, though, a plugin&#8217;s code will get in the way of another plugin, causing compatibility issues. If your site starts doing strange things, this may be the problem. Try deactivating all your plugins and re-activating them in various combinations until you isolate which one(s) caused the issue.'=>'كۆپ ھاللاردا ھەر خىل  قىستۇرمىلار WordPress ۋە باشقا قىستۇرمىلار بىلەن ياخشى ماسلىشىپ ئىشلەيدۇ. لېكىن بەزىدە قىسمەن قىستۇرما كودلىرى باشقا قىستۇرمىلارغا دەخلى قىلىپ، سىغىشماسلىق مەسىلىسىنى كەلتۈرۈپ چىقىرىدىغان ئەھۋاللار بولىدۇ. تور بېكىتىڭىزدىكى غەيرىيلىك قىستۇرما سەۋەبىدىن بولۇشى مۇمكىن. بۇ چاغدا بارلىق قىستۇرمىلارنى توختىتىۋېتىپ، قايسى قىستۇرمىدىن چاتاق چىققانلىقىنى تاپقانغا قەدەر قىستۇرمىلارنى ھەر خىل گۇرۇپپىلاش شەكلىدە قوزغىتىپ كۆرۈڭ..','After typing in your edits, click Update File.'=>'تەھرىرلەپ بولغاندىن كېيىن «ھۆججەتنى يېڭىلاش» نى چېكىڭ.','You can use the theme file editor to edit the individual CSS and PHP files which make up your theme.'=>'سىز باشتېمىڭىز تەشكىل قىلىدىغان يەككە CSS ۋە PHP ھۆججەتلىرىنى «باشتېما تەھرىرلىگۈچ»تە تەھرىرلىيەلەيسىز.','Enabling Accessibility Mode, via Screen Options, allows you to use Add and Edit buttons instead of using drag and drop.'=>'«ئېكران تاللانمىلىرى» ئارقىلىق زىيارەت ھالىتىنى ئىناۋەتلىك قىلغاندا، سۆرەپ ئەكىلىشنىڭ ئورنىغا قوشۇش ۋە تەھرىرلەش كۇنۇپكىلىرىنى ئىشلەتكىلى بولىدۇ.','Widgets may be used multiple times. You can give each widget a title, to display on your site, but it&#8217;s not required.'=>'ئەپچەلەرنى تەكرار ئىشلەتكىلى بولىدۇ. سىز ھەر بىر ئەپچەگە بىر ماۋزۇ بەلگىلەپ تور بېكىتىڭىزدە كۆرسىتەلەيسىز. لېكىن ئۇنداق قىلىش شەرت ئەمەس.','Widgets are independent sections of content that can be placed into any widgetized area provided by your theme (commonly called sidebars). To populate your sidebars/widget areas with individual widgets, drag and drop the title bars into the desired area. By default, only the first widget area is expanded. To populate additional widget areas, click on their title bars to expand them.'=>'ئەپچە ئۆرنەك تەرىپىدىن تەمىنلەنگەن ھەرقانداق كىچىكلىتىشكە بولىدىغان رايون (ئادەتتە يانبالداق دەپمۇ ئاتىلىدۇ) غا قويۇشقا بولىدىغان مۇستەقىل مەزمۇن بۆلىكى بولۇپ، خاس ئەپچە بىلەن يانبالداق ياكى ئەپچە رايونىڭىزنى بېيىتىش ئۈچۈن، تېما بالدىقىنى ئۆزىڭىز ياقتۇرغان ئورۇنغا سۆرەپ تارتىڭ. كۆڭۈلدىكى ئەھۋالدا، پەقەت دەسلەپكى ئەپچە رايونىنىلا يايغىلى بولىدۇ. قوشۇمچە ئەپچە رايونلىرىنى بېيىتىش ئۈچۈن، ئۇلارنىڭ تېما بالدىقىنى چېكىپ ئۇلارنى يېيىڭ.','Begin by choosing a theme to edit from the dropdown menu and clicking the Select button. A list then appears of the theme&#8217;s template files. Clicking once on any file name causes the file to appear in the large Editor box.'=>'ئاسما تىزىملىكتىن تەھرىرلەيدىغان ئۆرنەكنى تاللاپ، «تاللا» توپچەنى چەكسىڭىز، بارلىق قېلىپ ھۆججەتلىرىنىڭ تىزىملىكى كۆرۈنىدۇ. ھەرقانداق ھۆججەتنىڭ ئىسمى چېكىلسە، ئۇ ھۆججەت چوڭراق «تەھرىرلەش» رامكىسىدا كۆرۈنىدۇ.','<strong>Advice:</strong> Think very carefully about your site crashing if you are live-editing the theme currently in use.'=>'<strong>تەكلىپ:</strong> نۆۋەتتە ئىشلىتىلىۋاتقان ئۆرنەكنى شۇئان تەھرىرلەۋاتقان بولسىڭىز بېتىڭىزنىڭ بۇزۇلۇپ كېتىشىدىن قاتتىق ئېھتىيات قىلىڭ.','(no parent)'=>'(ئاتىسى يوق)','<strong>Parent</strong> &mdash; You can arrange your pages in hierarchies. For example, you could have an &#8220;About&#8221; page that has &#8220;Life Story&#8221; and &#8220;My Dog&#8221; pages under it. There are no limits to how many levels you can nest pages.'=>'<strong>ئانا بەت</strong> - سىز بەتلەرنى قاتلاملىق قىلىپ تەشكىللىسىڭىز بولىدۇ. مەسىلەن، سىز «ھەققىدە» دەپ بىر بەت قۇرۇپ، ئۇنىڭ ئاستىغا يەنە «تارىخىم» ۋە «قىزىقىشىم» دېگەندەك بەتلەرنى قۇرالايسىز. بەتنىڭ قاتلاملىق دەرىجىسىگە ھېچقانداق چەكلىمە يوق.','<strong>Template</strong> &mdash; Some themes have custom templates you can use for certain pages that might have additional features or custom layouts. If so, you&#8217;ll see them in this dropdown menu.'=>'<strong>ئەندىزە</strong> - بەزى ئۆرنەكلەردا مەلۇم بەتلەر ئۈچۈن قوشۇمچە ئىقتىدار ياكى ئىختىيارى ئورۇنلاشتۇرۇشلارنى قوشىدىغان قېلىپلار تەمىنلەنگەن. ئەگەر ئىشلىتىۋاتقان ئۆرنەكىڭىزدا تەمىنلەنگەن بولسا ئۈستىدىكى تىزىملىكتە كۆرەلەيسىز.','All updates have been completed.'=>'بارلىق يېڭىلاشلار تاماملاندى.','What&#8217;s the difference between categories and tags? Normally, tags are ad-hoc keywords that identify important information in your post (names, subjects, etc) that may or may not recur in other posts, while categories are pre-determined sections. If you think of your site like a book, the categories are like the Table of Contents and the tags are like the terms in the index.'=>'سەھىپە بىلەن بەلگىنىڭ قانداق پەرقى بار؟ ئادەتتىكى ئەھۋالدا، بەلگە بولسا يازمىلىرىڭىزدىكى باشقا يازمىلاردا قايتا كۆرۈنىشى مۇمكىن بولغان مۇھىم ئۇچۇر (نامى، تېمىسى قاتارلىقلار)نى پەرقلەندۈرۈشكە ئىشلىتىلىدىغان ئېلان خاراكتېردىكى ھالقىلىق سۆزلەرنى كۆرسىتىدۇ، سەھىپە بولسا ئالدىن بېكىتىلگەن بۆلەكلەرنى كۆرسىتىدۇ. ئەگەر بېكىتىڭىزنى بىر كىتاب دەپ قارىسىڭىز، سەھىپىلەر مەزمۇنى مۇندەرىجىسىگە، بەلگىلەر ئىندېكستىكى ئاتالغۇلارغا ئوخشايدۇ.','You can change the display of this screen using the Screen Options tab to set how many items are displayed per screen and to display/hide columns in the table.'=>'«ئېكران تاللانمىلىرى» بەتكۈچىدە ھەر ئېكراندا كۆرسىتىلىدىغان تۈر سانىنى ۋە ئىستونلارنى كۆرسىتىش- يوشۇرۇش ھالىتىنى بەلگىلەش ئارقىلىق بۇ ئېكراننىڭ كۆرۈنۈشىنى ئۆزگەرتەلەيسىز.','When adding a new category on this screen, you&#8217;ll fill in the following fields:'=>'بۇ بەتكە يېڭىدىن سەھىپە قوشماقچى بولسىڭىز، ئۇنداقتا تۆۋەندىكى ئورۇنغا تولدۇرسىڭىز بولىدۇ:','<strong>Description</strong> &mdash; The description is not prominent by default; however, some themes may display it.'=>'<strong>چۈشەندۈرۈش</strong> - بۇ چۈشەندۈرۈش ئادەتتىكى ئەھۋالدا كۆرۈنمىسىمۇ، لېكىن بۇنى كۆرسىتىدىغان ئۆرنەكلەرمۇ بار.','<strong>Name</strong> &mdash; The name is how it appears on your site.'=>'<strong>ئىسىم</strong> - تور بېكىتىڭىزدە مۇشۇ ئىسىمدا كۆرسىتىلىدۇ.','You can use categories to define sections of your site and group related posts. The default category is &#8220;Uncategorized&#8221; until you change it in your <a href="%s">writing settings</a>.'=>'سەھىپە ئىشلىتىپ تور بېكەت ۋە گۇرۇپپىڭىزنىڭ يازمىغا مۇناسىۋەتلىك بۆلەكلىرىنى بەلگىلىيەلەيسىز. تاكى سىز ئۇنى <a href="%s">يېزىش تەڭشەكلىرى</a>ڭىزدە ئۆزگەرتكەنگە قەدەر كۆڭۈلدىكى سەھىپىڭىز &#8220;سەھىپىگە ئايرىلمىغان&#8221; بولۇپ تۇرىدۇ.','When adding a new tag on this screen, you&#8217;ll fill in the following fields:'=>'بۇ بەتكە يېڭىدىن بەلگە قوشماقچى بولسىڭىز، ئۇنداقتا تۆۋەندىكى ئورۇنغا تولدۇرسىڭىز بولىدۇ:','Default Images'=>'كۆڭۈلدىكى سۈرەتلەر','Text Color'=>'تېكىست رەڭگى','Image Upload Error'=>'سۈرەت يۈكلەش خاتالىقى','Crop Header Image'=>'توربەت رەسىمىنى كېسىۋېلىش','This will remove the header image. You will not be able to restore any customizations.'=>'بۇنىڭدا توربەت رەسىمى ئۆچۈپ كېتىدۇ. ئۆزگەرتىشلىرىڭىزنى ئەسلىگە كەلتۈرەلمەيسىز.','Remove Header Image'=>'توربەت رەسىمىنى ئۆچۈرۈش','This will restore the original header image. You will not be able to restore any customizations.'=>'بۇنىڭدا ئەسلىدىكى توربەت رەسىمى ئەسلىگە قايتۇرۇلىدۇ. ئۆزگەرتىشلىرىڭىزنى ئەسلىگە كەلتۈرەلمەيسىز.','Restore Original Header Image'=>'توربەت رەسىمىنى ئەسلىگە ياندۇرۇش','You need JavaScript to choose a part of the image.'=>'بۇ سۈرەتنىڭ بىر قىسمىنى تاللاش ئۈچۈن JavaScript لازىم بولىدۇ.','Reset Image'=>'سۈرەتنى ئەسلىگە قايتۇر','Delete this comment permanently'=>'بۇ ئىنكاسنى مەڭگۈلۈك ئۆچۈر','Restore this comment from the Trash'=>'بۇ ئىنكاسنى ئەخلەتخانادىن ئەسلىگە كەلتۈر','<strong>%s</strong> &mdash; This allows you to associate an image with your post without inserting it. This is usually useful only if your theme makes use of the image as a post thumbnail on the home page, a custom header, etc.'=>'<strong>%s</strong> - بۇ، رەسىمنى يازمىغا قىستۇرماي تۇرۇپ يازمىغا باغلاش رولىنى ئوينايدۇ. خىل سۈرەتنى توربەتتە كىچىك كۆرۈنۈش قىلىپ، ياكى ھەر بىر يازما ئۈچۈن باش سۈرەت قىلىپ كۆرسىتىدىغان ئۇسلۇبلاردا كۆپ ئىشلىتىلىدۇ.','<strong>Discussion</strong> &mdash; You can turn comments and pings on or off, and if there are comments on the post, you can see them here and moderate them.'=>'<strong>مۇھاكىمە</strong> - ئىنكاس يېزىش، قايتما ئەۋەتىش قاتارلىقلارنى چەكلىگىلى ۋە ئاچقىلى بولىدۇ. يازمىغا باھا يېزىلغاندا، بۇ يەردە كۆرۈپ تەستىقلىغىلى بولىدۇ.','<strong>Title</strong> &mdash; Enter a title for your post. After you enter a title, you&#8217;ll see the permalink below, which you can edit.'=>'<strong>تېما</strong> - يازما تېمىسىنى كىرگۈزۈڭ. تېمىنى كىرگۈزگەندىن كېيىن ئاستى تەرەپتە تەھرىرلەشكە بولىدىغان مۇقىم ئۇلانمىنى كۆرەلەيسىز.','You can customize the display of this screen in a number of ways:'=>'بۇ بەتنىڭ كۆرۈنۈشىنى بىر قانچە خىل ئۇسۇلدا ئۆزگەرتەلەيسىز:','Hovering over a row in the posts list will display action links that allow you to manage your post. You can perform the following actions:'=>'مائۇسنى يازما تىزىملىكىدىكى بىرەر قۇر ئۈستىگە ئەكەلسىڭىز، يازمىلارنى باشقۇرۇشقا تەمىنلەنگەن مەشغۇلات ئۇلانمىلىرى كۆرسىتىلىدۇ. سىز تۆۋەندىكى مەشغۇلاتلارنى ئورۇنلىيالايسىز:','You can refine the list to show only posts in a specific category or from a specific month by using the dropdown menus above the posts list. Click the Filter button after making your selection. You also can refine the list by clicking on the post author, category or tag in the posts list.'=>'يازما تىزىملىكى ئۈستىدىكى ئېسىلما تىزىملىكىنى ئىشلىتىش ئارقىلىق تىزىملىكىنى ئەلالاشتۇرۇپ، مەلۇم سەھىپىدىكى ياكى مەلۇم بىر ئايدىكى يازمىلارنىلا كۆرسىتەلەيسىز. تاللاپ بولغاندىن كېيىن «سۈزۈش»نى چېكىڭ. سىز يەنە سەھىپە تىزىملىكتە يازما ئاپتورى، سەھىپە ياكى بەلگىلەرنى چېكىش ئارقىلىق تىزىملىكنى ئەلالاشتۇرالايسىز.','You can hide/display columns based on your needs and decide how many posts to list per screen using the Screen Options tab.'=>'«ئېكران تاللانمىلىرى» بەتكۈچىدە ئىستونلارنى ئېھتىياجىڭىزغا ئاساسەن يوشۇرالايسىز ياكى كۆرسىتەلەيسىز، شۇنداقلا ھەر ئېكراندا كۆرسىتىلىدىغان يازما سانىنى بەلگىلىيەلەيسىز.','Search Installed Plugins'=>'ئورنىتىلغان قىستۇرمىلاردىن ئىزدە','Your theme supports one menu. Select which menu you would like to use.'=>'ئۇسلۇبىڭىز بىر تىزىملىكنى قوللايدۇ. ھەر بىر ئورۇن ئۈچۈن كۆرسىتىلىدىغان تىزىملىكنى تاللاڭ.','Your theme does not support navigation menus or widgets.'=>'ئۆرنەكىڭىز يولباشچى تىزىملىك ياكى ئەپچەنى قوللىمايدىكەن.','Categories and Tags Converter'=>'سەھىپە ۋە بەلگە ئايلاندۇرغۇچ','Most Recent'=>'يېقىندا','Start date:'=>'باشلانغان چىسلا:','Theme InstallerTag'=>'بەلگە','Plugin InstallerTag'=>'بەلگە','verbClear'=>'تازىلا','commentMark as spam'=>'ئەخلەت خەت دەپ بەلگە قويۇش','Remove Background Image'=>'تەگلىك سۈرىتىنى ئۆچۈرۈش','Comments on &#8220;%s&#8221;'=>'&#8221;%s&#8220; دىكى باھالار','Show advanced menu properties'=>'تەپسىلىي تىزىملىك خاسلىقىنى كۆرۈش','You have version %1$s installed. Update to %2$s.'=>'ئىشلىتىۋاتقىنىڭىز  %1$s نەشرى ئىكەن.  %2$s نەشرىگە يېڭىلىۋېلىڭ.','Enabled'=>'قوزغىتىلغان','commentNot Spam'=>'ئەخلەت خەت ئەمەس','This will restore the original background image. You will not be able to restore any customizations.'=>'بۇنىڭدا تەگلىك رەسىمى ئەسلىگە قايتۇرۇلىدۇ. ئۆزگەرتىشلىرىڭىزنىڭ ھەممىسى يوققا چىقىدۇ.','WordPress Blog'=>'WordPress بىلوگى','&mdash; No role for this site &mdash;'=>'&mdash; بۇ بىلوگقا دەرىجە كەتمەيدۇ &mdash;','Remove Users from Site'=>'ئىشلەتكۈچىلەرنى توربەتتىن چىقىرىۋەت','Custom site deleted message.'=>'بىلوگ ئۆچۈرۈلگەنلىك ئۇچۇرى تۈزىتىلىدۇ.','Custom site suspended message.'=>'بىلوگ مەجبۇرى توختىتىلغانلىق ئۇچۇرى تۈزىتىلىدۇ.','New WordPress Site'=>'يېڭى WordPress تور بېكىتى','Custom site inactive message.'=>'تور بېكىتى توختىتىلغانلىق ئۇچۇرىنى خاشلاشتۇرۇش','Sorry, you are not allowed to create posts or drafts on this site.'=>'كەچۈرۈڭ، بۇ توربەتتە كوپىيە ياكى يازمىلارنى يېزىشىڭىزغا رۇخسەت يوق.','Sorry, you are not allowed to create pages on this site.'=>'كەچۈرۈڭ، بۇ توربەتتە بەت قۇرۇشىڭىزغا رۇخسەت يوق.','My Site'=>'تور بېكىتىم','If you have posts or comments in another system, WordPress can import those into this site. To get started, choose a system to import from below:'=>'ئەگەر يازما ۋە باھالىرىڭىز باشقا بىر سىستېمىدا بولسا، WordPress ئۇلارنى بۇ بىلوگقا ئىمپورتلىيالايدۇ. باشلاش ئۈچۈن بۇرۇن ئىشلەتكەن سىستېمىڭىزغا ئاساسەن تۆۋەندىكىلەردىن ماس كەلگەن بىرىنى تاللاڭ:','No items.'=>'ھېچقانداق تۈر يوق.','To use a subdomain configuration, you must have a wildcard entry in your DNS. This usually means adding a %s hostname record pointing at your web server in your DNS configuration tool.'=>'تارماق دائىرە سەپلىمىسىنى ئىشلىتىش ئۈچۈن، DNS ڭىزدا ئورتاق بەلگە كىرگۈزگىلى بولۇشى كېرەك. ئادەتتە بۇ DNS سەپلەش قورالىڭىزدىكى تور مۇلازىمىتېرىغا بىر %s ئاساسىي كومپۇتېر خاتىرىسى يېزىپ تور بەت مۇلازىمدېرىڭىزنى كۆرسۈتىشىڭىزنى كۆرسىتىدۇ.','The installer attempted to contact a random hostname (%s) on your domain.'=>'ئورنىتىش پروگراممىسى تور نامىڭىزدىكى خالىغان مۇلازىمېتىر (%s) بىلەن ئۇلانماقچى بولۇۋاتىدۇ.','The menu item has been successfully deleted.'=>'تىزىملىك تۈرى ئوڭۇشلۇق ئۆچۈرۈلدى.','Please provide a custom field name.'=>'ئىختىيارى سۆز بۆلىكىگە نام قويۇڭ.','Remove Image'=>'سۈرەتنى ئۆچۈرۈش','Display Options'=>'كۆرسىتىش تاللانمىلىرى','User deletion is not allowed from this screen.'=>'ئىشلەتكۈچىنى بۇ بەتتە ئۆچۈرگىلى بولمايدۇ.','Other users have been removed.'=>'باشقا ئىشلەتكۈچىلەر چىقىرىۋېتىلدى.','You cannot remove the current user.'=>'نۆۋەتتىكى ئىشلەتكۈچىنى چىقىرىۋېتەلمەيسىز.','There are no valid users selected for removal.'=>'چىقىرىۋېتىش ئۈچۈن تاللانغان ئىناۋەتلىك ئىشلەتكۈچى يوق.','Confirm Removal'=>'چىقىرىۋېتىشنى جەزملە','You have specified these users for removal:'=>'تۆۋەندىكى ئىشلەتكۈچىلەرنى چىقىرىۋەتمەكچى بولۇۋاتىسىز:','%s updated successfully.'=>'%s مۇۋەپپەقىيەتلىك يېڭىلاندى.','Yes, take me to my profile page'=>'بولىدۇ، ئارخىپ بېتىمگە باشلاپ بارغىن','No thanks, do not remind me again'=>'بولدى، قايتا ئەسكەرتمە','Your chosen password.'=>'تاللىغان ئىم.','Sorry, you are not allowed to restore this item from the Trash.'=>'كەچۈرۈڭ، بۇ تۈرنى ئەخلەتخانادىن ئەسلىگە كەلتۈرۈشىڭىزگە رۇخسەت يوق.','Sorry, you are not allowed to move this item to the Trash.'=>'كەچۈرۈڭ، بۇ تۈرنى ئەخلەتخاناغا يۆتكىشىڭىزگە رۇخسەت يوق.','%s comment restored from the Trash.'=>'%s ئىنكاس ئەخلەتخانىدىن ئەسلىگە كەلتۈرۈلدى','%s comment moved to the Trash.'=>'%s ئىنكاس ئەخلەتخاناغا يۆتكىۋېتىلدى.' . "\0" . '%s ئىنكاس ئەخلەتخاناغا يۆتكىۋېتىلدى.','The following themes have new versions available. Check the ones you want to update and then click &#8220;Update Themes&#8221;.'=>'تۆۋەندىكى ئۆرنەكلەرنىڭ يېڭى نەشرى چىقتى. يېڭىلىماقچى بولغىنىڭىزنى تاللاپ،&#8221;ئۆرنەك يېڭىلاش&#8220; نى چېكىڭ.','That user is already a member of this site.'=>'ئۇ ئىشلەتكۈچى بۇ توربەتنىڭ ئەزاسى بولۇپ بولغان.','User has been added to your site.'=>'ئىشلەتكۈچى تور بېكىتىڭىزگە قوشۇلدى.','Invitation email sent to user. A confirmation link must be clicked for them to be added to your site.'=>'ئىشلەتكۈچىگە تەكلىپ ئېلېكتىرونلۇق خېتى ئەۋەتىلدى. ئۇلارنىڭ تور بېكىتىڭىزگە قوشۇۋېلىنى